(5911, 8144, 'Upínač HSK63F HYDRO D=12', 'Upínač HSK63F HYDRO D=12', '<p>Přesný upínač HYDRO umožňuje dokonalé upnutí stopky. Dotažení šroubku způsobí, že olej dokonale stlačí stopku nástroje. Takové řešení prakticky eliminuje vibrace a umožňuje použití vysokých posuvů na CNC  strojích.</p>\\r\\n<p>Zaujal-li Vás tento nástroj a chtěli byste znát např. rozměry, nebo cenu, neváhejte zavolat na naše <strong>odborné poradenství</strong> na č. <strong>704 192 430</strong>.</p>', '_vyr_814418.jpg', 1, '0.00', '0.00', 'H6FPDXHYDRO12', '_vyrn_814418.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-8-0-0|2-8-664-0', NULL, '2020-10-01 12:04:58'),
