(5914, 8147, 'Univerzální profilový nůž HSS 40x4 mm', 'Univerzální profilový nůž HSS 40x4 mm', '<p><strong>• Určeno pro frézovací hlavy od , CMT, Pilana, Flury, Guhdo atd.<br />• Přesné otvory pro kvalitní umístění ve frézovací hlavě.<br />• Nabízíme v šířce 40 mm nebo 50 mm.<br />• Vyrobeno z legované nástrojové oceli.<br />• Přesně vybroušené.</strong></p>\\n<p>Univerzální profilové nože jsou určené pro univerzální frézovací hlavy s euro upínacím systémem. Díky jednoduchému upínacímu systému, můžete během chvilky změnit profil frézování na své frézovací hlavě. Přesné ustavovací otvory pro kolíky mají průměr 6 mm a jsou v rozteči 24 mm. <br />Dodáváno v páru (2ks), baleno v blistru. </p>\\n<p>Celková nabídka univerzálních nožů obsahuje téměř 200 standardních profilů. Široká nabídka uspokojí i náročného zákazníka. Univerzální profilové nože nejsou určené pro sériovou výrobu, ale jako dostupná pomoc při zakázkové a individuální výrobě.</p>\\n<p><strong></strong></p>\\n<p><strong>TECHNICKÉ INFORMACE:</strong></p>\\n<ul>\\n<li>Rozměry univerzálního profilového nože jsou 40x4 mm</li>\\n<li>', '_vyr_8147690691.jpg', 0, '376.80', '357.96', '690.000', '_vyrn_8147690691.jpg', '', '', '', 21, 1, 0, 0, '', 0, '22-0-0-0|22-671-0-0|22-671-673-0', NULL, '2020-10-01 12:04:58'),
