(7687, 24, 'EVLC Jig – Vrtací přípravek pro Lamello Cabineo', 'EVLC Jig – Vrtací přípravek pro Lamello Cabineo', '<p>• Maximálně rychlý způsob vytvoření spoje<br /> • Spoj vytvoříte pomocí vrtačky nebo aku šroubováku<br /> • Rychlý a pevný spoj dvou desek na 90°<br /> • Tvorba spoje na hraně nebo v ploše<br /> • Jedinečný přípravek pro spojky Lamello Cabineo<br /> <br /> Vrtací přípravek EVLC Jig spojuje jednoduchost a důvtip pro jednoduché ovládání a snadné vytvoření otvorů pro spojovací systém Lamello Cabineo. Přípravek je určen pro přesné a produktivní ruční spojování nábytkových dílců pomocí vrtačky nebo aku šroubováku. Přípravek EVLC je vybaven přesnými otvory pro předvrtání děr do dna, půdy a bočnic korpusu. S přípravkem EVLC zhotovíte nejen otvor pro šroub spojky, ale také navrtáte tři otvory pro samotnou spojku Lamello Cabineo. S EVLC přípravkem docílíte vysokou přesnost a produktivitu práce téměř jak na CNC stroji. Šablona je určena pro použití s vrtacím vřetenem, do kterého upnete potřebné vrtáky o průměrů od 5mm a 15mm.<br /> <br /> Práce s přípravkem je velmi rychlá intuitivní. Na vrta', '_vyr_24EVLCJig2-a.jpg', 0, '2371.00', '2790.00', 'EVLC Jig1', '_vyrn_24EVLCJig2-a.jpg', '_vyrp11_24EVLC_Lamello-cabineo-15.jpg', '_vyrp12_24EVLC_Lamello-cabineo-14.jpg', '_vyrp13_24csm_Alle_CNC_Maschinen_34d966500f.jpg', 21, 1, 14, 1, '', 0, '4-107-0-0|4-107-384-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7688, 33, 'Pilový kotouč na podélný a příčný řez - D300x3,2 d30 Z48 WS HW', 'Pilový kotouč na  podélný a příčný řez- D300x3,2 d30 Z48 WS HW', '<p>Univerzální pilový kotouč od značky Stehle vyniká německou kvalitou. Konstrukce vyniká kvalitním odhlučněním a rozdělení na více segmentů. Má vylepšené tlumící drážky pro snížení vibrací a hlučnosti. Je osazen střídavými zuby z extra tvrdého německého tvrdokovu pro příčné i podélné řezání dřeva a dřevěných panelů. Vysoká životnost a výdrž.</p>\\n<p></p>', '_vyr_33kotouc-hlavni-Stehle.jpg', 0, '1926.00', '2139.00', 'S58100702', '_vyrn_33kotouc-hlavni-Stehle.jpg', '_vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-19-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7689, 34, 'Čisticí emulze pro nástroje, FORMULA 2050 - 5l', 'Čisticí emulze pro nástroje, FORMULA 2050 - 5l', '<p>Pro perfektní očištění dřevoobráběcích nástrojů od smůly a  dalšího znečištění. Bezpečná a netoxická emulze zvyšuje životnost nástrojů a zanechává rzi odolný povlak. Napomáhá ke zvýšení životnosti nástroje mezi ostřením.</p>', '_vyr_34cistici-emulze-CMT.jpg', 0, '1275.56', '1275.00', 'C99800103', '_vyrn_34cistici-emulze-CMT.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-285-0|2-2-289-0|2-3-292-0|2-3-292-363|2-7-304-0|7-0-0-0|7-422-0-0|14-0-0-0|14-619-0-0', NULL, '2021-01-10 15:44:03'),
(7690, 35, 'Kotouč lamelovací pro lamelové spoje - D100x3,96 d22 Z6 HM střídavý zub', 'Kotouč lamelovací pro lamelové spoje - D100x3,96 d22 Z6 HM střídavý zub', '<p>Nový 100 mm CMT lamelovací kotouč s teflonovým oranžovým povrchem je vyroben z jakostní oceli. Tělo je osazeno tvrdokovovými zuby, které garantují dlouhou životnost. Určeno pro lamelovací frézky.</p>', '_vyr_35C240-lamelovaci-kotouc.jpg', 0, '459.00', '510.00', 'C24000604', '_vyrn_35C240-lamelovaci-kotouc.jpg', '', '', '', 21, 1, 5, 1, '', 0, '2-2-286-0|2-2-287-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7691, 39, 'F049 Falcovací žiletková fréza - H9,5 D34,9x12 L55 S=8 HMvv', 'F049 Falcovací žiletková fréza - H9,5 D34,9x12 L55 S=8 HM', '<p>Falcovací fréza je vybavena kopírovacím vodícím ložiskem B = 15,8 mm pro šířku falcu H = 9,5 mm.<br /><br />K této fréze je možné dokoupit kopírovací ložiska průměrů B = 9,5–12,7–19–22–28,5–34,9 mm, kterými vyrobíte šířku falcu H = 12,7–11,1–8–6,3–3,2–0 mm.<br />K volitelnému ložisku potřebujete podložku C54155200, aby vám ložisko nesjíždělo.</p>', '_vyr_39f049.jpg', 0, '1159.20', '1288.00', 'F049-35581', '_vyrn_39f049.jpg', '_vyrp11_39f049-1.jpg', '_vyrp12_39f049-2.jpg', '_vyrp13_39f049-3.jpg', 21, 1, 1, 0, '', 0, '2-1-17-335|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7692, 40, 'F049 Velká falcovací fréza - H16 D50,8x28,3 L87,3 S=12 HM', 'F049 Velká falcovací fréza - H16 D50,8x28,3 L87,3 S=12 HM', '<p>• Šikmé ostří pro lepší odvod třísek. <br />• Pro ořezávání i nejobtížnějších dílů podle šablony. <br />• HM tvrdokovové břity. <br />• Speciální kopírovací ložisko na čele frézy. <br />• Prodloužená délka ostří. <br /><br />Velká falcovací fréza je dodávána se základní sadou ložisek a kroužkem 19mm pro frézování 15,8 mm falcu. K této fréze je možné dokoupit 3 sady kopírovacích kroužků, se kterými vyrobíte 17 různých rozměrů falců. Při frézování falců větších než 12 mm provádějte vícenásobné úběry pomocí postupného zvětšování hloubky. <br /><br />Doporučujeme použití ve frézovacím stolku.</p>', '_vyr_40f049-4.jpg', 0, '1623.60', '1804.00', 'F049-50821', '_vyrn_40f049-4.jpg', '_vyrp11_40f049-5.jpg', '_vyrp12_40f049-6.jpg', '_vyrp13_40f049-7.jpg', 21, 1, 1, 0, '', 0, '2-1-17-336|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7693, 41, 'F046 Úhlová žiletková fréza - 45° D29x12 L52 S=8 HM', 'F046 Úhlová žiletková fréza - 45° D29x12 L52 S=8 HM', '<p>Fréza je určena pro ořezávání a srážení hran. <br /><br />Typ F046 je bez ložiska. Určen pro ruční frézování a také pro strojní frézování na CNC centrech.</p>', '_vyr_41f046.jpg', 0, '773.10', '859.00', 'F046-45081', '_vyrn_41f046.jpg', '_vyrp11_41f046-1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-13-320|2-1-0-0|2-1-13-0|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:03'),
(7694, 42, 'F051 Žiletková fréza HM na V drážku - 90° D23x11 L60 S=8', 'F051 Žiletková fréza HM na V drážku - 90° D23x11 L60 S=8', '<p>Ideální nástroj pro gravírování a tvorbu nápisů. Pokud se vám žiletka zdá tupá nebo opotřebená, jednoduše otočte a použijte další z ostrých břitů. Uzamykací šroubek bezpečně zajišťuje žiletku a tím i přesnost práce.</p>', '_vyr_42f051.jpg', 0, '430.00', '470.00', 'F051-23081', '_vyrn_42f051.jpg', '_vyrp11_42f051-1.jpg', '_vyrp12_42f051-2.jpg', '', 21, 1, 1, 0, '', 0, '2-1-15-328|2-1-0-0|2-1-15-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03'),
(7695, 43, 'F062 Radiusová žiletková fréza HM - R2 D27x3 L58 S=8', 'F062 Radiusová žiletková fréza HM - R2 D27x3 L58 S=8', '<p>• Výměnné žiletky z mikrozrnného tvrdokovu. <br />• Žiletky můžete otočit o 90° a získáte tím celkem 4 řezné hrany. <br />• Žiletky jsou upevněny speciálními Torx šrouby. <br />• Tělo frézy vyrobeno z kvalitní oceli. <br /><br />Žiletková fréza osazená dvěma trvdokovovými žiletkami pro zaoblení hran. Radius je vybroušen na všech 4 stranách žiletky pro maximální efektivitu nástroje. Fréza je osazena žiletkou s radiusem R3mm nebo R2mm, který se používá zejména na ABS hrany. K fréze je možné dokoupit i radius R1mm a R1,5 mm, kterým můžete srazit hranu při lepení umakartu, dýhy nebo lamina na deskách. Pro použití na ručních horních frézkách.</p>', '_vyr_43F062.png', 0, '1166.40', '1296.00', 'F062-02081', '_vyrn_43F062.png', '_vyrp11_43F062-1.png', '_vyrp12_43F062-2.png', '', 21, 1, 1, 0, '', 0, '2-1-14-0|2-1-0-0|2-1-14-322|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:03'),
(7696, 44, 'F042 Úhlová žiletková fréza - 22° D25x11 L65 S=6 HM', 'F042 Úhlová žiletková fréza - 22° D25x11 L65 S=6 HM', '<p>Určena pro ořezávání a srážení hran. <br /><br />Typ F042 je vybaven kopírovacím ložiskem. Určen pro ruční frézování.</p>', '_vyr_44f042.jpg', 0, '921.60', '1024.00', 'F042-22081', '_vyrn_44f042.jpg', '_vyrp11_44f042-1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7697, 45, 'Freza VHM (D=4; I=15; S=4; Z=1+1) RH', '190 Freza VHM (D=4; I=15; S=4; Z=1+1) RH', '<p><strong>TECHNICKÉ INFORMACE:</strong><br /><em></em></p>\\n<ul>\\n<li>Z2+2 spirálvě uložené břity</li>\\n<li>Tělo ze speciálního tvrdého materiálu HM o tvrdosti 93,8 HRA</li>\\n<li>Perfektní hrana řezu na horní i spodní straně dílce</li>\\n<li>Ostřeno novou laserovou technologií</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/Screenshot_2.jpg\\\" alt=\\\"\\\" width=\\\"538\\\" height=\\\"85\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<ul>\\n<li>Ostřeno novou laserovou technologií</li>\\n<li>Určeno pro všechny CNC stroje a ruční frézky pro spojování a frézování DTD, LTD, MDF a kompozitů na bázi dřeva, HPL.</li>\\n</ul>\\n<h3>ŘEZNÉ PODMÍNKY:</h3>\\n<ul>\\n<li>4 - 6 mm</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/4-6 mm.jpg\\\" alt=\\\"\\\" width=\\\"471\\\" height=\\\"283\\\" /></p>\\n<ul>\\n<li>8-18 mm</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/8-16 mm.jpg\\\" alt=\\\"\\\" width=\\\"522\\\" height=\\\"305\\\" /></p>\\n<h3><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/DT1%20(2).jpg\\\" alt=\\\" width=\\\" 200=\\\"\\\" height=\\\"225\\\" /></h3>', '_vyr_45c190.jpg', 0, '486.00', '0.00', '190.040.11', '_vyrn_45c190.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-588|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7698, 50, ' Spirálová fréza na ALU a PVC (D=4; I=40; S=8) RH, HSS', ' Spirálová fréza na ALU a PVC (D=4; I=40; S=8) RH, HSS', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Kvalitní HSS ocel Co 5%</li>\\n<li>Jeden spirálově uložený břit s</li>\\n<li>Pozitivní odvod třísky</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/DT1.jpg\\\" width=\\\"550\\\" height=\\\"102\\\" caption=\\\"false\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<p></p>\\n<h3></h3>\\n<ul>\\n<li>Tento nástroj je určen pro efektivní frézování všech slitin hliníku, duralu. Konstrukce břitu dovoluje vysokou produktivitu frézování, mnohem lepší než tradiční spirálové frézy. </li>\\n<li>Ideální do duralo, hliníku či plastu.</li>\\n</ul>\\n<p></p>\\n<h3></h3>', '_vyr_50c188.jpg', 0, '679.80', '0.00', '188.041.51', '_vyrn_50c188.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-11-0|2-1-11-313|2-7-0-0|2-7-45-0|2-7-45-589|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7699, 53, 'Drážkovací spirálová fréza (D=3; I=12,7; S=6,35; Z=2) RH', 'Drážkovací spirálová fréza (D=3; I=12,7; S=6,35; Z=2) RH', '<div class=\\\"row\\\">\\n<div class=\\\"col-lg-12\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_TCWebPartZone12\\\">\\n<div id=\\\"WebPart_TabContainer1\\\">\\n<div class=\\\"responsive-tabs-container  accordion-xs\\\">\\n<div class=\\\"tab-content\\\">\\n<div id=\\\"tab1\\\" class=\\\"tab-pane active\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_WebPartZone21\\\">\\n<div id=\\\"WebPart_FCKEditorNavBarNote1\\\">\\n<div class=\\\"fckeditornavbar\\\">\\n<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Z2 zuby uložené do spirály</li>\\n<li>Tělo ze speciálního tvrdého materiálu HM o tvrdosti 93,8 HRA</li>\\n<li>Pozitivní odvod třísky</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/191.jpg\\\" alt=\\\"\\\" width=\\\"285\\\" height=\\\"61\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<p></p>\\n<h3></h3>\\n<ul>\\n<li>Určeno pro požití na CNC strojích pro řezání a frézování masivního dřeva a materiálů na bázi dřeva.</li>\\n</ul>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"></pre>\\n<p></p>\\n<h3></h3>\\n</div>\\n</div>\\n</', '_vyr_53c191.jpg', 0, '798.66', '887.00', '191.003.11', '_vyrn_53c191.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-590|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7700, 54, 'Drážkovací spirálová fréza (D=3; I=12; S=3, Z=2) RH, negativní', 'Drážkovací spirálová fréza (D=3; I=12; S=3, Z=2) RH, negativní', '<div class=\\\"row\\\">\\n<div class=\\\"col-lg-12\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_TCWebPartZone12\\\">\\n<div id=\\\"WebPart_TabContainer1\\\">\\n<div class=\\\"responsive-tabs-container  accordion-xs\\\">\\n<div class=\\\"tab-content\\\">\\n<div id=\\\"tab1\\\" class=\\\"tab-pane active\\\">\\n<div id=\\\"ctl00_ewpz1_mainTemplateCtrl_WebPartZone21\\\">\\n<div id=\\\"WebPart_FCKEditorNavBarNote1\\\">\\n<div class=\\\"fckeditornavbar\\\">\\n<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Z2 zuby uložené do spirály</li>\\n<li>Tělo ze speciálního tvrdého materiálu HM o tvrdosti 93,8 HRA</li>\\n<li>Negativní odvod třísky</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/Screenshot_3.jpg\\\" alt=\\\"\\\" width=\\\"422\\\" height=\\\"96\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<ul>\\n<li>Určeno pro použití na CNC strojích pro řezání a frézování masivního dřeva a materiálů na bázi dřeva.</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/192 grafo.jpg\\\" alt=\\\"\\\" width=\\\"415\\\" height=\\\"311\\\" /></p>\\n<p><img src=\\\"/fotky101456/192 grafito.jpg\\\" alt=\\\"\\\" width=\\\"414\\\" height=\\\"313\\\" />', '_vyr_54192.jpg', 0, '341.42', '379.00', '192.03.012.050.03R', '_vyrn_54192.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-11-313|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-591|11-0-0-0|14-0-0-0|14-610-0-0|14-610-622-0', NULL, '2021-01-10 15:44:03'),
(7701, 57, 'C2S Úhlová fréza s ložiskem - 15° D22x22 S=8 HW', 'C2S Úhlová fréza s ložiskem - 15° D22x22 S=8 HW', '<p>• HW tvrdokovové zuby. <br />• Teflonový nepřilnavý povrch <br />• Kopírovací ložisko. <br /><br />Použití: Snadná výroba mnohoúhelníkových dílů. Frézují čisté a přesné úkosy pro výrobu dokonale vyrovnaných mnohostranných kontejnerů, krabic a dalších dekorativních předmětů. Mohou být použity s výbornými výsledky pro celou řadu prací, jako je výroba příček a sloupků. <br /><br /><strong>TIP:</strong> Je možno použít celou délku řezné hrany. Pravidelně nastavujte výšku frézy, aby byl maximálně využit celý HM tvrdokovový břit.</p>', '_vyr_57C2S-web.jpg', 0, '810.00', '900.00', 'GZ2485', '_vyrn_57C2S-web.jpg', '_vyrp11_57GZ-C2S-1.jpg', '_vyrp12_57Dis_B_C2s-lav.png', '_vyrp13_57Dis_B_C2S.png', 21, 1, 5, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-321|7-0-0-0|7-422-0-0|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7702, 59, '7C Zaoblovací fréza vydutá - R2 D17 S=6 HW', '7C Zaoblovací fréza vydutá - R2 D17 S=6 HW', '<p>• Pro zaoblování i nejobtížnějších dílů<br />• HM tvrdokovové břity<br />• Speciální kopírovací ložisko na čele frézy</p>\\n<p>Nejpoužívanější zaoblovací fréza, která je určená na zaoblování hran dřeva, MDF nebo začistění ABS hran s perfektním výsledkem opracování. <br />Pro obrézování široké struktury a druhů materiálů a to díky HW zubům. Opěrné ložisko zajišťuje přesné vedení a opěru v řezu.</p>\\n<p> </p>', '_vyr_597C-web.jpg', 0, '652.00', '725.00', 'GZ1248', '_vyrn_597C-web.jpg', '_vyrp11_597C-1.png', '_vyrp12_597C-2.png', '', 21, 1, 5, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-322|7-0-0-0|7-422-0-0|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:03'),
(7703, 60, 'C Ořezávací fréza, rovné zuby - D13x15 B13 S=8  HW', 'C Ořezávací fréza, rovné zuby - D13x15 B13 S=8  HW', '<p>• Pro ořezávání i nejobtížnějších dílů podle šablony<br /> • HM tvrdokovové břity<br /> • Speciální kopírovací ložisko na čele frézy</p>\\n<p>Nejpoužívanější ořezávací fréza, která je určená na kopírování šablon s perfektním výsledkem opracování. <br /> Pro ofrézování široké struktury a druhů materiálů a to díky HW zubům. Opěrné ložisko zajišťuje přesné vedení a opěru v řezu.</p>', '_vyr_60C-web.jpg', 0, '517.00', '575.00', 'GZ1050', '_vyrn_60C-web.jpg', '_vyrp11_60GZ-C-1.jpg', '_vyrp12_60Dis_B_C-lav.png', '_vyrp13_60Dis_B_C.png', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|7-0-0-0|7-422-0-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7704, 61, '5 Fréza na V drážku 22,5° - D15x15 45° S=6 HW', '5 Fréza na V drážku 22,5° - D15x15 45° S=6 HW', '<p>• Čisté dokonalé řezy do desek nebo čel zásuvek<br />• Pro srážení hran<br />• Pro frézování nápisů a graírování</p>\\n<p>Nejpoužívanější popisovací fréza, která je určená pro popisování, gravírování a frézování ostrýh rohů s perfektním výsledkem opracování. <br /> Pro ofrézování široké struktury a druhů materiálů a to díky HW zubům. Použití v ruční frézce nebo na CNC strojích.</p>', '_vyr_615-web.jpg', 0, '607.00', '675.00', 'GZ135', '_vyrn_615-web.jpg', '_vyrp11_61GZ-5-1.jpg', '_vyrp12_615-1.png', '_vyrp13_615-2.png', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-328|7-0-0-0|7-422-0-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03');
