(7705, 62, 'CC Sada na rám nábytkových dvířek S=8  HW', 'CC Sada na rám nábytkových dvířek S=8  HW', '<p>Sestava obsahuje jednu frézu, pomocí kterých vyrobíte okrasný rámeček pro kuchyňská dvířka, do dveří komod, vitrín nebo skříní. Sestavou vyrobíte podélný profil na příčce. Přeskládáním profilové frézy drážkovacího kotoučku vyrobíte kontra profil na konci příček. Celý spoj máte v jednom nástroji.</p>\\n<p>Jako volitelné příslušenství je možné dokoupit profilový talířek díky kterému jednoduše změníte prosil rámečku.  <br /> <br /> Fréza je opatřena ložiskem a podložkami, díky čemuž si přesně seskládáte potřebnou výšku profilu. <br /> <br /> Použití: Pro výrobu výplní dvířek a dveří. Doporučujeme použití frézovacího stolku.</p>', '_vyr_62GZ-817.png', 0, '1500.00', '1875.00', 'GZ817', '_vyrn_62GZ-817.png', '_vyrp11_62GZ-817-1.png', '_vyrp12_62GZ-817-2.png', '_vyrp13_62GZ-817-3.png', 21, 1, 3, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|7-0-0-0|7-422-0-0|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7706, 63, 'CT Náhradní kotouček ÚHEL pro frézu CC na dvířka D=6  HW', 'CT Náhradní kotouček ÚHEL pro frézu CC na dvířka D=6  HW', '<p> </p>\\n<p>Profilovací talířek, volitelné příslušenství díky kterému jednoduše změníte prosil rámečku.  <br /> <br />Určeno pro frézu HZ817 <br /> <br /> Použití: Pro výrobu výplní dvířek a dveří. Doporučujeme použití frézovacího stolku.</p>', '_vyr_63F-semplice-web.jpg', 0, '900.00', '1000.00', 'GZ1943', '_vyrn_63F-semplice-web.jpg', '_vyrp11_63GZ-CTU-1.jpg', '', '', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7707, 64, 'CT Náhradní kotouček RÁDIUS pro frézu CC na dvířka D=6  HW', 'CT Náhradní kotouček RÁDIUS pro frézu CC na dvířka D=6  HW', '<p> </p>\\n<p>Profilovací talířek, volitelné příslušenství díky kterému jednoduše změníte prosil rámečku.  <br /> <br />Určeno pro frézu HZ817 <br /> <br /> Použití: Pro výrobu výplní dvířek a dveří. Doporučujeme použití frézovacího stolku.</p>', '_vyr_64F-compl-web.jpg', 0, '900.00', '1000.00', 'GZ1942', '_vyrn_64F-compl-web.jpg', '_vyrp11_64GZ-CTR-1.jpg', '', '', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7708, 65, '8PB Fréza na výplně - D42x12 S=8 HW', '8PB Fréza na výplně - D42x12 S=8 HW', '<p>POZOR: Frézy používejte při nižších otáčkách mezi 10000 a 12000 ot./min. Pro bezpežné a přesné dosažení požadovaného profilu doporučujeme tři až pět průchodů. Výkon frézky musí být nejméně 1500W.<br /><br />Použití: Pro výrobu výplní dvířek, dveří a zásuvkových čel. Nutno použít frézovací stolek. Doporučujeme náš frézovací stolek, který byl testován pro toto použití.</p>', '_vyr_658PB-web.jpg', 0, '1192.00', '1325.00', 'GZ1235', '_vyrn_658PB-web.jpg', '_vyrp11_65GZ-8PB-1.jpg', '', '', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-340|7-0-0-0|7-422-0-0|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:03'),
(7709, 67, 'Kotouč lamelovací pro lamelové spoje - D100x3,96 d22 Z4+4 HW výměnné žiletky', 'Kotouč lamelovací pro lamelové spoje - D100x3,96 d22 Z4+4 HW výměnné žiletky', '<p>- Lamelovací kotouč s CHROME povrchem<br />- HW žiletkové zuby, které nabízejí maximální výkon<br />- Určeno pro ruční lamelovací frézky</p>\\n<p>Fink lamelovací kotouč s chromovým povrchem je vyroben z jakostní oceli. Tělo je kvalitně obrobeno na CNC stroji a osazeno výměnnými tvrdokovovými žiletkami, které garantují dlouhou životnost a možnost rychlé výměny či otočení. Určeno pro lamelovací frézky.</p>', '_vyr_67fink16-lamelovaci-kotouc.jpg', 0, '3100.00', '4133.00', 'FRHWFINK16', '_vyrn_67fink16-lamelovaci-kotouc.jpg', '', '', '', 21, 1, 2, 1, '', 0, '2-2-286-0|2-2-287-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7710, 68, 'Předřezový kotouč dvoudílný - D100x2,8-3,6 d20 Z10+10 HW', 'Předřezový kotouč dvoudílný - D100x2,8-3,6 d20 Z10+10 HW', '<p>Pilový kotouč od značky Stehle vyniká německou kvalitou. Špičkový předřezový dvoudílný pilový kotouč pro pily s předřezovým agregátem. Je osazen HW zuby z extra tvrdého německého tvrdokovu pro řezání lamina, dřevotřískových desek, MDF a HPL nebo kompaktů. Vysoká životnost a výdrž.</p>', '_vyr_68predrez-Stehle.jpg', 0, '1819.00', '2139.00', 'S58110190', '_vyrn_68predrez-Stehle.jpg', '101456_68__vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-2-21-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7711, 69, 'Pilový kotouč na lamino, DTD a MDF - D300x3,2 d30 Z96 HW', 'Pilový kotouč na lamino, DTD a MDF - D300x3,2 d30 Z96 HW', '<p>Pilový kotouč od značky GDA. Konstrukce vyniká kvalitním odhlučněním a rozdělení na více segmentů. Má v těle tlumící drážky pro snížení vibrací a hlučnosti. Je osazen trapézovými zuby z tvrdokovu pro řezání lamina, dřevotřískových desek, MDF a HPL nebo kompaktů. Vysoká životnost a výdrž.</p>\\n<p>Určeno pro použití s předřezem.</p>', '_vyr_69kotouc-hlavni-GDA.jpg', 0, '1600.00', '2000.00', 'PKTFFL0019', '_vyrn_69kotouc-hlavni-GDA.jpg', '101456_69__vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 5, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7712, 71, 'Pilový kotouč SK 300x3,2/2,2x30 5383-35 28 LWZ', 'Pilový kotouč SK 300x3,2/2,2x30 5383-35 28 LWZ', '<p>Pro příčné a podélné řezání přírodních dřev. Pilové kotouče jsou vybaveny omezovačem třísky. Ruční posuv.</p>', '_vyr_71pilovy-kotouc-5383-35.jpg', 0, '816.00', '907.00', 'PKWZPL0007', '_vyrn_71pilovy-kotouc-5383-35.jpg', '_vyrp11_715383-35.jpg', '_vyrp12_715383-35-2.jpg', '', 21, 1, 2, 0, '', 0, '2-2-19-0|2-2-0-0|2-2-19-352|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7713, 72, 'Pilový kotouč SK 250x3,2/2,2x30 5381-16 48 WZ', 'Pilový kotouč SK 250x3,2/2,2x30 5381-16 48 WZ', '<p>Pro příčné řezání přírodních dřev. Řezání tvrzených textílií a tvrzeného papíru s vyššími požadavky na kvalitu řezu.</p>', '_vyr_72pilovy-kotouc-5381-20.jpg', 0, '959.00', '1066.00', 'PKWZPL0010', '_vyrn_72pilovy-kotouc-5381-20.jpg', '_vyrp11_725381-20.jpg', '_vyrp12_725381-20-1.jpg', '', 21, 1, 2, 0, '', 0, '2-2-19-0|2-2-0-0|2-2-19-353|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7714, 74, '511B Ořezávací žiletková fréza - D12×25 L70 S=8 HW', '511B Ořezávací žiletková fréza - D12×25 L70 S=8 HW', '<p>- Masivní konstrukce</p>\\n<p>- Jedinečná konstrukce s vyvážením</p>\\n<p>- Přesné ustavení žiletky v lůžku</p>\\n<p>- Nejmenší průměr v žiletkovém provedení</p>\\n<p>Fréza určena pro přesné lícovací frézování a kopírování podle šablony, která je vespod. U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza tento jev eliminuje pomocí přesně ustavených výměnných žiletek, které se navíc dají otáčet a použít až 4 břity. Pro frézování Corianu je možné dokoupit rovné nebo kuželové ložisko s plastovým kroužkem, které zabezpečí přesné vedení po materiálu.</p>\\n<p>Specifikace:</p>\\n<p>- Ložisko</p>\\n<p>- MAN</p>\\n<p>- Z1</p>\\n<p>- HW žiletky</p>', '_vyr_74orezavaci-ziletkova-Briani.jpg', 0, '2105.88', '2237.00', '511B1200800', '_vyrn_74orezavaci-ziletkova-Briani.jpg', '', '', '', 21, 1, 2, 0, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|7-0-0-0|7-422-0-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7715, 77, 'Vrtací vřeteno EVVP1 pro EVLC Jig', 'Vrtací vřeteno EVVP1 pro EVLC Jig', '<p>Vrtací vřeteno EVVP1 je určeno pro vrtací přípravky k vyvrtání potřebných otvorů.<br /><br />Jedinečné vrtací pouzdro nahrazuje již značně zastaralý a namáhavý systém kalených ocelových pouzder a levných ocelových vrtáků, které vydrží ostré v laminu opravdu jen pár děr.<br /><br />Vrtací pouzdro umožňuje použití různých průměrů kolíkovacích HM tvrdokovových vrtáků od průměru 3 mm do průměru 15 mm s upínacím průměrem stopky 8 mm.</p>', '_vyr_77EVVP1-2.jpg', 0, '695.00', '0.00', 'EVVP-1', '_vyrn_77EVVP1-2.jpg', '_vyrp11_77EVLC_Lamello-cabineo-15.jpg', '', '', 21, 1, 5, 0, '', 0, '4-107-0-0|4-107-384-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7716, 78, 'Vrták pro neprůchozí díry D-5mm HW', 'Vrták pro neprůchozí díry D-5mm HW', '<p>• Tělo vrtáku z vysoce kvalitní tvrzené oceli.<br />• HM hlava s přesně vycentrovaným středicím hrotem.<br />• 2 precizně broušené HM břity (Z2).<br />• 2 HM zuby s předřezy a radiálním podbroušením (V2).<br />• 4 spiralové drážky.<br />• Válcová upínací stopka s unášecí plochou a šroubem pro nastavení délky.<br />• Baleno v plastové krabičce po 1 kuse.<br />• Ekonomické balení po 5 kusech.<br />• Vrtací hlava pro vrtání čistých neprůchozích otvorů s plochým dnem.<br />• Přesně broušená stopka pro přesné upnutí ve stroji.<br />• Teflonový povrch pro lepší odvod třísek. <br /><br />Použití: na vrtacích strojích a kolíkovačkách pro vrtání neprůchozích otvorů do DTD, MDF, lamina a plastů.</p>', '_vyr_78c30805011.jpg', 0, '243.00', '0.00', 'EVVN5', '_vyrn_78c30805011.jpg', '_vyrp11_78c30805011-1.jpg', '', '', 21, 1, 5, 0, '', 0, '2-0-0-0|2-372-0-0|4-107-384-0|7-0-0-0|7-422-0-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
(7717, 79, 'Sukovník pro neprůchozí otvor D-15mm HW', 'Sukovník pro neprůchozí otvor D-15mm HW', '<p>Sukovník se stopkou 8 mm, předřezovými hroty, centrovacím hrotem a 2 řeznými zuby.<br />Všechny hroty jsou z tvrdokovu určeného pro vrtání do DTD, LTD a měkkého i tvrdého dřeva.<br />Výborný i pro vrtání do lamino desek.<br />Kvalitní a přesný nástroj.</p>', '_vyr_79c39215011.jpg', 0, '472.00', '0.00', 'EVSN15', '_vyrn_79c39215011.jpg', '_vyrp11_79c39215011-1.jpg', '', '', 21, 1, 5, 0, '', 0, '2-0-0-0|2-5-0-0|2-5-293-0|2-5-293-373|2-5-293-375|4-107-384-0|7-0-0-0|7-422-0-0|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:03'),
(7718, 80, 'Spojovací prvek LAMELLO - CABINEO, délka euro šroubu 12mm - 1 ks', 'Spojovací prvek LAMELLO - CABINEO, délka euro šroubu 12mm - 1 ks', '<p>Cabineo lze vyvrtávat na jednoduchých CNC strojích o 3 osách nebo pomocí našeho přípravku EVLC Jig. Vše je konstruováno pro maximální jednoduchost výroby a montáže i s minimem prostředků.</p>\\n<p>Systém nabízí velice jednoduchou výrobu,dopravu a konečnou montáž u zákazníka. Samozřejmostí je stohování s minimem vyčnívajících částí a tím poškození lakovaných povrchů.</p>\\n<p>Vzhledem k tomu, že prvky jsou již z výroby nainstalovány, toto urychluje montáž a značně  pomáhá při snižování případné chyby.</p>\\n<p>Předinstalovaný šroub uvnitř tvarovky je pak zašroubován do 5 mm vrtané díry v odpovídajícím obrobku, pomocí imbusového klíče s kulovou hlavou.</p>\\n<p>Krytky v různých barvách jsou také k dispozici</p>', '_vyr_80Lamello-Cabineo.jpg', 0, '9.00', '11.00', '186320-1', '_vyrn_80Lamello-Cabineo.jpg', '_vyrp11_80EVLC_Lamello-cabineo-10.jpg', '_vyrp12_80EVLC_Lamello-cabineo-13.jpg', '_vyrp13_80Rozmery-a-roztece-vrtani-4.jpg', 21, 1, 1, 0, '', 0, '5-389-0-0|5-0-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7719, 81, 'Spojovací prvek LAMELLO - CABINEO, délka euro šroubu 8mm - 1 ks', 'Spojovací prvek LAMELLO - CABINEO, délka euro šroubu 8mm - 1 ks', '<p>Cabineo lze vyvrtávat na jednoduchých CNC strojích o 3 osách nebo pomocí nšeho přípravku EVLC Jig. Vše je konstruováno pro maximální jednoduchost výroby a montáže i s minimem prostředků.</p>\\n<p>Systém nabízí velice jednoduchou výrobu,dopravu a konečnou montáž u zákazníka. Samozřejmostí je stohování s minimem vyčnívajicích částí a tím poškození lakovaných povrchů.</p>\\n<p>Vzhledem k tomu, že prvky jsou již z výroby nainstalovány, toto urychluje montáž a značně  pomáhá při snižování případné chyby.</p>\\n<p>Předinstalovaný šroub uvnitř tvarovky je pak zašroubován do 5mm vrtané díry v odpovídajícím obrobku, pomocí imbusového klíče s kulovou hlavou.</p>\\n<p>Krytky v různých barvách jsou také k dispozici</p>', '101456_81__vyr_80Lamello-Cabineo.jpg', 0, '8.00', '10.00', '186310-1', '101456_81__vyrn_80Lamello-Cabineo.jpg', '101456_81__vyrp11_80EVLC_Lamello-cabineo-10.jpg', '101456_81__vyrp12_80EVLC_Lamello-cabineo-13.jpg', '101456_81__vyrp13_80Rozmery-a-roztece-vrtani-4.jpg', 21, 1, 80, 0, '', 0, '5-389-0-0|5-0-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7720, 82, 'Drážkovací fréza žiletková nástrčná 125x8 d30 Z4+4 HW', 'Drážkovací fréza žiletková nástrčná 125x8 d30 Z4+4 HW', '<p>- Fréza pro drážkování a falcování<br />- Cisté hrany díky predrezovým žiletkám<br />- Na masivní drevo velkoplošné materiály</p>\\n<p>Nástroj je osazen tvrdokovovými žiletkami. Určeno pro ruční posuv. Použití vhodné na rostlé i aglomerované dřevo.</p>', '_vyr_82drazkovaci-fr--ziletkova-RH.jpg', 0, '1950.00', '2166.00', '22012508', '_vyrn_82drazkovaci-fr--ziletkova-RH.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-3-24-0|2-3-0-0|13-0-0-0|13-601-0-0', NULL, '2021-01-10 15:44:03'),
(7721, 83, 'Zaoblovací fréza konvex-konkáv 116×20×30 HW', 'Zaoblovací fréza konvex-konkáv 116×20×30 HW', '<p>- HW výmenné žiletky o tlouštce 2mm<br />- Možnost zakoupení náhradních HW žiletek<br />- Na masivní drevo, velkoplošné materiály a plasty</p>\\n<p>Použití na rostlé i aglomerované dřevo, plasty apod.</p>\\n<p><strong>Provedení:</strong></p>\\n<ul>\\n<li>Oocelové těleso</li>\\n<li>Dvoubřitá fréza</li>\\n<li>Výměnné břitové destičky (VBD)</li>\\n<li>Ustavování bez potřeby seřizování</li>\\n<li>Možnost doplnění ložiskem D100mm</li>\\n<li>Ruční posuv - MAN</li>\\n</ul>', '_vyr_83freza-konvex-konkav-RH.jpg', 0, '2990.00', '3322.00', '57308030', '_vyrn_83freza-konvex-konkav-RH.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-3-0-0|2-3-27-0|7-0-0-0|7-422-0-0|13-0-0-0|13-604-0-0', NULL, '2021-01-10 15:44:03'),
(7722, 86, 'Frézovací hlava stavitelná  pro spojování dřeva na délku D150x80  d30(40) HW', 'Frézovací hlava stavitelná  pro spojování dřeva na délku D150x80  d30(40) HW', '<p>- Sestava masivních fréz s ocelovým tělem<br /> - Extra silné, výměnné HW nože<br /> - Přesné nastavení pomocí mezi kroužků</p>\\n<p>Stavitelná spojovací fréza CAUL s nastavitelnou tloušťkou frézování.<br />Zvláště vhodné pro podélné nastavování dřeva.<br /><br /></p>\\n<p>Masivní tělo nástroje. Maximální výška frézování je 80mm s nastavitelnou výškou pomocí podložek.</p>\\n<p>Frézovací hlavu je možné upnout na hřídel 30mm nebo 40mm.</p>\\n<p>Určeno pro profesionální obrábění dřeva.</p>', '_vyr_86freza-na-spoje-caul.jpg', 0, '15900.00', '22700.00', 'CAULTG02S', '_vyrn_86freza-na-spoje-caul.jpg', '_vyrp11_86freza-na-spoje-caul-3.jpg', '_vyrp12_86freza-na-spoje-caul-4.jpg', '_vyrp13_86freza-na-spoje-caul-1.jpg', 21, 1, 1, 1, '', 0, '2-3-28-0|2-3-0-0|7-0-0-0|7-422-0-0|13-0-0-0|13-605-0-0', NULL, '2021-01-10 15:44:03'),
(7723, 87, 'Frézovací hlava na spárovku D125x60 d30 HW', 'Frézovací hlava na spárovku D125x60  d30 HW', '<p>- Masivní tělo frézy z oceli<br />- Extra HW nože pro spárovku až 60mm<br />- Tvar nožů pro pohodlné lepení dřeva</p>\\n<p>Spojovací žiletková fréza CAUL s nastavitelnou tloušťkou frézování.<br />Zvláště vhodné pro tvorbu spárovky ze dřeva. Díky tvaru vlnovky dochází k lepšímu stažení díky plynulému vytlačení lepidla.<br /><br /></p>\\n<p>Masivní tělo nástroje. Maximální výška frézování je 60mm.</p>\\n<p>Frézovací hlavu je možné upnout na hřídel 30mm.</p>\\n<p>Určeno pro profesionální obrábění dřeva.</p>', '_vyr_87freza-na-sparovku-caul.jpg', 0, '3980.00', '4975.00', 'FRHWCAUL00', '_vyrn_87freza-na-sparovku-caul.jpg', '_vyrp11_87freza-na-sparovku-caul-1.jpg', '_vyrp12_87freza-na-spoje-caul-1.jpg', '_vyrp13_87freza-na-spoje-caul-2.jpg', 21, 1, 1, 1, '', 0, '2-3-28-0|2-3-0-0|7-0-0-0|7-422-0-0|13-0-0-0|13-605-0-0', NULL, '2021-01-10 15:44:03'),
(7724, 89, 'Kleštinový upínač CNC HSK 63F - DIN6388 RH/LH', 'Kleštinový upínač CNC – HSK 63F RH/LH', '<p>Upínač nástrojů s upínací klečtinou na CNC frézovacích strojích s automatickou výměnou nástrojů.</p>\\n<ul>\\n<li>upínací kužel podle DIN 69893-6 tvar F</li>\\n<li>kalené a broušené provedení</li>\\n<li>přesně vyvážené</li>\\n<li>zabezpečení nástrojů proti pootočení pomocí šroubů nebo kolíků</li>\\n<li>upínače jsou dodávány včetně převlečné matice pro provo-levý chod</li>\\n</ul>', '_vyr_89HSK63F.jpg', 0, '2497.00', '2775.00', '900101', '_vyrn_89HSK63F.jpg', '_vyrp11_89HSK63F-1.jpg', '', '', 21, 1, 1, 1, '', 0, '2-8-0-0|2-8-306-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7725, 91, 'Čep unašeče ISO30 - BIESSE, HSD Masterwood, Cosmec', 'Čep unašeče ISO30 - BIESSE, HSD Masterwood, Cosmec', '<p>Kromě kleštin a unašečů Vám nabízíme čepy pro unašeče. Tento čep je určený pro stroje <strong>BIESSE</strong>, <strong>HSD Masterwood</strong> a <strong>Cosmec</strong>. Průměr nástroje je <strong>12 mm</strong>, celková delka je <strong>44 mm</strong>.</p>\\n<p><strong>Technické parametry:</strong></p>\\n<ul>\\n<li>Pro upínač <strong>ISO30</strong></li>\\n<li>Pro stroje <strong>BIESSE</strong>, <strong>HSD Masterwood,</strong> <strong>Cosmec</strong></li>\\n<li>Průměr stopky <strong>12 mm</strong></li>\\n<li>Průměr v nejužším místě <strong>8 mm</strong></li>\\n<li>Celková délka <strong>44 mm</strong></li>\\n<li>Délka hlavice <strong>19,5 mm</strong></li>\\n<li>Radius hlavice <strong>R 3,2</strong></li>\\n</ul>\\n<p></p>\\n<p><img src=\\\"/fotky101456/biesekoty.jpg\\\" alt=\\\"\\\" width=\\\"250\\\" height=\\\"258\\\" /></p>\\n<p>Využijte také našeho odborného poradenství. Naši odborníci Vám telefonicky pomohou s <strong>vhodným výběrem nástroje</strong>, projdou s Vámi celý proces osazování nového stroje, nebo', '_vyr_91upinaci-cep-CNC.jpg', 0, '440.10', '489.00', 'CDM12BIE', '_vyrn_91upinaci-cep-CNC.jpg', '_vyrp11_91biesekoty.jpg', '', '', 21, 1, 13, 1, '', 0, '2-8-0-0|2-8-812-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7726, 92, 'Čep unašeče ISO30 - Cms, HSD Cms', 'Čep unašeče ISO30 - Cms, HSD Cms', '<p>Kromě kleštin a unašečů Vám nabízíme čepy pro unašeče. Tento čep je určený pro stroje<span> </span><strong>Cms, HSD Cms</strong>. Průměr nástroje je<span> </span><strong>12 mm</strong>, celková delka je<span> </span><strong>44 mm</strong>.</p>\\n<p><strong>Technické parametry:</strong></p>\\n<ul>\\n<li>Pro upínač<span> </span><strong>ISO30</strong></li>\\n<li>Pro stroje <strong>Cms, HSD Cms</strong></li>\\n<li>Průměr závitu<span> </span><strong>12 mm</strong></li>\\n<li>Průměr v nejužším místě<span> </span><strong>9 mm</strong></li>\\n<li>Celková délka<span> </span><strong>44 mm</strong></li>\\n<li>Délka hlavice<span> </span><strong>19 mm</strong></li>\\n<li>Radius hlavice<span> </span><strong>R 2,4</strong></li>\\n</ul>\\n<p></p>\\n<p><img src=\\\"/fotky101456/cmskoty.jpg\\\" alt=\\\"\\\" width=\\\"336\\\" height=\\\"334\\\" /></p>\\n<p>Využijte také našeho odborného poradenství. Naši odborníci Vám telefonicky pomohou s<span> </span><strong>vhodným výběrem nástroje</strong>, projdou s Vámi celý proces osazován', '_vyr_92cdm12cms.jpg', 0, '440.10', '489.00', 'CDM12CMS', '_vyrn_92cdm12cms.jpg', '_vyrp11_92cmskoty.jpg', '', '', 21, 1, 3, 1, '', 0, '2-8-0-0|2-8-305-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7727, 93, 'Kleština OZ 25/DIN 6388 - 8mm', 'Kleština OZ 25/DIN 6388 - 8mm', '<p>• Kleštinový kužel v kombinaci s dlouhým upínacím otvorem pro silné sevření a tuhost.<br />• Konzistentní silné sevření v celém délce 52mm v rozsahu 0-0,5 mm upínacího průměru.<br />• Navrženo pro všechny druhy složitějších operací s nárokem na přesnost upnutí.<br />• Zaručena dlouhá životnost díky vysoce kvalitní oceli a pečlivému tepelnému zpracování.</p>\\n<p>O správné montáži kleštin a převlečných matic si můžete přešit v našem <a title=\\\"Usazení kleštiny do upínače\\\" href=\\\"https://www.stopkovefrezy.cz/Usazeni-klestiny-do-upinace-a6_15.htm\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">článku</a>. </p>', '_vyr_93klestina-pro-din.jpg', 0, '524.00', '582.00', '910008', '_vyrn_93klestina-pro-din.jpg', '_vyrp11_93klestina-pro-din-1.jpg', '', '', 21, 1, 2, 1, '', 0, '2-8-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7728, 95, '161 Fréza na „V“ drážku žiletková Z1 D50x25 91° S=20 HW', '161 Fréza na „V“ drážku žiletková Z1 D50x25 91° S=20 HW', '<p>- Fréza pro gravírování a frézování V drážek<br />- Určeno pro CNC obrábění dřeva, lamina a HPL<br />- Masivní tělo nástroje s přesným vyvážením</p>\\n<p>Fréza s výměnnými žiletkami s jedním břitem, určeným k V drážkování tvrdého dřeva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobré upnutí na CNC strojích při vysokých otáčkách.</p>', '_vyr_95freza-uhlova-a-popisovaci-Briani.jpg', 0, '4890.00', '6112.00', '1619102008', '_vyrn_95freza-uhlova-a-popisovaci-Briani.jpg', '_vyrp11_95161-30-_BRIANI.jpg', '_vyrp12_95161-91-_BRIANI.jpg', '', 21, 1, 2, 1, '', 0, '2-7-43-0|2-7-0-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7729, 100, '2 Drážkovací fréza standard - D6x18 L50 S=8 HW', '2 Drážkovací fréza standard - D6x18 L50 S=8 HW', '<p>- Frézy pro drážkování<br />- Snadné vytvoření drážky nebo výřezu</p>\\n<p>Gamma Zinken drážkovací fréza je určena pro všechny druhy prací. Vyznačuje se kvalitním ostřím, které vyfrézuje dokonalou drážku. Pro frézování podle šablony lze použít kopírovací ložiska na stopce. <br /><br />Fréza má HM břity s dlouhou životností, je precizně naostřena. Díky konstrukci je vhodná pro frézování měkkého a tvrdého dřeva, lepeného dřeva, DTD, lamina , MDF, HPL a Corianu. <br /><br /><br /></p>', '_vyr_1002-web.jpg', 0, '675.00', '750.00', 'GZ1535', '_vyrn_1002-web.jpg', '_vyrp11_100Dis_B_2HM-lav.png', '_vyrp12_100Dis_B_N.png', '', 21, 1, 1, 1, '', 0, '2-1-11-312|2-1-0-0|2-1-11-0|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:03'),
(7730, 101, '2LTT Stopková fréza se závrtným zubem - D8x20 L70 S=8 HW', '2LTT Stopková fréza se závrtným zubem - D8x20 L70 S=8 HW', '<p>- Frézy pro přímé zavrtání<br />- Po zavrtání můžete frézovat požadovanou výšku řezu<br />- Snadné vytvoření drážky nebo výřezu</p>\\n<p>- Menší čezná hloubka, větší celková délka </p>\\n<p>Gamma Zinken drážkovací fréza se závrtným HM zubem jse určena pro všechny druhy prací včetně zavrtávání do materiálu. HM zavrtávací zub usnadňuje zavrtávání do měkkého a tvrdého dřeva, DTD, lamino desek, MDF a HDF. <br /><br /><strong>Zavrtávací HM břit naostřený pro hluboké zavrtání do materiálu.</strong></p>', '_vyr_1012TTL-web.jpg', 0, '720.00', '800.00', 'GZ3237', '_vyrn_1012TTL-web.jpg', '_vyrp11_101Dis_B_2TT_lav.png', '_vyrp12_101Dis_B_2TT_lav2.png', '_vyrp13_101Dis_B_2TT_70.png', 21, 1, 5, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:03'),
(7731, 102, '2C Falcovací fréza na polodrážku - H9,5 D32x12 S=8 HM', '2C Falcovací fréza na polodrážku - H9,5 D32x12 S=8 HM', '<p>• Šikmé ostří pro lepší odvod třísek. <br />• Pro ořezávání i nejobtížnějších dílů podle šablony. <br />• Speciální kopírovací ložisko na čele frézy.</p>\\n<p>S falcovací frézou můžete dokonce obnovit žlábky starých okenních rámů pro vsazení izolovaných skel. <br /><br />Použití: Pro vsazovaná dvířka a zásuvková čela, pevné polodrážkové spoje, frézování dokonalých spojů na pero a drážku a pro řadu dalších prací.</p>', '_vyr_1022C-web.jpg', 0, '765.00', '850.00', 'GZ488', '_vyrn_1022C-web.jpg', '_vyrp11_102Dis_B_2C-lav.png', '_vyrp12_102Dis_B_2C.png', '', 21, 1, 1, 0, '', 0, '2-1-17-335|2-1-0-0|2-1-17-0|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7732, 103, 'Cn Ořezávací fréza, šikmé zuby - D19x20 L70 S=8 HW', 'Cn Ořezávací fréza, šikmé zuby - D19x20 L70 S=8 HW', '<p>• Negativní úhel řezné hrany. <br />• Pro ořezávání i nejobtížnějších dílů podle šablony. <br />• HM tvrdokovové břity. <br />• Speciální kopírovací ložisko na čele frézy. <br />• Prodloužená délka ostří. <br /><br />Gamma Zinken frézy jsou vybaveny spodním ložiskem a jsou spirálově vybroušeny což umožnuje čisté hladké řezy do mnoha materiálu. Jedinečný nástroj zejména pro frézování zakřivených tvarů podél šablony.</p>', '_vyr_103Cn.jpg', 0, '810.00', '900.00', 'GZ4140', '_vyrn_103Cn.jpg', '_vyrp11_103Cn-1.jpg', '_vyrp12_103Cn-2.jpg', '', 21, 1, 2, 1, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7733, 104, 'Cs Ořezávací fréza s horním ložiskem - D19x25 S=8  HW', 'Cs Ořezávací fréza s horním ložiskem - D19x25 S=8  HW', '<p>• Pro ořezávání i nejobtížnějších dílů podle šablony<br /> • HM tvrdokovové břity<br /> • Speciální kopírovací ložisko na stopce frézy</p>\\n<p>Nejpoužívanější ořezávací fréza, která je určená na kopírování šablon s perfektním výsledkem opracování. <br /> Pro ofrézování široké struktury a druhů materiálů a to díky HW zubům. Opěrné ložisko zajišťuje přesné vedení a opěru v řezu.</p>', '_vyr_104Csup-web.jpg', 0, '742.50', '825.00', 'GZ3244', '_vyrn_104Csup-web.jpg', '_vyrp11_104Dis_B_Csup-lav.png', '_vyrp12_104Dis_B_Csup.png', '_vyrp13_1046dbfe62e64b4873608b92df198d27a7b.png', 21, 1, 4, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-316|14-0-0-0|14-611-0-0|14-611-626-0', NULL, '2021-01-10 15:44:03'),
(7734, 105, 'CS Ořezávací fréza se sražením 45° - D24x11 B19 S=8 HW', 'CS Ořezávací fréza se sražením 45° - D24x11 B19 S=8 HW', '<p>• Pro ořezávání i nejobtížnějších dílů podle šablony<br />• HM tvrdokovové břity</p>\\n<p>• Zaříznutí a sražení hrany na 45° v jedné operaci<br />• Speciální kopírovací ložisko na čele frézy</p>\\n<p>Nejpoužívanější ořezávací fréza, která je určená na kopírování šablon s perfektním výsledkem opracování. <br />Pro ofrézování široké struktury a druhů materiálů a to díky HW zubům. Opěrné ložisko zajišťuje přesné vedení a opěru v řezu.</p>', '_vyr_105CS-web.jpg', 0, '765.00', '850.00', 'GZ1052', '_vyrn_105CS-web.jpg', '_vyrp11_105Dis_B_CS-lav.png', '_vyrp12_105Dis_B_CS.png', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7735, 106, '2TTgf Drážkovací fréza s upínáním M12 - D16x25 L63 S=M12x1 HW', '2TTgf Drážkovací fréza s upínáním M12 - D16x25 L63 S=M12x1 HW', '<p>- Určeno pro kování na bezfalcové dveře</p>\\n<p>- Ideální pro výrobu otvorů pro kování Tectus, BACA PROTECT</p>\\n<p>- HW břity pro maximální výdrž a výkon</p>\\n<p>Drážkovací fréza se závitovým upínáním je ideální pro frézování hlubokých otvorů, závěsů na bezfalcových dveřích pomocí šablony a jiného stavebního kování například značku Tectus. Tato fréza se umístí na unašecí stopku díky závitu M12x1 a díky unašesí stopce je možné nástroj prodloužit na celkovou délku až 132 mm. Díky HW břitům jsou vhodné na masiv, dřevěné kompozity, plasty a lamináty. Může být používána na obrábění v CNC frézách a ručních frézkách. Upínací stopku pro upnutí v kleštině je nutno objednat zvlášť.</p>\\n<p>- Tectus 210/240 - Průměr nástroje 16mm, řezná hloubka 25mm nebo 35mm</p>\\n<p>- Tectus 310/340 - Průměr nástroje 24mm, řezná hloubka 25mm nebo 35mm</p>\\n<p>- BAKA PROTECT 3D - Průměr nástroje 20mm, řezná hloubka 25mm nebo 35mm</p>', '_vyr_1062tt-gf-web.jpg', 0, '990.00', '1100.00', 'GZ1137', '_vyrn_1062tt-gf-web.jpg', '_vyrp11_106Dis_B_2TT_lav.png', '_vyrp12_106Dis_B_2TT_lav2.png', '_vyrp13_106Dis_B_N.png', 21, 1, 1, 0, '', 0, '2-1-11-314|2-1-0-0|2-1-11-0|14-0-0-0|14-610-0-0|14-610-623-0', NULL, '2021-01-10 15:44:03'),
(7736, 107, 'IGM FKP656 Vrtací přípravek sada 656mm + ZDARMA 100ks kolíků 8x35', 'IGM FKP656 Vrtací přípravek sada 656mm + ZDARMA 100ks kolíků 8x35', '<p><strong>• Pro kolíkování na hraně dílce<br />• Pro spojování na konfirmáty<br />• Možnost upnutí různých průměrů vrtáků<br />• Rozteč otvorů v evropské normě</strong><br /> </p>\\n<p><strong>Univerzální vrtací přípravek je určen pro přesné a produktivní ruční kolíkování nábytkových dílců. Docílíte vysokou přesnost a produktivitu práce. Jednotlivé pozice děr jsou konstruovány s roztečí 32mm, což odpovídá standardní euro normě pro strojní kolíkování dílců. Přípravek je určen pro použití našich kolíkovacích vrtáků z HM tvrdokovovou špičkou, které jsou upnuté ve vrtacím pouzdru stejným systémem jako v kolíkovačce.</strong><br /> </p>\\n<p><strong>Přesnost a jednoduchost při vrtání kolíků</strong><br />Vrtací přípravek automaticky vytváří přesný rohový spoj s fazetkou 0,5mm. Koncové dorazy<br />přípravku zajišťují zarovnání spojovaných dílců z přední nebo zadní strany.<br /> </p>\\n<p>Kolíky i konfirmáty je možné vyrábět pouhou výměnou vrtáků ve vrtacím pouzdře.<br /><br /><strong>Vrtání ko', '_vyr_107pictureprovider-aspx.jpg', 0, '3800.00', '4089.00', 'FKP656-set', '_vyrn_107pictureprovider-aspx.jpg', '_vyrp11_107pictureprovider1-aspx.jpg', '_vyrp12_107pictureprovider2-aspx.jpg', '', 21, 1, 1, 1, '', 0, '4-107-384-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:03'),
(7737, 108, 'IGM FKP900 Vrtací šablona sada 900mm + ZDARMA 100ks kolíků 8x35', 'IGM FKP900 Vrtací šablona sada 900mm + ZDARMA 100ks kolíků 8x35', '<h2><span style=\\\"font-size: 14px;\\\">Jednoduchost a rychlost - snadné zpracování celého korpusu</span></h2>\\n<p><strong>• Pro kolíkování do plochy<br />• Otvory pro konfirmáty do ploch<br />• Pro nosiče polic<br />• Pro vrtání úchytek<br />• Pro NK panty (Hettich, Blum, Mepla, Grass a další)</strong><br /><br />Univerzální vrtací šablona je určena pro přesné a produktivní ruční kolíkování nábytkových dílců do plochy s Euro roztečí 32mm, pro vrtání děr nosičů polic průměru 3 a 5mm, vrtání otvorů pro úchytka, pro vrtání a značení otvorů pro NK panty. FKP900 obsahuje šablony pro předvrtání děr nejpoužívanějších NK pantů. Se šablonou FKP900 zhotovíte jak díry pro Euro šrouby či vruty podložek pantů na korpusovém dílu, tak předvrtáte díry pro pant na dvířkách včetně označení středu misky NK pantu. S FKP900 docílíte vysokou přesnost a produktivitu práce jak v dílně, tak i na montáži. Šablona je určena pro použití s vrtacím vřetenem FKP101, do kterého lze upnout vrtáky různých průměrů od 3mm ', '_vyr_108pictureprovider4-aspx.jpg', 0, '3200.00', '3548.00', 'FKP900-set', '_vyrn_108pictureprovider4-aspx.jpg', '_vyrp11_108pictureprovider5-aspx.jpg', '_vyrp12_108pictureprovider6-aspx.jpg', '_vyrp13_108pictureprovider7-aspx.jpg', 21, 1, 1, 0, '', 0, '4-107-384-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:03'),
(7738, 115, '153 Dlabací fréza žiletková HM D20x30 L135mm S=20 Z2', '153 Dlabací fréza žiletková HM D20x30 L135mm S=20 Z2', '<p>• Stálý řezný průměr výměnných žiletek HM<br />• Odolnější tvrdokov u žiletek proti celotvrdokovovým frézám<br />• Perfektně vyvážené tělo<br />• Snížení rizika zlomení<br />• Produktivní a ekonomická výroba<br /> </p>\\r\\n<p>Pro vyvrtávání extra hlubokých dlabů do masivního dřeva. Ideální pro frézování tvrdého dřeva nebo dřevěných kompozitů. Lze frézovat dlaby postupně krok za krokem až do cílové hloubky s vysokou rychlostí. Určeno pro použití s CNC obráběcími centry.<br /><br />D=20 mm, L=135 mm<br /><br /><em>• Vyrobeno z extra pevné oceli<br />• 2 břity (Z2R)<br />• Lamač třísky</em></p>', '_vyr_115153.jpg', 0, '4880.66', '5422.95', '1532003008', '_vyrn_115153.jpg', '', '', '', 21, 1, 1, 4, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7739, 116, '155 Drážkovací fréza žiletková - D19x50 L110 S=20 HM', '155 Drážkovací fréza žiletková - D19x50 L110 S=20 HM', '<p>Drážkovací stopková fréza s jednou zavrtávací žiletkou a jednou řezací žiletkou. Má vynikající vlastnosti při zavrtávání v tvrdém dřevě a deskových materiálech (lamino, dřevotříska, MDF a Corian). Stopka průměru 20 mm je určena pro bezpečné upnutí v CNC obráběcích centrech při vysokých posuvových rychlostech. Lze použít také pro ruční frézování. <br /><br />Fréza je vybavena zavrtávací žiletkou, která usnadňuje zavrtávání do materiálu.</p>\\n<p>Specifikace:</p>\\n<p>- Drážkování, ořezávání</p>\\n<p>- CNC</p>\\n<p>- MEC</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_116155_BRIANI.jpg', 0, '3810.73', '4234.14', '1551905009', '_vyrn_116155_BRIANI.jpg', '_vyrp11_116155_BRIANI_TECH.jpg', '_vyrp12_116155_WORKING.jpg', '', 21, 1, 1, 0, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7740, 117, '158 Fréza na „V“ drážku žiletková Z1 T7,3 L73 92° S=12 HW', '158 Fréza na „V“ drážku žiletková Z1 T7,3 L73 92° S=12 HW', '<p>- Fréza pro gravírování a frézování V drážek<br />- Určeno pro CNC obrábění dřeva, lamina a HPL<br />- Masivní tělo nástroje s přesným vyvážením</p>\\n<p>Fréza s výměnnými žiletkami s jedním břitem, určeným k V drážkování tvrdého dřeva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobré upnutí na CNC strojích při vysokých otáčkách.</p>\\n<p>Specifikace:</p>\\n<p>- Popisovací, úhlová</p>\\n<p>- CNC</p>\\n<p>- MEC, MAN</p>\\n<p>- Z1</p>\\n<p>- HW žiletky</p>', '_vyr_117158_BRIANI.jpg', 0, '1409.64', '1566.27', '1584501208', '_vyrn_117158_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-15-328|2-1-15-0|2-7-0-0|2-7-43-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03'),
(7741, 118, '164 Stopková fréza na plochy HM - D80x12 L90 S=20x50 Z3', '164 Stopková fréza na plochy HM - D80x12 L90 S=20x50 Z3', '<p>Fréza na plochy je ideální pro rychlý posuv a velké úběry materiálu z plochy materiálu. Výsledkem je vždy dokonale srovnaný povrch. Frézy mají 3 uběrací žiletky posazrné v axiálním úhlu, pro vytvoření skutečně ostrého rohu. Pro frézování měkkého a tvrdého dřeva , DTD a MDF, HPL na CNC obráběcích centrech.<br /><br />Šroub pro nastavení délky frézy je pouze na stopce S=20mm</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Drážkování, ořezávání, srovnávání</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MEC</p>\\r\\n<p>- Z3</p>\\r\\n<p>- HW žiletky</p>', '_vyr_118164_BRIANI.jpg', 0, '5105.92', '5673.24', '1648002008', '_vyrn_118164_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7742, 119, '162 Úhlová žiletková fréza - 45° D50x25 L75 S=12 HM', '162 Úhlová žiletková fréza - 45° D50x25 L75 S=12 HM', '<p>Fréza je určena pro ořezávání a srážení hran. <br /><br />Typ F046 je bez ložiska. Určen pro ruční frézování a také pro strojní frézování na CNC centrech.</p>\\n<p>Specifikace:</p>\\n<p>- Srážení hrany, ořezávání</p>\\n<p>- CNC</p>\\n<p>- MEC, MAN</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_119162_BRIANI.jpg', 0, '4004.64', '4449.60', '1624501208', '_vyrn_119162_BRIANI.jpg', '', '', '', 21, 1, 1, 4, '', 0, '2-7-0-0|2-7-43-0', NULL, '2021-01-10 15:44:03'),
(7743, 121, '171 Zaoblovací fréza žiletková - R8 D32x18 L80 S=20 HW', '171 Zaoblovací fréza žiletková - R8 D32x18 L80 S=20 HW', '<p>Fréza je dodávána s HW žiletkami. Žilůetky jsou na fréze umístěny v přesných lůžkách pro kvalitní řez materiálu.<br /><br />Použití :<br />Pro velké zaoblování hran dílců. Ideální pro masivní dřevo nebo DTD, LTD a MDF. Frézování je možné pouze po obvodu, není možné zavrtávání do materiálu. Určeno pro mechanický posuv. Pro CNC obráběcí centra.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Zaoblování, ořezávání</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_121171_BRIANI.jpg', 0, '5564.00', '6183.00', '1710800200', '_vyrn_121171_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-7-43-0|2-7-0-0', NULL, '2021-01-10 15:44:03'),
(7744, 126, '235 Rybinová žiletková fréza pro střešní trámy - 15° D40x31,5 S=M12x1 HW', '235 Rybinová žiletková fréza pro střešní trámy - 15° D40x31,5 S=M12x1 HW', '<p>Rybinová fréza je určená pro velké rybinové spoje trámů pro dřevostavby, střechy, krovy atd. Upínací systém vnitřní závit M12x1. Dvě HW výměnné žiletky.</p>\\r\\n<p>Frézování spojů pomocí šablony v masivním dřevě.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Drážkování, rybiny</p>\\r\\n<p>- Ruční frézování, CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_126235-ARUNDA_BRIANI.jpg', 0, '4310.09', '4788.99', '2351500028', '_vyrn_126235-ARUNDA_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-16-333|2-1-0-0|2-1-16-0|2-1-16-331|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:03'),
(7745, 127, '259 Frézovací vrták pro Domino Festool - D8x28 L49 S=M6 HW', '259 Frézovací vrták pro Domino Festool - D8x28 L49 S=M6 HW', '<p>Dlabací vrtáky pro Domino systém firmy Festool od firmy Briani. <br />Neplaťte více než musíte a dopřejte si přesné a kvalitní vrtáky pro Vaši Festool Domino frézku.<br />Určeno pro použití v Domino frézce od Festool.</p>\\n<p> </p>\\n<p>Určeno pro: <span style=\\\"font-size: 12px;\\\">DF 500 Q , </span><span style=\\\"font-size: 12px;\\\">DF 700 EQ</span></p>', '_vyr_127259_DOMINO_FESTO_BRIANI.jpg', 0, '578.10', '642.33', '2590800028', '_vyrn_127259_DOMINO_FESTO_BRIANI.jpg', '', '', '', 21, 1, 2, 1, '', 0, '2-1-11-311|2-5-35-0|2-5-35-369|12-0-0-0|12-599-0-0|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:03'),
(7746, 130, '507 Drážkovací talířová fréza - D40x1,5 F6 HW', '507 Drážkovací talířová fréza - D40x1,5 F6 HW', '<p>Talířová fréza bez unašecí stopky v německé variantě provedení.</p>\\n<p>Pro upnutí a následné použití je třeba dokoupit unašecí trn t.509 ( s ložiskem ) nebo t.510( bez ložiska )</p>\\n<p>Upínací otvor pro unašecí trn má průměr 6mm.</p>\\n<p>Specifikace:</p>\\n<p>- Drážkování v hraně, falcování</p>\\n<p>- MEC,MAN</p>\\n<p>- Z2</p>\\n<p>- HW pájené</p>', '_vyr_130507_BRIANI.jpg', 0, '400.22', '444.69', '50701500600', '_vyrn_130507_BRIANI.jpg', '_vyrp11_130507_kit_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-1-11-315|2-1-0-0|14-0-0-0|14-610-0-0|14-610-624-0', NULL, '2021-01-10 15:44:03'),
(7747, 133, '511 Ořezávací žiletková fréza se spodním ložiskem - D19x30 L72 S=8 HW', '511 Ořezávací žiletková fréza se spodním ložiskem - D19x30 L72 S=8 HW', '<p>Fréza Briani je určena pro přesné frézování a kopírování podle šablony, která je vespod ( pod materiálem ). U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza tento jev eliminuje pomocí přesně ustavených výměnných žiletek, které se navíc dají otáčet a použít až 4 břity. <br /><br />Typ nástroje 511C s řeznou délkou 50 mm je vybaven dvěma kopírovacími ložisky pro lepší vedení podle šablony.</p>\\n<p>Specifikace:</p>\\n<p>- Ložisko</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_133511_BRIANI.jpg', 0, '1375.87', '1528.74', '51119030800', '_vyrn_133511_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|7-0-0-0|7-422-0-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7748, 134, '511C Ořezávací žiletková fréza se spodním ložiskem - D19x30 L115 S=8 HW', '511C Ořezávací žiletková fréza se spodním ložiskem - D19x30 L115 S=8 HW', '<p>Fréza Briani je určena pro přesné frézování a kopírování podle šablony, která je vespod ( pod materiálem ). U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza tento jev eliminuje pomocí přesně ustavených výměnných žiletek, které se navíc dají otáčet a použít až 4 břity. <br /><br />Typ nástroje 511C s řeznou délkou 50 mm je vybaven dvěma kopírovacími ložisky pro lepší vedení podle šablony.</p>\\n<p>Specifikace:</p>\\n<p>- Ložisko dvojté</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_134511C_BRIANI.jpg', 0, '2016.90', '2241.00', '511C1905012', '_vyrn_134511C_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:03'),
(7749, 135, '512 Úhlová žiletková fréza - 45° D29x12 L65 S=8 HW', '512 Úhlová žiletková fréza - 45° D29x12 L65 S=8 HW', '<p>Úhlová fréza Briani je určena pro ořezávání a srážení hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian. <br /><br />Fréza je vybavena kopírovacím ložiskem, které je zajištěno maticí. Určen pro ruční frézování.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Ložisko</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_135512_BRIANI.jpg', 0, '1225.94', '1362.15', '51245000800', '_vyrn_135512_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7750, 136, '512B Úhlová žiletková fréza - 45° D29x14 L60 S=8 HW', '512B Úhlová žiletková fréza - 45° D29x14 L60 S=8 HW', '<p>Úhlová fréza Briani je určena pro ořezávání, srážení a drážkování hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian. <br /><br />Fréza je vybavena kopírovacím ložiskem, které je zajištěno šroubkem. Nástroj umožňuje frézovat V drážku do hrany materiálu. Určen pro ruční frézování.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Ložisko</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_136512B_BRIANI.jpg', 0, '1401.62', '1557.36', '512B4500800', '_vyrn_136512B_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03'),
(7751, 137, '543 Úhlová žiletková fréza - 45° D29x12 L65 S=8 HW', '543 Úhlová žiletková fréza - 45° D29x12 L65 S=8 HW', '<p>Úhlová fréza Briani je určena pro ořezávání a srážení hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian. <br /><br />Fréza je bez ložiska. Určen pro CNC a ruční frézování.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_137544_BRIANI.jpg', 0, '1106.87', '1229.85', '54445000800', '_vyrn_137544_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-320|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:03'),
(7752, 138, '546A Ořezávací žiletková fréza se středovým ložiskem - D22x12-30 L70 S=8 HW', '546A Ořezávací žiletková fréza se středovým ložiskem - D22x12-30 L70 S=8 HW', '<p>Fréza Briani je určena pro přesné ofrézování přesahů a nákližků na materiálu podle středového materiálu. Výhodou tohoto typu ořezávací frézy je možnost zvolit jakou částí nástroje potřebujete využívat. Možné využít jako nástroj k ořezávání se spodním, horním nebo středovým ložiskem.</p>\\n<p>U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza zajišťuje přesně ustavených výměnných žiletek, které se navíc dají otáčet a 4x použít. <br /><br /></p>\\n<p>Specifikace:</p>\\n<p>- Ložisko</p>\\n<p>- MAN</p>\\n<p>- Z2/4</p>\\n<p>- HW žiletky</p>', '_vyr_138546A_BRIANI.jpg', 0, '2995.95', '3328.83', '54612030800', '_vyrn_138546A_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|2-1-12-318|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0|14-611-627-0|14-611-628-0', NULL, '2021-01-10 15:44:03'),
(7753, 139, '546B Ořezávací žiletková fréza se středovým ložiskem - D22x30-45 L84 S=8 HW', '546B Ořezávací žiletková fréza se středovým ložiskem - D22x30-45 L84 S=8 HW', '<p>Fréza Briani je určena pro přesné ofrézování přesahů a nákližků na materiálu podle středového materiálu. Výhodou tohoto typu ořezávací frézy je možnost zvolit jakou částí nástroje potřebujete využívat. Možné využít jako nástroj k ořezávání se spodním, horním nebo středovým ložiskem.</p>\\r\\n<p>U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza zajišťuje přesně ustavených výměnných žiletek, které se navíc dají otáčet a 4x použít. <br /><br /></p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Ložisko</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2/4</p>\\r\\n<p>- HW žiletky</p>', '_vyr_139546B_BRIANI.jpg', 0, '3416.58', '3796.20', '54630045800', '_vyrn_139546B_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-12-317|2-1-0-0|2-1-12-0|2-1-12-318|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0|14-611-627-0|14-611-628-0', NULL, '2021-01-10 15:44:03'),
(7754, 140, '547 Ořezávací žiletková fréza s drážkovacím kotoučem - D22x26 D2-40x4 L66 S=8 HW', '547 Ořezávací žiletková fréza s drážkovacím kotoučem - D22x26 D2-40x4 L66 S=8 HW', '<p>Fréza Briani je určena pro přesné ofrézování přesahy a vytvoření drážky pro narážecí hranu. Výhodou tohoto typu frézy je, že jedním projetím oříznete materiál a vytvoříte drážku 2,5mm, 3mm nebo 4mm. Použití pomocí opěrného pravítka nebo upnutím ve frézovacím stolku.</p>\\r\\n<p>U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza zajišťuje přesně ustavených výměnných žiletek, které se navíc dají otáčet a 4x použít. <br /><br /></p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2/6</p>\\r\\n<p>- HW žiletky</p>', '_vyr_140547_BRIANI.jpg', 0, '4099.65', '4555.17', '54722040800', '_vyrn_140547_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-11-315|2-1-12-390|14-0-0-0|14-610-0-0|14-610-624-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:03'),
(7755, 141, '557C Velká falcovací fréza - H17 D50x29,5 L95 S=12 HM', '557C Velká falcovací fréza - H17 D50x29,5 L95 S=12 HM', '<p>• Šikmé ostří pro lepší odvod třísek. <br />• Pro ořezávání i nejobtížnějších dílů podle šablony. <br />• HW tvrdokovové břity. <br />• Speciální kopírovací ložisko na čele frézy. <br />• Prodloužená délka ostří. <br /><br />Velká falcovací fréza je dodávána se základní sadou ložisek a kroužkem 16mm pro frézování 17 mm falcu. K této fréze je možné dokoupit 16 velikostí kopírovacích kroužků a tři velikosti ložisek, se kterými vyrobíte 19 různých rozměrů falcu. Při frézování falců větších než 12 mm provádějte vícenásobné úběry pomocí postupného zvětšování hloubky. <br /><br />Doporučujeme použití ve frézovacím stolku.</p>', '_vyr_141557C_BRIANI.jpg', 0, '4004.64', '4449.60', '557C5001200', '_vyrn_141557C_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-17-336|2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7756, 142, '513 Stopková fréza rybinová, žiletková - D28x26 L60 15° S=8 HW', '513 Stopková fréza rybinová, žiletková - D28x26 L60 15° S=8 HW', '<p>Rybinová fréza je určená pro vštší rybinové spoje fošem a desek na nábytku nebo stavebních prvcích jakou jsou dveře a další. Dvě HW výměnné žiletky s možností otočení a dvou ostří.</p>\\r\\n<p>Frézování spojů pomocí šablony nebo pravítek v masivním dřevě.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Drážkování, rybiny</p>\\r\\n<p>- Ruční frézování, CNC</p>\\r\\n<p>- MAN, MEC</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_142513_BRIANI.jpg', 0, '2995.95', '3328.83', '51315000800', '_vyrn_142513_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-16-331|2-1-0-0|2-1-16-0|2-1-16-333|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:03'),
(7757, 143, '557 Falcovací fréza žiletková - B12,5 D38x12 L50 S=8 HW', '557 Falcovací fréza žiletková - B12,5 D38x12 L50 S=8 HW', '<p>• Pro falcování i nejobtížnějších dílů podle šablony. <br />• HW tvrdokovové břity. <br />• Kopírovací ložisko na čele frézy.  <br /><br />Briani falcovací fréza je dodávána se základním ložisekem 13mm pro frézování 12,5 mm falcu. K této fréze je možné dokoupit čtyři velikosti ložisek. Při frézování falců větších než 12 mm provádějte vícenásobné úběry pomocí postupného zvětšování hloubky. </p>', '_vyr_143557_BRIANI.jpg', 0, '1551.80', '1724.22', '55738000800', '_vyrn_143557_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7758, 144, '567 Ořezávací žiletková fréza s horním a spodním ložiskem - D19x50 L105 S=12 HW', '567 Ořezávací žiletková fréza s horním a spodním ložiskem - D19x50 L105 S=12 HW', '<p>Briani ořezávací fréza s horním a spodním ložiskem. Dvoustranné žiletky upnuty pevnostními Torx šrouby. Pro přesné lícovací frézování horní frézkou nebo ve frézovacím stolku.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Ložisko horní a spodní</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_144567_BRIANI.jpg', 0, '2144.48', '2382.75', '56719050120', '_vyrn_144567_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-12-0|2-1-12-318|14-0-0-0|14-611-0-0|14-611-628-0', NULL, '2021-01-10 15:44:03'),
(7759, 145, '580 Fréza na „V“ drážku žiletková Z1 T7,3 L63 92° S=8 HW', '580 Fréza na „V“ drážku žiletková Z1 T7,3 L63 92° S=8 HW', '<p>- Fréza pro gravírování a frézování V drážek<br />- Určeno pro ruční a CNC obrábění dřeva, lamina a HPL<br />- Masivní tělo nástroje s přesným vyvážením</p>\\r\\n<p>Fréza s výměnnými žiletkami s jedním břitem, určeným k V drážkování tvrdého dřeva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobré upnutí na CNC strojích při vysokých otáčkách.</p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- Popisovací, úhlová</p>\\r\\n<p>- RUČNÍ frézování, CNC</p>\\r\\n<p>- MEC, MAN</p>\\r\\n<p>- Z1</p>\\r\\n<p>- HW žiletky</p>', '_vyr_145580_BRIANI.jpg', 0, '1499.00', '1566.00', '5804500800', '_vyrn_145580_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-15-328|2-1-15-0|2-7-0-0|2-7-43-0|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:03'),
(7760, 146, '583 Úhlová žiletková fréza - 45° D26x19,5 d16 S=8 HW', '583 Úhlová žiletková fréza - 45° D26x19,5 d16 S=8 HW', '<p>Úhlová fréza Briani je určena pro ořezávání a srážení hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian. <br /><br />Fréza je vybavena kopírovacím ložiskem o průměru 16mm, které je zajištěno šroubem. Určen pro ruční frézování, srážení hrany a zdobení hran.</p>\\n<p>Specifikace:</p>\\n<p>- Ložisko</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_146583_BRIANI.jpg', 0, '1921.89', '2135.43', '58345026800', '_vyrn_146583_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-13-0|2-1-0-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:03');
INSERT INTO `products` (`id`, `productId`, `name`, `secondName`, `description`, `picture`, `available`, `price`, `secondPrice`, `productnumber`, `previewPicture`, `gallery0`, `gallery1`, `gallery2`, `vat`, `vatlevel`, `amountInStock`, `avaibilityId`, `ean`, `unsaleable`, `categories`, `changedAt`, `dt`) VALUES
(7761, 147, '584 Falcovací fréza žiletková, sada - d10-16 D26x19,5 L70 S=8 HW', '584 Falcovací fréza žiletková, sada - d10-16 D26x19,5 L70 S=8 HW', '<p>• Pro falcování i nejobtížnějších dílů podle šablony. <br />• HW tvrdokovové, žiletkové břity. <br />• Kopírovací ložiska s uputím na čele frézy.  </p>\\n<p>• Prodloužená pracovní víška <br /><br />Briani falcovací fréza je dodávána se sadou ložisek 3ks. Při frézování falců větších než 12 mm provádějte vícenásobné úběry pomocí postupného zvětšování hloubky. </p>\\n<p>Průměr nástroje 26mm:  ložiska 10mm, 13mm, 16mm / falc 8mm, 7,5mm, 5 mm</p>\\n<p>Průměr nástroje 32mm:  ložiska 10mm, 13mm, 16mm / falc 11mm, 9,5mm, 8 mm</p>\\n<p>Specifikace:</p>\\n<p>- Falcování</p>\\n<p>- Ruční grézka</p>\\n<p>- MAN</p>\\n<p>- Z2</p>\\n<p>- HW žiletky</p>', '_vyr_147584_BRIANI.jpg', 0, '1799.66', '1999.62', '58426000800', '_vyrn_147584_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:03'),
(7762, 148, '585 Ořezávací žiletková fréza s horním ložiskem - D19x30 L68 S=8 HW', '585 Ořezávací žiletková fréza s horním ložiskem - D19x30 L68 S=8 HW', '<p>Fréza Briani je určena pro přesné frézování a kopírování podle šablony, která je na horní straně materiálu. Tento typ nástroje se dá využít i pro silnější materiály a to pomocí ložiska. U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza tento jev eliminuje pomocí přesně ustavených výměnných žiletek, které se navíc dají otáčet a použít až 4 břity ( platí u žiletek 12x12x1,5mm ). </p>\\r\\n<p>Specifikace:</p>\\r\\n<p>- KOpírování, drážkování, ořezávání</p>\\r\\n<p>- Ložisko na stopce</p>\\r\\n<p>- MAN</p>\\r\\n<p>- Z2</p>\\r\\n<p>- HW žiletky</p>', '_vyr_148585-T30_BRIANI.jpg', 0, '1405.27', '1561.41', '58519030800', '_vyrn_148585-T30_BRIANI.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-12-0|2-1-12-316|14-0-0-0|14-611-0-0|14-611-626-0', NULL, '2021-01-10 15:44:03'),
(7763, 149, '301 Upínací pouzdro s kónickou 30° dosedací plochou, M10 - S10, L46 RH', '301 Upínací pouzdro s kónickou 30° dosedací plochou, M10 - S10, L46 RH', '<p>- Vysoká přesnost. <br />- Vysoce kvalitní tvrzená ocel. <br />- Rychlá výměna vrtáku. <br />- Naprostá spolehlivost. <br />- Dokonalé centrování. <br />- Plynulá rotace. <br />- Nahrazuje vrták se závitem. <br /><br />Upínací pouzdra nabízejí moderní způsob výměny kolíkovacích vrtáků v kolíkovacích a vyvrtávacích strojích. Tvoří přechod mezi strojem a kolíkovacími vrtáky. Pro správnou volbu upínacího pouzdra je důležitá dosedací plocha, volba závitu nebo průměru pouzdra. <br /><br />Centrovací konus 30 °. <br />Použití na strojních typu: Alberti (starší model) Balestrini, Bilek, Busellato (starší model), Schleicher, Vitap (starší model).</p>\\n<p>- RH - pravotočivé provedené - bez drážky po obvodu</p>\\n<p>- LH - levotočivé provedení - drážka po obvodu</p>', '_vyr_149301DX_BRIANI.jpg', 0, '237.90', '264.33', '3011000008', '_vyr_149301DX_BRIANI.jpg', '_vyrp11_149301SX_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-372-396-0|2-372-0-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
(7764, 150, '303 Upínací pouzdro s válcovou dosedací plochou d11, M10 - S10, L40 RH', '303 Upínací pouzdro s válcovou dosedací plochou d11, M10 - S10, L40 RH', '<p>- Vysoká přesnost. <br />- Vysoce kvalitní tvrzená ocel. <br />- Rychlá výměna vrtáku. <br />- Naprostá spolehlivost. <br />- Dokonalé centrování. <br />- Plynulá rotace. <br />- Nahrazuje vrták se závitem. <br /><br />Upínací pouzdra nabízejí moderní způsob výměny kolíkovacích vrtáků v kolíkovacích a vyvrtávacích strojích. Tvoří přechod mezi strojem a kolíkovacími vrtáky. Pro správnou volbu upínacího pouzdra je důležitá dosedací plocha, volba závitu nebo průměru pouzdra. <br /><br />Válcová dosedací plocha D11x4mm. <br />Použití na strojích typu: Biesse (starší model), Masterwood (Zangheri &amp; Boschetti), Morbidelli, Torwegge, Vitap (nový design), Weeke.</p>\\r\\n<p>- RH - pravotočivé provedené - bez drážky po obvodu</p>\\r\\n<p>- LH - levotočivé provedení - drážka po obvodu</p>', '_vyr_150303DX_BRIANI.jpg', 0, '237.90', '264.33', '3031000008', '_vyrn_150303DX_BRIANI.jpg', '_vyrp11_150303SX_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-372-396-0|2-372-0-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
