(7774, 162, '2r Drážkovací žiletková fréza – D16×30 L75 S8 Z2 HW', '2r Drážkovací žiletková fréza – D16×30 L75 S8 Z2 HW', '<ul>\\n<li>Masivní konstrukce</li>\\n<li>Přesné ustavení žiletky v lůžku</li>\\n</ul>\\n<p>Speciální geometrie ostří pro opracování širokého spektra materiálů. Konstrukce frézy nabízí hloubku frézování až 50 mm. Celou hloubku doporučujeme frézovat na více průchodů materiálem. Výborné využití při frézování, formátování a drážkování pomocí horní frézky a šablon. Lze použít pro ruční frézování nebo na CNC obráběcích centrech.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Drážkování, ořezávání</li>\\n<li>Ruční frézování, CNC</li>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW žiletky</li>\\n</ul>', '_vyr_162GZ-2r.png', 0, '2160.00', '2400.00', 'GZ2551', '_vyrn_162GZ-2r.png', '_vyrp11_162GZ-2r-1.png', '_vyrp12_162GZ-2r-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:03'),
