(7780, 168, 'IGM Univerzální frézovací hlava MAN - D100x40-50 d30 OCEL', 'Univerzální frézovací hlava MAN - D100x40-50 d30 OCEL', '<p>Tělo nástroje je vyrobeno z kvalitní oceli nebo z tvrzené hliníkové slitiny (ALU) s vysokou pevností. Fréza je vybavena upínacím systémem pro profilové nože a omezovače, které umožňují bezpečný ruční posuv (MAN) materiálu do řezu. Euro upínací systém zajišťuje perfektní a přesné upnutí nožů 40x4mm a 50x4mm kód F026 a omezovačů F027. Upínací průměr d=30mm. <br /><br /><strong>Parametry: </strong><br />Otáčky pro D100mm 5800–8400 ot./min., pro D120mm 5100–7400 ot./min., ruční posuv materiálu MAN. <br /><br /><strong>Nože a omezovače nejsou součástí dodávky a objednávají se zvlášť!</strong></p>', '_vyr_168pictureprovider.jpg', 0, '1078.00', '1198.00', 'F020-10030', '_vyrn_168pictureprovider.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-3-291-0|2-3-0-0|2-3-291-359|13-0-0-0|13-608-0-0', NULL, '2021-01-10 15:44:03'),
(7781, 169, 'IGM FK650 Šablona pro spoj kuchyňských desek 650mm', 'IGM FK650 Šablona pro spoj kuchyňských desek 650mm', '<p><strong>FK650 je určena pro frézování spojů kuchyňských pracovních desek všemi typy horních frézek. Systém důmyslného a jasného značení jednotlivých operací kompletně zjednodušuje a zrychluje práci se šablonou.<br /><br />• Tvrzený a odolný materiál, který se manipulací nepoškrábe a nepraskne tak, jako šablony z plexiskla, průhledných plastů nebo MDF.<br />• Pro spoje 90° a 45°, včetně šablon pro svěrky a zaoblení rohů.<br />• Extra doraz pro šířku desek 600 mm umožňuje okamžité použití šablony bez zaměření.<br />• Dodáváno s jasným a přehledným návodem k použití.</strong><br /><br /><strong>Nástroje pro práci se šablonou:</strong><br />• <strong>Horní frézku</strong>, doporučujeme raději o výkonu 1600W a více. S lehkou a málo výkonnou frézkou budete mít problém s dodržením přesnosti a kvality spoje. Doporučené frézky zde.<br />• <strong>Kopírovací kroužek D 30 mm</strong>, měl by být součástí každé horní frézky, pokud jej nemáte, doporučujeme naši redukční desku FRB170.<br />• <str', '_vyr_169FK650.jpg', 0, '2687.00', '2985.00', 'FK650', '_vyrn_169FK650.jpg', '_vyrp11_169fk6501.jpg', '_vyrp12_169fk6502.jpg', '_vyrp13_169fk6503.jpg', 21, 1, 2, 0, '', 0, '4-107-385-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:03'),
(7782, 170, 'IGM Šablona na pracovní desky + Fréza žiletková ', 'Šablona na pracovní desky + Fréza žiletková ', '<p><strong>Šablona FK650 + žiletková fréza průměr 12mm HW</strong></p>\\n<p>- Šablona pro spojování prac. desek do hloubky 650mm<br />- Volitelná varianta s profi žiletkovou frézou 12 HW<br />- Snadné použití a využití i na kuchyních IKEA</p>\\n<p>FK650 je určena pro frézování spojů kuchyňských pracovních desek všemi typy horních frézek. Systém důmyslného a jasného značení jednotlivých operací kompletně zjednodušuje a zrychluje práci se šablonou.<br /><br />• Tvrzený a odolný materiál, který se manipulací nepoškrábe a nepraskne tak, jako šablony z plexiskla, průhledných plastů nebo MDF.<br />• Pro spoje 90° a 45°, včetně šablon pro svěrky a zaoblení rohů.<br />• Extra doraz pro šířku desek 600 mm umožňuje okamžité použití šablony bez zaměření.<br />• Dodáváno s jasným a přehledným návodem k použití.<br /><br />Nástroje pro práci se šablonou:<br />• Horní frézku, doporučujeme raději o výkonu 1600W a více. S lehkou a málo výkonnou frézkou budete mít problém s dodržením přesnosti a kvality ', '_vyr_170FK650-nastroj.jpg', 0, '4250.00', '4722.00', 'FK650-set', '_vyrn_170FK650-nastroj.jpg', '101456_170__vyrp11_169fk6501.jpg', '101456_170__vyrp12_169fk6502.jpg', '101456_170__vyrp13_169fk6503.jpg', 21, 1, 2, 0, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:03'),
(7783, 171, '357 Vrták kolíkovací neprůchozí POWER – D=5×27 S=10×27 L=57,5  HW,  RH', '357 Vrták kolíkovací neprůchozí POWER – D=5×27 S=10×27 L=57,5  HW,  RH', '<ul>\\n<li>Tělo vrtáku z vysoce kvalitní tvrzené oceli.</li>\\n<li>HW hlava s přesně vycentrovaným středicím hrotem.</li>\\n<li>HW zub s předřezy a vodícím hrotem v radiálním podbroušením.</li>\\n<li>2 spiralové drážky.</li>\\n<li>Válcová upínací stopka s unášecí plochou a šroubem pro nastavení délky.</li>\\n<li>Přesně broušená stopka pro přesné upnutí ve stroji.</li>\\n<li>RH = pravotočivé provedení, označeno černou barvou vrtáku</li>\\n<li>LH = levotočivé provedení, označeno červenou barvouvrtáku</li>\\n<li>HW = tvrdokovová špička nástroje</li>\\n<li>Vrtáky POWER = výkonnostní řada vrtáků s lepší čistotou opracování</li>\\n</ul>\\n<p> </p>\\n<p><u>Použití:</u></p>\\n<ul>\\n<li>Na vrtacích strojích a kolíkovačkách pro vrtání neprůchozích otvorů do DTD, MDF, lamina, HPL a plastů.</li>\\n<li>Mělčí otvory do masivního dřeva.</li>\\n</ul>', '_vyr_171357DX_BRIANI.jpg', 0, '440.00', '489.00', '3570502729', '_vyrn_171357DX_BRIANI.jpg', '_vyrp11_171357SX_BRIANI.jpg', '', '', 21, 1, 1, 0, '', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:03'),
