(7799, 187, '323 Sukovník šroubovací výměnný – D=20 S=M12×1 L=30 HW, RH', '323 Sukovník šroubovací výměnný – D=20 S=M12×1 L=30 HW, RH', '<ul>\\n<li>Šroubovací verze sukovníku Briani nabízí vnitřní závitové upnutí M12x1.</li>\\n<li>Po našroubování unašecí stopky a upnutí do stroje může být neustále upnut ve vrtačce ve stejné pozici bez změny hloubky vrtání.</li>\\n<li>Našroubováný sukovník dosedne přesně do stejné pozice jako vyměněný kus a proto nemusíte znovu nastavovat hloubku na stroji.</li>\\n<li>Má 2 předřezávací hroty, centrovací hrot a 2 řezné zuby.</li>\\n<li>Všechny hroty jsou z tvrdokovu určeného pro vrtání do měkkého a tvrdého dřeva, lamina, DTD a HPL.</li>\\n</ul>\\n<p> </p>\\n<p><u>Použití:</u></p>\\n<ul>\\n<li>Pro stacionární vrtačky a ruční frézky.</li>\\n<li>Pro unašecí stopku 321 a 322.</li>\\n</ul>', '_vyr_187B-323.png', 0, '695.00', '772.00', '3232000028', '_vyrn_187B-323.png', '_vyrp11_187B-323-1.png', '_vyrp12_187B-323-2.png', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7800, 188, '324 Sukovník ruční – D=8 S=10×60 L=90 HW, RH', '324 Sukovník ruční – D=8 S=10×60 L=90 HW, RH', '<ul>\\n<li>Sukovník má 2 předřezávací hroty, centrovací hrot a 2 řezné zuby.</li>\\n<li>Hrot z tvrdokovu určeného pro vrtání do měkkého a tvrdého dřeva, lamina, DTD a HPL.</li>\\n<li>Kvalitní a přesný nástroj.</li>\\n<li><strong>Průměr 8 - 14mm je dodáván jako vrták s HW špičkou.</strong></li>\\n</ul>\\n<p> </p>\\n<p><u>Použití:</u></p>\\n<ul>\\n<li>Nejpoužívanější sukovník.</li>\\n<li>Ideální sukovník pro vrtání do lamino desek a kuchyňských dvířek.</li>\\n<li>Pro ruční i stacionární vrtačky.</li>\\n</ul>', '_vyr_188B-324.png', 0, '625.00', '694.00', '3240800028', '_vyrn_188B-324.png', '_vyrp11_188B-324-1.png', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7801, 189, '329 Vrták neprůchozí pro ruční vrtání – D=5×60 S=5 L=90 HW, RH', '329 Vrták neprůchozí pro ruční vrtání – D=5×60 S=5 L=90 HW, RH', '<ul>\\n<li>Ruční tvrdokovový vrták pro ruční vrtání do tvrdého a měkkého dřeva, lamina , dřevotřísky.</li>\\n<li>Dlouhá životnost ostří.</li>\\n</ul>\\n<p> </p>\\n<p><u>Použití:</u></p>\\n<ul>\\n<li>Extra dlouhé vrtání otvorů až 200mm.</li>\\n</ul>', '_vyr_189B-329.png', 0, '708.00', '787.00', '3290500028', '_vyrn_189B-329.png', '_vyrp11_189B-329-1.png', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-35-0|2-5-35-367|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7802, 190, '7080 Fréza na V drážku pro Alucobond – a=90° d=3 D=20 T=8,8 S=8x35 HW', '7080 Fréza na V drážku pro Alucobond – a=90° d=3 D=20 T=8,8 S=8x35 HW', '<p>Kompozitní panely ALUCOBOND® plus lze formovat velice snadno pomocí V-drážkovací frzy Briani. Technika nazvaná „frézování a skládání“ umožňuje výrobcům vytvářet tvary různé geometrie a velikosti. Horní frézkou vyfrézujte V-drážku jejíž dno se dotýká vnějšího obalu. Nedotčená vnější deska může být nyní ručně ohnuta s čistou linií kopírující vyfrézovanou drážku. Vnější rádius ohnuté desky závisí na tvaru drážky a její hloubce. Drážku je možné frézovat jak CNC tak i horní frézkou. Metodu „frézování a skládání“ je možné použít na všechny dostupné povrchové úpravy kompozitních panelů ALUCOBOND® plus.</p>', '_vyr_1907080.png', 0, '1419.00', '1577.00', '70800900800', '_vyrn_1907080.png', '_vyrp11_1907080-1.png', '_vyrp12_1907080-2.png', '_vyrp13_1907080-3.png', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-15-0|2-1-15-328|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:04'),
(7803, 191, '570 Zaoblovací fréza žiletková oboustranná, sada – D=41 T=15 S=12×40 L=90 H=40', '570 Zaoblovací fréza žiletková oboustranná, sada – D=41 T=15 S=12×40 L=90 H=40', '<p>Rádiusová fréza s dvěma tvdokovovými břity s rádiusovým profilem. Ideální pro zaoblování hran tvrdého dřeva a DTD, LTD nebo MDF desek s nalepenou ABS hranou. Pro tlouštku desky maximálně 50mm. Výška fazety při použití 45° HW žiletky 6mm. Upínací stopka S=12 nebo 16mm pro spolehlivé upnutí v CNC. Dodáváno jako sada s žiletkami R2, R3, R4, R5 a úhel 45°.</p>', '_vyr_191570_BRIANI.jpg', 0, '6327.00', '7030.00', '57000101200', '_vyrn_191570_BRIANI.jpg', '_vyrp11_191570_WORKING.jpg', '_vyrp12_191570_WORKING_A.jpg', '_vyrp13_191570_WORKING_B.jpg', 21, 1, 1, 0, '', 0, '2-7-0-0|2-7-43-0', NULL, '2021-01-10 15:44:04'),
(7804, 192, '571 Popisovací fréza žiletková, sada – D=17 T=8,3 S=8×30  ', '571 Popisovací fréza žiletková, sada – D=17 T=8,3 S=8×30  ', '<ul>\\n<li>Fréza pro gravírování a frézování V drážek.</li>\\n<li>Určeno pro CNC obrábění dřeva, lamina a HPL.</li>\\n<li>Masivní tělo nástroje s přesným vyvážením.</li>\\n</ul>\\n<p> </p>\\n<p>Fréza s výměnnými žiletkami s jedním břitem, určeným k V drážkování tvrdého dřeva a DTD, LTD nebo MDF desek. Stopka 20mm pro dobré upnutí na CNC strojích při vysokých otáčkách.</p>\\n<p> </p>\\n<p>SPECIFIKACE:</p>\\n<ul>\\n<li>Popisovací, úhlová</li>\\n<li>CNC</li>\\n<li>MEC, MAN</li>\\n<li>Z1</li>\\n<li>HW žiletky. Dodáváno jako sada s žiletkami 92°, 60°, R3, R4, R5.</li>\\n</ul>', '_vyr_192571_BRIANI.jpg', 0, '4349.00', '4832.00', '57100000800', '_vyrn_192571_BRIANI.jpg', '_vyrp11_192571_BRIANI_TECH.jpg', '_vyrp12_192571_SPARE_PARTS.jpg', '_vyrp13_192571_WORKING.jpg', 21, 1, 1, 0, '', 0, '2-7-0-0|2-7-43-0', NULL, '2021-01-10 15:44:04'),
