(7816, 204, 'ODSAVAČ PILIN ZIPPER ZI ASA550, HADICE A ROZDVOJKA ZD', 'ODSAVAČ PILIN ZIPPER ZI ASA550, HADICE A ROZDVOJKA ZD', '<h1 id=\\\"h1-fig\\\">Odsavač prachu a pilin ZIPER</h1>\\n<p><strong>Odsavač prachu</strong> a pilin <strong>ZIPER</strong> je spolehlivé zařízení, které <strong>odsává piliny</strong> a podobný dřevní odpad od menších dřevoobráběcích strojů. Výhodou tohoto přístroje je, že <strong>nedochází ke zbytečnému odvětrávání tepla</strong>. Stojan odsavače je opatřen <strong>velkými kolečky</strong> a zajištuje tak mobilitu zařízení. Oproti podobným odsavačům pilin má tento <strong>spodní část vyrobenou z trubkového rámu</strong>, která se nekroutí a na rámu má velká pojezdová kola.</p>\\n<p>Přístroj má silný motor s <strong>výkonem 550 W</strong> s 2850 otáčkami za minutu. Odpadní vak má objem <strong>65 litrů</strong>. Celý stroj váží 26 kilogramů a rozměry balení jsou <strong>900 × 540 × 390 mm</strong>.</p>\\n<p>Odsavač je vhodný pro většinu menších strojů, jako <strong>hoblovky s protahem typu KDR301, KDR302</strong>, <strong>Holzmann HOB260</strong>, <strong>kotoučovým pilám KDR101</strong>, <s', '_vyr_181_vyr_872ASA50.jpg', 0, '2907.50', '3135.00', '02a', '_vyrn_181_vyr_872ASA50.jpg', '', '', '', 21, 1, 1, 0, '9,12E+12', 0, '3-62-398-0|3-62-0-0', NULL, '2021-01-10 15:44:04'),
(7817, 205, 'AKUMULÁTOROVÝ ŠROUBOVÁK VRTAČKA S PŘÍKLEPEM HOLZMANN AKS 45IND', 'AKUMULÁTOROVÝ ŠROUBOVÁK VRTAČKA S PŘÍKLEPEM HOLZMANN AKS 45IND', '<h3 style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">AKUMULÁTOROVÝ ŠROUBOVÁK VRTAČKA S PŘÍKLEPEM HOLZMANN AKS45IND</span></h3>\\n<p><span style=\\\"font-size: 14pt;\\\">Firma Holzmann Vám nabízí AKU šroubovák s příklepem. Tento stroj má bezkartáčový motor, díky kterému vydrží až 10x déle, než běžné motory a udržuje se o 60 % vyšší výkon. Nástroj upnete rychloupínacím sklíčidlem a můžete začít pracovat. Tento šroubovák usnadňuje práci se dřevem, ocelí i betonem a to díky vrtacímu výkonu 22 mm (dřevo), 8 mm (ocel), 8 mm (beton). Na práci Vám svítí LED dioda. Součástí balení jsou dvě baterie, nabíječka a vše je dodáno v plastovém přepravním kufříku.</span></p>', '_vyr_182_vyr_3502003_aks45ind.jpg', 0, '2549.70', '0.00', 'HMAKS45IND', '_vyrn_182_vyr_3502003_aks45ind.jpg', '', '', '', 21, 1, 1, 4, '9,12E+12', 0, '3-59-0-0', NULL, '2021-01-10 15:44:04'),
(7818, 206, 'LAMELOVACÍ FRÉZKA HOLZMANN PJ 100PRO', 'LAMELOVACÍ FRÉZKA HOLZMANN PJ 100PRO', '<h2 style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">LAMELOVACÍ FRÉZKA HOLZMANN PJ100PRO</span></h2>\\n<p><span style=\\\"font-size: 14pt;\\\"><img style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" src=\\\"https://www.dobrestroje.cz/fotky5238/HOLZMANN2/pj100pro.jpg\\\" alt=\\\" width=\\\" height=\\\"602\\\" /></span></p>\\n<div style=\\\"text-align: justify;\\\">\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">Ilustrativní foto: Holzmann PJ100PRO</span></p>\\n<table style=\\\"width: 100 %; border: 2px solid #000000; background-color: #ff0000;\\\" border=\\\"2\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" align=\\\"center\\\">\\n<tbody>\\n<tr>\\n<td valign=\\\"top\\\" width=\\\"670\\\">\\n<p><span style=\\\"font-size: 14pt;\\\"><strong>1. Popis:</strong></span></p>\\n</td>\\n</tr>\\n</tbody>\\n</table>\\n<div>\\n<ul>\\n<li><span style=\\\"font-size: 14pt;\\\">Přesné řezné zařízení</span></li>\\n<li><span style=\\\"font-size: 14pt;\\\">Moderní design</span></li>\\n<li><span style=\\\"font-size: 14pt;\\\">Max. hloubka', '_vyr_183_vyr_4101pj100pro.jpg', 0, '1956.10', '0.00', 'HMPJ100PRO', '_vyrn_183_vyr_4101pj100pro.jpg', '_vyrp11_183_vyrp11_4101PJ100PROa.jpg', '', '', 21, 1, 1, 4, '9,12E+12', 0, '3-60-0-0|3-60-416-0', NULL, '2021-01-10 15:44:04'),
(7819, 207, 'LAMELOVACÍ FRÉZKA HOLZMANN PJ 100A', 'LAMELOVACÍ FRÉZKA HOLZMANN PJ 100A', '<h3>LAMELOVACÍ FRÉZKA HOLZMANN PJ100A</h3>\\n<p>Představujeme Vám lamelovací frézku z produkce firmy Holzmann. Frézka je zvláště konstruovaná pro snadné a bezpečné drážkování desek, avšak není vhodné ji používat pro zásmolky! Může provádět jakýkoliv typ spojení rychle a přesně díky přední příložce, která může být nastavena ve výšce a úhlu bez použití nástrojů. Stroj přichází vybaven kanálem a vakem pro sběr prachu. Součástí frézky je tvrdokovová fréza s maximální hloubkou frézování 19 mm. Její plně vybavený transportní kufřík ji předurčuje pro práci mimo dílnu. </p>\\n<p></p>\\n<div></div>\\n<p></p>', '_vyr_184_vyrp11_4101PJ100PROa.jpg', 0, '1560.90', '0.00', 'HMPJ100A', '_vyrn_184_vyrp11_4101PJ100PROa.jpg', '_vyrp11_184_vyrp11_4101PJ100PROa.jpg', '_vyrp12_184_vyrp12_1305fraese_pj100b.jpg', '_vyrp13_184_vyrp13_1305fraese_pj100e.jpg', 21, 1, 1, 4, '9,12E+12', 0, '3-60-0-0|3-60-416-0', NULL, '2021-01-10 15:44:04'),
