(7825, 215, 'KOTOUČOVÁ STOLNÍ PILA HOLZMANN TS 200', 'KOTOUČOVÁ STOLNÍ PILA HOLZMANN TS 200', '<h1 id=\\\"h1-fig\\\">Kotoučová stolní pila HOLZMANN TS200</h1>\\n<p><strong>Kotoučová stolní pila</strong> od výrobce precizních strojů <strong>Holzmann Maschinen</strong> je<strong> základním modelem kotoučové pily</strong>. Její výhodou je <strong>výborný poměr cena/výkon</strong>. Přístroj má velmi<strong> robustní a pevný stůl</strong>, který je vyrobený <strong>z litiny</strong> a zaručuje stabilitu celé pily. Samozřejmě nechybí ani <strong>prodloužení stolu</strong>. S přístrojem se <strong>lehce manpuluje</strong> a pracuje, je velmi jednoduše nastavitelný. <strong>Pilový agregát je naklopitelný až na 45 stupňů</strong>. Součástí je také <strong>podélné pravítko</strong> s doladěním a <strong>příčné pravítko</strong> s dorazem. </p>\\n<h2 id=\\\"h2-fig\\\">Standardní výbava:</h2>\\n<ul>\\n<li>Tvrdý kovový kotouč 200 mm</li>\\n<li>Podélné pravítko</li>\\n<li>Příčné pravítko</li>\\n<li>Ochranný kryt</li>\\n<li>Podstavec</li>\\n</ul>\\n<h2 id=\\\"h2-fig\\\">Příslušenství:</h2>\\n<ul>\\n<li>Odsavač pilin<', '_vyr_192_vyr_1337TS200.jpg', 0, '16791.80', '0.00', '2HLMTS200', '_vyrn_192_vyr_1337TS200.jpg', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-62-0-0', NULL, '2021-01-10 15:44:04'),
(7826, 216, 'KOTOUČOVÁ STOLNÍ PILA HOLZMANN TS 250 - 400V', 'KOTOUČOVÁ STOLNÍ PILA HOLZMANN TS 250 - 400V', '<h1 id=\\\"h1-fig\\\">Kotoučová stolní pila HOLZMANN TS 250 400 V</h1>\\n<p><strong>Kotoučová stolní pila HOLZMANN TS 250</strong> má oproti modelu kotoučové pily HOLZMANN TS 200 s až 250 mm nástrojem výrazně <strong>masivnější konstrukci a možnost motoru i na napětí 400 V</strong>. Tento přístroj se perfektně hodí do jakékoli dílny. <strong>Litinový stůl</strong> tohoto stroje je velmi robustní a stabilní. Nesmí chybět také ani <strong>prodloužení stolu</strong>. Pila má tu výhodu, že je velice <strong>jednoduše nastavitelná</strong> a lehce se s ní manipuluje.<strong> Pilový agregát je naklopitelný až na 45 stupňů</strong>. Součástí je samozřejmě <strong>podélné pravítku s doladěním</strong> a <strong>příčné pravítko s dorazem</strong> pro přesnější práci.</p>\\n<p>Zde můžete zhlédnout podrobný a snadno pochopitelný <strong>návod</strong> k sestavení této pily ve vaší dílně. Pro více informací můžete navštívit naše stránky <a href=\\\"https://aparatea.cz/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"', '_vyr_1935238_1742__vyr_1418TS250.jpg', 0, '21569.00', '0.00', '2HLMTS250400', '_vyrn_1935238_1742__vyr_1418TS250.jpg', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-62-0-0', NULL, '2021-01-10 15:44:04'),
(7827, 217, 'Swanson - úhelník Speed Square 7\\\" (17,7mm) pouze palcová stupnice', 'Swanson - úhelník Speed Square 7\\\" (17,7mm) pouze palcová stupnice', '<p>Pouze v palcová verze. použítí jako příložník,úhelník,rýsování a opora při řezání. Velká výhoda je v jeho velikosti kdy se vejde do kapsáře či za opasek.</p>\\n<p>Ideální úhelním pro dřevostavby emerického provedení.</p>', '_vyr_19418408_s0101.jpg', 0, '446.00', '0.00', 'S0101', '_vyrn_19418408_s0101.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2021-01-10 15:44:04'),
(7828, 218, 'Swanson - vodováha tropedo magnetická podsvícená 22cm', 'Swanson - vodováha tropedo magnetická podsvícená 22cm', '<p>Vodováha z jednoho kusu eloxovaného hlíníku je jedné strany osazena čtyřmi silnými magnety a na straně druhé opatřena žlábkem pro měření na trubkách.</p>\\n<p>Plochy jsou pro větší přesnost frézovány. Je opatřena průhledy na libely i z hrany vodováhy. Stupnice v mm/inch v rozsahu 0-18cm(0-7inch)</p>\\n<p>Třil libely pro přesné měření 0°/90°/45° s přesností lahvičky libely 0,29°.</p>\\n<p>Podsvícení automaticky zhasne po 3 min. a je napájeno 2xAAA články</p>', '_vyr_19517190_tll049m-300.jpg', 0, '812.00', '0.00', 'TLL049M', '_vyrn_19517190_tll049m-300.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2021-01-10 15:44:04'),
(7829, 219, 'Swanson - protiskluzové pravítko s přesným měřítkem', 'Swanson - protiskluzové pravítko s přesným měřítkem', '<p>Swanson -Savage je jednoduché profilové pravítko s přesnou stupnicí pro rýsování,měření a hlavně řezání nožem. Protiskluzová podložka zabrání posunu po materiálu a tvar profilu zabrání sklouznutí nože a případnému pořezání.</p>', '_vyr_19618411_swanson-savage-straight-edge-sve360-product-shot.jpg', 0, '640.00', '0.00', 'SVE121', '_vyrn_19618411_swanson-savage-straight-edge-sve360-product-shot.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0', NULL, '2021-01-10 15:44:04'),
(7830, 220, 'Swanson - sloupková magnetická vodováha', 'Swanson - sloupková magnetická vodováha', '<ul>\\r\\n<li>\\r\\n<p> Magnetické pásky nebo stahovací guma pro upevnění na sloupek</p>\\r\\n</li>\\r\\n<li>\\r\\n<p>Zhotovený z  houževnatého kompozitního materiálu</p>\\r\\n</li>\\r\\n<li>\\r\\n<p>Tou nejlepší volbou pro kovové kolíky</p>\\r\\n</li>\\r\\n<li><span style=\\\"font-size: 10pt;\\\">Sloupky , zábradlí ,kolíky nebo tyčky k rajčatům vše bude snadno rovné nebo kolmé</span></li>\\r\\n</ul>', '_vyr_1978519_swnason-sloupkova-magneticka-vodovaha.jpg', 0, '155.00', '0.00', 'PL001M', '_vyrn_1978519_swnason-sloupkova-magneticka-vodovaha.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2021-01-10 15:44:04'),
(7831, 221, 'C306 Vrták kolíkovací neprůchozí S8 L55,5 HW - D3x18 S=8x20 L55,5 P', 'C 306 Vrták kolíkovací neprůchozí S8 L55,5 HW - D3x18 S=8x20 L55,5 P', '<p><strong>• Tělo vrtáku z vysoce kvalitní tvrzené oceli. <br />• HM hlava s přesně vycentrovaným středicím hrotem. <br />• 2 precizně broušené HM břity (Z2). <br />• 2 HM zuby s předřezy a radiálním podbroušením (V2). <br />• 4 spiralové drážky. <br />• Válcová upínací stopka s unášecí plochou a šroubem pro nastavení délky. <br />• Baleno v plastové krabičce po 1 kuse. <br />• Ekonomické balení po 5 kusech. <br />• Vrtací hlava pro vrtání čistých neprůchozích otvorů s plochým dnem. <br />• Přesně broušená stopka pro přesné upnutí ve stroji. <br />• Teflonový povrch pro lepší odvod třísek. </strong><br /><br />Použití: na vrtacích strojích a kolíkovačkách pro vrtání neprůchozích otvorů do DTD, MDF, lamina a plastů.</p>', '_vyr_221C30603021.jpeg', 0, '315.00', '350.00', '306.030.21', '_vyrn_221C30603021.jpeg', '_vyrp11_221C30603021-1.jpeg', '', '', 21, 1, 1, 0, '6,64E+11', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
