(7844, 234, 'Gz Ořezávací fréza se středovým ložiskem - D26x25 S=8 HW', 'Gz Ořezávací fréza se středovým ložiskem - D26x25 S=8 HW', '<p>Fréza je určena pro přesné ofrézování přesahů a nákližků na materiálu podle středového materiálu. Výhodou tohoto typu ořezávací frézy je možnost zvolit jakou částí nástroje potřebujete využívat. Možné využít jako nástroj k ořezávání se spodním, horním nebo středovým ložiskem.</p>\\n<p>Vyuřití na materiál od 11mm do 26mm</p>\\n<div style=\\\"caret-color: #000000; color: #000000; font-family: Helvetica; font-size: 12px; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none;\\\"><span style=\\\"font-size: 14px;\\\">Sestavená ořezávací frézy se středovým ložiskem, praktický příklad modulární frézy.</span></div>\\n<div style=\\\"caret-color: #000000; color: #000000; font-family: Helvetica; font-size: 12px; font-style: normal; font-variant-caps: normal; ', '_vyr_234F-doppio-refilo-web.jpg', 0, '1462.00', '1625.00', 'GZ819', '_vyrn_234F-doppio-refilo-web.jpg', '_vyrp11_234819-1.png', '_vyrp12_234819-2.png', '', 21, 1, 1, 1, '', 0, '2-1-12-390|2-1-0-0|2-1-12-0|14-0-0-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:04'),
