(7846, 236, 'Gz Talířová drážkovací fréza - D65x3 F10 Z3 HW', 'Gz Talířová drážkovací fréza - D65x3 F10 Z3 HW', '<p>Talířová fréza drážkovací.</p>\\n<p>Drážkovací talířky se nabázejí v šíři 3 - 8 mm a jsou určeny pro unašeč s upínacím průměrem pro talířek 10mm.</p>', '_vyr_236Fresa-disco-65-web.jpg', 0, '675.00', '750.00', 'GZ2804', '_vyrn_236Fresa-disco-65-web.jpg', '_vyrp11_2362804-1.png', '', '', 21, 1, 1, 0, '', 0, '2-1-0-0|2-1-11-0|2-1-11-315|14-0-0-0|14-610-0-0|14-610-624-0', NULL, '2021-01-10 15:44:04'),
(7847, 237, 'Gz Talířová drážkovací fréza - D40x1,5 F6 Z2 HW', 'Gz Talířová drážkovací fréza - D40x1,5 F6 Z2 HW', '<p>Talířová fréza drážkovací.</p>\\n<p>Drážkovací talířky se nabázejí v šíři 1,5 - 6 mm a jsou určeny pro unašeč s upínacím průměrem pro talířek 6mm.</p>', '_vyr_237Fresa-disco-web.jpg', 0, '562.00', '625.00', 'GZ752', '_vyrn_237Fresa-disco-web.jpg', '_vyrp11_237GZ-752-1.png', '_vyrp12_237GZ-752-2.png', '', 21, 1, 2, 0, '', 0, '2-1-0-0|2-1-11-0|2-1-11-315|14-0-0-0|14-610-0-0|14-610-624-0', NULL, '2021-01-10 15:44:04'),
(7848, 239, 'Gz Trn talířové frézy, upnutí matkou bez ložiska - d10mm, Lu12mm, S=8', 'Gz Trn talířové frézy, upnutí matkou bez ložiska - d10mm, Lu12mm, S=8', '<p>Unašecí stopka s upínacím trnem pro talířové frézy s upínaícm průměrem 6mm.</p>\\n<p>Upínání pomocí matice. Upínací stopka 8mm.</p>', '_vyr_239GZ-3066.png', 0, '450.00', '500.00', 'GZ3066', '_vyrn_239GZ-3066.png', '_vyrp11_239GZ-3066-1.png', '', '', 21, 1, 1, 0, '', 0, '2-1-11-315|2-1-0-0|2-1-11-0|14-0-0-0|14-610-0-0|14-610-624-0', NULL, '2021-01-10 15:44:04'),
