(7851, 255, 'C311 Xtreme Flat Vrták kolíkovací neprůchozí S10 L70 HWM - D5x30 S=10x30 L70 P', 'C311 Xtreme Flat Vrták kolíkovací neprůchozí S10 L70 HWM - D5x30 S=10x30 L70 P', '<p><strong>• Nadprůměrně kvalitní ocel pro vysokou odolnost a dlouhou životnost<br />• Spirálová část z tvrdokovu HWM špičkové kvality<br />• 2 břity (Z2) + 2 zuby s předřezy a radiálním podbroušením (V2)<br />• 2 spiralové drážky<br />• Válcová upínací stopka s unašecí plochou a šroubem pro nastavení délky<br />• Doporučená rychlost 1-4 m/min. - 6000 ot./min</strong><br /><br />Použití:<br />Ideální na dřevotřísku, MDF, HDF a lamináty. Vhodné pro průchozí otvory na tenkých deskách - s možností výších otáček a posuvových rychlostí. Použití v upínacích pouzdrech na kolíkovacích strojích.</p>', '_vyr_255C31105071.jpeg', 0, '482.40', '536.00', '311.050.71', '_vyrn_255C31105071.jpeg', '_vyrp11_255C31105071-1.jpeg', '', '', 21, 1, 5, 0, '6,64E+11', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7852, 257, '310 Xtreme Vrták kolíkovací neprůchozí S10 L57,5 HWM - D1,3x5 S=10x30 L57,5 P-L', '310 Xtreme Vrták kolíkovací neprůchozí S10 L57,5 HWM - D1,3x5 S=10x30 L57,5 P-L', '<p><strong>• Tělo vrtáku z vysoce kvalitní tvrzené oceli. <br />• HM hlava s přesně vycentrovaným středicím hrotem. <br />• 2 precizně broušené HM břity (Z2). <br />• 2 HM zuby s předřezy a radiálním podbroušením (V2). <br />• 2 spiralové drážky. <br />• Válcová upínací stopka s unášecí plochou a šroubem pro nastavení délky. <br />• Baleno v plastové krabičce po 1 kuse. <br />• Ekonomické balení po 5 kusech. <br />• Vrtací hlava pro vrtání čistých neprůchozích otvorů s plochým dnem. <br />• Přesně broušená stopka pro přesné upnutí ve stroji. <br />• Průmyslová kvalita jemnozrného tvrdokovu na tvrdé materiály. <br />• Radiusové podbroušení pro vysokou produktivitu. <br /><br />Celotvrdokovové tělo vsazené do stopky. </strong><br />Použití: na vrtacích strojích, CNC strojích a kolíkovačkách, pro vrtání neprůchozích otvorů s možností výších otáček a posuvových rychlostí.<br />Masivní dřevo, DTD, MDF, LTD a plasty.</p>', '_vyr_257C31001320.jpeg', 0, '279.00', '310.00', '310.013.20', '_vyrn_257C31001320.jpeg', '_vyrp11_257C31001320-1.jpeg', '', '', 21, 1, 5, 0, '', 0, '2-372-0-0|2-372-391-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
