(7856, 261, 'Rychloupínací pouzdro 360 Maggi, Masterwood, Griggio pro vrták S10, D19,4x40 60° P-L', 'Rychloupínací pouzdro 360 Maggi, Masterwood, Griggio pro vrták S10, D19,4x40 60° P-L', '<p><strong>• Vysoká přesnost. <br />• Vysoce kvalitní tvrzená ocel. <br />• Rychlá výměna vrtáku. <br />• Naprostá spolehlivost. <br />• Dokonalé centrování. <br />• Plynulá rotace. <br />• Nahrazují staré typy vrtáků se závitem. </strong><br /><br />Upínací pouzdra nabízejí moderní způsob výměny kolíkovacích vrtáků v kolíkovacích a vyvrtávacích strojích. Tvoří přechod mezi strojem a kolíkovacími vrtáky. Pro správnou volbu upínacího pouzdra je důležitá dosedací plocha, volba závitu nebo průměru pouzdra. <br /><br />Rychlý systém výměny pouzdra bez použití klíče!</p>', '_vyr_261F360-40000.jpeg', 0, '441.00', '490.00', 'F360-40000', '_vyrn_261F360-40000.jpeg', '_vyrp11_261F360-40000-1.jpeg', '', '', 21, 1, 5, 0, '8,59E+12', 0, '2-0-0-0|2-372-0-0|2-372-396-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
