(7873, 297, 'Cr Ořezávací žiletková fréza – D19×12 L55 S6 HW', ' Cr Ořezávací žiletková fréza – D19×12 L55 S6 HW', '<ul>\\n<li>Masivní konstrukce</li>\\n<li>Přesné ustavení žiletky v lůžku</li>\\n<li>Nejpoužívanější žiletkové provedení ořezávací frézy</li>\\n<li>Možnost dokoupení menšího ložiska</li>\\n</ul>\\n<p>Fréza určena pro přesné lícovací frézování a kopírování podle šablony nebo ofrézované hrany, která je vespod. U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza tento jev eliminuje pomocí přesně ustavených výměnných žiletek, které se navíc dají otáčet a použít až 4 břity. Pro frézování Corianu je možné dokoupit rovné nebo kuželové ložisko s plastovým kroužkem, které zabezpečí přesné vedení po materiálu.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Ložisko spodní</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HW žiletky</li>\\n</ul>', '_vyr_297GZ-Cr.png', 0, '990.00', '1100.00', 'GZ2534', '_vyrn_297GZ-Cr.png', '_vyrp11_297GZ-Cr-1.png', '_vyrp12_297GZ-Cr-2.png', '_vyrp13_297GZ-Cr-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:04'),
(7874, 298, '2Cr Falcovací žiletková fréza – D44×12 L57 S8 HW', ' 2Cr Falcovací žiletková fréza – D44×12 L57 S8 HW', '<ul>\\n<li>Pro falcování i nejobtížnějších dílů podle šablony nebo hrany délce.</li>\\n<li>HW tvrdokovové žiletky</li>\\n<li>Kopírovací ložisko na čele frézy.</li>\\n</ul>\\n<p>Gamma Zinken falcovací fréza je dodávána se základním ložiskem 13mm pro frézování 12,5 mm falcu. K této fréze je možné dokoupit čtyři velikosti ložisek. Při frézování falců větších než 12 mm provádějte vícenásobné sběry pomocí postupného zvětšování hloubky.</p>', '_vyr_298GZ-2Cr.png', 0, '1327.50', '1475.00', 'GZ2763', '_vyrn_298GZ-2Cr.png', '_vyrp11_298GZ-2Cr-1.png', '_vyrp12_298GZ-2Cr-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-17-0|2-1-17-335|14-0-0-0|14-616-0-0', NULL, '2021-01-10 15:44:04'),
(7875, 299, 'CrS Ořezávací žiletková fréza s horním ložiskem – D19×30 L68 S8 HW', ' CrS Ořezávací žiletková fréza s horním ložiskem – D19×30 L68 S8 HW', '<p>Falcovací fréza Gamma Zinken je určena pro přesné frézování a kopírování podle šablony, která je na horní straně materiálu. Tento typ nástroje se dá využít i pro silnější materiály a to pomocí ložiska. U tradiční pájené frézy dochází při ostření ke zmenšení řezného průměru proti ložisku a to způsobuje vznik zubu. Žiletková fréza tento jev eliminuje pomocí přesně ustavených výměnných žiletek, které se navíc dají otáčet a použít až 4 břity ( platí u žiletek 12x12x1,5mm ).</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Kopírování, drážkování, ořezávání</li>\\n<li>Ložisko na stopce</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HW žiletky</li>\\n</ul>', '_vyr_299GZ-CrS.png', 0, '1327.50', '1475.00', 'GZ2431', '_vyrn_299GZ-CrS.png', '_vyrp11_299GZ-CrS-1.png', '_vyrp12_299GZ-CrS-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-316|14-0-0-0|14-611-0-0|14-611-626-0', NULL, '2021-01-10 15:44:04'),
(7876, 300, 'CrD Ořezávací žiletková fréza s horním a spodním ložiskem – D19×12 L55 S6 HW', ' CrD Ořezávací žiletková fréza s horním a spodním ložiskem – D19×12 L55 S6 HW', '<p>Gamma Zinken ořezávací fréza s horním a spodním ložiskem. Dvoustranné žiletky upnuty pevnostními Torx šrouby. Pro přesné lícovací frézování horní frézkou nebo ve frézovacím stolku.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Ložisko horní a spodní</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HZ žiletky</li>\\n</ul>', '_vyr_300GZ-CrD.png', 0, '1237.50', '1375.00', 'GZ2814', '_vyrn_300GZ-CrD.png', '_vyrp11_300GZ-CrD-1.png', '_vyrp12_300GZ-CrD-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-318|14-0-0-0|14-611-0-0|14-611-628-0', NULL, '2021-01-10 15:44:04'),
(7877, 301, '4r Úhlová žiletková fréza – D26×10,8 L47 S6 22°', ' 4r Úhlová žiletková fréza – D26×10,8 L47 S6 22°', '<p>Úhlová fréza Gamma Zinken je určena pro ořezávání a srážení hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian. Fréza je bez ložiska. Určen pro CNC a ruční frézování pomocí pravítka.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>CNC</li>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW žiletky</li>\\n</ul>', '_vyr_301GZ-4r.png', 0, '1237.50', '1375.00', 'GZ2539', '_vyrn_301GZ-4r.png', '_vyrp11_301GZ-4r-1.png', '_vyrp12_301GZ-4r-2.png', '_vyrp13_301GZ-4r-4.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-320|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:04'),
(7878, 302, '6Cr Zaoblovací žiletková fréza vypouklá – D31,5×19,5 L60 S8 R=5', ' 6Cr Zaoblovací žiletková fréza vypouklá – D31,5×19,5 L60 S8 R=5', '<p>Vypouklá fréza Gamma Zinken je určena pro ozdobné srážení hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian.</p>\\n<p>Fréza je osazena spodním ložiskem. Určen pro CNC ( po odšroubování ložiska ) a ruční frézování pomocí ložiska.</p>\\n<p><strong>Specifikace:&lt;/strong</strong></p>\\n<ul>\\n<li>CNC</li>\\n<li>MAN MEC</li>\\n<li>Z2</li>\\n<li>HW žiletky</li>\\n</ul>', '_vyr_302GZ-6Cr.png', 0, '1755.00', '1950.00', 'GZ2768', '_vyrn_302GZ-6Cr.png', '_vyrp11_302GZ-6Cr-1.png', '_vyrp12_302GZ-6Cr-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-324|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:04'),
(7879, 303, 'C2Sr Úhlová žiletková fréza – D26×10,8 L55 S6 22° HW', ' C2Sr Úhlová žiletková fréza – D26×10,8 L55 S6 22° HW', '<p>Úhlová fréza Gamma Zinken je určena pro ořezávání, srážení a drážkování hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian.</p>\\n<p>Fréza je vybavena kopírovacím ložiskem, které je zajištěno šroubkem. Nástroj umožňuje frézovat V drážku do hrany materiálu. Určen pro ruční frézování.</p>\\n<p><strong>Specifikace:&lt;/strong</strong></p>\\n<ul>\\n<li>Ložisko</li>\\n<li>MAN</li>\\n<li>Z2</li>\\n<li>HW žiletky</li>\\n</ul>', '_vyr_303GZ-C2Sr.png', 0, '1237.50', '1375.00', 'GZ2545', '_vyrn_303GZ-C2Sr.png', '_vyrp11_303GZ-C2Sr-1.png', '_vyrp12_303GZ-C2Sr-2.png', '_vyrp13_303GZ-C2Sr-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-321|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:04'),
(7880, 304, 'Prr Vrtací fréza žiletková na rozety – D52 L90 ', ' Prr Vrtací fréza žiletková na rozety – D52 L90 ', '<p>Ideální nástroj pro vytváření nádherných ozdobných ornamentů kruhového tvaru (rozet) na vrtačce. Tělo nástroje je vyrobeno z pevné oceli, má 2 precizní tvrdokovové HM břity. Válcová stopka s třemi pravidelnými ploškami, pro pevné upnutí ve vrtačce.</p>\\n<p>Použití: ve stojanové vrtačce s nízkými otáčkami.</p>\\n<p><strong>Specifikace:&lt;/strong</strong></p>\\n<ul>\\n<li>Pravotočivé provedení.</li>\\n<li>Maximální otáčky: 1800 ot/min.</li>\\n</ul>', '_vyr_304GZ-PRr.png', 0, '2137.50', '2375.00', 'GZ2931', '_vyrn_304GZ-PRr.png', '_vyrp11_304GZ-PRr-1.png', '_vyrp12_304GZ-PRr-2.png', '_vyrp13_304GZ-PRr-3.png', 21, 1, 0, 1, '', 0, '2-5-0-0|2-5-424-0|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:04'),
(7881, 305, 'Cgf Ořezávací fréza s upínáním M12 – D19×25 L60 SM12×1 ', ' Cgf Ořezávací fréza s upínáním M12 – D19×25 L60 SM12×1 ', '<p>Ořezávací fréza se závitovým upínáním je ideální pro ořezávání silných materiálů, závěsů na dveřích nebo oknech pomocí šablony nebo hrany. Tato fréza se umístí na unašecí stopku díky závitu M12x1 a díky unašesí stopce je možné nástroj prodloužit na celkovou délku až 132 mm. Díky HW břitům jsou vhodné na masiv, dřevěné kompozity, plasty a lamináty. Může být používána na obrábění v CNC frézách a ručních frézkách. Upínací stopku pro upnutí v kleštině je nutno objednat zvlášť.</p>', '_vyr_305C-gf-web.jpg', 0, '922.50', '1025.00', 'GZ515', '_vyrn_305C-gf-web.jpg', '_vyrp11_305GZ-Cgf-1.png', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-317|14-0-0-0|14-611-0-0|14-611-627-0', NULL, '2021-01-10 15:44:04'),
(7882, 306, 'C2gf Ořezávací fréza se středovým ložiskem a upínáním M12 – D19×25 L90 SM12×1 ', ' C2gf Ořezávací fréza se středovým ložiskem a upínáním M12 – D19×25 L90 SM12×1 ', '<p>Ořezávací fréza se závitovým upínáním je ideální pro ořezávání silných materiálů, závěsů na dveřích nebo oknech pomocí šablony nebo hrany. Tato fréza se umístí na unašecí stopku díky závitu M12x1 a díky unašesí stopce je možné nástroj prodloužit na celkovou délku až 160 mm. Díky HW břitům jsou vhodné na masiv, dřevěné kompozity, plasty a lamináty. Může být používána na obrábění v CNC frézách a ručních frézkách. Upínací stopku pro upnutí v kleštině je nutno objednat zvlášť.</p>', '_vyr_306C2-gf-web.jpg', 0, '1237.50', '1375.00', 'GZ516', '_vyrn_306C2-gf-web.jpg', '_vyrp11_306GZ-C2gf-1.png', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:04'),
(7883, 307, '1 Drážkovací fréza krátká – D11×14 L50 S8 HSS', ' 1 Drážkovací fréza krátká – D11×14 L50 S8 HSS', '<ul>\\n<li>Frézy pro drážkování</li>\\n<li>Snadné vytvoření drážky nebo výřezu</li>\\n</ul>\\n<p>Gamma Zinken drážkovací fréza je určena pro všechny druhy prací. Vyznačuje se kvalitním ostřím, které vyfrézuje dokonalou drážku. Pro frézování podle šablony lze použít kopírovací ložiska na stopce. Fréza má HW nebo HSS tělo s dlouhou životností, je precizně naostřena. Díky konstrukci je vhodná pro frézování měkkého a tvrdého dřeva, lepeného dřeva. Nástroj v provedení HW je vhodný také pro obrábění DTD, lamina , MDF, HPL a Corianu.</p>', '_vyr_3071-web.jpg', 0, '427.50', '475.00', 'GZ46', '_vyrn_3071-web.jpg', '_vyrp11_307GZ-1-1.png', '_vyrp12_307GZ-1-2.png', '', 21, 1, 2, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:04'),
(7884, 308, 'PSP Drážkovací fréza na okenní těsnění – D3,4 D5,5×8 L63 S6 ', ' PSP Drážkovací fréza na okenní těsnění – D3,4 D5,5×8 L63 S6 ', '<ul>\\n<li>Pro frézování drážek pro okenní a dveřní těsnění.</li>\\n<li>HW celotvrdokovové tělo nástroje.</li>\\n</ul>', '_vyr_308PSP-web.jpg', 0, '922.50', '1025.00', 'GZ1288', '_vyrn_308PSP-web.jpg', '_vyrp11_308GZ-PSP-1.png', '_vyrp12_308GZ-PSP-2.png', '', 21, 1, 0, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:04'),
