(7886, 314, 'C375 Vrták kolíkovací průchozí S10 L70 HW - D5x40 S=10x20 L70 P', 'C375 Vrták kolíkovací průchozí S10 L70 HW - D5x40 S=10x20 L70 P', '<p><strong>• Vrtací hlava pro vrtání čistých průchozích otvorů. <br />• Přesně broušená stopka pro přesné upnutí ve stroji. <br />• Teflonový povrch pro lepší odvod třísek. <br />• Provedení stejné jako u vrtáků neprůchozích. <br />• Rozdíl je ve speciálně vybroušené vrtací hlavě pro průchozí otvory. <br />• Vrtá čistě průchozí otvor bez vytrhávání materiálu. <br />• 4 spirálové drážky. </strong><br /><br />Použití: na vrtacích strojích, CNC strojích a kolíkovačkách, pro vrtání průchozích otvorů do DTD, MDF, lamina a plastů. Maximální tloušťka vrtaného materiálu je 35 mm.</p>', '_vyr_314C37505011.jpeg', 0, '271.80', '302.00', '375.050.11', '_vyrn_314C37505011.jpeg', '_vyrp11_314C37505011-1.jpeg', '', '', 21, 1, 5, 0, '', 0, '2-372-0-0|2-7-0-0|2-7-303-0|2-372-392-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7887, 316, 'C378 Vrták kolíkovací průchozí se záhlubníkem S10 L70 HW - D5x35 D2=16 S=10x20 P', 'C378 Vrták kolíkovací průchozí se záhlubníkem S10 L70 HW - D5x35 D2=16 S=10x20 P', '<p><strong>• Vrtací hlava pro vrtání čistých průchozích otvorů. <br />• Přesně broušená stopka pro přesné upnutí ve stroji. <br />• Teflonový povrch pro lepší odvod třísek. <br />• Provedení stejné jako u vrtáků neprůchozích. <br />• Rozdíl je ve speciálně vybroušené vrtací hlavě pro průchozí otvory. <br />• Vrtá čistě průchozí otvor bez vytrhávání materiálu. <br />• 2 spirálové drážky. </strong><br /><br />Použití: pro vrtání a zahlubování v masivním dřevě, plastu a laminu. Vhodné pro vysoké rychlosti.</p>', '_vyr_316C37805211.jpeg', 0, '418.50', '465.00', '378.052.11', '_vyrn_316C37805211.jpeg', '_vyrp11_316C37805211-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-372-0-0|2-372-392-0|12-0-0-0|12-600-0-0', NULL, '2021-01-10 15:44:04'),
(7888, 317, 'Titebond III Ultimate Lepidlo na dřevo D4 - 237ml', 'Titebond III Ultimate Lepidlo na dřevo D4 - 237ml', '<p><strong>• Extrémně voděodolné vysokopevnostní lepidlo.<br />• Ideální pro vnitřní i venkovní použití.         <br />• Odolnost proti vodě D4<br />• Vynikající pevnost - silná počáteční lepivost.<br />• Prodloužená doba fixace.<br />• Použitelné i za nižších teplot.<br />• Dobře brousitelné a lakovatelné.<br />• Univerzální - lepí dřevo, dřevovláknité desky, vysokotlaké - lamináty a dřevotřískové desky.<br />• Snadné čištění vodou.</strong><br /><br />Titebond III je extrémně voděodolné lepidlo pro vnitřní i venkovní použití, oceněné 1 místem srovnávacích testů amerického časopisu Fine Woodworking 2007. Bylo navrženo jako speciální lepidlo na dřevo, kterým je možno nahradit používání polyuretanových lepidel, které jsou nepochybně flexibilnější, ale také těžko odstranitelné z nářadí a především z rukou. Titebond III vytvoří mimořádně silnou vazbu se dřevem, má delší otevřenou dobu a větší viskozitu než konvenční disperzní lepidla. Udrží integritu i při nižších teplotách. Vyznačuje se ', '_vyr_317123-141_01_web.jpg', 0, '130.00', '145.00', '123-1413', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-1413/123-1413_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-1413/123-1413_03_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-1413/123-1413_04_web.jpg', 21, 1, 1, 1, '37083014136', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7889, 318, 'Titebond II Premium Lepidlo na dřevo D3 - 237ml', 'Titebond II Premium Lepidlo na dřevo D3 - 237ml', '<p><strong>• Vysokopevnostní voděodolné lepidlo.<br />• Ideální pro vnitřní a venkovní použití.<br />• Odolnost proti vodě D3.<br />• Silná počáteční lepivost a rychle tuhnoucí.<br />• Ideální pro vysokofrekvenční lepení a lisy za tepla.<br />• Spoj je silnější než pevnost dřeva.<br />• Vynikající odolnost proti většině rozpouštědel.<br />• Dobře brousitelné a přelakovatelné.<br />• Univerzální - lepí dřevo, dřevovláknité desky, vysokotlaké - lamináty a dřevotřískové desky.<br />• Snadné čištění vodou.</strong><br /><br />Titebond II Premium je vysokopevnostní voděodolné lepidlo, které splňuje  přísnou americkou normu ANSI Typ 2 specifikace pro odolnost proti vodě. Lepí všechny venkovní dřevěné konstrukce včetně venkovního dřevěného nábytku. Titebond II Premium poskytuje silnou počáteční lepivost v krátké době, vysokou pevnost a vynikající brousitelnost.  Titebond II Premium je snadno použitelný, netoxický, odolný proti povětrnostním vlivům. Lepidlo lze snadno očistit navlhčeným hadřík', '_vyr_318123-5003.jpg', 0, '92.00', '102.00', '123-5003', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5003/123-5003_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5003/123-5003_03_web.jpg', '', 21, 1, 1, 1, '37083050035', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7890, 319, 'Titebond Original Lepidlo na dřevo D2 - 237ml', 'Titebond Original Lepidlo na dřevo D2 - 237ml', '<p><strong>• Vysokopevnostní disperzní lepidlo.<br />• Použití pouze v interiéru.<br />• Kratší fixační doba.<br />• Rychle zasychá - zkrácení času lepení.<br />• Spoj je silnější než pevnost dřeva.<br />• Vynikající odolnost proti většině rozpouštědel.<br />• Dobře brousitelné a přelakovatelné.<br />• Univerzální - lepí dřevo, dřevovláknité desky, vysokotlaké lamináty a dřevotřískové desky.<br />• Snadné čištění vodou.</strong><br /><br />Titebond Original je nejlepší disperzní lepidlo, které lze použít pro všechny vysocepevnostní spoje dřeva, laminátů, DTD desek, kůže, látky a porézních materiálů. Vynikající např. pro lamelové spoje, pera a drážky, spárovky, protože poskytuje silnou počáteční lepivost v krátké době, čímž minimalizuje upínací dobu. Je velmi oblíbené u truhlářů. Lepidlo lze snadno očistit navlhčeným hadříkem. Po zaschnutí je dobře brousitelné. Je netoxické, bez rozpouštědel a vodou ředitelné do 5 %. Při zahřátí znovu změkne.<br /><br /><em>• Typ: Alifatické disperzní l', '_vyr_319123-5063.jpg', 0, '85.00', '85.00', '123-5063', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5063/123-5063_02_web.jpg', '', '', 21, 1, 1, 1, '37083050639', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7891, 320, 'Titebond Cold Press Veneer Lepidlo na dřevo - 946ml', 'Titebond Cold Press Veneer Lepidlo na dřevo - 946ml', '<p><strong>• Speciální disperzní lepidlo pro dýhování za studena.<br />• Minimalizuje průsaky lepidla skrz dýhu.<br />• Spoj je silnější než pevnost dřeva.<br />• Střední doba montáže 15-20 minut.<br />• Lepení dřevěné dýhy na masivní dřevo, MDF nebo dřevotřísku.<br />• Použití pouze v interiéru.</strong><br /><br />Disperzní lepidlo Titebond Cold Press for Veneer je vysoce kvalitní a úsporná alternativa pro velkoplošné lepení dýh na ploché povrchy ke kontaktním lepidlům. Je speciálně navrženo pro dýhování za studena, pro nalepení dřevěné dýhy na masivní dřevo, dřevotřískové desky, MDF, překližky a jiné materiály na bázi dřeva. Nabízí středně dlouhou montážní dobu a neobsahuje žádné škodlivé nebo žíravé výpary typické pro většinu kontaktních lepidel. Pomáhá také zabránit průsaku přes otevřené póry dýhy a surovou nezpracovanou dýhu. Vynikající odolnost proti většině rozpouštědel, je nehořlavé a snadno se čistí vodou.<br /><br /><em>• Typ: Modifikovaný Polyvinyl acetát PVA<br />• Použití', '_vyr_320123-5175.jpg', 0, '199.00', '217.00', '123-5175', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5175/123-5175_02_web.jpg', '', '', 21, 1, 1, 1, '37083051759', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7892, 321, 'Titebond Extend Lepidlo na dřevo - 473ml', 'Titebond Extend Lepidlo na dřevo - 473ml', '<p><strong>• Vysokopevnostní disperzní lepidlo.<br />• Použití pouze v interiéru.<br />• Delší fixační doba než Titebond Original.<br />• Spoj je silnější než pevnost dřeva.<br />• Zvýšená odolnost proti vyšším teplotám.<br />• Vynikající odolnost proti většině rozpouštědel.<br />• Dobře brousitelné a přelakovatelné.<br />• Univerzální - lepí dřevo, dřevovláknité desky, vysokotlaké lamináty a dřevotřískové desky.<br />• Snadné čištění vodou.</strong><br /><br />Disperzní lepidlo na dřevo s prodlouženou dobou montáže má stejné vlastnosti jako Titebond Original. Poskytuje však více času pro lepení složitějších sestav. Použití v interiérech, zvláště v exponovaných částech, které jsou vystaveny vyšším teplotám jako kuchyňské linky, obklady radiátorů a pod.<br /><br />Použití: dřevo, dřevovláknité desky, MDF, překližka, vysokotlaký laminát a dřevotřískové desky, látka, kůže.<br /><br /><em>• Typ: Disperzní lepidlo PVA<br />• Použití: Interiér<br />• Doba otevření: max. 15 minut<br />• Celko', '_vyr_321123-9104.jpg', 0, '149.00', '161.00', '123-9104', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-9104/123-9104_02_web.jpg', '', '', 21, 1, 1, 1, '37083091045', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7893, 322, 'Titebond Liquid Hide Klihové lepidlo na dřevo - 118ml', 'Titebond Liquid Hide Klihové lepidlo na dřevo - 118ml', '<p><strong>• Připraveno k okamžitému použití.<br />• Typ - glutinový klih s přísadami.<br />• Vynikající brousitelnost a odolnost proti tečení.<br />• Vhodné pro dřevo a látky.<br />• Použití pouze v interiéru.<br />• Umožňuje rozebíratelný spoj po zahřátí.<br />• Dlouhá doba fixace pro precizní montáž.<br />• Nevhodné pro dlouhé skladování po otevření nutno spotřebovat.</strong><br /><br />Titebond Liquid Hide Glue je první klihové lepidlo, které se nabízí v tekutém stavu připraveném k použití. Nevyžaduje žádný ohřev a míchání. Profesionálové používají Titebond Liquid Hide pro výjimečnou pevnost, dlouhou montážní dobu, pružnost a jedinečný přenos zvuku v nezkreslené podobě.<br /><br />Poskytuje vynikající odolnost proti tečení, nabízí skvělou brousitelnost a lze je povrchově upravovat lakováním a pod.. Jeho citlivost na vyšší teplotu umožňuje snadnou demontáž částí, což je zásadní přínos pro restaurování nábytku nebo opravu hudebních nástrojů.  Ideální pro všechny restaurátorské práce', '_vyr_322123-5012.jpg', 0, '94.00', '92.00', '123-5012', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5012/123-5012_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-5012/123-5012_03_web.jpg', '', 21, 1, 1, 1, '37083050127', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7894, 323, 'Titebond No-run, No-drip Lepidlo na dřevo - 473ml', 'Titebond No-run, No-drip Lepidlo na dřevo - 473ml', '<p><strong>• Vysokopevnostní disperzní lepidlo.<br />• Použití pouze v interiéru.<br />• Velmi krátká fixační doba.<br />• Spoj je silnější než pevnost dřeva.<br />• Zvýšená odolnost proti vyšším teplotám.<br />• Vynikající odolnost proti většině rozpouštědel.<br />• Dobře brousitelné a přelakovatelné.<br />• Univerzální - lepí dřevo, dřevovláknité desky, vysokotlaké lamináty a dřevotřískové desky.<br />• Snadné čištění vodou.</strong><br /><br />Disperzní lepidlo s nejrychlejší fixací, velmi rychle usychá. Ideální pro lepení například okrasných lišt a dalších projektů požadujících rychlé lepení bez stékání. Snadné k použití, rychlá fixace, která však dostatečně dovoluje vyrovnání dílů. Vynikající pro porézní i polo-porézní materiály.<br /><br />Použití: dřevo, dřevovláknité desky, MDF, překližka, vysokotlaký laminát a dřevotřískové desky, látka, kůže.<br /><br /><em>• Typ: Disperzní lepidlo PVA<br />• Použití: Interiér<br />• Doba otevření: max. 3-5 minut<br />• Celková montážní doba:', '_vyr_323123-2404.jpg', 0, '138.00', '151.00', '123-2404', '', '', '', '', 21, 1, 1, 1, '37083024043', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7895, 324, 'Titebond II Dark Lepidlo na dřevo tmavé D3 - 237ml', 'Titebond II Dark Lepidlo na dřevo tmavé D3 - 237ml', '<p>Titebond II Dark je obarvená verze lepidla Titebond Premium II do barvy tmavého hnědého dřeva. Je to vysokopevnostní voděodolné lepidlo, které splňuje  přísnou evropskou normu DIN EN 204/ D3 pro pevnostní odolnost proti vodě. Po zaschutí má hnědou barvu, a proto je vhodné všude tam, kde se používají tmavé odstíny dřeva.<br />Lepí všechny venkovní dřevěné konstrukce včetně venkovního dřevěného nábytku. Titebond II Premium poskytuje silnou počáteční lepivost v krátké době, vysokou pevnost a vynikající brousitelnost. Titebond II Premium je snadno použitelný, odolný proti povětrnostním vlivům. Lepidlo lze snadno očistit navlhčeným hadříkem.<br /><br /><em>• Typ:  Polyvinyl acetát PVA<br />• Použití: Interiér a exteriér<br />• Doba otevření: max. 5 minut<br />• Celková montážní doba:  10 - 15 minut<br />• Úplné zaschnutí:  24 hodin<br />• Pracovní a skladovací teplota : 10° - 30°C<br />• Vhodné pro: dřevo, dřevotřísku, tkaniny, kůže<br />• Skupina namáhání: DIN EN 204 / D3</em></p>', '_vyr_324123-3703.jpg', 0, '92.00', '104.00', '123-3703', '', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/123-3703/123-Dark_2_web.jpg', '', '', 21, 1, 1, 1, '37083037036', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7896, 325, 'Titebond Quick & Thick Lepidlo na dřevo - 237ml', 'Titebond Quick & Thick Lepidlo na dřevo - 237ml', '<p><strong>• Třikrát větší pevnost spoje.</strong><br /><strong><strong>• Průhledná barva po vytvrzení.</strong><br /><strong>• Dvakrát rychlejší doba fixace.</strong><br /><strong>• Ideální lepidlo pro domácí a řemeslné použití.</strong><br /><strong>• Vyplňuje mírné trhliny a mezery.</strong><br /><strong>• Vynikající odolnost proti většině rozpouštědel.</strong><br /><strong>• Dobře brousitelné a přelakovatelné.</strong><br /><strong>• Univerzální - lepí dřevo, dřevovláknité desky, vysokotlaké lamináty a dřevotřískové desky.</strong><br /><strong>• Snadné čištění vodou, netoxické a nehořlavé.</strong></strong><br /><br />Disperzní lepidlo s nejrychlejší fixací, a maximální pevností vyniká svými vlastnostmi nad ostatní lepidla. Ideální pro lepení například okrasných lišt a dalších projektů požadujících rychlé lepení bez stékání v interiéru. Snadné k použití, rychlá fixace, která však dostatečně dovoluje vyrovnání dílů. Vynikající pro porézní i polo-porézní materiály. Lepidlo není vho', '_vyr_325123-2403.jpg', 0, '82.00', '92.00', '123-2403', '', '', '', '', 21, 1, 1, 1, '37083024036', 0, '5-0-0-0|5-386-0-0', NULL, '2021-01-10 15:44:04'),
(7897, 326, 'IGM Tavné lepidlo pro olepovačky - balení 1kg', 'Tavné lepidlo pro  olepovačky - balení 1kg', '<p>Speciálně vyvinuté tavné lepidlo v granulích pro  manuální olepovačky hran. Je přírodní barvy, má nízkou viskozitu, rychlé tavení a vysokou lepivost. Lepidlo je určené pro lepení hran z materiálů ABS, PVC, PP, melamin, polyester nebo dýha. Doporučujeme nastavit teplotu na  olepovačce na hodnotu cca 140° podle teploty v dílně.<br /><br />Doporučená pracovní teplota, při aplikaci válečkem: 120 -140°C, manuální olepovačky 120°C - 140°C.<br /><br /><em>Vlastnosti:<br />• nízká viskozita<br />• nízká aplikační teplota   <br />• rychle nátavné    <br />• velmi dobrá smáčivost  <br />• vysoce vydatné lepidlo</em></p>', '_vyr_326M967-1.jpg', 0, '220.00', '244.00', 'M967-1', '', '', '', '', 21, 1, 1, 1, '8,59E+12', 0, '5-0-0-0|5-387-0-0', NULL, '2021-01-10 15:44:04'),
(7898, 327, 'Pár nožů -  40x4mm HSS', 'Pár nožů -  40x4mm HSS', '<p><strong>• Určeno pro frézovací hlavy od , CMT, Pilana, Flury, Guhdo atd.<br />• Přesné otvory pro kvalitní umístění ve frézovací hlavě.<br />• Nabízíme v šířce 40 mm nebo 50 mm.<br />• Vyrobeno z legované nástrojové oceli.<br />• Přesně vybroušené.</strong></p>\\n<p>Univerzální profilové nože jsou určené pro univerzální frézovací hlavy s euro upínacím systémem. Díky jednoduchému upínacímu systému, můžete během chvilky změnit profil frézování na své frézovací hlavě. Přesné ustavovací otvory pro kolíky mají průměr 6 mm a jsou v rozteči 24 mm. Dodáváno v páru (2ks), baleno v blistru. </p>\\n<p>Celková nabídka univerzálních nožů obsahuje téměř 200 standardních profilů. Široká nabídka uspokojí i náročného zákazníka. Univerzální profilové nože nejsou určené pro sériovou výrobu, ale jako dostupná pomoc při zakázkové a individuální výrobě.</p>\\n<p><strong></strong></p>\\n<p><strong>TECHNICKÉ INFORMACE:</strong></p>\\n<ul>\\n<li>Rozměry univerzálního profilového nože jsou 40x4 mm</li>\\n<li>Materi', '_vyr_327par.png', 0, '267.90', '282.00', '690.000', '_vyrn_327par.png', '', '', '', 21, 1, 1, 1, '', 0, '22-0-0-0|22-671-0-0|22-671-826-0', NULL, '2021-01-10 15:44:04'),
