(8102, 539, 'CMT CHROME Pilový kotouč na lamino, DTD a MDF - D300x3,2 d30 Z96 HM', 'CMT CHROME Pilový kotouč na lamino, DTD a MDF - D300x3,2 d30 Z96 HM', '<p>Nový pilový kotouč s chromovaným povrchem, který redukuje ulpívání zbytků lepidla a pryskyřice na těle kotouče. Má nové tlumící drážky vyplněné oranžovým polyuretanem pro snížení vibrací a hlučnosti. Trapézové zuby z extra tvrdého tvrdokovu pro řezání lamina, dřevotřískových desek a MDF. Vysoká životnost. Pro pily s předřezem.</p>', '_vyr_539C28169612M.jpeg', 0, '1533.00', '1703.00', 'C28169612M', '_vyrn_539C28169612M.jpeg', '_vyrp11_539C28169612M-1.jpeg', '_vyrp12_539C28168010M-2.jpeg', '', 21, 1, 1, 1, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:06'),
(8103, 542, 'ATS Diamantová fréza dvouzubá Z2+1 - D8x15 S=12 RH', 'ATS Diamantová fréza dvouzubá Z2+1 - D8x15 S=12 RH', '<p><strong>TECHNICKÉ ÚDAJE:</strong></p>\\n<ul>\\n<li><span id=\\\"result_box\\\" class=\\\" lang=\\\"><span class=\\\"alt-edited\\\"> tělo z kvalitního materiálu DENSIMETU</span></span></li>\\n<li>dva diamantové zuby</li>\\n<li>výška diamantového plátku 3 mm<span id=\\\"result_box\\\" class=\\\" lang=\\\"></span></li>\\n</ul>\\n<p> </p>\\n<p><strong>POUŽITÍ:</strong></p>\\n<p>Pro drážkování v materiálech: HPL, MDF, HDF, laminované desky, překližky a voděodolné překližky.</p>\\n<p><strong>VÝHODY:</strong> Vysoký posuv, kvalitní odvod třísek, dokonalý povrch obrobené plochy, tichý provoz. Na obrobek nezanechávají stopky, nejčastější použití na MDF.</p>\\n<p> </p>\\n<p><em>Graf a data mají informační charakter. Mohou se měnit v závislosti na druhu práce</em></p>\\n<p><em>a zpracovávaných materiálech.</em></p>', '_vyr_542AT2.png', 0, '4552.94', '4500.00', 'ATS081510R', '_vyrn_542AT2.png', '_vyrp11_542ATS-2.png', '_vyrp12_542ATS-1.png', '101456_542__vyrp13_541AT2-3.png', 21, 1, 1, 1, '', 0, '2-7-46-0|2-1-11-0|2-1-11-311|2-7-0-0|7-0-0-0|7-419-0-0|7-419-436-0|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8104, 543, 'Universální upínací přípravek ITA tools - pro ISO30', 'Universální upínací přípravek ITA tools - pro ISO30', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Rychlé upnutí<span> </span>HSK nebo <strong>ISO</strong> hlav</li>\\n<li>Užitečný při výměně nástroje</li>\\n<li>Rychlé upnutí a pevná fixace hlavy</li>\\n<li>Ložiskový systém</li>\\n<li>Snadná manipulace</li>\\n<li>Průměr<span> </span><strong>50 mm</strong></li>\\n</ul>\\n<h3>POPIS:</h3>\\n<p>Je určený pro rychlé upnutí HSK nebo ISO hlav při výměně nástroje. Hlavní výhodou je rychlé upnutí a fixace hlavy. Hlava se vkládá do přípravku, kde důmyslný systém ložisek zafixuje její polohu proti pootočení.</p>', '_vyr_543183-ISO_183-ISO-405.jpg', 0, '5236.16', '5817.96', '183-ISO', '_vyrn_543183-ISO_183-ISO-405.jpg', '_vyrp11_543183-ISO_183-ISO-105.jpg', '', '', 21, 1, 5, 0, '', 0, '2-8-0-0|2-8-309-0', NULL, '2021-01-10 15:44:06'),
(8105, 544, 'Universální upínací přípravek ITA tools - pro HSK63', 'Universální upínací přípravek ITA tools - pro HSK63', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Rychlé upnutí <strong>HSK</strong> nebo ISO hlav</li>\\n<li>Užitečný při výměně nástroje</li>\\n<li>Rychlé upnutí a pevná fixace hlavy</li>\\n<li>Ložiskový systém</li>\\n<li>Snadná manipulace</li>\\n<li>Průměr <strong>63 mm</strong></li>\\n</ul>\\n<h3>POPIS:</h3>\\n<p>Je určený pro rychlé upnutí HSK nebo ISO hlav při výměně nástroje. Hlavní výhodou je rychlé upnutí a fixace hlavy. Hlava se vkládá do přípravku, kde důmyslný systém ložisek zafixuje její polohu proti pootočení.</p>', '101456_544__vyr_543image002.jpg', 0, '5236.16', '5817.96', '183-HSK', '101456_544__vyrn_543image002.jpg', '_vyrp11_544122094901_368429857600304_5019688759285334979_n.jpg', '', '', 21, 1, 9, 0, '', 0, '2-8-0-0|2-8-309-0', NULL, '2021-01-10 15:44:06'),
(8106, 547, 'CMT Industrial Pilový kotouč na lamino a DTD - D250x3,2 d30 Z80 HM', 'CMT Industrial Pilový kotouč na lamino a DTD - D250x3,2 d30 Z80 HM', '<p>Osvědčený kotouč s trapézovým zubem a expanzními drážkami. Určený pro vysoce kvalitní řezy do lamina a dřevotřísky. Vysoká životnost tvrdokovových zubů. Pro pily s předřezem.</p>', '_vyr_547C28108010M.jpg', 0, '1427.00', '1586.00', 'C28108010M', '_vyrn_547C28108010M.jpg', '_vyrp11_547C28108010M-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:06'),
(8107, 548, 'CMT Industrial C283 Pilový kotouč na lamino bez předřezu - D300x3,2 d30 Z96 HM', 'CMT Industrial C283 Pilový kotouč na lamino bez předřezu - D300x3,2 d30 Z96 HM', '<p>Speciální konstrukce s extra šikmými zuby pro docílení jemnějšího řezu oboustranně povrchově upravených materiálů, jako lamina nebo dýhy, na kotoučových pilách nebo velkých zkracovacích pilách. Perfektní povrch spodní hrany při použití tohoto kotouče. Vysoká životnost tvrdokovových zubů. Vhodné pro vertikální pily. Pro lamino, DTD, MDF, překližku a příčné řezy dřeva.</p>', '_vyr_548C28309612M.jpeg', 0, '1738.00', '1932.00', 'C28309612M', '_vyrn_548C28309612M.jpeg', '_vyrp11_548C28309612M-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:06'),
(8108, 549, 'CMT Sada kotoučů na lamino - D300 d30 Z96 + D100 d20 Z20 HM', 'CMT Sada kotoučů na lamino - D300 d30 Z96 + D100 d20 Z20 HM', '<p>Nejlevnější sady kvalitních CMT kotoučů určené k dělení laminotřískových materiálů. Hlavní kotouč s trapézovým zubem a skládaný předřezový kotouč.</p>', '_vyr_549FA-300100.jpg', 0, '2370.00', '2499.00', 'FA-300100', '_vyrn_549FA-300100.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-423-0-0', NULL, '2021-01-10 15:44:06'),
(8109, 550, 'CMT Sada kotoučů na lamino - D300 d30 Z96 + D120 d20 Z24 HM', 'CMT Sada kotoučů na lamino - D300 d30 Z96 + D120 d20 Z24 HM', '<p>Nejlevnější sady kvalitních CMT kotoučů určené k dělení laminotřískových materiálů. Hlavní kotouč s trapézovým zubem a skládaný předřezový kotouč.</p>', '_vyr_550FA-300100.jpg', 0, '2370.00', '2499.00', 'FA-300120', '_vyrn_550FA-300100.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-423-0-0', NULL, '2021-01-10 15:44:06'),
(8110, 551, 'CMT Sada na ornamenty, fréza 3D S=8mm, šablona KLASIK s rámem', 'CMT Sada na ornamenty, fréza 3D S=8mm, šablona KLASIK s rámem', '<p>Výhodná sada obsahuje frézu na ornamenty a šablonu na zásuvky s rámem s klasickým vzorem A. Za zvýhodněnou cenu získáte nejpoužívanější vzor a frézu na ornamenty. Kdykoliv si můžete dokoupit další vzory a rámy z naší nabídky.<br /><br />Ornamenty upadly dlouhá léta v zapomnění. Nyní jsou však opět v kurzu a jejich renesanci napomáhá i snadnější výroba pomocí unikátní šablony CRCS značky CMT. S tímto přípravkem můžete vyrobit krásné rozety, rohové ornamenty na dveře nebo rámy, ornamenty na kuchyňská dvířka, ornamenty na čela postelí nebo skříní. Nábytek z masivu ozdobený ornamenty zažívá nyní renesanci a proto se podívejme jak to všechno funguje.<br /><br /><strong>Jak frézování ornamentů funguje?</strong><br />1. Připevněte rám na díl.<br />2. Umístěte šablonu a při frézování kopírujte výřezy.<br />3. Přemístěte šablonu a opakujte postup.<br />4. Hotový ornament</p>', '_vyr_551CRCS-START1.jpeg', 0, '3020.00', '3357.00', 'CRCS-START1', '_vyrn_551CRCS-START1.jpeg', '_vyrp11_551CRCS-START1-1.jpeg', '_vyrp12_551CRCS-START1-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-0-0-0|4-107-0-0|4-107-385-0', NULL, '2021-01-10 15:44:06'),
(8111, 552, 'CMT Multifunkční oscilační pila 300W', 'CMT Multifunkční oscilační pila 300W', '<p><strong>Ideální pomocník při broušení, dělení, strhnutí koberce, vyříznutí otvoru, řezání dřeva nebo plastů, zařezávání trubek, řezání hřebíků.</strong><br /><br /><strong>• Rychloupínací systém nástavců.<br />• Dodáváno s rukojetí a odsáváním.<br />• Výkonný motor 300 W.<br />• Elektronická změna otáček.<br />• Praktické držení stroje.<br />• Bohatá nabídka příslušenství pro široké použití.</strong><br /><br />CMT multifunkční oscilační pila má výkonný 300 wattový motor s regulovatelnou rychlostí otáček, umožňující široké využití napříč oborům. Robustní konstrukce převodovky umožňuje lepší přenos síly na nástroj. Rychloupínací systém usnadňuje výměnu nástavců.<br /><br />• Typ: CMT11<br />• Doporučené použití: Řemeslník<br />• Příkon: 300W<br />• Volnoběžné otáčky: 11000–21000 ot./min<br />• Vibrace: 19,7m/s<sup>2</sup><br />• Typ otvoru upnutí: Universální<br />• Amplituda: 1,5m/s<sup>2</sup><br />• Hmotnost: 1,2 kg<br /><br /><strong></strong></p>\\n<h3>Součást balení:</h3>\\n<p>• ', '_vyr_552CMT11.jpg', 0, '2004.00', '2226.00', 'CMT11', '', '_vyrp11_552CMT11-1.jpg', '_vyrp12_552CMT11-2.jpg', '_vyrp13_552CMT11-3.jpg', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-417-0', NULL, '2021-01-10 15:44:06'),
(8112, 553, 'CMT10 Nová Ořezávací frézka 550W, kleštiny 8mm a 6mm', 'CMT10 Nová Ořezávací frézka 550W, kleštiny 8mm a 6mm', '<p><span>Jedinečná konstrukce frézky má ergonomický tvar pro lepší práci jednou rukou. Motor má 32000 ot./min a poskytuje dostatečnou sílu i pro větší úběry materiálu. Je vybavena unikátním průhledným otočným krytem, který kopíruje povrch a díky kterému vždy perfektně vidíte na práci. Integrovaná odsávací hubice umožňuje připojit frézku k odsávání. Přesná hloubka se jednoduše nastavuje otáčením základny, přičemž 1 otáčka je 2 mm a přesné nastavení lze odečítat na stupnici s noniusem s rozlišením 0,05 mm. Součástí balení je základna s nastavitelným frézovacím pravítkem, kopírovací kroužek D10 mm, 2 klíče pro jednoduchou výměnu frézy, 2 kleštiny o průměru 8 a 6 mm a návod k obsluze. To vše v přepracním kufříku.</span></p>', '_vyr_553CMT10N.jpg', 0, '2061.00', '2290.00', 'CMT10N', '', '_vyrp11_553CMT10N-1.jpg', '_vyrp12_553CMT10N-2.jpg', '', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:06'),
(8113, 554, 'CMT 7E Horní frézka 2400 W, kleština 8 a 12mm', 'CMT 7E Horní frézka 2400 W, kleština 8 a 12mm', '<p><strong>• Elektronická regulace rychlosti s měkkým startem 8000 až 20000 ot./min.<br />• Odnímatelná pružina zdvihu pro snadné nastavení hloubky frézování při práci ve frézovacím stolku.<br />• Snadno přístupné uhlíky.<br />• Bezpečnostní kryt vypínače s ochranou proti zapnutí.<br />• Boční větrací otvory zamezují pronikání prachu do motoru.<br />• Revolverový doraz pro rychlé přednastavení hloubek řezu.<br />• Jednoduché nastavení výšky frézování ve frézovacím stolku.<br />• Přepínání mezi volnou a pevnou polohou zdvihu frézky.<br />• Ochranné kryty.<br />• Multifunkční pracovní deska pro snadné frézování.<br />• Rychlé upevnění a odstranění multifunkční pracovní desky.<br /><br />U obou typů CMT frézek lze nastavit výšku frézování ve frézovacím stolku shora pomocí ruční kliky.</strong><br /><br /><em>• Typ: CMT7E<br />• Doporučené použití: Řemeslník<br />• Příkon: 2400 W<br />• Volnoběžné otáčky: 8000–20000 ot./min<br />• Max. zdvih: 68 mm<br />• Max. průměr otvoru ve stolku: 79 m', '_vyr_554CMT7E.jpg', 0, '7306.00', '7690.00', 'CMT7E', '', '_vyrp11_554CMT7E-1.jpg', '_vyrp12_554CMT7E-2.jpg', '_vyrp13_554CMT7E-3.jpg', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:06'),
(8114, 555, 'CMT 8E Horní frézka 1000 W, kleština 8 a 12mm', 'CMT 8E Horní frézka 1000 W, kleština 8 a 12mm', '<p><strong>• Elektronická regulace rychlosti s měkkým startem 8000 až 20000 ot./min.<br />• Snadno přístupné uhlíky.<br />• Bezpečnostní kryt vypínače s ochranou proti zapnutí.<br />• Boční větrací otvory zamezují pronikání prachu do motoru.<br />• Revolverový doraz pro rychlé přednastavení hloubek řezu.<br />• Jednoduché nastavení výšky frézování ve frézovacím stolku.<br />• Rychlé upevnění a odstranění multifunkční pracovní desky.<br />• Přepínání mezi volnou a pevnou polohou zdvihu frézky.<br />• Ochranné kryty.<br />• Multifunkční pracovní deska pro snadné frézování.</strong><br /><br /><strong>U obou typů CMT frézek lze nastavit výšku frézování ve frézovacím stolku shora pomocí ruční kliky.</strong><br /><br /><em>• Typ: CMT8E<br />• Doporučené použití : Řemeslník<br />• Příkon: 1000 W<br />• Volnoběžné otáčky: 8000–20000 ot./min<br />• Max. zdvih: 59 mm<br />• Max. průměr nástroje při max. zatížení: 50 mm<br />• Max. průměr otvoru ve stolku: 77,5 mm<br />• Kleštiny v balení: 8 a ', '_vyr_555CMT8E.jpg', 0, '5310.00', '5900.00', 'CMT8E', '', '_vyrp11_555CMT8E-1.jpg', '_vyrp12_555CMT8E-2.jpg', '_vyrp13_555CMT8E-3.jpg', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:06'),
(8115, 556, 'CMT Frézovací stolek', 'CMT Frézovací stolek', '<p><strong>• Lehká stabilní konstrukce.<br />• Pravítko a přítlaky v základní výbavě.<br />• Upnutí všech typů frézek.<br />• Velká pracovní plocha.</strong><br /><br />CMT frézovací stůl byl navržen pro řemeslníky a kutily, kterým vyhovuje standardní provedení pracovního vybavení. Frézovací stůl rozšiřuje využití a možnosti ručních frézek. Díky zkušenostem značky CMT frézovací stolek nabízí ideální kombinaci ceny a užitných vlastnosti. Pracovní plochu tvoří MDF laminátová deska o velikosti 80x60x2,5cm. Pohodlnou pracovní výšku 90cm zajišťuje stojan z pevné oceli s výškově stavitelnýma nohama.<br />Středová deska je připravena pro upnutí a využití CMT horních frézek. Přesto je možné upnout všechny frézky libovolných značek a modelů na trhu.<br /><br /><em>• Doporučené použití: Řemeslník<br />• Rozměr pracovní plochy: 800 x 600mm<br />• Rozměry frézovacího pravítka: 840-900 x 75mm<br />• Maximální průměr frézy pod stolkem: 95mm<br />• Odsávání: 57mm<br />• Délka x šířka x výška: 900 x 6', '_vyr_556C99911000.jpeg', 0, '8806.00', '9784.00', 'C99911000', '_vyrn_556C99911000.jpeg', '_vyrp11_556C99911000-1.jpeg', '', '', 21, 1, 1, 0, '', 0, '4-427-0-0', NULL, '2021-01-10 15:44:06'),
(8116, 557, 'CMT Industrio Frézovací stolek', 'CMT Industrio Frézovací stolek', '<p>INDUSTRIO je frézovací stolek určený pro každodenní profesionální použití. Konstrukce stolu umožňuje upnutí nástrojů do průměru 89mm. Je rozdělen na tři části, které mohou být zakoupeny samostatně. Velkou výhodou je vložená výškově nastavitelná upínací deska frézky z tvrzeného plastu. Na desce stolu je integrovaný profil s dvěmi T drážkami pro přesné vedení příslušenství nebo Vámi vyrobené posuvné šablony.<br /><br /><strong>CMT INDUSTRIO stolek obsahuje všechny zobrazené komponenty vyjma:</strong><br />• Elektrického STOP vypínače<br />• Zahnutého klíče na horní frézku<br />• Zobrazené stopkové frézy tyto produkty lze objednat samostatně.<br />Tyto produkty lze objednat samostatně</p>', '_vyr_557C99950001.jpeg', 0, '14960.00', '16630.00', 'C99950001', '_vyrn_557C99950001.jpeg', '_vyrp11_557C99950001-1.jpeg', '_vyrp12_557C99950001-2.jpeg', '_vyrp13_557C99950001-3.jpeg', 21, 1, 1, 0, '', 0, '4-427-0-0', NULL, '2021-01-10 15:44:06'),
(8117, 558, 'CMT Spojovací přípravek Pocket-Pro', 'CMT Spojovací přípravek Pocket-Pro', '<ul>\\n<li>CMT vrtací přípravek Pocket-Pro je určen pro rychlé, jednoduché a přesné spojování nábytku, korpusů a rámů.</li>\\n<li>Umožňuje tvořit pevné, slepé spoje v deskách o tloušťce 12,7 – 40 mm, to vše s neuvěřitelnou rychlostí a přesností. </li>\\n</ul>\\n<p><br />Hlavní výhodou vrtacího přípravku Pocket-Pro je unikátně lisované tělo s tvrzenými vrtacími pouzdry a dvoudílná zámková konstrukce. Posunem nahoru a dolů jednoduše nastavíte tloušťku vrtaného materiálu na stupnici po 1,6mm, aniž byste museli vyvrtávat testovací otvory nebo cokoliv měřit. Jestli již máte zkušenost s podobnými vrtacími přípravky, pak vám některé vlastnosti přijdou známé, Pocket-Pro ovšem nabízí mnohé další výhody.<br /><br />Například:</p>\\n<ul>\\n<li>Některé přípravky vyžadují rozebrání, pokud chcete nastavit jinou tloušťku obrobku. Pocket-Pro ale stačí posunout nahoru nebo dolů po stupnici od 12,7mm až po 40mm a tak nastavit požadovanou tloušťku spojovaného materiálu.</li>\\n<li>Jiné přípravky vyžadují neustá', '_vyr_558CPPJ-002.jpeg', 0, '2061.00', '2290.00', 'CPPJ-002', '_vyrn_558CPPJ-002.jpeg', '_vyrp11_558CPPJ-002-1.jpeg', '_vyrp12_558CPPJ-002-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-0-0-0|4-107-0-0|4-107-384-0', NULL, '2021-01-10 15:44:06'),
(8118, 559, 'JET JRT-1 Frézovací stolek', 'JET JRT-1 Frézovací stolek', '<p>Frézovací stolek pro přesné frézování stopkovými frézami větších průměrů. Je vybavený bezpečnostním vypínačem s možností připojení horní frézky s výkonem až 1600W.<br /><br />Součástí stolku je pravé a levé rozšíření stolu na délku 1030mm , frézovací pravítko s ochranným odklopným krytem, přítlačný doraz a pokosové pravítko. Stolek je určen pro umístění na stůl nebo podstavec.<br /><br />• Typ: JRT-1<br />• Doporučené použití: Kutil<br />• Bezpečnostní vypínač: 230 V, 50 - 60 Hz, max. 1600 W<br />• Rozměr stolu ze slitiny: 610 x 360mm<br />• Prodloužení pracovní plochy přední a zadní: 210 x 360mm<br />• Rozměry frézovacího pravítka: 540-610 x 75mm<br />• Maximální průměr frézy pod stolkem: 50mm<br />• Odsávání: 70mm (57mm)<br />• Délka x šířka x výška: 1030 x 360 x 410mm<br />• Hmotnost: 10 kg</p>', '_vyr_559JRT-1M.jpeg', 0, '2417.00', '2545.00', '121-JRT-1M', '_vyrn_559JRT-1M.jpeg', '', '', '', 21, 1, 1, 0, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:06'),
(8119, 560, 'JET JRT-2 Frézovací stolek s litinovým stolem', 'JET JRT-2 Frézovací stolek s litinovým stolem', '<p><strong><span style=\\\"line-height: 1.6;\\\">• Otvor v desce stolu pro snadnou změnu zdvihu frézky.<br />• Upevňovací otvory pro frézku CMT7E.<br />• Pracovní stůl z litiny.<br />• Rozšíření pracovní plochy z ocelového plechu.<br />• Nastavitelné frézovací pravítko</span></strong>.<br /><br /><span style=\\\"line-height: 1.6;\\\">Frézovací stolek JRT-2 je vhodný pro různé značky ručních frézek. Z výroby jsou předpřipravené upínací otvory pro ruční frézku CMT7E, která je vybavena snadným systémem zdvihu z horní strany stolu. Středová deska stolu je konstruována tak, aby se dala jednoduše odmontovat pro vytvoření otvorů pro libovolnou ruční frézku. Důležitou výhodou stolku je vrchní deska z litiny, která je lepší než jiné materiály používané na frézovacích stolcích. Hmotnost stolku je ve srovnání s konkurenčními stolky téměř dvojnásobná, což má pozitivní vliv jak na pracovní pohodlí a tak kvalitu frézování. Stůl je opatřen pohyblivým úhlovým pravítkem, které je vedeno v T drážce stolu, a nas', '_vyr_560JRT-12M-2.jpeg', 0, '3724.00', '3920.00', '121-JRT-2M', '_vyrn_560JRT-12M-2.jpeg', '_vyrp11_560JRT-12M-3.jpeg', '_vyrp12_560JRT-12M-4.jpeg', '_vyrp13_560JRT-12M-5.jpeg', 21, 1, 1, 0, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:06'),
(8120, 561, 'IGM FD300 Cinkovací přípravek 305mm včetně rybinové frézy 12,7mm', 'IGM FD300 Cinkovací přípravek 305mm včetně rybinové frézy 12,7mm', '<h3>Snadno a rychle vyrobíte elegantní spoje. Vhodné pro všechny typy horních frézek. </h3>\\n<ul>\\n<li>Dvě velikosti přípravku.</li>\\n<li>Pevné ocelové tělo.</li>\\n<li>Přesná laserem řezaná šablona z 4mm pozinkovaného ocelového plechu.</li>\\n<li>Masivní držáky šablony.</li>\\n<li>Robustní ocelové přítlaky</li>\\n<li>Jednoduché nastavení a používání.</li>\\n<li>Šablony pro minirybinu, čepový spoj a otevřenou rybinu jsou k dispozici jako příslušenství.</li>\\n<li>Speciální úchytné otvory pro umístění dorazů na šabloně.</li>\\n</ul>\\n<p><br /> Cinkovací přípravek je určen pro výrobu polokrytých rybinových spojů pomocí ruční frézky a stopkové frézy. Polokryté rybinové spoje se nejčastěji používají na zásuvkách z masivního dřeva. Díky volitelným šablonám lze přípravek rozšířit na výrobu různý typů spojů, jako jsou čepové spoje, otevřené rybinové spoje, které využijete pro výrobu nábytku z masivního dřena, šperkovnice nebo pracovní bedny z masivního dřeva. Robustní přítlaky bezpečně upnou i větší', '_vyr_561FD300.jpeg', 0, '2716.00', '3018.00', 'FD300', '_vyrn_561FD300.jpeg', '_vyrp11_561FD300-1.jpeg', '_vyrp12_561FD300-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-107-385-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:06'),
(8121, 562, 'IGM FD600 Cinkovací přípravek 610mm včetně rybinové frézy 12,7mm', 'IGM FD600 Cinkovací přípravek 610mm včetně rybinové frézy 12,7mm', '<h2>Snadno a rychle vyrobíte elegantní spoje. Vhodné pro všechny typy horních frézek. </h2>\\n<ul>\\n<li>Dvě velikosti přípravku.</li>\\n<li>Pevné ocelové tělo.</li>\\n<li>Přesná laserem řezaná šablona z 4mm pozinkovaného ocelového plechu.</li>\\n<li>Masivní držáky šablony.</li>\\n<li>Posuvné dorazy pro jednoduché ustavení dílů vzhledem k šabloně.</li>\\n<li>Robustní ocelové přítlaky</li>\\n<li>Jednoduché nastavení a používání.</li>\\n<li>Šablony pro minirybinu, čepový spoj a otevřenou rybinu jsou k dispozici jako příslušenství.</li>\\n<li>Speciální úchytné otvory pro umístění dorazů na šabloně.<br /><br /></li>\\n</ul>\\n<p>Cinkovací přípravek je určen pro výrobu polokrytých rybinových spojů pomocí ruční frézky a stopkové frézy. Polokryté rybinové spoje se nejčastěji používají na zásuvkách z masivního dřeva. Díky volitelným šablonám lze přípravek rozšířit na výrobu různý typů spojů, jako jsou čepové spoje, otevřené rybinové spoje, které využijete pro výrobu nábytku z masivního dřena, šperkovnice ', '_vyr_562FD600.jpeg', 0, '4770.00', '5300.00', 'FD600', '_vyrn_562FD600.jpeg', '_vyrp11_562FD600-1.jpeg', '_vyrp12_562FD600-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-107-385-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:06'),
(8122, 563, 'IGM Fachmann Digitální úhloměr +-- 180°, rozlišení na 0,1°', 'IGM Fachmann Digitální úhloměr +-- 180°, rozlišení na 0,1°', '<p><strong>• Měření úhlů v rozmezí +/-180° s rozlišením 0,1°.<br />• Vybaven automatickým vypínáním.<br />• Možnost uzamčení hodnoty.<br />• Voděodolný.<br />• Zabudovaný magnet.</strong><br /><br />Vybaven možností uzamčení číselné hodnoty úhlu. Vodě odolný digitální úhloměr umožňuje měřit úhly v rozmezí +/- 180° s rozlišením na 0,1°. Digitální úhloměr je vybaven autovypínáním, je malý a má zabudovaný magnet, pomocí kterého můžete velmi snadno změřit například úhel naklopení pilového kotouče na Vaší pile.</p>', '_vyr_563FDU-001.jpeg', 0, '801.00', '890.00', 'FDU-001', '_vyrn_563FDU-001.jpeg', '', '', '', 21, 1, 1, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2021-01-10 15:44:06'),
(8123, 564, 'IGM Fachmann Digitální úhloměr s ramenem 0°- 220°, rozlišení na 0,05°', 'IGM Fachmann Digitální úhloměr s ramenem 0°- 220°, rozlišení na 0,05°', '<p><strong>• Velký dobře čitelný displej.<br />• Úhloměr a vodováha v jednom.<br />• Měření úhlů v rozmezí 0° - 225°.<br />• Rozlišení 0,05°.<br />• 270mm pravítko.</strong><br /><br />Tento digitální úhloměr s ramenem je měřící nástroj s mnoha funkcemi. Velmi snadno můžete změřit úhel a pomocí pravítka délky 270 mm narýsovat zároveň rysku řezu. Čitelný velký displej Vám ukáže přesný úhel v rozmezí 0° - 225° s rozlišením na 0,05°. Úhloměr slouží zároveň jako vodováha, obsahuje jednu libelu.</p>', '_vyr_564FDU-002.jpeg', 0, '831.00', '923.00', 'FDU-002', '_vyrn_564FDU-002.jpeg', '_vyrp11_564FDU-002-1.jpeg', '_vyrp12_564FDU-002-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-108-0-0|4-0-0-0', NULL, '2021-01-10 15:44:06'),
(8124, 566, 'Virutex vrtací přípravek pro systém 32mm, 215x320 mm', 'Virutex vrtací přípravek pro systém 32mm, 215x320 mm', '<p style=\\\"font-size: 20px;\\\"><strong>Popis výrobku:</strong></p>\\n<p>Nenahraditelné polohovací zařízení, užitečné pro výrobu vitrín a výrobu nábytku. Přesnost dvoustranného vedení je zachována i po otočení zařízení. Umožňuje vyvrtávat otvory v rozteči 32 mm od sebe, do vnitřních částí korpusů, dvířek a další montážní práce, jako jsou úchytky, pojezdy, podpěry, police a další. Rozměry nástroje jsou 320 x 215 mm a váží 0,35 kg.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', '_vyr_566PMT111.jpg', 0, '3304.00', '3670.00', 'PMT111', '_vyrn_566PMT111.jpg', '_vyrp11_566PMT111-1.jpg', '_vyrp12_566PMT111-2.jpg', '_vyrp13_566PMT111-3.jpg', 21, 1, 1, 0, '', 0, '4-497-498-0|4-497-0-0', NULL, '2021-01-10 15:44:06'),
(8125, 567, 'IGM Flexibilní šablona pro frézování oblouků a křivek - 1000x18x18mm', 'IGM Flexibilní šablona pro frézování oblouků a křivek - 1000x18x18mm', '<p><strong>Pro rychlou a snadnou výrobu oblouků, tvarových lišt, stolů a podobně.</strong><br /><br />Vynikající přípravky pro rychlé a přesné vytvoření šablony pro tvarové frézování. Jsou vyrobeny z flexibilního materiálu, který můžete vytvarovat do požadované podoby a poté jej vruty připevníte k budoucí šabloně. Šablonu připevníte k obráběnému dílci a pomocí kopírovacího ložiska na stopkové fréze nebo frézovací hlavě kopírujete požadovaný tvar.</p>', '_vyr_567FLF-121200.jpeg', 0, '1480.00', '1644.00', 'FLF-181000', '_vyrn_567FLF-121200.jpeg', '_vyrp11_567FLF-121200-1.jpeg', '_vyrp12_567FLF-121200-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-107-385-0', NULL, '2021-01-10 15:44:06'),
(8126, 568, 'Flexibilní šablona pro frézování oblouků a křivek - 1200x12x12mm', 'Flexibilní šablona pro frézování oblouků a křivek - 1200x12x12mm', '<p><strong>Pro rychlou a snadnou výrobu oblouků, tvarových lišt, stolů a podobně.</strong><br /><br />Vynikající přípravky pro rychlé a přesné vytvoření šablony pro tvarové frézování. Jsou vyrobeny z flexibilního materiálu, který můžete vytvarovat do požadované podoby a poté jej vruty připevníte k budoucí šabloně. Šablonu připevníte k obráběnému dílci a pomocí kopírovacího ložiska na stopkové fréze nebo frézovací hlavě kopírujete požadovaný tvar.</p>', '_vyr_568FLF-121200.jpeg', 0, '1690.40', '1605.88', 'FLF-121200', '_vyrn_568FLF-121200.jpeg', '_vyrp11_568FLF-121200-1.jpeg', '_vyrp12_568FLF-121200-2.jpeg', '', 21, 1, 0, 0, '', 0, '4-107-385-0|4-0-0-0|4-107-0-0', NULL, '2021-01-10 15:44:06'),
(8127, 569, 'IGM Flexibilní šablona pro frézování oblouků a křivek - 2000x18x18mm', 'IGM Flexibilní šablona pro frézování oblouků a křivek - 2000x18x18mm', '<p><strong>Pro rychlou a snadnou výrobu oblouků, tvarových lišt, stolů a podobně.</strong><br /><br />Vynikající přípravky pro rychlé a přesné vytvoření šablony pro tvarové frézování. Jsou vyrobeny z flexibilního materiálu, který můžete vytvarovat do požadované podoby a poté jej vruty připevníte k budoucí šabloně. Šablonu připevníte k obráběnému dílci a pomocí kopírovacího ložiska na stopkové fréze nebo frézovací hlavě kopírujete požadovaný tvar.</p>', '_vyr_569FLF-121200.jpeg', 0, '3045.00', '3383.00', 'FLF-182000', '_vyrn_569FLF-121200.jpeg', '_vyrp11_569FLF-121200-1.jpeg', '_vyrp12_569FLF-121200-2.jpeg', '', 21, 1, 1, 0, '', 0, '4-107-385-0', NULL, '2021-01-10 15:44:06'),
(8128, 570, 'Virutex vrtací přípravek pro systém 32mm, 215x810 mm', 'Virutex vrtací přípravek pro systém 32mm, 215x810 mm', '<p style=\\\"font-size: 20px;\\\"><strong>Popis výrobku:</strong></p>\\n<p>Nenahraditelné polohovací zařízení, užitečné pro výrobu vitrín i nábytku. Přesnost dvoustranného vedení je zachována i po otočení zařízení. Umožňuje vyvrtávat otvory v rozteči 32 mm od sebe, do vnitřních částí korpusů, dvířek a další montážní práce, jako jsou úchytky, pojezdy, podpěry, police a další. Rozměry nastroje jsou 810 x 215 mm a váží 1,20 kg. Součástí standartní výbavy je vrták o průměru 5 mm, držák, zátka, dvě ramena s kalenými pouzdry, 3 náhradní šrouby, prodloužení.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % o', '_vyr_570PMT111T.jpg', 0, '5430.00', '0.00', 'PMT111T', '_vyrn_570PMT111T.jpg', '_vyrp11_570PMT111T-1.jpg', '_vyrp12_570PMT111T-2.jpg', '_vyrp13_570PMT111T-3.jpg', 21, 1, 1, 1, '', 0, '4-497-498-0|4-497-0-0', NULL, '2021-01-10 15:44:06'),
(8129, 571, 'Virutex Ruční mechanická nanášečka lepidla', 'Virutex EM25D ruční mechanická nanášečka lepidla', '<p><span class=\\\"bullet-line\\\">Ruční mechanická nanášečka lepidla. </span></p>\\n<p><span class=\\\"bullet-line\\\"><br /></span><span class=\\\"bullet-line\\\">Je konstruována k čistému, rychlému a efektivnímu nanášení lepidla především na větší plochy. <br /></span><span class=\\\"bullet-line\\\">Je vybavena dvěma nanášecími válci:<br /></span><span class=\\\"bullet-line\\\">                                           <strong>Spodním</strong> - ten umožňuje nanášet lepidlo odvalováním nanášečky po dílci.<br /></span><span class=\\\"bullet-line\\\">                                           <strong>Horním</strong> - ten umožňuje nanášet lepidlo unášením dílce po nanášečce, která je uchycena do stojanu.</span></p>\\n<p><span class=\\\"bullet-line\\\"><br /></span><span class=\\\"bullet-line\\\">Nanášečka je velice praktickým pomocníkem ať už v truhlářské výrobě tak i v čalounictví apod.</span></p>\\n<div class=\\\"parameters--row\\\">\\n<div class=\\\"parameters-column--title\\\">Šířka spodního válce:  122 mm</div>\\n</div>\\n<', '_vyr_571EM25D.jpg', 0, '3341.00', '3713.00', 'EM25D', '_vyrn_571EM25D.jpg', '_vyrp11_571EM25D-1.jpg', '_vyrp12_571EM25D-2.jpg', '_vyrp13_571EM25D-3.jpg', 21, 1, 1, 0, '', 0, '5-428-0-0|5-0-0-0', NULL, '2021-01-10 15:44:06');
