(8130, 572, 'CMT C512 Sukovník ruční - D14 L90 S=10x60 HM P', 'CMT C512 Sukovník ruční - D14 L90 S=10x60 HM P', '<p>Osvědčený sukovník CMT má 2 předřezávací hroty, centrovací hrot a 2 řezné zuby.<br />Všechny hroty jsou z tvrdokovu určeného pro vrtání do měkkého i tvrdého dřeva.<br />Výborný i pro vrtání do lamino desek.<br />Kvalitní a přesný nástroj.<br />Pro ruční i stacionární vrtačky.</p>', '_vyr_57225805696-_-_-o.jpg', 0, '719.00', '797.00', 'C51214011', '_vyrn_57225805696-_-_-o.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C51214011/C51214011_2_web.jpg', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:06'),
(8131, 573, 'CMT C513 Sukovník ruční - D15 L120 S=13x50 HM P', 'CMT C513 Sukovník ruční - D15 L120 S=13x50 HM P', '<p>Masivní sukovník CMT řady C513 má dlouhou masivní stopku o průměru 13 mm.<br />Má 2 předřezávací hroty, centrovací hrot a 2 řezné zuby.<br />Všechny hroty jsou z tvrdokovu určeného pro vrtání do měkkého i tvrdého dřeva.<br />Výborný i pro vrtání do lamino desek.<br />Masivní  nástroj pro stacionární vrtačky.</p>', '_vyr_57325805696-_-_-o.jpg', 0, '1223.00', '1359.00', 'C51315011', '_vyrn_57325805696-_-_-o.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C51315011/C51315011_2_web.jpg', '', '', 21, 1, 1, 0, '', 0, '2-5-0-0|2-5-293-0|2-5-293-373|12-0-0-0|12-599-0-0', NULL, '2021-01-10 15:44:06'),
(8132, 574, 'IGM A8 Tlakový dávkovač lepidla, ocelový, 8 kg', 'A8 Tlakový dávkovač lepidla, ocelový, 8 kg', '<h4>Cena / provedení.</h4>\\n<p><strong>Dávkovač s tlakovou nádobou z kvalitní oceli pro malé a střední dílny.<br />Výborný poměr ceny a provedení.</strong><br /><br /><em>• Tlaková nádoba: Ocel<br />• Kapacita náplně: 8 kg<br />• Maximální tlak: 5 bar<br />• Hmotnost: 14 kg<br />• Rozměry (D x Š x V): 20 x 20 x 65 cm</em><br /><br />Kvalitní a bezproblémové tlakové dávkovače lepidla razantně snižují pracovní čas při lepení nebo stříkání lepidel a barev v porovnání s klasickým způsobem aplikace. Jsou určeny pro disperzní vodou ředitelná lepidla (PVA) pro vysokopevnostní spoje dřeva. Se speciální dávkovací nebo stříkací pistolí lze aplikovat také PUR lepidla nebo stříkat lepidla a barvy na bázi rozpouštědel, či vodou ředitelná. Dávkovače jsou spolehlivé, efektivní a snadno se udržují. V nabídce je široké množství nástavců a trysek pro lepení kolíkových, čepových nebo lamelových spojů, pro drážky, na plochy a mnoho dalších řešení. Podívejte se na video, jak dávkovače fungují. Pro vyrábí i', '_vyr_574136-9001.jpg', 0, '13567.00', '13159.99', '136-9001', '', '', '', '', 21, 1, 1, 0, '', 0, '5-428-0-0|5-0-0-0', NULL, '2021-01-10 15:44:06'),
(8133, 575, 'IGM Ruční nanašečka lepidla 74 mm se stojánkem', ' Ruční nanašečka lepidla 74 mm se stojánkem', '<p><strong>• Jednoduše a rovnoměrně nanáší lepidlo na lepené plochy. <br />• Šířka pěnového válečku 74 mm.<br />• Pro disperzní vodou ředitelná lepidla.<br />• Vyrobeno z plastového výlisku, včetně odkládacího stojánku.<br />• Náhradní váleček je součástí dodávky.</strong><br /><br />Jednoduchá a ekonomická nanašečka lepidla je vyrobená z plastu a je určená pro krátkodobé kutilské použití. Součástí dodávky jsou 2 pěnové válečky.<br /><br /><em>• Rozměry balení (DxŠxV): 13x15x20 cm<br />• Rozměry produktu (DxŠxV): 13x24x20 cm<br />• Hmotnost: 0,63 kg</em><br /><br /><strong>Použití:</strong> Vyjměte náhradní váleček z vaničky. Našroubujte rukojeť na vaničku. Nalejte disperzní lepidlo do vaničky.  <br />Páka ve volné pozici – maximální dávka lepidla, páka přitažená – minimální dávka lepidla. </p>', '_vyr_575146-1002.jpg', 0, '400.00', '430.00', '146-1002', '', '_vyrp11_575146-1002-1.jpg', '_vyrp12_575146-1002-2.jpg', '_vyrp13_575146-1002-3.jpg', 21, 1, 1, 0, '', 0, '5-428-0-0|5-0-0-0', NULL, '2021-01-10 15:44:06'),
(8134, 576, 'DD Drážkovací fréza dvoustupňová – d6×10 D10×7 L40 S6 HSS', ' DD Drážkovací fréza dvoustupňová – d6×10 D10×7 L40 S6 HSS', '<ul>\\n<li>Pro frézování drážek pro okenní a dveřní těsnění.</li>\\n<li>Speciální dvoustupňový vybroušení břitů</li>\\n<li>HSS tělo nástroje.</li>\\n</ul>\\n<p>Gamma Zinken drážkovací fréza je určena pro všechny druhy prací. Vyznačuje se kvalitním ostřím, které vyfrézuje dokonalou dvou drážku v masivním dřevě. Pro frézování podle šablony nebo pravítka.</p>', '_vyr_576DD-web.jpg', 0, '427.50', '475.00', 'GZ99', '_vyrn_576DD-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:06'),
(8135, 577, '2LTT Drážkovací fréza prodloužená – D× L S ', ' 2LTT Drážkovací fréza prodloužená – D× L S ', '<ul>\\n<li>Frézy pro přímé zavrtání</li>\\n<li>Po zavrtání můžete frézovat požadovanou výšku řezu</li>\\n<li>Snadné vytvoření drážky nebo výřezu</li>\\n</ul>\\n<p>Gamma Zinken drážkovací fréza se závrtným HM zubem jse určena pro všechny druhy prací včetně zavrtávání do materiálu. HW zavrtávací zub usnadňuje zavrtávání do měkkého a tvrdého dřeva, DTD, lamino desek, MDF a HDF. Nástroj s prodlouženým tělem. Zavrtávací HM břit naostřený pro hluboké zavrtání do materiálu.</p>', '_vyr_5772TTL-web.jpg', 0, '810.00', '900.00', 'GZ1083', '_vyrn_5772TTL-web.jpg', '_vyrp11_5772LTT-1.png', '_vyrp12_5772LTT-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8136, 578, 'C2 Ořezávací fréza se středovým ložiskem – D13×15/15 L60 S6 HW', ' C2 Ořezávací fréza se středovým ložiskem – D13×15/15 L60 S6 HW', '<p>Fréza je určena pro přesné ofrézování přesahů a nákližků na materiálu podle středového materiálu. Výhodou tohoto typu ořezávací frézy je možnost zvolit jakou částí nástroje potřebujete využívat. Možné využít jako nástroj k ořezávání se spodním, horním nebo středovým ložiskem.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>Využtí na materiál od 15mm do 30mm nebo od 25mm do 50mm.</li>\\n<li>Ořezávací fréza se středovým ložiskem s minimální vzdálenost mezi břity je 10 mm.</li>\\n</ul>', '_vyr_578C2-web.jpg', 0, '1012.50', '1125.00', 'GZ913', '_vyrn_578C2-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-390|14-0-0-0|14-611-0-0|14-611-625-0', NULL, '2021-01-10 15:44:06'),
(8137, 579, 'G1 Vyřezávací fréza na otvory – D6×15 L60 S6 HW', ' G1 Vyřezávací fréza na otvory – D6×15 L60 S6 HW', '<ul>\\n<li>Unikátní a časově úsporná fréza.</li>\\n<li>Ořezávání horní desky</li>\\n<li>HM celotvrdokovové tělo nástroje.</li>\\n</ul>', '_vyr_579G1-web.jpg', 0, '630.00', '700.00', 'GZ156', '_vyrn_579G1-web.jpg', '_vyrp11_579G1-1.png', '_vyrp12_579G1-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-319|14-0-0-0|14-611-0-0|14-611-629-0', NULL, '2021-01-10 15:44:06'),
(8138, 580, 'G2 Vyřezávací fréza na otvory – D6×15 L70 S6 HW', ' G2 Vyřezávací fréza na otvory – D6×15 L70 S6 HW', '<ul>\\n<li>Unikátní a časově úsporná fréza.</li>\\n<li>Ořezávání dolní a horní desky najednou.</li>\\n<li>HM celotvrdokovové tělo nástroje.</li>\\n</ul>', '_vyr_580G2-web.jpg', 0, '765.00', '850.00', 'GZ158', '_vyrn_580G2-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-12-0|2-1-12-319|14-0-0-0|14-611-0-0|14-611-629-0', NULL, '2021-01-10 15:44:06'),
(8139, 581, 'NC1 Úhlová fréza bez ložiska – 30° D21×10 L50 S6 HW', ' NC1 Úhlová fréza bez ložiska – 30° D21×10 L50 S6 HW', '<p>Úhlová fréza Gamma Zinken je určena pro ořezávání a srážení hran na širokém spektru materiálů dřevo, DTD, lamino, HPL nebo Corian. Fréza je bez ložiska. Určen pro CNC a ruční frézování pomocí pravítka.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>CNC</li>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW</li>\\n</ul>', '_vyr_581NC1-web.jpg', 0, '720.00', '800.00', 'GZ149', '_vyrn_581NC1-web.jpg', '_vyrp11_581NC1-1.png', '_vyrp12_581NC1-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-13-0|2-1-13-320|14-0-0-0|14-612-0-0|14-612-630-0', NULL, '2021-01-10 15:44:06'),
