(8141, 583, 'N Dlabací a srovnávací fréza – D19×20 L50 S6 HW', ' N Dlabací a srovnávací fréza – D19×20 L50 S6 HW', '<p>Dlabací a srovnávací fréza Gamma Zinken je ideální pro pološné frézovací např. Dlaby, panty apod. Fréza je vhodná na široké spektru materiálů dřevo, DTD, lamino, HPL nebo Corian.</p>\\n<p><strong>Specifikace:</strong></p>\\n<ul>\\n<li>MAN, MEC</li>\\n<li>Z2</li>\\n<li>HW</li>\\n</ul>', '_vyr_583N-web.jpg', 0, '697.50', '775.00', 'GZ148', '_vyrn_583N-web.jpg', '_vyrp11_583N-1.png', '_vyrp12_583N-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8142, 584, 'Bvr Drážkovací fréza dvoustupňová – d2,2×3 D6×5 L50 S6 HW', ' Bvr Drážkovací fréza dvoustupňová – d2,2×3 D6×5 L50 S6 HW', '<ul>\\n<li>Pro frézování drážek ozdobných a dekorativních lišt.</li>\\n<li>Speciální dvoustupňový vybroušení břitů.</li>\\n<li>HWM tělo nástroje.</li>\\n</ul>\\n<p>Gamma Zinken drážkovací fréza je určena k vyfrézování drážek pro vložení dekorativních a ozdobných lišt. Vyznačuje se kvalitním ostřím, které vyfrézuje dokonalou dvou drážku v masivním dřevě. Ideální pro frézování podle šablony nebo pravítka.</p>', '_vyr_584DD-web.jpg', 0, '855.00', '950.00', 'GZ3687', '_vyrn_584DD-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:06'),
(8143, 585, 'IP Fréza na spojení spárovky – D16×30 L50 S6 ', ' IP Fréza na spojení spárovky – D16×30 L50 S6 ', '<ul>\\n<li>Pro frézování spojů v masivním dřevu.</li>\\n<li>SV zuby pro pevné spojení.</li>\\n<li>HW zuby nástroje.</li>\\n</ul>\\n<p>Gamma Zinken fréza na spoje je určena k vyfrézování spojů pro spojování dřeva na šířku. Vyznačuje se kvalitním ostřím, které vyfrézuje dokonalý spoj v masivním dřevě. Ideální pro frézování ve frézovacím stolku nebo podle pravítka.</p>', '_vyr_585IP-web.jpg', 0, '1012.50', '1125.00', 'GZ949', '_vyrn_585IP-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-338|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:06'),
(8144, 586, 'OvvO Stopková drážkovací fréza – D12×13 L70 S8 ', ' OvvO Stopková drážkovací fréza – D12×13 L70 S8 ', '<p>Stopková fréza Gamma Zinken pro Sytem OVVO 1240.</p>', '_vyr_586GZ-4142.png', 0, '877.50', '975.00', 'GZ4142', '_vyrn_586GZ-4142.png', '_vyrp11_586GZ-4142-1.png', '_vyrp12_586GZ-4142-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-311|14-0-0-0|14-610-0-0|14-610-620-0', NULL, '2021-01-10 15:44:06'),
(8145, 587, '3 Fréza pro rybinový spoj – D11×15 L50 S6 7° HW', ' 3 Fréza pro rybinový spoj – D11×15 L50 S6 7° HW', '<ul>\\n<li>Pro frézování rybinových spojů.</li>\\n<li>Masivní krček nástroje</li>\\n<li>HW zuby nástroje</li>\\n</ul>\\n<p>Gamma Zinken fréza na rybonové spoje je perfektně zpracovaný nástroj pro rybinový (cinkový) spoj, který bývá výzvou pro profesionály i amatéry. Rybinové frézy dodáváme v několika velikostech. Rybinové frézy jsou konstruovány tak, aby všechny většině oblíbeným přípravkům, včetně systémů , Leigh, DeWalt, TREND, FESTO, BOSCH atd.</p>', '_vyr_5873-web.jpg', 0, '652.50', '725.00', 'GZ130', '_vyrn_5873-web.jpg', '_vyrp11_5873-1.png', '_vyrp12_5873-2.png', '_vyrp13_5873-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-16-0|2-1-16-331|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:06'),
(8146, 588, '3C Fréza pro rybinový spoj s ložiskem – D10×10 L50 S6 10° HW', ' 3C Fréza pro rybinový spoj s ložiskem – D10×10 L50 S6 10° HW', '<ul>\\n<li>Pro frézování rybinových spojů.</li>\\n<li>Masivní krček nástroje.</li>\\n<li>HW zuby nástroje.</li>\\n</ul>\\n<p>Gamma Zinken fréza na rybonové spoje je perfektně zpracovaný nástroj pro rybinový (cinkový) spoj, který bývá výzvou pro profesionály i amatéry. Rybinové frézy dodáváme v několika velikostech. Rybinové frézy jsou konstruovány tak, aby všechny většině oblíbeným přípravkům, včetně systémů , Leigh, DeWalt, TREND, FESTO, BOSCH atd. Nástroj je pro snadné použití vybavený ložiskem.</p>', '_vyr_5883C--web.jpg', 0, '832.50', '925.00', 'GZ2923', '_vyrn_5883C--web.jpg', '_vyrp11_5883C-1.png', '_vyrp12_5883-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-16-0|2-1-16-334|14-0-0-0|14-615-0-0', NULL, '2021-01-10 15:44:06'),
(8147, 589, 'C2S Úhlová fréza na Corian – D32×25 L57 S12 15° HW', ' C2S Úhlová fréza na Corian – D32×25 L57 S12 15° HW', '<p>Tato fréza je určena pro spojení horní pracovní desky a umyvadla nebo dřezu Corianu pod úhlem 15°.</p>\\n<p>Fréza je vybavena ložiskem s ochranou proti špinění materiálu. Určená pro ruční horní frézky. Frézuje také velmi dobře jakékoliv materiály ze dřeva nebo dřevěných materiálů. Ideální pro výrobu kuchyňských dřezů nebo koupelnových umyvadel.</p>', '_vyr_589C2S-K-web.jpg', 0, '1237.50', '1375.00', 'GZ3273', '_vyrn_589C2S-K-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-351-0|14-0-0-0|14-618-0-0', NULL, '2021-01-10 15:44:06'),
(8148, 590, '7CK Rádiusová fréza na Corian – D50×25 L60 S12 15° R=12,7 HW', ' 7CK Rádiusová fréza na Corian – D50×25 L60 S12 15° R=12,7 HW', '<p>Fréza je určena k zaoblení a zaříznutí hrany umyvadla po jeho sestavení. Může být použita s frézkou, která předfrézuje zkosení hrany umyvadla s miskou. Je vybavena ložiskem s ochranou proti špinění materiálu. Určená pro ruční horní frézky.</p>', '_vyr_5907C-K-web.jpg', 0, '1687.50', '1875.00', 'GZ3274', '_vyrn_5907C-K-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-351-0|14-0-0-0|14-618-0-0', NULL, '2021-01-10 15:44:06'),
(8149, 591, '4 Čelní úhlová fréza – D25×18 L50 S6 32° HW', ' 4 Čelní úhlová fréza – D25×18 L50 S6 32° HW', '<p>Fréza se zkosením je určena pro spojení masivu a konstrukčních prvků. Čelní úhlové frézy mohou být použity pro šikmé frézování nebo pro výrobu křížových spojů dvou materiálů. Tento spoj vám umožní vytvořit rámů a předělení panelů nebo dveřních příček.</p>', '_vyr_5914-web.jpg', 0, '877.50', '975.00', 'GZ134', '_vyrn_5914-web.jpg', '_vyrp11_5914-1.png', '_vyrp12_5914-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-328|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8150, 592, '6 Drážkovací fréza se zaobleným dnem – D8×14 L50 S6 R=4 HW', ' 6 Drážkovací fréza se zaobleným dnem – D8×14 L50 S6 R=4 HW', '<p>Fréza se zaobleným dnem Vám umožní vytvořit rytiny do jakéhokoliv dřeva nebo dřevěného výrobku. Nabízíme kompletní výběr průměrů a řezných hloubek, abyste dosáhli požadovaného výsledku. S použitím frézovacího stolku můžete frézovat až do hloubky 25 mm a vytvořit zaoblenou drážku až 40mm. Větší průměry fréz je možné osadit horním ložiskem, poté můžete použit vlastní šablonu nepravidelného tvaru.</p>', '_vyr_5926-web.jpg', 0, '562.50', '625.00', 'GZ137', '_vyrn_5926-web.jpg', '_vyrp11_5926-1.png', '_vyrp12_5926-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-329|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8151, 593, '6/2SC Zaoblovací fréza vypouklá – D25×11 L50 S6 R=4 HW', ' 6/2SC Zaoblovací fréza vypouklá – D25×11 L50 S6 R=4 HW', '<p>Zaoblovací vypouklá fréza Gamma Zinken je ideální pro výrobu hran s ozdobným profilem. Frézuje běžný profil s jemným horním osazením, nebo dvěma osazeními a to pouze výměnou ložiska Dodává nábytku zvláštní vzhled.</p>\\n<ul>\\n<li>Tělo nástroje z prvotřídní oceli.</li>\\n<li>HW tvrdokovové břity.</li>\\n<li>Povrch nástroje s nepřilnavou vrstvou.</li>\\n</ul>', '_vyr_5936-2SC-web.jpg', 0, '877.50', '975.00', 'GZ2438', '_vyrn_5936-2SC-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-324|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8152, 594, '6CS Zaoblovací fréza vypouklá – D23×14 L50 S6 R=5 HW', ' 6CS Zaoblovací fréza vypouklá – D23×14 L50 S6 R=5 HW', '<p>Zaoblovací vypouklá fréza Gamma Zinken je ideální pro výrobu hran s ozdobným profilem. Vyfrézujete jemný ozdobný profil, který dodává nábytku zvláštní vzhled.</p>\\n<p> </p>\\n<ul>\\n<li>Tělo nástroje z prvotřídní oceli.</li>\\n<li>HW tvrdokovové břity.</li>\\n<li>Povrch nástroje s nepřilnavou vrstvou.</li>\\n</ul>', '_vyr_5946SC-web.jpg', 0, '742.50', '825.00', 'GZ140', '_vyrn_5946SC-web.jpg', '_vyrp11_5946SC-1.png', '_vyrp12_5946SC-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-324|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8153, 595, '7 Zaoblovací fréza vydutá – D18×11 L50 S6 R=5 HW', ' 7 Zaoblovací fréza vydutá – D18×11 L50 S6 R=5 HW', '<p>Zaoblovací vydutá fréza Gamma Zinken je ideální pro frézování oblých tvarů nebo kulatin. Jednoduchou úpravou výšky nebo hloubky řezu změníte hloubku a tvar profilu. Můžete použít na frézovacích stolech nebo v ruční frézce podle pravítka. Použití: Je univerzální, umožňuje vyrábět krásné okraje, hrany a lišty. Použijte tyto frézy pro výrobu široké škály jednoduchých a dvojitých okrajových profilů a zaoblení.</p>', '_vyr_5957-web.jpg', 0, '652.50', '725.00', 'GZ141', '_vyrn_5957-web.jpg', '_vyrp11_5957-1.png', '_vyrp12_5957-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-323|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8154, 596, '7V Rádiusová fréza čelní – D8×8 L50 S6 R=4 HW', ' 7V Rádiusová fréza čelní – D8×8 L50 S6 R=4 HW', '<p>Široká nabídka profilových fréz Gamma Zinken je určena pro výrobce skříněk a nábytku. Každá profilová fréza může být upravena pro výrobu profilů pouhou změnou hloubky. Ideální nástroj pro ozdobné frézování čel dvířek.</p>\\n<p>Použití: Pro klasický jednoduchý nebo dvojitý okraj hrany. Ideální pro vytváření dekoračních efektů na deskách, dveřích a zásuvkách.</p>', '_vyr_5967V-web.jpg', 0, '720.00', '800.00', 'GZ741', '_vyrn_5967V-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-329|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8155, 597, '7BA Fréza na hrany stolu a madla zábradlí – D42×12 d=13 L55 S8 ', ' 7BA Fréza na hrany stolu a madla zábradlí – D42×12 d=13 L55 S8 ', '<p>Zaoblovací fréza Gamma Zinken doplňuje sestavu na zábradlí a hrany stolů. Elipsovitá radiusová výseč se skvěle hodí pro zábradlí s prvky funkcionalismu.</p>\\n<p>Frézy na zábradlí a hrany stolů s pozvolným rádiusovým zaoblením Vám umožní vyrábět krásné a funkční zábradlí nebo nádherné hrany rustikálních stolů.</p>\\n<p>VTato široko-profilová fréza při frézování ubírá velké množství materiálu a vytváří velké množství pilin. Pro snadnější a bezpečnější práci doporučujeme frázovat ve frézovacím stolku.</p>', '_vyr_5977BA-web.jpg', 0, '1237.50', '1375.00', 'GZ1898', '_vyrn_5977BA-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-322|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8156, 598, '2/7 Fréza drážkovací se zaoblením hrany – D12/20×35 h1=35 L73 S8 R = 3 HW', ' 2/7 Fréza drážkovací se zaoblením hrany – D12/20×35 h1=35 L73 S8 R = 3 HW', '<p>Drážkovací fréza se zaoblením fréza Gamma Zinken nabízí jedinečné využití pro více operací.</p>\\n<p>Fréza díky své konstrukci drážkovací části a zaoblovací části nabízí jedinečné využití při drážkování a ořezávání se zaoblením horní hrany.</p>\\n<p>Tato víceúčelová drážkovací fréza je praktickým nástrojem. Je určena pro frézování masivního dřeva, lamina, DTD, MDF, HPL nebo Corianu.</p>', '_vyr_598GZ-2-7.png', 0, '945.00', '1050.00', 'GZ3048', '_vyrn_598GZ-2-7.png', '_vyrp11_598GZ-2-7-1.png', '_vyrp12_598GZ-2-7-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|2-1-14-0|2-1-14-323|14-0-0-0|14-610-0-0|14-610-621-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8157, 599, '8 Fréza profilová čelní – D20×13 L50 S6 R=3+3 HW', ' 8 Fréza profilová čelní – D20×13 L50 S6 R=3+3 HW', '<p>Profilové frézy Gamma Zinken nabízí jedinečné využití pro více operací.</p>\\n<p>Profilové frézy jsou určené pro výrobce skříněk a nábytku. Dodáváme různé profily na hrany stolů, obložení dveří nebo okrasné lišty. Každá profilová fréza může být upravena pro výrobu dvou profilů pouhou výměnou ložiska.</p>\\n<p>profilové frézy jsou praktickým nástrojem k výrobě ozdobných prvků. Jsou určeny pro frézování masivního dřeva, lamina, DTD, MDF, HPL nebo Corianu.</p>', '_vyr_5998-web.jpg', 0, '742.50', '825.00', 'GZ144', '_vyrn_5998-web.jpg', '_vyrp11_5998-1.png', '_vyrp12_5998-2.png', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-330|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
