(8185, 627, '9 Fréza zaoblovací púlkruhová vydutá – D18×16 L50 S6 R=5 HW', ' 9 Fréza zaoblovací púlkruhová vydutá – D18×16 L50 S6 R=5 HW', '<p>Nejpoužívanější zaoblovací fréza, která je určená na zaoblování hran dřeva, MDF s perfektním výsledkem opracování. <br /> Pro obrábění široké struktury a druhů materiálů a to díky HW zubům. Fréza je dodávána bez ložiska. Frézování pomocí pravítka nebo ve frézovacím stolku.</p>\\n<ul>\\n<li>Pro zaoblování i nejobtížnějších dílů</li>\\n<li>HM tvrdokovové břity</li>\\n<li>Vytvoření pravidelného púlkruhu v jedné operaci</li>\\n</ul>', '_vyr_6279-web.jpg', 0, '787.50', '875.00', 'GZ928', '_vyrn_6279-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-323|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
