(8187, 629, '9 Fréza zaoblovací púlkruhová vydutá s ložiskem – D23×16 L57 S8 R=5 r=1 HW', ' 9 Fréza zaoblovací púlkruhová vydutá s ložiskem – D23×16 L57 S8 R=5 r=1 HW', '<p>• Pro zaoblování i nejobtížnějších dílů • HM tvrdokovové břity • Vytvoření pravidelného púlkruhu v jedné operaci Nejpoužívanější zaoblovací fréza, která je určená na zaoblování hran dřeva, MDF s perfektním výsledkem opracování. Pro obrábění široké struktury a druhů materiálů a to díky HW zubům. Pro ofrézování široké struktury a druhů materiálů je nástroj vybaven HW zuby. Fréza je osazena spodním ložiskem pro snadné vedení po hraně materiálu a to i na složitých tvarech dílce. stolku.</p>', '_vyr_6299-web.jpg', 0, '1102.50', '1225.00', 'GZ4183', '_vyrn_6299-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-14-0|2-1-14-322|14-0-0-0|14-613-0-0', NULL, '2021-01-10 15:44:06'),
(8188, 630, 'IC Fréza na lepené spoje, zásuvky – D40×14 L50 S8 HW', ' IC Fréza na lepené spoje, zásuvky – D40×14 L50 S8 HW', '<p>• Pro výrobu zásuvek a přesazených dílců • HM tvrdokovové břity • Vytvoření kvalitního spoje Nejpoužívanější spojovací fréza, která je určená na spoje zásuvek a přesazených důlců. Pro ofrézování široké struktury a druhů materiálů je nástroj vybaven HW zuby. Fréza je osazena spodním ložiskem pro snadné vedení po hraně materiálu, čímž se dosahuje větší přesnosti při výrobě.</p>', '_vyr_630IC-web.jpg', 0, '1170.00', '1300.00', 'GZ1990', '_vyrn_630IC-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-18-0|2-1-18-338|14-0-0-0|14-617-0-0', NULL, '2021-01-10 15:44:06'),
(8189, 631, 'T Fréza na T-drážky – D9,5×10 L50 S8 d=5 HW', ' T Fréza na T-drážky – D9,5×10 L50 S8 d=5 HW', '<p>Fréza na T drážky Gamma Zinken je jejdinečným nástrojem pro výrobu T drážek. Touto frézou můžete snadno vyrobit drážky pro speciální profily regálových lišt, závěsného kování, otvorů pro zavěšení rámečků nebo hlavy šroubů. Doporučujeme nejprve předfrézovat drážkovací frézou.</p>', '_vyr_631T-web.jpg', 0, '877.50', '975.00', 'GZ1319', '_vyrn_631T-web.jpg', '_vyrp11_631T-1.png', '_vyrp12_631T-2.png', '_vyrp13_631T-3.png', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-11-0|2-1-11-312|14-0-0-0|14-610-0-0|14-610-621-0', NULL, '2021-01-10 15:44:06'),
(8190, 632, 'S1 Kulová fréza – D12×11 L50 S8 R=6 HW', ' S1 Kulová fréza – D12×11 L50 S8 R=6 HW', '<p>Fréza s kulovým břitem Gamma Zinken je jejdinečným nástrojem pro výrobu drážek nebo ozdobných drážek. Touto frézou můžete snadno vyrobit drážky pro kabely, závěsné kování, otvory pro zavěšení rámečků nebo hlavy šroubů. Doporučujeme nejprve předfrézovat drážkovací frézou.</p>', '_vyr_632S1-web.jpg', 0, '832.50', '925.00', 'GZ3014', '_vyrn_632S1-web.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-0-0|2-1-15-0|2-1-15-329|14-0-0-0|14-614-0-0', NULL, '2021-01-10 15:44:06'),
(8191, 633, 'HOLZMANN KAM35MAX OLEPOVAČKA HRAN', 'OLEPOVAČKA HRAN HOLZMANN KAM 35MAX', '<h2 style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">OLEPOVAČKA HRAN HOLZMANN KAM35MAX S PŘEDFRÉZEM</span></h2>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">V PŘÍPADĚ ŽE NENÍ SKLADEM, INFROMUJTE SE PŘED OBJEDNÁNÍM NA TERMÍN NASKLADNĚNÍ</span></p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\"> </span></p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: 14pt;\\\">Ilustrační foto: Holzmann KAM 35 MAX 400V</span></p>\\n<table style=\\\"border: 1px solid #000000; width: 100 %; background-color: #ff0000;\\\" border=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td><span style=\\\"font-size: 14pt;\\\"><strong>POPIS OLEPOVAČKY HRAN HOLZMANN</strong></span></td>\\n</tr>\\n</tbody>\\n</table>\\n<ul>\\n<li><span style=\\\"font-size: 14pt;\\\">Jednostranný automatický olepovací stroj <b>S PŘEDFRÉZOVACÍM AGREGÁTEM</b></span></li>\\n<li><span style=\\\"font-size: 14pt;\\\">Pro lepení hran z masivního dřeva až do tloušťky 3mm, PVC ABS hrany do 2mm</span></li>\\n<li><span style=\\\"fo', '_vyr_633_vyr_3505kam35max-400v.jpg', 0, '256931.20', '0.00', 'HMKAM35MAX', '_vyrn_633_vyr_3505kam35max-400v.jpg', '_vyrp11_633_vyrp12_350522555657_2061091317459349_3956671211232655641_o.jpg', '_vyrp12_633_vyrp13_350522555536_2061097004125447_1202576488290772278_o.jpg', '_vyrp13_633_vyrp14_350522555587_2061091320792682_4559355216815209540_o.jpg', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-62-426-0', NULL, '2021-01-10 15:44:06');
