(8196, 639, 'HOLZMANN TS315VF3200 400V FORMÁTOVACÍ PILA', 'FORMÁTOVACÍ PILA HOLZMANN TS 315VF 3,2M STŮL 400 V', '<h1 id=\\\"h1-fig\\\">Formátovací pila HOLZMANN TS 315VF 3200 - 3,2 m fotmátovací stůl 400 V</h1>\\n<p>Precizní<strong> formátovací pila od kvalitního výrobce HOLZMANN</strong> je vhodná k řezání materiálů, které se opracovávají podobně jako dřevo. Především je to dřevo, plast a papír. Jednou z mnoha předností tohoto přístroje je <strong>dvojitý masivní litinový stůl</strong>, který má také <strong>prodloužení a rozšíření s podpěrnou nohou</strong>. Toto rozšíření se stejně jako nosná tyč pravítka může rychle sklopit dolů. Stabilitu stroje zlepšuje také <strong>zesílený stojan v místě posuvného stolu</strong>. Další výhodou je <strong>náklopný a výškově přestavitelný kotouč s předřezem</strong>. Šířka řezu vpravo od kotouče může být až<strong> 1260 mm</strong>. Pilá má také lehce ovladatelné a robustní <strong>podélné pravítko</strong> s rychloupínačem na nosnou tyčí a <strong>teleskopické úhlovací pravítko</strong> s odklopným dorazem. Manipulaci s obrobkem usnadňuje <strong>váleček</stron', '_vyr_6395238_4250__vyr_890TS-315VF-2600.jpg', 0, '75088.90', '0.00', '2HLMTS315VF3200', '_vyrn_6395238_4250__vyr_890TS-315VF-2600.jpg', '_vyrp11_6395238_4250_d__vyrp11_338Hz_TS315VF-3200.jpg', '_vyrp12_6395238_4250_d__vyrp12_338TS-315VF-2600_det1.jpg', '_vyrp13_6395238_4250_d__vyrp13_338TS-315VF-2600_det2.jpg', 21, 1, 1, 0, '9,12E+12', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
