(8202, 646, 'HOLZMANN TS315F 1500 400V KOTOUČOVÁ PILA', 'KOTOUČOVÁ PILA HOLZMANN TS 315F 1500 400 V', '<h1 id=\\\"h1-fig\\\">Stolní kotoučová pila HOLZMANN TS 315F 1500</h1>\\n<p><strong>Stolní kotoučová pila HOLZMANN TS 315F 1500</strong> může být skvělým pomocníkem ve vaší dílně. Díky<strong> promyšleným odsávacím výstupům umístěným z vrchu i spodu stroje</strong>, které vás zbaví přebytečného prachu, bude vaše práce jednodušší jako nikdy předtím a dosáhnete perfektních výsledků. <strong>Pilový kotouč s průměrem 315 mm</strong> je jak úhlově, tak výškově nastavitelný a dokáže řezat až do výšky 100 mm. Vpravo můžete řezat až do šíře 940 mm. Dlouhou životnost pily zajišťuje mimojiné <strong>stůl vyrobený z pevné šedé litiny</strong>.<strong> Formátovací stůl je dlouhý 1500 mm</strong> a součástí je také podpěrný rám. Nemůže chybět ani<strong> výsuvné příčné pravítko s dorazem</strong> nebo <strong>podélné AL pravítko s pojezdem</strong> na masivní tyči. Celkově je tento přístroj velmi kvalitní a spolehlivý.</p>\\n<h2 id=\\\"h2-fig\\\">Výbava:</h2>\\n<ul>\\n<li>Odsávací výstupy pro bezprašnou práci<', '5238_4247__vyr_948TS315F-1500_LQ01.jpg', 0, '47417.30', '0.00', '2HLMTS315F1500-400', '_vyrn_6465238_4247__vyr_948TS315F-1500_LQ01.jpg', '_vyrp11_6465238_4247__vyrp114_9485940-big.jpg', '_vyrp12_6465238_4247__vyrp115_9485941-big.jpg', '_vyrp13_6465238_4247__vyrp111_9485935-big.jpg', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-0-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
