(8210, 654, 'HOLZSTAR HBS473 PÁSOVÁ PILA', 'DOPRAVA ZDARMA PÁSOVÁ PILA HOLZSTAR HBS 473', '<h1 id=\\\"h1-fig\\\">Pásová pila HOLZSTAR HBS 473</h1>\\n<p>Tato velmi<strong> kompaktní pásová pila na dřevo</strong> je vhodná pro <strong>náročné hobby použití</strong> a domácí dílnu s uzavřeným podstavcem. Tento přístroj zaručuje <strong>přesné řezání dřeva, plastu i neželezných kovů</strong>. Tuhá svařovaná <strong>konstrukce je velmi stabilní</strong> i přes to, že ložná plocha je malá. Kvalitní <strong>masivní stůl pily</strong> je z šedé litiny s přesně broušeným povrchem a je připevněn na kyvném uložení.<strong> Sklon</strong> tohoto stolu je možné nastavit v rozsahu <strong>0-45°</strong>. Samozřejmostí je <strong>přesné tříkladkové vedení pilového pásu nahoře i dole</strong> pro pásy šířky 6-25 mm. Výměna pásu je snadná a rychlá díky rychloupínací páce s výstředníkem, beze změny základního nastavení. Nechybí ani<strong> hliníkový příložník s excentrickým rychloupínáním, lupou a pravítkem</strong>. Přístroj je v<strong> dvourychlostním provedení 460 a 980 m/min</strong>.</p>\\n<h', '_vyr_654_vyr_2989HBS-473.jpg', 0, '30990.00', '0.00', 'BW5900473', '_vyrn_654_vyr_2989HBS-473.jpg', '', '', '', 21, 1, 1, 3, '', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
(8211, 655, 'HOLZSTAR HBS471 PÁSOVÁ PILA', 'DOPRAVA ZDARMA PÁSOVÁ PILA HOLZSTAR HBS 471', '<h1 id=\\\"h1-fig\\\">Pásová pila HOLZSTAR HBS 471</h1>\\n<p><strong>Kompaktní pásová pila na dřevo</strong> od kvalitního výrobce <strong>HOLZSTAR</strong> je vhodná pro <strong>náročné hobby</strong> použití a domácí dílnu s uzavřeným podstavcem. Tuhá svařovaná konstrukce, která je i přes malou ložnou plochu velmi <strong>stabilní.</strong> Pilový pás má přesné tříkladkové vedení nahoře i dole pro pásy, které mají šířku 6-25 mm. Pilový pás se také pomocí rychloupínací páky s výstředníkem snadně a rychle výmění a to beze změny základního nastavení. Pila zaručuje<strong> přesné řezání dřeva, plastu a dokonce i neželezných kovů</strong>. Součástí přístroje je <strong>masivní a kvalitní stůl vyrobený z šedé litiny</strong> s přesně broušeným povrchem, který je připevněn na kyvném uložení. Sklon stolu si můžete nastavit v rozsahu<strong> 0° až 45°</strong>. Nechybí ani snadno nastavitelný hliníkový příložník s excentrickým rychloupínáním, pravítkem a lupou. Tento spolehlivý stroj má dvourychlo', '_vyr_655_vyr_2990HBS-471.jpg', 0, '34990.00', '0.00', 'BW5900471', '_vyrn_655_vyr_2990HBS-471.jpg', '_vyrp11_2990HBS-471.jpg', '', '', 21, 1, 1, 3, '', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:06'),
