(8214, 658, 'HOLZMANN HBS470PROFI 230V PÁSOVÁ PILA', 'PÁSOVÁ PILA HOLZMANN HBS 470PROFI 230V', '<h1 id=\\\"h1-fig\\\">Pásová pila HOLZMANN HBS 470PROFI 230 V</h1>\\n<p><strong>Pásová pila od špičkové firmy HOLZMANN</strong> se hodí do každé dílny. <strong>Pogumovaná ocelová poháněcí kola</strong> zaručují správný chod vašeho přístroje. Na pile je připevněno <strong>hliníkové podélné pravítko s rychloupínačem</strong>. Pro vysokou přesnost nastavení je zde také<strong> měřítko s odčítací lupou</strong>.<strong> Výšku řezu</strong> si rychle nastavíte pomocí <strong>ručního kola a ozubené tyče</strong>. Kontrolovat napnutí pásu je možné skrz vestavěné okénko.<strong> Šířka pilového pásu</strong> může být <strong>od 6 až do 35 mm</strong>. Stroj je také velmi <strong>výkonný</strong> a je u něj možné nastavit <strong>dvě rychlosti</strong> (380 a 820 U.min^-1). Stůl je možné s pomocí ozubeného vedení<strong> naklánět od 0° až po 45°</strong>. S <strong>výškou 186 cm</strong> se pila vejde do většiny místostí a dílen. Součástí jsou také<strong> 2 odsávací hubice</strong> s průměrem 100 mm', '_vyr_6585238_5264__vyr_1125HBS470.jpg', 0, '25674.70', '0.00', '2HLMHBS470PROFI230', '_vyrn_6585238_5264__vyr_1125HBS470.jpg', '_vyrp11_6585238_5264__vyrp11_112513312753_1797737403794743_8998597612286066133_n.jpg', '_vyrp12_6585238_5264__vyrp12_112513325593_1797737443794739_8727180606967127849_n.jpg', '_vyrp13_6585238_5264__vyrp13_112513331026_1797737437128073_703195927970225955_n.jpg', 21, 1, 1, 3, '', 0, '3-62-399-0|3-62-0-0', NULL, '2021-01-10 15:44:06'),
