(8220, 664, 'HOLZMANN SSAT1000 ODSÁVACÍ BROUSÍCÍ STŮL', 'ODSÁVACÍ BROUSÍCÍ STŮL HOLZMANN SSAT1000', '<h1 id=\\\"h1-fig\\\">Odsávací brousící stůl HOLZMANN SSAT1000</h1>\\n<p><strong>Odsávací stůl HOLZMANN SSAT1000</strong> umožňuje <strong>bezprašné broušení</strong>, takže už není potřebný žádný další extrakční systém. Je <strong>vhodný pro dřevěné části</strong> všech různých druhů. Prodyšné boční panely umožňují také broušení delších obrobků. Díky pogumovaným podpěrám stolu nehrozí poškrábání obrobků. Díky velkému povrchu filtru má stůl <strong>vysoký sací výkon</strong>.</p>\\n<p>Stroj obsahuje <strong>vestavěný ventilátor</strong> a <strong>zasouvací sběrač prachu</strong> na přední straně pro snadnou likvidaci brusného prachu. Filtrovaný odpadní vzduch je na pracovišti recikulován recikulací a zaručuje čistý vzduch při práci.</p>\\n<p>Podobné přístroje naleznete v sekci <a href=\\\"/Velke-stacionarni-stroje-c3_62_2.htm\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Velké stacionární stroje.</a></p>\\n<p></p>', '_vyr_664_vyr_5257SSAT1000.jpg', 0, '18757.80', '0.00', 'HMSSAT1000', '_vyrn_664_vyr_5257SSAT1000.jpg', '', '', '', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
