(8225, 670, 'HOLZMANN FAN4000 VENTILÁTOR', 'VENTILÁTOR HOLZMANN FAN 4000', '<h1 id=\\\"h1-fig\\\">Ventilátor HOLZMANN FAN4000</h1>\\n<p>Ventilátor HOLZMANN FAN4000 Vám nabízí velký výkon o velikosti 6500 m&#179;/h a motor s výkonem 4 kW. Hmotnost tohoto stroje je 55 kilogramů s rozměry 620 × 665 × 795 mm. Vstup/výstup má velikost 250 mm.</p>', '_vyr_670_vyr_4392FAN2200-4000.jpg', 0, '12827.80', '0.00', '1HMFAN4000', '_vyrn_670_vyr_4392FAN2200-4000.jpg', '_vyrp11_670_vyrp11_4392FAN2200-4000a.jpg', '5238_4393__vyrp12_4392FAN2200-4000.jpg', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06');
