(8227, 672, 'HOLZMANN ABS5000SE 400V ODSAVAČ PILIN', 'ODSAVAČ PILIN HOLZMANN ABS 5000SE - 400V', '<h1 in=\\\"h1-fig\\\">Odsavač pilin HOLZMANN ABS 5000SE - 400V</h1>\\n<p>Odsavač <strong>HOLZMANN ABS 5000SE</strong> je výkonné a univerzální zařízení, které se využívá k <strong>odsávání prachu a dřevních pilin</strong> při práci s většinou dřevoobráběcích strojů. Nedochází u něj ke zbytečnému odvětrávání tepla a díky dvou velkým vakům dokáže pojmout<strong> odpad o objemu až 260 litrů</strong>. Odsavač pohání<strong> svařený kovový rotor s 2950 otáčkami za minutu</strong>. <strong>Odsávací kapacita</strong> u tohoto přístroje je <strong>5000 m&#179;/h</strong> a vytváří <strong>podtlak o velikosti 2500 Pa</strong>. Také je zde <strong>motor s výkonem 2,2 kW</strong>. <strong>Napájecí napětí je 400 V</strong>. Solidní plechová konstrukce zajišťuje optimální proudění vzduchu a ke snadné manipulaci slouží<strong> integrovaný podvozek</strong>. Stroj má <strong>výsoký konstantní sací výkon</strong> (i pro trvalý provoz) a disponuje<strong> velkou plochou filtru</strong>. Také je díky<strong>', '_vyr_672_vyr_4107ABS5000SE.jpg', 0, '11838.90', '0.00', '2HLMABS5000SE400V', '_vyrn_672_vyr_4107ABS5000SE.jpg', '_vyrp11_672_vyrp11_4107IMG_5767.jpg', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8228, 674, 'HOLZSTAR SAA3001 (230 V) ODSÁVACÍ ZAŘÍZENÍ', 'ODSÁVACÍ ZAŘÍZENÍ HOLZSTAR SAA 3001 (230 V)', '<h1 id=\\\"h1-fig\\\">Odsávací zařízení HOLZSTAR SAA 3001 (230 V)</h1>\\n<p>Odsávací zařízení <strong>HOLZSTAR SAA 3001</strong> je spolehlivý přístroj určený k <strong>odsávání prachu, třísek, hoblin</strong> a dalšího dřevního odpadu při práci s dřevoobráběcími stroji. <strong>Vyšší sací výkon o velikosti 3910 m&#179;/h</strong> zajišťují <strong>kovové lopatky ventilátoru</strong>. Průměr odsávacího nátrubku je 150 mm a průměr odsávací trubice u rozdělovače je 3 × 100 mm.<strong> Příkon</strong> tohoto přístroje je <strong>2200 W</strong>. Celá stabilní <strong>konstrukce</strong> je vyrobena <strong>z masivního ocelového plechu</strong> (nejsou použity <strong>žádné plasty</strong>). Zařízení je <strong>tiché</strong>, váží 59 kilogramů a má vynikající poměr <strong>cena/výkon</strong>.</p>\\n<p>Můžete také navštívit stránky <a href=\\\"/admin/itatools.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">itatools.cz</a> a <a href=\\\"/admin/aparatea.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">aparatea.cz</a>', '_vyr_674_vyr_3048saa3001.jpg', 0, '10990.00', '0.00', 'BW5922301', '_vyrn_674_vyr_3048saa3001.jpg', '', '', '', 21, 1, 1, 0, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8229, 675, 'HOLZSTAR SAA3003 (400 V) ODSÁVACÍ ZAŘÍZENÍ', 'ODSÁVACÍ ZAŘÍZENÍ HOLZSTAR SAA 3003 (400 V)', '<h1 id=\\\"h1-fig\\\">Odsávací zařízení HOLZSTAR SAA 3003 (400 V)</h1>\\n<p><strong>Odsávací zařízení HOLZSTAR SAA 3003</strong> je zařízení určné pro odsávání prachu, třísek a hoblin při dřevoobráběcích pracích. Výborně se hodí do vaší dílny, která díky němu bude uklizená a čístá. <strong>Kovové lopatky ventilátoru</strong> zaručují <strong>vysoký sací výkon o velikosti 3910 m&#179;/h</strong>. Zařízení je oproti jiným <strong>tiché</strong> a na výrobu jeho stabilní konstrukce byl použit jen <strong>ocelový plech</strong>,<strong> </strong>který je známkou kvality (neobsahuje žádné plasty). Přístroj má<strong> příkon 2200 W</strong>, průměr odsávací trubice trubice u rozdělovače je 3 × 100 mm a průměr odsávacího nátrubku je 150 mm.<strong> Elektrické připojení</strong> je <strong>400 V </strong>a celé zařízení je s hmotností 59 kilogramů mobilní a lehce se s ním manipuluje. Tento výrobek je mezi nelepšími v poměru <strong>cena/výkon</strong>.</p>\\n<h2 id=\\\"h2-fig\\\">Doporučená příslušenstv', '_vyr_6755238_3049__vyr_3048saa3001.jpg', 0, '10990.00', '0.00', 'BW5922303', '_vyrn_6755238_3049__vyr_3048saa3001.jpg', '', '', '', 21, 1, 1, 0, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8230, 676, 'HOLZMANN FAN2200 VENTILÁTOR', 'VENTILÁTOR HOLZMANN FAN 2200', '<h1 in=\\\"h1-fig\\\">Ventilátor HOLZMANN FAN 2200</h1>\\n<p><strong>Ventilátor HOLZMANN FAN 2200</strong> se slušným <strong>výkonem 4000 m&#179;</strong><span><strong>/h</strong> a <strong>výkonem motoru 2,2 kW</strong> je ten pravý přístroj do vaší dílny. S <strong>napětím 400 V</strong> a hmotností <strong>36 kilogramů</strong> se řadí mezi kvalitní produkty.</span></p>\\n<p>Můžete také navštívit webové stránky <a href=\\\"/admin/aparatea.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">aparatea.cz</a> a <a href=\\\"/admin/itatools.cz\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">itatools.cz</a></p>', '_vyr_676_vyr_4392FAN2200-4000.jpg', 0, '8874.90', '0.00', '1HMFAN2200', '_vyrn_676_vyr_4392FAN2200-4000.jpg', '_vyrp11_676_vyrp11_4392FAN2200-4000a.jpg', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8231, 677, 'HOLZMANN ABS1500FF 400V ODSAVAČ PRO ÚKLID', 'ODSAVAČ PRO ÚKLID HOLZMANN ABS 1500FF 400V', '<h1 id=\\\"h1-fig\\\">Odsavač pro úklid HOLZMANN ABS 1500 FF 400 V</h1>\\n<p><strong>Odsavač HOLZMANN ABS 1500 FF 400 V</strong> je všestranný přístroj, který slouží k <strong>odsávání dřevního materiálu</strong> od většiny dřevoobráběcích strojů a k úklidu dílny. Zařízení zbytečně <strong>neodvětrává teplo</strong>. Odsavač je opatřen <strong>speciálním kazetovým filtrem</strong>. Velká <strong>filtrační plocha 2,2 m&#178; </strong>tohoto filtru umožňuje vysoký průchod odsávaného tepla. <strong>Odsávací kapacita</strong> je <strong>1500 m&#179;/h</strong>.<strong> Kolo ventilátoru</strong> je vyrobeno z velmi <strong>odolné oceli</strong>. Přístroj má<strong> pevnou konstrukci z ocelových plechů</strong>, které v porovnání s plastovým krytem <strong>udržuje statické náboje na minimu</strong>. Zařízení zaručuje<strong> konstantní odsávací sílu</strong> i během delší činnosti. Vzniká <strong>podtlak</strong> o velikosti <strong>1020 Pa</strong>. Díky podstavci s kolečky je odsavač <strong>po', '_vyr_677_vyr_3398ABS1500FF.jpg', 0, '7886.00', '0.00', 'HMABS1500FF', '_vyrn_677_vyr_3398ABS1500FF.jpg', '_vyrp11_677_vyrp12_3398ABS1500FF_2.jpg', '_vyrp12_677_vyrp13_3398ABS1500FF_3.jpg', '_vyrp13_3398ABS1500FF_3.jpg', 21, 1, 1, 2, '9,12E+12', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8232, 678, 'HOLZMANN ABS3000SE 400V ODSAVAČ PILIN', 'ODSAVAČ PILIN HOLZMANN ABS 3000SE - 400V', '<h1 id=\\\"h1-fig\\\">Odsavač pilin HOLZMANN ABS 3000SE- 400V</h1>\\n<p></p>\\n<p><strong>Odsavač prachu a pilin HOLZMANN ABS 3000SE</strong> je ideální přístroj k odsávání dřevních a jiných druhů pilin od strojů obrábějících dřevo s<strong> odsávací kapacitou 3000 m&#179;/h</strong>, <strong>podtlakem 1800 Pa</strong> a <strong>napájecím napětím 400 V</strong>. Velkou výhodou je, že odsavač při své práci zbytečně <strong>neodvětrává nahromaděné teplo</strong>.</p>\\n<p>Stroj se skládá z kvalitního svařeného kovového rotoru, filtračního vaku, <strong>velkých odpadních vaků</strong> o<strong> objemu 165 litrů</strong> a <strong>rychloupínače</strong>, který slouží ke snadné výměně a manipulaci vaků. V podstavci jsou také výhodně zabudované kolečka pro snadnější pohyb s odsavačem. Zaručujeme <strong>konstantní sací výkon</strong> a výborný <strong>poměr ceny a výkonu</strong>. </p>\\n<p>Podobné stroje můžete najít v sekci <a href=\\\"/Stroje-a-elektonaradi-c3-0-1-htm\\\" target=\\\"_blank\\\" rel=\\\"noop', '_vyr_6785238_4391__vyr_4104ABS3000SE.jpg', 0, '8874.90', '0.00', '2HLMABS3000SE400V', '_vyrn_6785238_4391__vyr_4104ABS3000SE.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
(8233, 679, 'HOLZMANN ABS3000SE 230V ODSAVAČ PILIN', 'ODSAVAČ PILIN HOLZMANN ABS 3000SE - 230V', '<h1 id=\\\"h1-fig\\\">Odsávač pilin Holzmann ABS 3000SE - 230V</h1>\\n<p><strong>Odsavač prachu</strong> a pilin <strong>HOLZMAN ABS</strong> <strong>3000SE</strong> je univerzální zařízení určené k odsávání dřevního odpadu od většiny dřevoobráběcích strojů <strong>bez zbytečného odvětrávání tepla. </strong>Odsávač je vybavený svařeným kovovým rotorem a má v podstavci zabudovaná kolečka, která slouží k lepší manipulaci.</p>\\n<p>Přístroj má <strong>velký výkon</strong> při malých nárocích na prostor a má také <strong>velké odpadní vaky</strong> pro lepší práci s rychloupínačem pro lehčí zacházení. Garantujeme <strong>konstatní sací výkon</strong> s výborným poměrem <strong>cena/výkon</strong>.</p>\\n<p> Můžete také navštívit naše webové stránky <a href=\\\"https://www.aparatea.cz/#page\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">aparatea.cz</a> a <a href=\\\"https://www.itatools.cz/\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">itatools.cz</a>.</p>\\n<h2 id=\\\"h2-fig\\\">Výbava:</h2>\\n<ul>\\n<li>Kovový rotor</li>\\n<l', '_vyr_6795238_4391__vyr_4104ABS3000SE.jpg', 0, '8874.90', '0.00', '2HLMABS3000SE230V', '_vyrn_6795238_4391__vyr_4104ABS3000SE.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:06'),
