(8269, 728, 'HOLZMANN TS250F1600 230V KOTOUČOVÁ STOLNÍ PILA', 'STOLNÍ PILA HOLZMANN TS 250F - 1600 230 V', '<h1 id=\\\"h1-fig\\\">Stolní pila HOLZMANN TS 250F1600 230 V</h1>\\n<p><strong>Stolní pila TS 250F1600 230 V</strong> od špičkového výrobce HOLZMANN se pyšní <strong>nejlepším poměrem cena/výkon</strong> v kategorii kotoučových pil. Je vhodná do každé dílny a jejím výběrem neuděláte chybu. Její <strong>litinový stůl</strong> je velmi <strong>robustní a stabilní</strong>, samozřejmě nechybí ani jeho výhodné prodloužení. Namontovaný <strong>kovový pilový kotouč s průměrem 250 mm</strong> je zárukou špičkového řezání. Na jeho krytu je zabudovaný také odsávací výstup pro bezprašnou práci.<strong> Formátovací stůl o délce 1600 mm</strong> má <strong>podpěrný rám se zabudovaným válečkem</strong> pro kvalitnější práci. Je zde i <strong>teleskopické pravítko</strong>. Také si velmi snadno a přesně nastavíte požadovanou výšku řezu pilového kotouče a úhel řezu pomocí <strong>ručního kolečka</strong>. Součástí je také <strong>paralelní pravítko</strong>. Prach se odsává jak z horního krytu kotouče, ta', '_vyr_728_vyr_4245h0425e.jpg', 0, '37534.50', '0.00', '2HLMTS250F1600', '_vyrn_728_vyr_4245h0425e.jpg', '_vyrp11_728_vyrp11_4245373000-big_36m192m.jpg', '_vyrp12_728_vyrp14_4245373004-big_332c365f.jpg', '_vyrp13_728_vyrp16_4245372998-big_833y888f.jpg', 21, 1, 1, 1, '9,12E+12', 0, '3-62-0-0|3-62-399-0', NULL, '2021-01-10 15:44:07'),
