(8273, 735, 'HOLZMANN BBM35MAN PNEUMATICKÁ VRTAČKA POUZDER DVEŘNÍCH ZÁMKŮ', 'PNEUMATICKÁ VRTAČKA POUZDER DVEŘNÍCH ZÁMKŮ HOLZMANN BBM35MAN', '<h2 style=\\\"text-align: center;\\\">PNEUMATICKÁ VRTAČKA POUZDER DVEŘNÍCH ZÁMKŮ HOLZMANN BBM35MAN</h2>\\n<p style=\\\"text-align: center;\\\"><strong>SPECIÁLNÍ PODZIMNÍ AKCE OD 15.10. DO 15.12.2018 NEBO DO VYPRODÁNÍ ZÁSOB</strong></p>\\n<p> </p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: medium;\\\"><em>Ilustrační obrázek</em><br /></span></p>\\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 14pt;\\\"><strong>Popis stroje: </strong></span></p>\\n<ul>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">náš vrtací stroj má pneumatické podávání</span></li>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">vrtací vzor Blum, přestavba na Hettich Vrtací vzor s volitelnou hlavou Hettich je možná</span></li>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">ideální pro ambiciózní hobby řemeslníky a malé podniky</span></li>\\n<li style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt;\\\">Průměr řezacího závěsu 35 mm</span><', '_vyr_735_vyr_5256BBM35MAN.jpg', 0, '10850.90', '0.00', 'HLM-BBM35MAN', '_vyrn_735_vyr_5256BBM35MAN.jpg', '_vyrp11_735_vyrp12_5256BBM35_bohrbild.jpg', '', '', 21, 1, 1, 1, '9,12E+12', 0, '3-61-0-0|3-61-413-0', NULL, '2021-01-10 15:44:07'),
(8274, 736, 'HOLZMANN ABS1500FF 230V ODSAVAČ PRO ÚKLID', 'ODSAVAČ PRO ÚKLID HOLZMANN ABS 1500FF 230 V', '<h1 id=\\\"h1-fig\\\">Odsavač pro úklid HOLZMANN ABS 1500FF 230 V</h1>\\n<p><strong>Odsavač HOLZMANN ABS1500FF</strong> je univerzální <strong>zařízení pro úklid a odsávání přebytečného dřevního odpadu</strong> (piliny, hobliny) po dřevozpracující práci s většinou strojů bez zbytečného odvětrávání tepla. Přístroj má <strong>speciální kazetový filtr</strong>, jehož 2,2 m&#178; velká plocha umožnňuje průchod velkého množství odsávaného vzduchu, a odolné <strong>kolo ventilátoru vyrobené z oceli</strong>. Odsavač má i během delší činnost konstantní odsávací sílu. <strong>Odsávací kapacita je 1500 m&#179;/h</strong> a <strong>podtlak činí 1020 Pa</strong>. Masivní <strong>konstrukce je vyrobena z ocelových plechů</strong>, které udržují statické náboje na minimu (oproti plastovému krytu). Díky rychloupínači je možná rychlá výměna odpadního vaku a podstavec s kolečky zaručuje <strong>vysokou pohyblivost</strong>.</p>\\n<h2 id=\\\"h2-fig\\\">Standardní výbava:</h2>\\n<ul>\\n<li>Kovový rotor</li>\\n<li>Ry', '_vyr_7365238_3517__vyr_3398ABS1500FF.jpg', 0, '7886.00', '0.00', 'HMABS1500FF230', '_vyrn_7365238_3517__vyr_3398ABS1500FF.jpg', '_vyrp11_7365238_3517__vyrp12_3398ABS1500FF_2.jpg', '_vyrp12_7365238_3517__vyrp13_3398ABS1500FF_3.jpg', '', 21, 1, 1, 1, '9,12E+12', 0, '3-62-0-0|3-62-398-0', NULL, '2021-01-10 15:44:07'),
(8275, 739, 'CMT Industrial Pilový kotouč na železo - D136x1,5 d10 Z30 HM', 'CMT Industrial Pilový kotouč na železo - D136x1,5 d10 Z30 HM', '<p>Perfektní „SUCHÉ“ řezání na všech typech pil na kovy i na dřevo. Excelentní kvalita řezu. Speciální typ zubů spolu s výběrovou kvalitou tvrdokovových břitů zaručuje dlouhou životnost.<br /><br />Ideální pro typy materiálu:<br />• měkká a tvrdá ocel, litina, profilovaná litina, ocelové trubky a plechy<br />• profily pro hliníkové dveře a okna, sendvičové panely s PVC povrchem<br />• sendviče s ocelovým povrchem, garážová vrata, fasádní panely<br />• kování nábytkové, šatní tyče, kování na posuvné dveře a pod.<br /><br /><strong>Doporučené otáčky pro kotouče řady C226  </strong></p>\\n<p>Otáčky uvedené na kotouči (MAX. RPM) jsou maximální konstrukční otáčky kotouče na volnoběh, nejedná se o otáčky vhodné pro řezání.<br /><span style=\\\"color: #ff0000;\\\">Doporučené řezné otáčky naleznete níže v tabulce, tyto otáčky nepřekračujte.</span><br />Vyšší řezné otáčky mohou způsobit rychlé otupení HM pilových zubů.</p>\\n<table border=\\\"1\\\" cellspacing=\\\"2\\\" cellpadding=\\\"2\\\">\\n<tbody>\\n<tr>\\n<td', '_vyr_739C22603005.jpeg', 0, '785.00', '872.00', 'C22603005', '_vyrn_739C22603005.jpeg', '_vyrp11_739C22603005-1.jpeg', '_vyrp12_739C22603005-2.jpeg', '', 21, 1, 1, 1, '6,64E+11', 0, '2-2-0-0|2-2-434-0', NULL, '2021-01-10 15:44:07'),
(8276, 740, 'CMT XTreme Pilový kotouč na nerez ocel - D160x1,8 d20 Z40 HM', 'CMT XTreme Pilový kotouč na nerez ocel - D160x1,8 d20 Z40 HM', '<p>Perfektní „SUCHÉ“ řezání na všech typech pil na kovy i na dřevo. Excelentní kvalita řezu. Speciální typ zubů spolu s výběrovou kvalitou tvrdokovových břitů zaručuje dlouhou životnost.<br /><br />Ideální pro typy materiálu:<br />• měkká a tvrdá ocel, litina, profilovaná litina, ocelové trubky a plechy<br />• profily pro hliníkové dveře a okna, sendvičové panely s PVC povrchem<br />• sendviče s ocelovým povrchem, garážová vrata, fasádní panely<br />• kování nábytkové, šatní tyče, kování na posuvné dveře a pod.<br />• nerezová ocel se zvýšenou odolností proti opotřebení<br /> </p>\\n<h4>Pilové kotouče na nerezovou ocel se zvýšenou odolností proti opotřebení.</h4>\\n<p><br /><strong>Doporučené otáčky pro kotouče řady C226  </strong><br />Otáčky uvedené na kotouči (MAX. RPM) jsou maximální konstrukční otáčky kotouče na volnoběh, nejedná se o otáčky vhodné pro řezání.<br /><span style=\\\"color: #ff0000;\\\">Doporučené řezné otáčky naleznete níže v tabulce, tyto otáčky nepřekračujte.</span><br ', '_vyr_740C22654006H.jpeg', 0, '1052.00', '1169.00', 'C22654006H', '_vyrn_740C22654006H.jpeg', '_vyrp11_740C22654006H-1.jpeg', '_vyrp12_740C22654006H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-434-0', NULL, '2021-01-10 15:44:07'),
(8277, 741, 'CMT Pilový kotouč na cementotřískové desky - D160x2,2 d20 Z4 Diamantový', 'CMT Pilový kotouč na cementotřískové desky - D160x2,2 d20 Z4 Diamantový', '<p>Pilový kotouč s kónickým nebo rovným diamantovým zubem pro dělení extra tvrdých materiálů jako jsou: DuPont Corian®, cementotřískové a cementovláknité desky (Cetris, Eternit®, Swisspearl®, Fermacell®, Ivarplank®, Hardieplank®), MDF, DTD, termoplasty a sádrokarton, vhodné pro pokosové, zkracovací, ruční elektrické nebo akumulátorové pily. Vysoká životnost diamantových zubů.</p>', '_vyr_741C23616004H.jpeg', 0, '1058.00', '1176.00', 'C23616004H', '_vyrn_741C23616004H.jpeg', '_vyrp11_741C23616004H-1.jpeg', '_vyrp12_741C23616004H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-23-0', NULL, '2021-01-10 15:44:07'),
(8278, 742, 'CMT ITK Ultra tenký kotouč pro AKU pily - D136x1,5 d20(+10) Z18 HM podélný řez', 'CMT ITK Ultra tenký kotouč pro AKU pily - D136x1,5 d20(+10) Z18 HM podélný řez', '<p>CMT Ultra tenké kotouče ITK Vám poskytnou výhody kvalitního nástroje, vysokou produktivitu a dobrou užitnou hodnotu. Jsou vyrobeny nejmodernějšími výrobními procesy, které zaručují vyváženost kotouče, přesnost naostření a dlouhou životnost ostří.<br /><br />Doporučujeme CMT Stabilizátory pilových kotoučů pro průměry od 200 mm a výše.<br /><br />Pilové kotouče pro podélné řezy dřeva.<br /><br />POUŽITÍ: pro podélné řezy, kde je kladen důraz na co nejmenší prořez. MATERIÁL: měkké a tvrdé dřevo, překližka.</p>', '_vyr_742C27113618H.jpeg', 0, '276.00', '307.00', 'C27113618H', '_vyrn_742C27113618H.jpeg', '_vyrp11_742C27113618H-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8279, 745, 'CMT XTreme Pilový kotouč na lamino a DTD - D220x3,2 d30 Z63 HM', 'CMT XTreme Pilový kotouč na lamino a DTD - D220x3,2 d30 Z63 HM', '<p>Nový standardní kotouč s trapézovými negativ zuby pro extra jemný a čistý řez oboustranně povrchově upravených materiálů, jako lamina nebo dýhy, na kotoučových nebo vertikálních pilách (např. Striebig, Holzher) bez předřezu. Vysoká životnost tvrdokovových zubů. Pro lamino, DTD, MDF, překližku.</p>', '_vyr_745C28106309M.jpeg', 0, '1257.00', '1397.00', 'C28106309M', '_vyrn_745C28106309M.jpeg', '_vyrp11_745C28106309M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:07'),
(8280, 746, 'CMT Industrial Pilový kotouč na lamino a DTD - D160x2,2 d20 Z40 HM', 'CMT Industrial Pilový kotouč na lamino a DTD - D160x2,2 d20 Z40 HM', '<p>Osvědčený kotouč s trapézovým zubem a expanzními drážkami. Určený pro vysoce kvalitní řezy do lamina a dřevotřísky. Vysoká životnost tvrdokovových zubů. Pro pily s předřezem.</p>', '_vyr_746C28116040H2.jpeg', 0, '596.00', '662.00', 'C28116040H2', '_vyrn_746C28116040H2.jpeg', '_vyrp11_746C28116040H2-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8281, 747, 'CMT CHROME Pilový kotouč na lamino, DTD a MDF - D250x3,2 d30 Z80 HM', 'CMT CHROME Pilový kotouč na lamino, DTD a MDF - D250x3,2 d30 Z80 HM', '<p>Nový pilový kotouč s chromovaným povrchem, který redukuje ulpívání zbytků lepidla a pryskyřice na těle kotouče. Má nové tlumící drážky vyplněné oranžovým polyuretanem pro snížení vibrací a hlučnosti. Trapézové zuby z extra tvrdého tvrdokovu pro řezání lamina, dřevotřískových desek a MDF. Vysoká životnost. Pro pily s předřezem.</p>', '_vyr_747C28168010M.jpeg', 0, '1251.00', '1390.00', 'C28168010M', '_vyrn_747C28168010M.jpeg', '_vyrp11_747C28168010M-1.jpeg', '_vyrp12_747C28168010M-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:07'),
(8282, 748, 'CMT Pilový kotouč pro velkoplošné pily - D300x4,4 d30 Z60 16° HM', 'CMT Pilový kotouč pro velkoplošné pily - D300x4,4 d30 Z60 16° HM', '<p>Pro formátování jednotlivých desek nebo desek ve stohu na horizontálních velkoplošných pilách. Pro materiál oboustranně laminované dřevotřísky nebo MDF desky.<br /><br /><strong>Příklady unašecích děr: </strong><br />p / d1 / t mm<br />p = počet unašecích otvorů<br />d1 = průměr unašecích otvorů<br />t = rozteč unašecích otvorů<br /><br />Pilové kotoouče mají provedení unašecích otvorů sdružené do skupin COMBI3, COMBI5 a COMBI7.<br /><br /><strong>COMBI3</strong><br />2/7/42 mm<br />2/9/46,4 mm<br />2/10/60 mm<br /><br /><strong>COMBI5</strong><br />2/7/110 mm<br />2/8,4/130 mm<br />2/14/110 mm<br />4/9/100 mm<br />4/19/120 mm<br /><br /><strong>COMBI7</strong><br />2/10/80 mm<br />1/11/85 mm<br />2/11/115 mm<br />2/11/148 mm<br />2/14/100 mm<br />2/14/125 mm<br />2/19/120 mm</p>', '_vyr_748C28206012M.jpeg', 0, '2031.00', '2257.00', 'C28206012M', '_vyrn_748C28206012M.jpeg', '_vyrp11_748C28206012M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-7-0-0|2-7-47-0', NULL, '2021-01-10 15:44:07'),
(8283, 749, '283 Pilový kotouč na lamino bez předřezu - D220x3,2 d30 Z64 HM', '283 Pilový kotouč na lamino bez předřezu - D220x3,2 d30 Z64 HM', '<p>Speciální konstrukce s extra šikmými zuby pro docílení jemnějšího řezu oboustranně povrchově upravených materiálů, jako lamina nebo dýhy, na kotoučových pilách nebo velkých zkracovacích pilách. Perfektní povrch spodní hrany při použití tohoto kotouče. Vysoká životnost tvrdokovových zubů. Vhodné pro vertikální pily. Pro lamino, DTD, MDF, překližku a příčné řezy dřeva.</p>', '_vyr_749C28306409M.jpeg', 0, '1280.00', '1422.00', '283.064.09M', '_vyrn_749C28306409M.jpeg', '_vyrp11_749C28306409M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:07'),
(8284, 750, 'CMT CHROME C283 Pilový kotouč na lamino bez předřezu - D250x3,2 d30 Z80 HM', 'CMT CHROME C283 Pilový kotouč na lamino bez předřezu - D250x3,2 d30 Z80 HM', '<p>Nový pilový kotouč s chromovaným povrchem, který redukuje ulpívání zbytků lepidla a pryskyřice na těle kotouče. Má nové tlumící drážky vyplněné oranžovým polyuretanem pro snížení vibrací a hlučnosti. Speciální konstrukce s extra šikmými zuby pro docílení jemnějšího řezu oboustranně povrchově upravených materiálů, jako lamina nebo dýhy, na kotoučových pilách nebo velkých zkracovacích pilách. Perfektní povrch spodní hrany při použití tohoto kotouče. Vysoká životnost tvrdokovových zubů. Vhodné pro vertikální pily. Pro lamino, DTD, MDF, překližku a příčné řezy dřeva.</p>', '_vyr_750C28368010M.jpeg', 0, '1750.00', '1944.00', 'C28368010M', '_vyrn_750C28368010M.jpeg', '_vyrp11_750C28368010M-1.jpeg', '_vyrp12_750C28368010M-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:07'),
(8285, 757, 'CMT Industrial C287 Pilový kotouč na lamino bez předřezu - D160x2,6 d20 Z34 HM', 'CMT Industrial C287 Pilový kotouč na lamino bez předřezu - D160x2,6 d20 Z34 HM', '<p>Nový standardní kotouč s vydutými zuby pro jemný a čistý řez oboustranně povrchově upravených materiálů, jako lamina nebo dýhy, na kotoučových nebo vertikálních pilách (např. Striebig, Holzher) bez předřezu. Pro lamino, DTD, MDF, překližku a příčné řezy dřeva.</p>', '_vyr_757C28703406H.jpeg', 0, '851.00', '946.00', 'C28703406H', '_vyrn_757C28703406H.jpeg', '_vyrp11_757C28703406H-1.jpeg', '_vyrp12_757C28703406H-2.jpeg', '_vyrp13_757C28703406H-3.jpeg', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-355', NULL, '2021-01-10 15:44:07'),
(8286, 759, 'CMT Pilový kotouč pro elektronářadí, podélný řez - D150x20 Z12 HM', 'CMT Pilový kotouč pro elektronářadí, podélný řez - D150x20 Z12 HM', '<p>CMT pilové kotouče pro elektronářadí jsou vysoce kvalitní nástroje pro každý typ ruční elektrické nebo bateriové pily, zkracovacích pil a dalších nářadí do průměru pilového kotouče 235 mm. Jsou vyrobeny nejmodernějšími výrobními procesy, které zaručují vyváženost kotouče, přesnost naostření a dlouhou životnost ostří. Jsou vyráběny z kvalitních celosvětově ověřených materiálů a průběžně kontrolovány ve výrobním procesu.</p>', '_vyr_759C29015012H.jpeg', 0, '286.00', '318.00', 'C29015012H', '_vyrn_759C29015012H.jpeg', '_vyrp11_759C29015012H-1.jpeg', '_vyrp12_759C29015012H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8287, 761, 'CMT Pilový kotouč pro elektronářadí univerzální - D120x1,8 d20 Z18 HM Industrial', 'CMT Pilový kotouč pro elektronářadí univerzální - D120x1,8 d20 Z18 HM Industrial', '<p>CMT pilové kotouče pro elektronářadí jsou vysoce kvalitní nástroje pro každý typ ruční elektrické nebo bateriové pily, zkracovacích pil a dalších nářadí do průměru pilového kotouče 235 mm. Jsou vyrobeny nejmodernějšími výrobními procesy, které zaručují vyváženost kotouče, přesnost naostření a dlouhou životnost ostří. Jsou vyráběny z kvalitních celosvětově ověřených materiálů a průběžně kontrolovány ve výrobním procesu.</p>', '_vyr_761C29112018H.jpeg', 0, '517.00', '574.00', 'C29112018H', '_vyrn_761C29112018H.jpeg', '_vyrp11_761C29112018H-1.jpeg', '_vyrp12_761C29015012H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8288, 763, 'CMT Pilový kotouč pro elektronářadí, finální řez - D120x1,8 d20 Z36 HM Industrial', 'CMT Pilový kotouč pro elektronářadí, finální řez - D120x1,8 d20 Z36 HM Industrial', '<p>CMT pilové kotouče pro elektronářadí jsou vysoce kvalitní nástroje pro každý typ ruční elektrické nebo bateriové pily, zkracovacích pil a dalších nářadí do průměru pilového kotouče 235 mm. Jsou vyrobeny nejmodernějšími výrobními procesy, které zaručují vyváženost kotouče, přesnost naostření a dlouhou životnost ostří. Jsou vyráběny z kvalitních celosvětově ověřených materiálů a průběžně kontrolovány ve výrobním procesu.</p>', '_vyr_763C29212036H.jpeg', 0, '702.00', '780.00', 'C29212036H', '_vyrn_763C29212036H.jpeg', '_vyrp11_763C29212036H-1.jpeg', '_vyrp12_763C29212036H-2.jpeg', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8289, 768, 'CMT Super XTreme Pilový kotouč na lamino a DTD - D250x3,2 d30 Z78 HM', 'CMT Super XTreme Pilový kotouč na lamino a DTD - D250x3,2 d30 Z78 HM', '<p>Maximální výkon při řezání lamina bez předřezu. Speciální geometriem zubů. Tvrdost plátků KCR05, pevnost 2500 N/mm<sup>2</sup> a boční házivost do 0,05 mm. Pro lamino, DTD, MDF, překližku.</p>', '_vyr_768C29507810M.jpeg', 0, '1643.00', '1826.00', 'C29507810M', '_vyrn_768C29507810M.jpeg', '_vyrp11_768C29507810M-1.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-20-0|2-2-20-356', NULL, '2021-01-10 15:44:07'),
(8290, 771, 'CMT Redukční kroužek pro pilové kotouče - D20 d12,7 t1,4', 'CMT Redukční kroužek pro pilové kotouče - D20 d12,7 t1,4', '<p>Redukční kroužek pro pilové kotouče</p>', '_vyr_771C29922100.jpeg', 0, '57.00', '63.00', 'C29922100', '_vyrn_771C29922100.jpeg', '_vyrp11_771C29922100.jpeg', '', '', 21, 1, 1, 1, '8,02E+12', 0, '2-2-0-0|2-2-289-0', NULL, '2021-01-10 15:44:07'),
(8291, 778, 'CMT Contractor Pilový kotouč na dřevo - D160x2,2 d20 Z24 HM', 'CMT Contractor Pilový kotouč na dřevo - D160x2,2 d20 Z24 HM', '<p>Kotouče s tvrdokovovými zuby Contractor jsou určeny pro běžné řezání stavebních materiálu jako je měkké dřevo, OSB, překližka bez větších nároků na kvalitu řezu.</p>\\n<p>Jedná se o ekonomický kotouč s vynikajícím poměrem výkonu a ceny. Výhodné obchodní balení Masterpack po 10 ks, průměr 250 po 5ks pro obchody nebo větší výroby jako jsou paletárny, stavební nebo tesařské podniky. Po jednom kuse jsou kotouče dodávány nebalené, pouze s plastovou ochranou zubů a štítkem s čárovým kodem. Jsou určeny pro ruční okružní pily, kotoučové nebo pokosové pily. Skvělá cena, která odpovídá kvalitě produktu.</p>\\n<p> </p>\\n<p><span style=\\\"font-size: 18px;\\\"><span style=\\\"color: #ff0000;\\\"><strong>Ideální na stavby nebo hobby použití.</strong></span></span></p>', '_vyr_778C-K16024H-X10.jpeg', 0, '179.00', '199.00', 'C-K16024H-X10', '_vyrn_778C-K16024H-X10.jpeg', '_vyrp11_778C-K16024H-X10-1.jpeg', '_vyrp12_778C-K16024H-X10-2.jpeg', '', 21, 1, 5, 1, '8,02E+12', 0, '2-2-0-0|2-2-286-0', NULL, '2021-01-10 15:44:07'),
(8292, 779, 'JET 10-20 Plus Válcová bruska', 'JET 10-20 Plus Válcová bruska', '<p><strong>• Možnost dokoupit kartáčovací válec.<br />• Plynulá regulace posuvu.<br />• Stavitelná stupnice pro odečet výšky.<br />• Přesné vedení agregátu.<br />• Vnitřní žebrování válce pro lepší odvod tepla.<br />• Snadná výměna brusného pásu.<br />• Masivní zavěsení válce.</strong><br /><br />Stolní válcová bruska JET 10-20 spojuje výkon, praktičnost a nároky na minimální prostor. Výkonný motor 1300 W, regulovatelný posuv a přesné vedení agregátu nabízejí broušení desek tloušťky 3 až 75 mm. Šířka dílce je max. 255 mm na jeden průchod nebo 505 mm na dva průchody strojem. Elektronická regulece posuvu plynule mění posuv pro dosažení dokonalého povrchu. Vnitřní žebrování duralového brusného válce zajišťuje odvod tepla a díky tomu nedochází k spálení povrchu broušeného materiálu.<br /><br />Pokud jste kutil nebo řemeslník, oceníte kvalitu a přesnost s jakou je stroj vyroben a zároveň možnosti, které Vám nabídne.<br /><br /><em>• Typ: 10-20 Plus<br />• Doporučené použití: Řemeslník<br />', '_vyr_779jet-10-20.jpeg', 0, '21200.00', '22410.00', '121-1020M', '_vyrn_779jet-10-20.jpeg', '_vyrp11_779jet-10-20-2.jpeg', '_vyrp12_779jet-10-20-3.jpeg', '_vyrp13_779jet-10-20-4.jpeg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8293, 780, 'IGM PD80 Ohraňovací-ořezávací frézka na ABS hranu', 'PD80 Ohraňovací-ořezávací frézka na ABS hranu', '<p><strong></strong><br /><br />PD80 ořezávací a ohraňovací frézka je určena pro precizní zaoblení nebo zkosení nábytkových hran z PVC, ABS nebo dýhy a všech hran dřevěných nebo plastových dílů či desek.<br /><br />Jedinečná konstrukce frézky dává vynikající stabilitu díky vodící základně s madlem . Motor má 30000 ot./min a poskytuje dostatečnou sílu i pro větší úběry materiálu. Je vybavena unikátním průhledným otočným krytem, který kopíruje povrch a díky kterému vždy perfektně vidíte na práci. Integrovaná odsávací hubice umožňuje připojit frézku k odsávání. Ve spodní části krytu je umístěno přibržďování kopírovacího ložiska. Tím se eliminuje poškrábání nebo otlačení dílce od roztočeného ložiska. Přesná hloubka se jednoduše nastavuje otáčením základny, přičemž 1 otáčka je 2 mm a přesné nastavení lze odečítat na stupnici s noniusem s rozlišením 0,05 mm. Ve stroji je vestavěná cidlina pro srážení ostrých hran. Součástí balení je tvrdokovová zaoblovací radiusová fréza R2mm, montážní klíče', '_vyr_780PD-80.png', 0, '4753.00', '4900.00', '142-PD80', '_vyrn_780PD-80.png', '', '', '', 21, 1, 1, 0, '', 0, '3-60-0-0|3-60-415-0', NULL, '2021-01-10 15:44:07'),
(8294, 857, 'JET AFS-1000B Filtr vzduchu', 'JET AFS-1000B Filtr vzduchu', '<p><strong>• Výkonný motor.<br />• Vhodné pro montáž na strop.<br />• Dálkové ovládání.<br />• Tři rychlosti motoru 12, 15, 20 m<sup>3</sup>/min.<br />• Tři nastavení časování 2, 4 a 8 hodin.</strong><br /><br />Filtrační jednotka s výkonným motorem 200 W. Filtr vzduchu je určen pro větší výrobní dílny. Ideální umístění filtračního zařízení je alespoň 2 metry nad zemí na ocelových závěsech. Vzduch je naháněn přes elektrostatický předfiltr do vnitřního skládaného filtru a zpět do dílny. Účinnost filtrování je 98  % všech částic o velikosti 5 mikronů a 85  % všech částic o velikosti 1 mikron. Dálkové ovládání má tři nastavení otáček motoru a tři různé časové nastavení 2, 4 a 8 hodin.Výhodou filtračního zařízení je úspora energií za vytápění, jelikož při fitrování nedochází k ochlazování venkovním vzduchem. Volitelné příslušenství je uhlíkový filtr.<br /><br /><strong>Tiše čistí a filtruje vzduch při práci. Účinnost 98  % u částic 5 mikronů a 85  % u částic 1 mikron.</strong><br /><br /><', '_vyr_857AFS-1000.jpg', 0, '9250.00', '9737.00', '121-AFS-1000BM', '_vyrn_857AFS-1000.jpg', '_vyrp11_857AFS-1000-1.jpg', '_vyrp12_857AFS-1000-2.jpg', '', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8295, 941, 'JET 31A Kombinovaná bruska', 'JET 31A Kombinovaná bruska', '<p><strong>•&nbsp;Pevná konstrukce z litiny a svařené oceli.<br />•&nbsp;Pás lze polohovat a zajistit v&nbsp;libovolném rozmezí úhlu od 0° do 90°.<br />•&nbsp;Indexace naklopení pásu v pozici 0°, 45° a 90°.<br />•&nbsp;Přesně broušené litinové stoly s drážkami.<br />•&nbsp;Stůl brusného kotouče lze naklonit v&nbsp;rozmezí od -15°do +45°.<br />•&nbsp;Litinové stoly zaručují přesné broušení.<br />•&nbsp;Jednoduchá výměna brusných pásů.<br />•&nbsp;300 mm vyvážený kotouč zaručuje kvalitní broušení.<br />•&nbsp;Vhodné pro upnutí brusiva se suchým zipem.</strong><br /><br />Kombinovaná bruska JET je určena pro profesionální použití a plně konkuruje jiným výrobcům průmyslových strojů. Kombinovaná brusku je stabilní a přesná díky vysoce kvalitním litinovým stolům a podstavci z lisované oceli. Přesně broušené stolky lze jednoduše nastavit tak, aby mezi brusivem a stolkem byla minimální mezera, a tím byla práce se strojem maximálně bezpečná. Stůl brusného kotouče je opatřen T-drážkou pro přesné', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C99001111/c990.5_freza-na-vyplne_1_web.jpg', 0, '31554.29', '33132.00', '121-31AM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/C99001111/c990.5_freza-na-vyplne_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-31AM/121-31AM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-31AM/121-31AM_02_web.jpg', '', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8296, 942, 'JET 719A Dlabačka ostrohranná', 'JET 719A Dlabačka ostrohranná', '<p><strong>&bull; Snadn&eacute; spou&scaron;těn&iacute; a zved&aacute;n&iacute; vřetene je zaji&scaron;těno masivn&iacute;m hřebenem, ozuben&yacute;m kolem v kombinaci s rybinov&yacute;m veden&iacute;m a plynov&yacute;m p&iacute;stem.<br />&bull; Bočn&iacute; hloubkov&yacute; doraz pro přesnou hloubku.<br />&bull; Rychloup&iacute;nac&iacute; svěr&aacute;k pro rychl&eacute; upnut&iacute; a uvolněn&iacute; d&iacute;lce.<br />&bull; V&yacute;konn&yacute; motor.<br />&bull; Otočn&yacute; agreg&aacute;t o 180 &deg;, umožňuje vrt&aacute;n&iacute; z&aacute;mků v již hotov&yacute;ch dveř&iacute;ch.<br />&bull; Přesn&eacute; rybinov&eacute; veden&iacute;, pracovn&iacute; deska z MDF, posuv stolu ve dvou os&aacute;ch, podstavec s &uacute;ložn&yacute;m prostorem a d&eacute;lkov&yacute; doraz pro s&eacute;riovou v&yacute;robu.</strong><br /><br />Profesion&aacute;ln&iacute; ostrohrann&aacute; dlabačka JET 719A m&aacute; robusn&iacute; litinov&yacute; stůl a podstavec s &uacute;ložn&yacute;m prosto', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_01_web.jpg', 0, '26623.81', '27955.00', '121-719A-M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-719A-M/121-719A_02_web.jpg', '', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8297, 943, 'JET DC-1100A Odsavač pilin a prachu', 'JET DC-1100A Odsavač pilin a prachu', '<p><strong>• Technologie oddělování částic s účinností až 98  %.<br />• Rozbočka v základní výbavě.</strong><br /><br />Robustní a dobře vybavené odsávací zařízení určené pro odsávání až dvou strojů. Motor a speciálně konstruované dmychadlo pro vysoký výkon a tichý chod bez vibrací. Odsavač je opatřen vysoce účinným ventilátorem a unikátní technologií „Vortex Cone“, která udržuje vysoký výkon a zabraňuje předčasnému zanášení filtru. Rychlá instalace. Čtyři kolečka umožňují celkovou pohyblivost. Dodává se s pěti pytli na odpad a filtračním vakem na částice o velikosti nad 30 mikronů. Tento filtr je navíc vybaven ovládací klikou, kterou otáčíte vnitřními lopatkami a čistíte tak filt zevnitř bez potřeby demontáže, tím snadno udržíte výkon odsavače na maximum. Hadice není součástí dodávky.<br /><br /><strong>Vortex Cone – jedinečná technologie pro vysoký odsávací výkon</strong><br />Eliminuje zanesení filtru a následné zdravotní problémy při ručním čištění. Odstraňuje náhlý pokles výkonu k', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_01_web.jpg', 0, '10871.43', '11415.00', '121-DC-1100A', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_02a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100A/121-DC-1100A_03a_web.jpg', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8298, 944, 'JET DC-1100CK Odsavač pilin a prachu s mikrofiltračním nástavcem', 'JET DC-1100CK Odsavač pilin a prachu s mikrofiltračním nástavcem', '<p><strong>• Technologie oddělování částic s účinností až 98  %.<br />• Rozbočka v základní výbavě.</strong><br /><br />Robustní a dobře vybavené odsávací zařízení určené pro odsávání až dvou strojů. Motor a speciálně konstruované dmychadlo pro vysoký výkon a tichý chod bez vibrací. Odsavač je opatřen vysoce účinným ventilátorem a unikátní technologií „Vortex Cone“, která udržuje vysoký výkon a zabraňuje předčasnému zanášení filtru. Rychlá instalace. Čtyři kolečka umožňují celkovou pohyblivost. Dodává se s pěti pytli na odpad a s mikrofiltračním nástavcem na částice o velikosti nad 2 mikrony. Tento filtr je navíc vybaven ovládací klikou, kterou otáčíte vnitřními lopatkami a čistíte tak filt zevnitř bez potřeby demontáže, tím snadno udržíte výkon odsavače na maximum. Hadice není součástí dodávky.<br /><br /><strong>Vortex Cone – jedinečná technologie pro vysoký odsávací výkon</strong><br />Eliminuje zanesení filtru a následné zdravotní problémy při ručním čištění. Odstraňuje náhlý pokle', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_01_web.jpg', 0, '166031.43', '174333.00', '121-DC-1100CKM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1100CKM/121-DC-1100CKM_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8299, 945, 'JET DC-1900A Odsavač pilin a prachu dvoupytlový', 'JET DC-1900A Odsavač pilin a prachu dvoupytlový', '<p><strong>&bull; V&yacute;kon&yacute; motor a efektivn&iacute; oběžn&eacute; kolo ventil&aacute;toru umožňuj&iacute; maxim&aacute;ln&iacute; prouděn&iacute; vzduchu.<br />&bull; Unik&aacute;tn&iacute; technlogie &bdquo;Vortex Cone&ldquo; eliminuje zanesen&iacute; filtru.<br />&bull; Rychloup&iacute;n&aacute;n&iacute; odpadn&iacute;ho pytle umožňuje snadnou a rychlou v&yacute;měnu.<br />&bull; Možnost volby ods&aacute;vac&iacute;ch vstupů 3x 100 mm nebo 1x 200 mm.<br />&bull; Čtyři otočn&aacute; kolečka pro snadn&yacute; pohyb po d&iacute;lně.<br />&bull; Technologie oddělov&aacute;n&iacute; č&aacute;stic s &uacute;činnost&iacute; až 98  %.<br />&bull; Rozbočka v z&aacute;kladn&iacute; v&yacute;bavě.</strong><br /><br />Vysoce v&yacute;kon&yacute; odsavač s možnost&iacute; připojen&iacute; v&iacute;ce strojů. S průtokem vzduchu 2900 m<sup>3</sup>/h, snadno zvl&aacute;dne až 3 stroje. Robustn&iacute; konstrukce, tich&yacute; chod a &uacute;činn&eacute; proveden&iacute; bude vyhovovat vě', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 0, '22847.62', '23990.00', '121-DC-1900AT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8300, 946, 'JET DC-900A Odsavač pilin a prachu', 'JET DC-900A Odsavač pilin a prachu', '<p>Dobře vybaven&eacute; ods&aacute;vac&iacute; zař&iacute;zen&iacute; určen&eacute; pro stroje s men&scaron;&iacute; produkc&iacute; odpadu. Motor a speci&aacute;lně konstruovan&eacute; dmychadlo pro vysok&yacute; v&yacute;kon a tich&yacute; chod bez vibrac&iacute;. Rychl&aacute; instalace. Čtyři kolečka umožňuj&iacute; celkovou pohyblivost. Dod&aacute;v&aacute; se odpadn&iacute;m pytlem a filtračn&iacute;m vakem na č&aacute;stice o velikosti nad 30 mikronů. Hadice je souč&aacute;st&iacute; dod&aacute;vky. Plechov&aacute; turb&iacute;na.<br /><br /><em>&bull; Typ: DC-900A<br />&bull; Doporučen&eacute; použit&iacute;: Kutil<br />&bull; Př&iacute;kon / V&yacute;kon (230 V): 750 / 550 W<br />&bull; Průtok vzduchu (hadice 100 mm): 900 m<sup>3</sup>/h<br />&bull; Objem odpadn&iacute;ho vaku: 55 l<br />&bull; Max. podtlak: 1050 Pa<br />&bull; Připojovac&iacute; hrdlo: 100 mm<br />&bull; Velikost č&aacute;stic: 30 mikronů<br />&bull; D&eacute;lka x &scaron;&iacute;řka x v&yacute;&scaron;ka: ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 0, '5254.29', '5517.00', '121-DC-900AM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DC-1900AT/121-DC-1900A_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8301, 947, 'JET DDS-225 Dvouválcová bruska 635mm', 'JET DDS-225 Dvouválcová bruska 635mm', '<p><strong>• Robustní konstrukce stroje vhodná pro nepřetržitý provoz.<br />• Přesný nastavovací systém druhého válce, umožňuje nastavit rozdíl oproti prvnímu válci.<br />• Rychlá výměna brusného pásu pomocí chytrých klipsů.<br />• Brusný pás šířky 75 nebo 100 mm.<br />• Pogumované přítlačné válce zajišťují perfektní výsledky broušení.<br />• Zdvih stolu na čtyřech závitových tyčích.<br />• Pogumovaný pás a dvě rychlosti posuvu.<br />• Úběr na jeden průchod až 1,5 mm.<br />• Umožnuje finální úpravu povrchu na jeden průchod.<br />• Přesnost roviny broušení do 0,2 mm v celé šířce.</strong><br /><br />Dvouválcová bruska JET řady DDS je určena pro finální povrchovou úpravu nábytkových dílců, stavebních prvků nebo k egalizaci materiálu. Bruska patří svým provedením do řady profesionálních strojů, je určená pro průmyslový provoz a každodenní použití.<br /><br />Dvouválcová bruska má pevnou a silnou ocelovou konstrukci a výkonný motor. Dva 152 mm brusné válce jsou vyrobeny z přesně opracované', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_1_web.jpg', 0, '93831.43', '98523.00', '121-DDS-225', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_2a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-225/121-DDS-225_dvouvalcova-bruska_2_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8302, 948, 'JET DDS-237 Dvouválcová bruska 940mm', 'JET DDS-237 Dvouválcová bruska 940mm', '<p><strong>&bull; Robustn&iacute; konstrukce stroje vhodn&aacute; pro nepřetržit&yacute; provoz.<br />&bull; Přesn&yacute; nastavovac&iacute; syst&eacute;m druh&eacute;ho v&aacute;lce, umožňuje nastavit rozd&iacute;l oproti prvn&iacute;mu v&aacute;lci.<br />&bull; Rychl&aacute; v&yacute;měna brusn&eacute;ho p&aacute;su pomoc&iacute; chytr&yacute;ch klipsů.<br />&bull; Brusn&yacute; p&aacute;s &scaron;&iacute;řky 75 nebo 100 mm.<br />&bull; Pogumovan&eacute; př&iacute;tlačn&eacute; v&aacute;lce zaji&scaron;ťuj&iacute; perfektn&iacute; v&yacute;sledky brou&scaron;en&iacute;.<br />&bull; Zdvih stolu na čtyřech z&aacute;vitov&yacute;ch tyč&iacute;ch.<br />&bull; Pogumovan&yacute; p&aacute;s a dvě rychlosti posuvu.<br />&bull; &Uacute;běr na jeden průchod až 1,5 mm.<br />&bull; Umožnuje fin&aacute;ln&iacute; &uacute;pravu povrchu na jeden průchod.<br />&bull; Přesnost roviny brou&scaron;en&iacute; do 0,2 mm v cel&eacute; &scaron;&iacute;řce.</strong><br /><br />Dvouv&aacute;lcov&aacute; bru', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_01_web.jpg', 0, '141957.14', '149055.00', '121-DDS-237T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_02a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-DDS-237T/121-DDS-237T_02_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07');
