(8303, 949, 'JET JBG-200 Dvoukotoučová bruska', 'JET JBG-200 Dvoukotoučová bruska', '<p><strong>&bull; Kvalitn&iacute; zakrytovan&aacute; ložiska.<br />&bull; Litinov&yacute; kryt motoru.<br />&bull; Nastaviteln&eacute; opěrky pro n&aacute;stroje.<br />&bull; Nastaviteln&yacute; bezpečnostn&iacute; &scaron;t&iacute;t.<br />&bull; Osvětlen&iacute; pracovn&iacute; plochy.</strong><br /><br />Masivn&iacute; dvoukotoučov&aacute; bruska s dostatečn&yacute;m&nbsp;v&yacute;konem a vynikaj&iacute;c&iacute;m designem. 200 mm průměr brusn&yacute;ch kotoučů. N&aacute;stroj je při brou&scaron;en&iacute; schovan&yacute;&nbsp;za ochrann&yacute;m &scaron;t&iacute;tem nastaviteln&yacute;m do libovoln&eacute; polohy. Pro&nbsp;snadn&eacute; brou&scaron;en&iacute; je bruska vybavena pracovn&iacute;m osvětlen&iacute;m.&nbsp;Bruska se dod&aacute;v&aacute; s dvěma brusn&yacute;mi kotouči s různou&nbsp;hrubost&iacute; (hrub&yacute; a jemn&yacute;).<br /><br /><em>&bull; Typ: JBG-200<br />&bull; Doporučen&eacute; použit&iacute;: Profesion&aacute;ln&iacute; v&yacute;roba<br />&bull; Př&iacute;', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_01_web.jpg', 0, '5100.00', '5355.00', '121-JBG-200', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBG-200/121-JBG-200_bruska_02_web.jpg', 'JET JBG-200 Dvoukotoučová bruska', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8304, 950, 'JET JBM-5 Stolní ostrohranná dlabačka', 'JET JBM-5 Stolní ostrohranná dlabačka', '<p><strong>&bull; Přesn&eacute; veden&iacute; zdvihu s tlumičem.<br />&bull; Nastaviteln&yacute; hloubkov&yacute; doraz dlab&aacute;n&iacute;.<br />&bull; Nastaviteln&eacute; pod&eacute;ln&eacute; prav&iacute;tko.<br />&bull; Vertik&aacute;ln&iacute; upnut&iacute; obrobku.<br />&bull; Pracovn&iacute; stůl z litiny s MDF deskou.</strong><br /><br />Stoln&iacute; ostrohrann&aacute; dlabačka JBM-5 je určena pro z&aacute;kladn&iacute; v&yacute;robu dlabů se spolehlivost&iacute; a přesnost&iacute; odpov&iacute;daj&iacute;c&iacute; profesion&aacute;ln&iacute;mu stroji. I přes men&scaron;&iacute; možnosti dlaban&eacute; hloubky a maxim&aacute;ln&iacute;ho průměru dl&aacute;ta je stroj dobr&yacute;m pomocn&iacute;kem při v&yacute;robě dlabů. Stoln&iacute; dlabačka je kompaktn&iacute;, mobiln&iacute; a snadno použiteln&aacute; na jak&eacute;mkoli m&iacute;stě v d&iacute;lně nebo na mont&aacute;ži, Propracovan&eacute; mechanismy pom&aacute;haj&iacute; usnadnit pr&aacute;ci. K dispozici je plynov', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_01_web.jpg', 0, '8380.95', '8800.00', '121-JBM-5', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBM-5/121-JBM-5_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8305, 951, 'JET JBOS-5 Oscilační válečková bruska', 'JET JBOS-5 Oscilační válečková bruska', '<p><strong>&bull; Oscilačn&iacute; pohyb pro dokonal&yacute; povrch obrobku a del&scaron;&iacute; životnost brusn&eacute;ho pap&iacute;ru.<br />&bull; Naklopen&iacute; litinov&eacute;ho stolu až 45&deg;.<br />&bull; V z&aacute;kladn&iacute; v&yacute;bavě vřetena o průměru 6, 12, 16, 38 a 50 mm.<br />&bull; Z&aacute;sobn&iacute;k na redukčn&iacute; středov&eacute; kroužky.<br />&bull; Z&aacute;sobn&iacute;k na brusn&eacute; v&aacute;lečky.<br />&bull; Ods&aacute;vac&iacute; hubice 100 mm ze zadn&iacute; strany stroje.</strong><br /><br />Velmi univerz&aacute;ln&iacute; bruska s oscilac&iacute; a plně sklopn&yacute;m stolem. Je ide&aacute;ln&iacute; pro v&scaron;echny druhy dokončovac&iacute;ch prac&iacute; v d&iacute;lně. Oscilačn&iacute; pohyb brusky usnadňuje pr&aacute;ci a z&aacute;roveň snižuje rychl&eacute; opotřeben&iacute; brusn&eacute;ho pap&iacute;ru. Litinov&yacute; stůl lze sklopit až do 45 &deg;. JBOS-5 bruska je vhodn&aacute; pro každou d&iacute;lnu. Dod&aacute;v&aacute; se', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_01_web.jpg', 0, '11340.00', '11907.00', '121-JBOS-5M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBOS-5M/121-JBOS-5_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8306, 952, 'JET JBS-22 Kartáčová bruska, kartáč hrubost 46', 'JET JBS-22 Kartáčová bruska, kartáč hrubost 46', '<p><strong>• „Sand Smart System“ – automatické snížení rychlosti posuvu při přetížení stroje.<br />• Plynule nastavitelný posuv 0–3 m/min.<br />• Digitální odečet výšky stolu.<br />• Prodlužovací stoly v základní výbavě stroje.<br />• Snadná změna mezi kartáčováním, broušením a dobrušováním profilovaných dílců.<br />• Možnost dovybavit pěti typy kartáčů pro široké možnosti struktur povrchů.<br />• Možnost změny na plnohodnotnou válcovou brusku výměnou kartáče za brusný válec.<br />• Masivní konstrukce a kola pro snadnou manipulaci.<br />• Agregát poháněný přes klínový řemen.</strong><br /><br />Kartáčovací bruska JET je určená k vytváření imitace starého dřeva zvýrazněním struktury vláken pomocí kartáčovacího válce. S další výbavou umožňuje snadnou změnu mezi kartáčováním, broušením a dobrušováním profilovaných dílců. Můžete také brousit lišty a výplně s hloubkou profilu až 15 mm nebo egalizovat (sjednotit) tloušťku dílců. Je to unikátní víceúčelový kartáčovací stroj. Kartáčovací brusk', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_01_web.jpg', 0, '80173.33', '84182.00', '121-JBS22MA', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JBS22M/121-JBS-22_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8307, 953, 'JET JCDC-1,5 Cyklonová odsávací jednotka', 'JET JCDC-1,5 Cyklonová odsávací jednotka', '<p><strong>• Účinná cyklonová technologie.<br />• Nízká hlučnost.<br />• Účinná filtrace i jemného prachu 2 mikrony.<br />• Masivní kovové provedení.<br />• Kovový kontejner na odpad.<br />• Čištění filtračního nástavce bez demontáže.<br />• Dvoustupňové filtrování pilin a prachu.<br />• Mobilní kola cyklonu a odpadní nádoby.</strong><br /><br />JET Cyklonová filtrační jednotka má bezkonkurenční filtrační vlastnosti a nejlepší odsávací výkon při odsávání třísek a prachu od strojů. Dokáže se jedinečně přizpůsobit typu použití, což přispívá k jednoduchému a snadnému použití. Pevná konstrukce stroje a nižší hlučnost, než mají odsavače, zajišťují pohodlnou práci v dílně i po delší době.<br /><br />Nabízené modely mobilních cyklonů jsou vhodné k umístění v malé dílně nebo střední řemeslné dílně. Jednotlivě lze připojit až tři stroje najednou nebo můžete cyklon připojit k pevnému rozvodnému potrubí ve Vaší dílně a zabezpečit tak odsávání od všech strojů.<br /><br />Mobilní cyklony poskytují ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JCDC-15M/121-JCDC-15M_1_web.jpg', 0, '29320.00', '30786.00', '121-JCDC-15M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JCDC-15M/121-JCDC-15M_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JCDC-15M/121-JCDC-15M_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JCDC-15M/121-JCDC-15M_2_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JCDC-15M/121-JCDC-15M_3_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
