(8313, 959, 'JET JDR-34 Radiální vrtačka stolní', 'JET JDR-34 Radiální vrtačka stolní', '<p><strong>• Indukční 600W motor pro dlouhodobý chod.<br />• Litinový stůl s naklápěním +/- 90 °.<br />• Naklápěcí vrtací hlava.<br />• Ocelový sloup průměru 62 mm.<br />• Rychloupínací sklíčidlo s ochrannou vrstvou 1–16 mm.<br />• Odklápěcí bezpečnostní štít proti odlétajícím třískám.<br />• Maximální kapacita vrtání 410 mm.<br />• Laserový kříž ukazuje bod vrtání.</strong><br /><br />Radiální stolní vrtačka JET JDR-34 má výkonný indukční motor o příkonu 600 W určený pro dlouhodobý chod stroje. Vrtací vřeteno se zdvihem 80 mm je poháněné řemenem s možností volby 5-ti stupňů otáček od 500 do 2500 ot./min. Je vybaveno rychloupínacím sklíčidlem s ochrannou vrstvou s kapacitou 1–16 mm. Má průhledný otočný bezpečnostní kryt proti odlétajícím třískám s bezpečnostním odpojením proudu při výměně nástrojů. Sloup vrtačky je z masivní oceli průměru 62 mm. Litinový stůl má rozměr 220 x 220 mm a lze jej naklopit na obě strany až do svislé polohy tzn. +/- &nbsp;90 °. Maximální kapacita vrtání je 41', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_01_web.jpg', 0, '10201.91', '10712.00', '121-JDR-34', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34/121-JDR-34_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8314, 960, 'JET JDR-34F Radiální sloupová vrtačka', 'JET JDR-34F Radiální sloupová vrtačka', '<p><strong>&bull; Indukčn&iacute; 600 W motor pro douhodob&yacute; chod.<br />&bull; Kulat&yacute; litinov&yacute; stůl s nakl&aacute;pěn&iacute;m +/- 90 &deg;.<br />&bull; Neomezen&yacute; rozsah nastaven&iacute; stolu.<br />&bull; Nakl&aacute;pěc&iacute; vrtac&iacute; hlava.<br />&bull; Ocelov&yacute; sloup průměru 73 mm.<br />&bull; Rychloup&iacute;nac&iacute; skl&iacute;čidlo s ochrannou vrstvou 1&ndash;16 mm.<br />&bull; Odkl&aacute;pěc&iacute; bezpečnostn&iacute; &scaron;t&iacute;t proti odl&eacute;taj&iacute;c&iacute;m tř&iacute;sk&aacute;m.<br />&bull; Maxim&aacute;ln&iacute; kapacita vrt&aacute;n&iacute; 410 mm.<br />&bull; Laserov&yacute; kř&iacute;ž ukazuje bod vrt&aacute;n&iacute;.</strong><br /><br />Radi&aacute;ln&iacute; sloupov&aacute; vrtačka JET JDR-34F m&aacute; v&yacute;konn&yacute; indukčn&iacute; motor o př&iacute;konu 600 W určen&yacute; pro dlouhodob&yacute; chod stroje. Vrtac&iacute; vřeteno se zdvihem 80 mm je poh&aacute;něn&eacute; řemenem s možnost&iacute; v', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34F/121-JDR-34F_01_web.jpg', 0, '11754.29', '12342.00', '121-JDR-34F', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34F/121-JDR-34F_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34F/121-JDR-34F_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34F/121-JDR-34F_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JDR-34F/121-JDR-34F_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8315, 961, 'JET JOSS-S Oscilační válečková bruska', 'JET JOSS-S Oscilační válečková bruska', '<p><strong>• Optimální pracovní výška zajišťující pohodlí při práci.<br />• Stabilní a pevný stojan s integrovaným úložným prostorem.<br />• 10 brusných vřeten s průměry v rozsahu 6–100 mm s rychlou montáží.<br />• Kvalitní ložiska zajišťují vysokou přesnost vřetena.<br />• Převodovka v olejové lázni zaručuje dlouhou životnost.<br />• Pravidelná oscilace poskytuje hladký povrch obrobku.<br />• Velký litinový stůl umožňuje broušení rozměrných dílců.<br />• Nastavitelný úhel pracovního stolu.<br />• Jednoduchá výměna vřetene - pouze jedním klíčem.<br />• Flexibilní kryt pro zvýšení účinku odsávání.<br />• Rychlé a snadné naklopení stolu -15 ° až +45 °.<br />• Vybroušení každého úhlu.<br />• Uzamykání vřetene.<br />• Optimalizované odsávání.</strong><br /><br />Nová verze univerzální profesionální brusky s oscilací a plně sklopným stolem je určena pro profesionální broušení hran zakřivených dílců.<br /><br />Bruska má modernizované oscilační uložení, které zlepšuje kvalitu a účinnost brou', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_01_web.jpg', 0, '36812.38', '38653.00', '121-JOSS-SM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JOSS-S/121-JOSS-S_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8316, 962, 'JET JPT-10B Srovnávací a tloušťkovací frézka stolní s podstavcem', 'JET JPT-10B Srovnávací a tloušťkovací frézka stolní s podstavcem', '<p><strong>• Srovnávací šířka 254 mm.<br />• Výkonný motor 1,5 kW.<br />• Přesné srovnávací stoly a dlouhý stůl protahu.<br />• Jednoduchý přechod od srovnávání k tlouštkování.<br />• Naklopení opěrného pravítka 90°- 45°.<br />• Vhodná pro převoz na montáže.</strong><br /><br />Celková velikost a kompaktnost stroje umožňuje široké použití všude tam, kde byste se s klasickým strojem nikdy nedostali. JET JPT-10B má pevnou a stabilní konstrukci, přesné srovnávací stoly a dlouhý stůl protahu. Díky odsávacímu krytu, bezpečnostním krytům a pojistce na motoru je stroj vhodný pro každou kutilskou dílnu a také na převoz na montáže. Výhodou frézky je stabilní plechový podstavec opatřený gumovými nohami.<br /><br /><em>• Typ: JPT-10B<br />• Doporučené použití: Kutil<br />• Příkon (230 V): 1,5 kW<br />• Otáčky: 9000 ot./min.<br />• Průměr válce: 45 mm<br />• </em> <em>Rychlost posuvu protahování</em> <em>: 6 m/min.<br />• Počet žiletek na válci: 2 ks<br />• Max. úběr při srovnávání: 3 mm<br />• Ma', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_01_web.jpg', 0, '9943.81', '10441.00', '121-JPT-10B', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-10B/121-JPT-10B_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8317, 963, 'JET JPT-310HH Srovnávací a tloušťkovací frézka, žiletkový válec', 'JET JPT-310HH Srovnávací a tloušťkovací frézka, žiletkový válec', '<p><strong>Modely JPT-310HH a 410HH mají speciální válec osazený tvrdokovovými žiletkami sestavenými do spirály.</strong><br /><br /><strong>• Žiletkový hoblovací válec se 4 spirálovými drážkami.<br />• Tvrdokovové výměnné žiletky až s 20 krát delší životností.<br />• 4 vysoce přesné řezné hrany se zaoblením na každé žiletce.<br />• Vysoká kvalita opracovaného povrchu bez vytrhávání.<br />• Úspora až 40  % provozních nákladů na hoblování 1 metru.<br />• Snížená spotřeba energie.<br />• Výkonný motor 2,2 kW výkonu.<br />• Dlouhý masivní litinový srovnávací stůl.<br />• Jednoduchý přechod od srovnávání k tloušťkování.<br />• Současné odklápění obou srovnávacích stolů pouze jednou rukou.<br />• Nastavení výšky vstupního i výstupního stolu.</strong><br /><br />Pohodlně pouze jednou rukou lze zvednout litinový stůl. Přechod od srovnávání k tlouštkování nemůže být jednodušší. Se svým dlouhým stolem a přesným pravítkem je zde přesnost standardem, stejně jako vždy výborný povrch díky žiletkové', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_01_web.jpg', 0, '71600.00', '75180.00', '121-JPT-310HH-T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310HH-T/121-JPT-310HH_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8318, 964, 'JET JPT-310 Srovnávací a tloušťkovací frézka', 'JET JPT-310 Srovnávací a tloušťkovací frézka', '<p><strong>• Dlouhý masivní litinový srovnávací stůl.<br />• Jednoduchý přechod od srovnávání k tloušťkování.<br />• Současné odklápění obou srovnávacích stolů.<br />• Nastavení výšky vstupního i výstupního stolu.<br />• 3-nožová hoblovací hřídel.</strong><br /><br />Pohodlně pouze jednou rukou lze zvednout litinový stůl. Přechod od srovnávání k tlouštkování nemůže být jednodušší. Se svým dlouhým stolem a přesným pravítkem je zde přesnost standardem, stejně jako vždy výborný povrch díky 3 nožové hlavě. Nastavení výšky vstupního stolu pomocí excentrické páky je jednoduché a snadné. Možnost nastavení výšky výstupního stolu excentrem. Odsávací hubice udržuje stroj čistý při připojení k vhodnému systému odsávání. Stroj pro profesionální dílny nebo údržby i kutily s širokým rozsahem použití.<br /><br /><strong>Stroje pro profesionální dílny nebo údržby i kutily s širokým rozsahem použití.</strong><br /><br /><em>• Typ: JPT-310<br />• Doporučené použití: Profesionální výroba<br />• Příkon / ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_01_web.jpg', 0, '50466.67', '52990.00', '121-JPT-310T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-310T/121-JPT-310T_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8319, 965, 'JET JPT-410HH Srovnávací a tloušťkovací frézka, žiletkový válec', 'JET JPT-410HH Srovnávací a tloušťkovací frézka, žiletkový válec', '<p><strong>Modely JPT-310HH a 410HH mají speciální válec osazený tvrdokovovými žiletkami sestavenými do spirály.<br /><br />• Žiletkový hoblovací válec se 4 spirálovými drážkami.<br />• Tvrdokovové výměnné žiletky až s 20 krát delší životností.<br />• 4 vysoce přesné řezné hrany se zaoblením na každé žiletce.<br />• Vysoká kvalita opracovaného povrchu bez vytrhávání.<br />• Úspora až 40  % provozních nákladů na hoblování 1 metru.<br />• Snížená spotřeba energie.<br />• Výkonný motor 3,0 kW výkonu.<br />• Dlouhý masivní litinový srovnávací stůl.<br />• Jednoduchý přechod od srovnávání k tloušťkování.<br />• Současné odklápění obou srovnávacích stolů pouze jednou rukou.<br />• Nastavení výšky vstupního i výstupního stolu.</strong><br /><br />Pohodlně pouze jednou rukou lze zvednout litinový stůl. Přechod od srovnávání k tlouštkování nemůže být jednodušší. Se svým dlouhým stolem a přesným pravítkem je zde přesnost standardem, stejně jako vždy výborný povrch díky žiletkovému válci. Nastave', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410HH-T/121-JPT-410HH_01_web.jpg', 0, '93323.81', '97990.00', '121-JPT-410HH-T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410HH-T/121-JPT-410HH_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410HH-T/121-JPT-410HH_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410HH-T/121-JPT-410HH_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410HH-T/121-JPT-410HH_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8320, 966, 'JET JPT-410 Srovnávací a tloušťkovací frézka', 'JET JPT-410 Srovnávací a tloušťkovací frézka', '<p><strong>• Dlouhý masivní litinový srovnávací stůl.<br />• Jednoduchý přechod od srovnávání k tloušťkování.<br />• Současné odklápění obou srovnávacích stolů.<br />• Nastavení výšky vstupního i výstupního stolu.<br />• 3-nožová hoblovací hřídel.</strong><br /><strong>• Šířka srovnávání 407 mm.<br />• Výkonný motor 3 kW výkonu.</strong><br /><br />Pohodlně pouze jednou rukou lze zvednout litinový stůl. Přechod od srovnávání k tlouštkování nemůže být jednodušší. Se svým dlouhým stolem a přesným pravítkem je zde přesnost standardem, stejně jako vždy výborný povrch díky 3 nožové hlavě. Nastavení výšky vstupního stolu pomocí excentrické páky je jednoduché a snadné. Možnost nastavení výšky výstupního stolu excentrem. Odsávací hubice udržuje stroj čistý při připojení k vhodnému systému odsávání. Stroj pro profesionální dílny nebo údržby i kutily s širokým rozsahem použití.<br /><br /><strong>Stroje pro profesionální dílny nebo údržby i kutily s širokým rozsahem použití.</strong><br /><br />', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_01_web.jpg', 0, '66657.14', '69990.00', '121-JPT-410T', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JPT-410T/121-JPT-410_03_web.jpg', 21, 1, 1, 1, '8,59176E+12', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8321, 967, 'JET JSG-64 Kombinovaná bruska', 'JET JSG-64 Kombinovaná bruska', '<p><strong>&bull; Rychl&eacute; napnut&iacute; a uvolněn&iacute; brusn&eacute;ho p&aacute;su.<br />&bull; &Uacute;hlov&eacute; prav&iacute;tko veden&eacute; v T-dr&aacute;žce.<br />&bull; Sklopn&eacute; rameno s brusn&yacute;m p&aacute;sem.<br />&bull; Pracovn&iacute; stůl z lit&eacute;ho hlin&iacute;ku.</strong><br /><br />Kombinovan&aacute; bruska JSG-64 je určena pro občasn&eacute; použit&iacute; v truhl&aacute;řsk&eacute; d&iacute;lně a do kutilsk&yacute;ch d&iacute;len. Bruska je vhodn&aacute; pro men&scaron;&iacute; d&iacute;lce, čela, hrany a ploch&eacute; č&aacute;sti, zaoblov&aacute;n&iacute; hran, odstraňov&aacute;n&iacute; star&yacute;ch n&aacute;těrů. Jednotku s brusn&yacute;m p&aacute;sem můžete nastavit v libovoln&eacute;m sklonu. Při horizont&aacute;ln&iacute;m nakloněn&iacute; můžete brousit velk&eacute; plochy. V t&eacute;to poloze využijete př&iacute;čnou zar&aacute;žku nad p&aacute;sem. Je-li jednotka nastavena vertik&aacute;lně, může zar&aacute;žka sloužit jako opěr', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_01_web.jpg', 0, '3920.95', '4117.00', '121-JSG-64', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG-64/121-JSG-64_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8322, 968, 'JET JSG-96 Kombinovaná bruska', 'JET JSG-96 Kombinovaná bruska', '<p><strong>&bull; Brusn&yacute; kotouč průměru 230 mm.<br />&bull; Litinov&yacute; stůl s dorazy na 45 &deg; a 90 &deg;.<br />&bull; &Scaron;&iacute;řka p&aacute;su 150 mm.<br />&bull; Podpůrn&yacute; stůl s grafitovou podložkou.<br />&bull; Integrovan&eacute; ods&aacute;v&aacute;n&iacute; v&yacute;vod 100 mm.<br />&bull; P&aacute;sov&aacute; bruska naklopiteln&aacute; vertik&aacute;ln&iacute; a vodorovně.</strong><br /><br />Kombinovan&aacute; bruska m&aacute; brusn&yacute; kotouč z poloviny uzavřen a jako opěra slouž&iacute; přesně brou&scaron;en&yacute; litinov&yacute; stůl, kter&yacute; můžete nakl&aacute;nět o 45 &deg;. Stůl je opatřen dvěma T-dr&aacute;žkami, kter&eacute; využijete pro prav&iacute;tko nebo hrot. Integrovan&eacute; ods&aacute;v&aacute;n&iacute; je opatřeno hrad&iacute;tky, aby bylo ods&aacute;v&aacute;n&iacute; &uacute;činn&eacute;. Bruska může b&yacute;t upevněna př&iacute;mo na pracovn&iacute; stůl nebo na voliteln&yacute; podstavec s &uacute;ložn&yacute;m prost', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_01_web.jpg', 0, '13320.00', '13986.00', '121-JSG-96M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSG96M/121-JSG96M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8323, 969, 'JET JSMS-10L Pokosová pila s pojezdem a laserem', 'JET JSMS-10L Pokosová pila s pojezdem a laserem', '<p><strong>• 9 předvoleb úhlů úkosu.<br />• HM pilový kotouč v ceně.<br />• Silný motor s brzdou.<br />• Laser pro označení řezu.<br />• Vhodná i pro lamináty.<br />• Čisté řezy měkkého i tvrdého dřeva.<br />• Rozšíření stolu až na 103 cm v ceně.</strong><br /><br />Pokosová pila JSMS-10L o hmotnosti 18 kg, avšak robustní konstrukce. Je to vynikající pomocník, bezpečný a s vynikajícími řezy za všech okolností. Pila řeze přesně a čistě měkké i tvrdé dřevo a lamináty díky 1500W motoru s brzdou. Má laser, který Vám označí řez. Je vybavena HM kotoučem. Rozšíření stolu poskytuje podporu dílců až v délce 1030 mm.<br /><br /><strong>Vysoce kvalitní, oblíbená pokosová pila s kompaktními rozměry a s vynikající řeznou kapacitou 305x90 mm.<br />Devět předvoleb pozic nabízí všechny potřebné úhly úkosu pro truhlářské a tesařské práce.&nbsp;</strong><br /><br /><em>•&nbsp;</em><em>Typ: JSMS-10L</em><br /><em>•&nbsp;</em><em>Doporučené použití: Řemeslník</em><br /><em>•&nbsp;</em><em>Příkon (230 V): ', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_01_web.jpg', 0, '5900.00', '6195.00', '121-JSMS-10LM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSMS-10LM/121-JSMS-10LM_pokos.pila_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8324, 970, 'JET JSMS-12L Pokosová pila s pojezdem a laserem', 'JET JSMS-12L Pokosová pila s pojezdem a laserem', '<p><strong>• HM pilový kotouč v ceně.<br />• Silný motor s brzdou.<br />• Laser pro označení řezu.<br />• Vhodná i na lamináty.<br />• Čisté řezy měkkého i tvrdého dřeva.<br />• Rozšíření stolu až na 730 mm v ceně.<br />• Pracovní stůl z litého hliníku.<br />• Výsuv agregátu ve válečkovém vedení.<br />• Průměr kotouče 305 mm.</strong><br /><br />Jet JSMS-12L zakracovací a pokosová pila je vybavena 305 mm velkým pilovým kotoučem a možností výsuvu agregátu ve válečkovém vedení. Díky kapacitě řezu můžete pilu použit v dílně i na montáži nebo na stavbě k řezání podlahových lišt, obložek, stěnových panelů. Výkon motoru je dostatečně vysoký, abyste zvládli řezat různé druhy materiálů.<br /><br />Stůl lze otočit na levou a pravou stranu, v každé poloze jej můžete zafixovat, a je vybaven stop-západkami. Naklápění se provádí naklopením na levou stranu. V maximální poloze jsou koncové dorazy, které je možné nastavit. Pro zjednodušení řezání je stroj vybaven laserovým naváděcím paprskem.<br /><br', '_vyr_97023.jpg', 0, '8528.57', '8955.00', '121-JSMS-12LM', '_vyrn_97023.jpg', '_vyrp11_97024.jpg', '_vyrp12_97025.jpg', '_vyrp13_97026.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8325, 971, 'JET JSS-16MA Vyřezávací lupínková pila stolní', 'JET JSS-16MA Vyřezávací lupínková pila stolní', '<p><strong>• Pracovní stůl s naklopením až 45°.<br />• Ofuk pracovní plochy pro snazší a přesný řez.<br />• Silný komutátorový motor.<br />• Litinová základna pro lepší stabilitu a snížení vibrací.</strong><br /><br />Elektrická lupínková pila nebo-li dekupírka JET je vybavena výkonným komutátorovým DC motorem s plynulou regulací kmitů (550-1.600 / min). Proto s ní lze snadno řezat širokou škálu materiálů až do tloušťky 50 mm. Průměr odsávací hubice pro připojení k odsavači je 35 mm. Velkorysý stůl (410 x 254 mm) s maximální šířkou řezu 510 mm je možné naklápět až na 45° pro úhlové řezání. Pila je dodávána s kolíkovým upínáním pilových listů. Uvolňovací ovládací kolo umožňuje rychlou a snadnou výměnu. Ventilátor pomáhá udržet místo řezu čisté a dobře viditelné. Díky těžké litinové základně je stroj stabilní a má minimální vibrace.<br /><br /><em>• Typ: JSS-16<br />• Doporučené použití : Kutil<br />• Příkon (230 V): 90 W<br />• Kmity pilového listu: 550 - 1600 / min<br />• Délka pilovéh', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_01_web.jpg', 0, '3514.29', '3690.00', '121-JSS-16MA', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSS-16MA/121-JSS-16MA_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8326, 972, 'JET JSSG-10 Bruska na nástroje', 'JET JSSG-10 Bruska na nástroje', '<p><strong>• Brusný kotouč 250 mm.<br />• Regulace otáček.<br />• Bohaté příslušenství v základu.<br />• Velký výběr volitelného příslušenství.</strong><br /><br />Velmi účinná bruska pro broušení nářadí a nástrojů. Spodní část brusných&nbsp;kotoučů je ve vodní nádržce, čímž se zajišťuje chlazení a eliminuje přehřátí.&nbsp;Robustní a silný motor s plynulou regulací otáček 90 - 150 ot./min.<br /><br />Spodní část brusného kamene je ponořena ve vodní lázni. Jak se brusný kámen otáčí,&nbsp;průběžně přivádí vodu na broušený povrch, a tím je chlazen a eliminuje se tak riziko&nbsp;přehřívání materiálu. Bruska má 90 - 150 ot./min., a 160 W motor. Otáčky motoru se&nbsp;mohou regulovat. Pokud je brusný kotouč průměru 250 mm, nastavte brusku na nižší&nbsp;otáčky 90 ot./min. Během času se bude brusný kámen obrušovat a jeho průměr se zmenší,&nbsp;pak použijte regulaci otáček pro dosažení optimální obvodové rychlosti a otáčky zvyšte.<br /><br /><em>• Typ JSSG-10M<br />• Doporučené použití Profesion', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_01_web.jpg', 0, '7499.05', '7874.00', '121-JSSG-10M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JSSG-10M/121-jssg-10_bruska_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8327, 973, 'JET JTS-10 Stolní pila s podstavcem', 'JET JTS-10 Stolní pila s podstavcem', '<p><strong>• Vlastní podstavec v ceně.<br />• Silný motor s brzdou.<br />• Naklápění a výškové nastavení kotouče.<br />• Úhlové pravítko.<br />• Paralelní pravítko.<br />• Rozšíření stolu vlevo, vpravo a zadní.<br />• HM pilový kotouč v ceně.<br />• Stavitelná výška řezu až 80 mm.</strong><br /><br />Tato vysoce oblíbená stolní pila je vybavena 1500W motorem s brzdou a ve spojení s průměrem kotouče 254 mm dává impozantní výšku řezu až 80 mm. Všechny funkce, které najdete ve vyšších řadách pil jsou na JET JTS-10. Nastavitelná výška řezu, úhlové řezání 0–45° a úhlové pravítko, paralelní pravítko, rozšíření stolu a 40 zubový HM pilový kotouč. Dodávána včetně stolu - podstavce.<br /><br /><em>• Typ: JTS-10<br />• Doporučené použití: Kutil<br />• Příkon (230 V): 1,5 kW<br />• Kotouč x upínání: 254 x 30 mm<br />• Otáčky: 4500 ot./min.<br />• Naklopení kotouče: 0–45°<br />• Max. výška řezu při 45°: 55 mm<br />• Max. výška řezu při 90°: 80 mm<br />• Maximální šířka řezu: 410 mm<br />• Velikost', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_1_web.jpg', 0, '5837.14', '6129.00', '121-JTS-10M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-10M/121-JTS10_2_web.jpg', 'JET JTS-10 Stolní pila s podstavcem', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8328, 974, 'JET JTS-254 Mobilní kotoučová pila s podstavcem', 'JET JTS-254 Mobilní kotoučová pila s podstavcem', '<p><strong>• Pohodlné nastavení naklopení pilového kotouče.<br />• Jednoduché nastavení hloubky řezu.<br />• Přesný hliníkový stůl s vozíkem.<br />• Integrované podélné pravítko s možností naklopení.<br />• Úhlové pravítko s možností upevnění k posuvnému vozíku.<br />• Rukojeť a kola pro snadnou manipulaci a přepravu.<br />• Sklopný podstavec.</strong><br /><br />JET JTS-254 je plně vybavený kompaktní stroj pro práci na stavbách, na montážích nebo pro kutilskou práci se dřevem. Inteligentní konstrukce kombinuje přesnost, produktivitu a jednoduchost s minimálními rozměry. Díky rukojeti a kolečkům lze s pilou jednoduše manipulovat a převážet v autě na montáže.<br /><br />Pro řezání pod úhlem a pro práci s malými obrobky je na pile nastavitelné úhlové pravítko, které je možno upevnit k posuvnému vozíku. Tato kombinace posuvného vozíku a úhlovacího pravítka nabízí pohodlné a přesné zakracování.<br /><br />Podélné pravítko zajišťuje integrovaný mechanizmus, který slouží také pro rozšíření p', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_01_web.jpg', 0, '13853.33', '14546.00', '121-JTS-254M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-254M/121-JTS-254M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8329, 975, 'JET JTS-315SP Kotoučová pila - 230V', 'JET JTS-315SP Kotoučová pila - 230V', '<p><strong>• Posuvný stůl pro přesné řezy v ceně.<br />• Zadní přídavný stůl v ceně.<br />• Brzděný indukční motor.<br />• Excentrické upínání podélného pravítka.<br />•&nbsp;Přesné vedení podpěrného stolu na šesti ložiskách.<br />•&nbsp;Odsávání z vrchu a zespod kotouče.</strong><br /><br />Pila z pozinkované oceli pro použití v dílně nebo na stavbě. Nohy lze složit pro přepravu v dodávce nebo v osobním automobilu. I když pily tohoto typu jsou obvykle používány pro rozřezávání, lze snadno provádět přesné zakrácení buď kolmo nebo pod úhlem pomocí posuvného stolu s vozíkem (dodávány jako standard). Mezi další funkce této vynikající pily patří bržděný indukční motor, zadní odkládací přídavný stůl, odsávání nad a pod kotoučem a volitelné rozšíření stolu o boční přídavný stůl.<br /><br />JTS-315 SP je k dispozici v provedení 230 V a 400 V. Standardně je pila dodávána se zadním přídavným stolem, 315 mm HM pilovým kotoučem, který lze sklopit až na 47°, pravítkem pro podélné řezy, posuvným st', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 0, '12972.38', '13621.00', '121-JTS-315SPM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_2_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_3_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07');
