(8330, 976, 'JET JTS-315SP Kotoučová pila - 400V', 'JET JTS-315SP Kotoučová pila - 400V', '<p><strong>• Posuvný stůl pro přesné řezy v ceně.<br />• Zadní přídavný stůl v ceně.<br />• Brzděný indukční motor.<br />• Excentrické upínání podélného pravítka.<br />•&nbsp;Přesné vedení podpěrného stolu na šesti ložiskách.<br />•&nbsp;Odsávání z vrchu a zespod kotouče.</strong><br /><br />Pila z pozinkované oceli pro použití v dílně nebo na stavbě. Nohy lze složit pro přepravu v dodávce nebo v osobním automobilu. I když pily tohoto typu jsou obvykle používány pro rozřezávání, lze snadno provádět přesné zakrácení buď kolmo nebo pod úhlem pomocí posuvného stolu s vozíkem (dodávány jako standard). Mezi další funkce této vynikající pily patří bržděný indukční motor, zadní odkládací přídavný stůl, odsávání nad a pod kotoučem a volitelné rozšíření stolu o boční přídavný stůl.<br /><br />JTS-315 SP je k dispozici v provedení 230 V a 400 V. Standardně je pila dodávána se zadním přídavným stolem, 315 mm HM pilovým kotoučem, který lze sklopit až na 47°, pravítkem pro podélné řezy, posuvným st', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 0, '12972.38', '13621.00', '121-JTS-315SPT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_1_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_2_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-315SPM/121-JTS-315SP_3_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8331, 977, 'JET JTS-600XL Formátovací kotoučová pila', 'JET JTS-600XL Formátovací kotoučová pila', '<p><strong>• Délka formátovacího stolu 1300 mm.<br />• Pevná a stabilní konstrukce stroje.<br />• Masivní litinový držák pilového agregátu.<br />• Litinová ovládací kola.<br />• Snadná obsluha a jednoduchá údržba.<br />• Pevný a přesný formátovací stůl z eloxovaného, extrudovaného hliníku.<br />• Přesné úhlování na hlavním pravítku díky otočným dorazům.<br />• Broušený masivní litinový stůl s bočním a zadním rozšířením.<br />• Odsávání z vrchu a zespod kotouče.<br />• Pravítko 2200 mm s posuvným dorazem.<br />• Možnost naklopení na 45 °.<br />• Výložník pro přesné řezání v základní výbavě.<br />• Velká snadno čitelná stupnice naklopení kotouče až 45 °.<br />• Podélné pravítko s integrovaným jemným nastavením.</strong><br /><br />Formátovací kotoučová pila JET JTS-600XL je profesionální stroj, který je určen pro přesné řezání dřeva a velkoplošných materiálů s délkou řezu na formátovacím vozíku až 1300 mm. Díky kompaktnosti je vhodná do menších a středních dílen nebo jako doplňkový stroj', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_01_web.jpg', 0, '48180.95', '50590.00', '121-JTS-600XLT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XLT/121-JTS-600XLT_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8332, 978, 'JET JTS-600X Formátovací kotoučová pila', 'JET JTS-600X Formátovací kotoučová pila', '<p><strong>• Přesný broušený a rovný litinový stůl.<br />• Masivní litinový držák pilového agregátu pro přesné řezy.<br />• Jednoduché nastavení pomocí litinových ovládacích kol.<br />• Podélné pravítko s integrovaným jemným nastavením.<br />• Posuvný formátovací stůl z masivního eloxovaného hliníku.<br />• Pravítko 2200 mm na výložníku 460x600mm pro dlouhé dílce.<br />• Uzamykatelný vypínač proti neoprávněné manipulaci.<br />• Odsávací hubice 100 mm pro odvod prachu a třísek.</strong><br /><br />Kotoučová pila se zkracovacím vozíkem JTS-600X má robustní podstavec, paralelní pravítko, silný motor, zkracovací posuvný stůl 1000 x 255 mm s výložníkem a 80 mm hloubku řezu. Velmi snadno si poradí s masivním dřevem a deskovým&nbsp;materiálem. Tento stroj zvládne všechny požadavky v malé a střední dílně, na údržbě nebo v kutilské dílně.<br /><br />Snadno lze přesouvat po dílně pomocí mobilního podstavce (není součástí stroje obj.kód 121 - 708118).<br />Ke stroji je možné dokoupit přesné úhlov', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_01_web.jpg', 0, '36180.95', '37990.00', '121-JTS-600XT', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JTS-600XT/121-JTS-600X_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8333, 979, 'JET JWBS-14Q Pásová pila', 'JET JWBS-14Q Pásová pila', '<p><strong>• Páka pro rychlé povolení pásu.<br />• Paralelní pravítko a úhelník v základní výbavě.<br />• Přesné a nastavitelné vedení pásu.<br />• Naklopení stolu -10 ° až 45 °.</strong><br /><br />Pásová pila JET JWBS-14Q je určena pro středně těžkou práci. Má dvě rychlosti, litá vyvážená kola, zamykání, super litinový stůl, který můžete naklonit od -10 ° až +45 °. Paralelní pravítko, které je fixováno na přední a zadní straně stolu, sahá mírně nad stůl z litiny. Pilový pás je veden nad a pod stolem mezi ložisky a válečky, které mu poskytují velmi přesné vedení, což vede k ideální kvalitě řezu a prodlužuje životnost pilového pásu. Stroje jsou vybaveny bezpečnostními vypínači, elektromechanickou motorovou brzdou a snadno přístupným uvolněním pásu při jeho výměně.&nbsp;Tyto pily jsou určeny pro profesionální dílnu, kde je požadována přesnost a kvalita práce.<br /><br />Pro snadné přesouvání těchto strojů po dílně doporučujeme nákup mobilního podstavce, díky němuž lze se strojem posouva', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_01_web.jpg', 0, '28523.81', '29950.00', '121-JWBS-14QM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-14QM/121-JWBS-14Q_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8334, 980, 'JET JWBS-9 Pásová stolní pila na dřevo', 'JET JWBS-9 Pásová stolní pila na dřevo', '<p><strong>• Pilový pás šíře 6 mm v základu<br />• Robustní stůl z litého hliníku<br />• Přesné úhlovací pravítko<br />• Naklopení stolu až 45°<br />• Osvětlení stolu</strong><br /><br />Malá pásová pila pro běžné přesné práce má skvěle vyvážená unášecí kola. Robustní stůl stroje lze naklápět na 45°. Stroj je vybaven tichým indukčním motorem 350W a osvětlením pracovního prostoru. Maximální výška řezu je 80 mm. Dodávána včetně přesného pokosového pravítka s hliníkovým profilem s naklopením +/- 60°.<br /><br /><em>• Typ: JWBS-9<br />• Doporučené použití: Kutil<br />• Příkon (230 V): 350 W<br />• Délka pásu: 1510 mm<br />• Rychlost pásu: 670 m/min.<br />• Šířka pásu min. / max.: 6 / 10 mm<br />• Max. šířka řezu: 230 mm<br />• Max. výška řezu: 80 mm<br />• Rozměry stolu: 300 x 300 mm<br />• Naklopení stolu: 0° až 45°<br />• Průměr kola: 240 mm<br />• Odsávání: 50 mm<br />• Délka x šířka x výška: 480 x 450 x 730 mm<br />• Hmotnost: 17 kg</em></p>', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_01_web.jpg', 0, '4030.48', '4232.00', '121-JWBS-9M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_02a_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWBS-9M/121-JWBS-9_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8335, 981, 'JET JWDS-1632 Válcová bruska', 'JET JWDS-1632 Válcová bruska', '<p><strong>• Technologie Sandsmart™ průběžně kontroluje zatížení stroje a automaticky upravuje rychlost pásu.<br />• Rovinnost pásu jednoduše upravíte otočením kola na boční straně stroje a to bez použití nářadí.<br />• Systém naklonění stolu je navíc vybaven dorazem pro rychlý návrat do původní polohy.<br />• Odsávací kryt vytváří odsávací kanál, která kopíruje tvar válce a směřuje tak třísky a prach přímo do odsávání.</strong><br /><br />Představujeme zcela nově navrženou válcovou brusku JET JWDS. Silný motor nabízí více než dost výkonu na zvládnutí jakéhokoliv broušení. Inovativní systém nastavení rovinnosti stolu vůči brusnému válci umožňuje jednoduchou úpravnu sklonu podle typu broušení a požadavku na finální výsledek. Naklonění stolu jednoduše nastavíte pootočením kola. Regulace pro plynulou změnu rychlosti posuvu umožňuje zvolení optimální rychlosti pro ideální výsledek, zatímco technologie Sandsmart™ průběžně monitoruje zatížení stroje a zabraňuje tak přetížení motorů. Přesná k', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_01_web.jpg', 0, '29935.24', '31432.00', '121-JWDS-1632M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1632M/121-JWDS-1632M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8336, 982, 'JET JWDS-1836 Válcová bruska', 'JET JWDS-1836 Válcová bruska', '<p><strong>• Technologie Sandsmart™ průběžně kontroluje zatížení stroje a automaticky upravuje rychlost pásu.<br />• Rovinnost pásu jednoduše upravíte otočením kola na boční straně stroje a to bez použití nářadí.<br />• Systém naklonění stolu je navíc vybaven dorazem pro rychlý návrat do původní polohy.<br />• Odsávací kryt vytváří odsávací kanál, která kopíruje tvar válce a směřuje tak třísky a prach přímo do odsávání.</strong><br /><br />Představujeme zcela nově navrženou válcovou brusku JET JWDS. Silný motor nabízí více než dost výkonu na zvládnutí jakéhokoliv broušení. Inovativní systém nastavení rovinnosti stolu vůči brusnému válci umožňuje jednoduchou úpravnu sklonu podle typu broušení a požadavku na finální výsledek. Naklonění stolu jednoduše nastavíte pootočením kola. Regulace pro plynulou změnu rychlosti posuvu umožňuje zvolení optimální rychlosti pro ideální výsledek, zatímco technologie Sandsmart™ průběžně monitoruje zatížení stroje a zabraňuje tak přetížení motorů. Přesná k', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1836M/121-JWDS-1836M_01_web.jpg', 0, '32013.33', '33614.00', '121-JWDS-1836M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1836M/121-JWDS-1836M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1836M/121-JWDS-1836M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1836M/121-JWDS-1836M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWDS-1836M/121-JWDS-1836M_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8337, 983, 'JET JWL-1221VS Soustruh na dřevo', 'JET JWL-1221VS Soustruh na dřevo', '<p><strong>&bull; Elektronick&aacute; plynul&aacute; regulace ot&aacute;ček 60&ndash;3600 ot./min.<br />&bull; Zpětn&yacute; chod a digit&aacute;ln&iacute; displej ot&aacute;ček.<br />&bull; Siln&yacute; 730 W motor se zpětn&yacute;m chodem.<br />&bull; Plně litinov&aacute; konstrukce s extra &scaron;irok&yacute;m ložem 17 cm.<br />&bull; Litinov&yacute; kon&iacute;k s poohybov&yacute;m trap&eacute;zov&yacute;m &scaron;roubem Acme.<br />&bull; Mimoř&aacute;dně stabiln&iacute; a bez vibrac&iacute;.<br />&bull; Nov&yacute; syst&eacute;m nap&iacute;n&aacute;n&iacute; p&aacute;su, vždy perfektn&iacute; a rychl&aacute; změna.<br />&bull; Ergonomicky um&iacute;stěn&eacute; ovl&aacute;dac&iacute; prvky po prav&eacute; ruce.<br />&bull; Indexace 24 pozic vřetene po 15 &deg;.</strong><br /><br />JET JWL-1221VS je kompaktn&iacute; revolučn&iacute; soustruh nov&eacute; generace pln&yacute; unik&aacute;tn&iacute;ch konstrukčn&iacute;ch ře&scaron;en&iacute;, kter&eacute; usnadn&iacute; a zpř&iacute', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_01a.jpg', 0, '21239.05', '22301.00', '121-JWL-1221VS', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_01a.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_01a.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS/121-JWL-1221VS_03.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8338, 984, 'Sada JET JWL-1221VS Soustruh + JET Podstavec', 'Sada JET JWL-1221VS Soustruh + JET Podstavec', '<h1 style=\\\"font-weight: bolder; font-stretch: normal; font-size: 22.496px; line-height: normal; font-family: Arial, Helvetica, sans-serif; color: #000000;\\\"><span style=\\\"color: #ff0000;\\\">+ ZDARMA Podstavec</span></h1>\\n<p style=\\\"margin: 0px auto; line-height: 20px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 11.84px;\\\"><strong style=\\\"font-size: 11.84px;\\\">• </strong><a href=\\\"http://www..cz/jet-podstavec-pro-soustruh-jwl-1221vs\\\">JET Podstavec pro soustruh JWL-1221VS</a></p>\\n<p><br /><br /><strong>• Elektronická plynulá regulace otáček 60–3600 ot./min.<br />• Zpětný chod a digitální displej otáček.<br />• Silný 730 W motor se zpětným chodem.<br />• Plně litinová konstrukce s extra širokým ložem 17 cm.<br />• Litinový koník s poohybovým trapézovým šroubem Acme.<br />• Mimořádně stabilní a bez vibrací.<br />• Nový systém napínání řemenu, vždy perfektní a rychlá změna.<br />• Ergonomicky umístěné ovládací prvky po pravé ruce.<br />• Indexace 24 pozic vřeten', '_vyr_984716JO4hN-FL-_SX425_.jpg', 0, '25113.10', '30469.00', '121-JWL-1221VS-S1', '_vyrn_984716JO4hN-FL-_SX425_.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS-S1/00_121-JWL-1221VS-S1_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS-S1/121-JWL-1221VS_01a.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1221VS-S1/121-JWL-1221VS_02_web.jpg', 21, 1, 0, 1, '', 0, '3-62-402-0', NULL, '2021-01-10 15:44:07'),
(8339, 985, 'JET JWL-1440VS Soustruh na dřevo', 'JET JWL-1440VS Soustruh na dřevo', '<p><strong>• Plně litinová konstrukce s extra širokým ložem.<br />• Litinový vřeteník se otáčí o 360 ° se 7 přednastavenými pozicemi.<br />• Pozice v 0, 30, 60, 90, 120, 180, a 270 ° pro maximální variabilitu a optimální uživatelský komfort.<br />• Plynulá regulace otáček 280–2500 ot./min.<br />• Vylepšené uzamčení pozice a prodloužený zdvih opěrky.<br />• Trapézový kluzný závit koníku typu Acme pro vrtací operace.<br />• Vylepšené uzamčení koníku.<br />• Snadno čitelný displej s ukazatelem otáček.<br />• Volitelné prodloužení lože o 508 mm a litinový podstavec (2 nohy).<br />• CE certifikace.</strong><br /><br />JWL-1440VS je druhou úspěšnou generací robustních soustruhů JET střední velikosti, které vynikají robustní litinovou konstrukcí, dostatkem síly, přesnosti a flexibility, která je při soustružení dřeva potřebná. Vřeteno je uloženo v masivních ložiscích a je poháněno 750 W motorem s plynulou regulací otáček a s digitálním ukazatelem na LCD displeji. Vřeteno lze indexovat po 10 °', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_01_web.jpg', 0, '349191.43', '366651.00', '121-JWL-1440VS', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1440VS/121-JWL-1440VS_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8340, 987, 'JET JWL-1640EVS Soustruh na dřevo', 'JET JWL-1640EVS Soustruh na dřevo', '<p><strong>• Plně litinová konstrukce s extra širokým ložem.<br />• Posuvný litinový vřeteník se otáčí o 360 ° se 7 přednastavenými pozicemi.<br />• Prodloužené uložení vřetene s dvojitými ložisky.<br />• Zdokonalený uzamykací mechanismus koníku.<br />• Trapézový kluzný závit koníku typu Acme pro hladký a přesný pohyb.<br />• Bezzávitové uzamykání koníku klínovým systémem.<br />• Elektronická plynulá regulace otáček 40-3200 ot/min.<br />• 36 poloh indexování.<br />• Zajištění vřeteníku přístupné z přední strany soustruhu.<br />• Držák nástrojů umístěný na noze pod vřeteníkem.<br />• Prakticky umístěný digitální displej zobrazení otáček.<br />• Gumová odkládací plocha na vrchní straně vřeteníku.<br />• CE certifikace.</strong><br /><br />Soustruh JWL-1640VS s plynule nastavitelnými otáčkami je vybaven špičkovými funkcemi, které jej výrazně odlišují od ostatních soustruhů ve stejné kategorii. Posuvný vřeteník je otočný o 360 stupňů se 7 přednastavenými pozicemi. To umožňuje zvolit nejpoh', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_01_web.jpg', 0, '52404.76', '55025.00', '121-JWL-1640EVSM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_05_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1640EVSM/121-JWL-1640EVSM_06_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8341, 989, 'JET JWL-1840EVS Soustruh na dřevo', 'JET JWL-1840EVS Soustruh na dřevo', '<p><strong>• Plně litinová konstrukce s extra širokým ložem.<br />• Posuvný litinový vřeteník se otáčí o 360 ° se 7 přednastavenými pozicemi.<br />• Prodloužené uložení vřetene s dvojitými ložisky.<br />• Zdokonalený uzamykací mechanismus koníku.<br />• Trapézový kluzný závit koníku typu Acme pro hladký a přesný pohyb.<br />• Bezzávitové uzamykání koníku klínovým systémem.<br />• Elektronická plynulá regulace otáček 40-3200 ot/min.<br />• 36 poloh indexování.<br />• Zajištění vřeteníku přístupné z přední strany soustruhu.<br />• Držák nástrojů umístěný na noze pod vřeteníkem.<br />• Prakticky umístěný digitální displej zobrazení otáček.<br />• Gumová odkládací plocha na vrchní straně vřeteníku.<br />• CE certifikace.</strong><br /><br />Soustruh JWL-1840VS s plynule nastavitelnými otáčkami je vybaven špičkovými funkcemi, které jej výrazně odlišují od ostatních soustruhů ve stejné kategorii. Posuvný vřeteník je otočný o 360 stupňů se 7 přednastavenými pozicemi. To umožňuje zvolit nejpoh', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_01_web.jpg', 0, '66234.29', '69546.00', '121-JWL-1840EVSM', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWL-1840EVS/121-JWL-1840EVS_03_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8342, 990, 'JET JWP-12 Tloušťkovací frézka stolní', 'JET JWP-12 Tloušťkovací frézka stolní', '<h2><span style=\\\"color:#FF0000;\\\">+ ZDARMA 2 sady nožů HSS na měkké a tvrdé dřevo</span><br /><span style=\\\"line-height: 1.2; font-size: 13px;\\\">(Jedna sada nožů ZDARMA je upnutá v hoblovacím válci.)</span></h2><p><strong>• Výkonný motor<br />• Úběr materiálu až 2,5 mm<br />• Masivní vedení agregátu<br />• Dvounožový válec</strong><br /><br />Hoblovací válec je osazen 2ks hoblovacích žiletek HSS. Otáčky a vhodná rychlost posuvu zajišťují vynikající povrch opracování. Stroj je vybaven ochranou proti přetížení s bezpečnostní pojistkou. Maximální tloušťka materiálu je 153 mm a maximální šířka 318 mm. Sklopné nástavce stolu s válečky na koncích poskytují podporu pro dlouhé dílce.<br />Kryt hoblovacího válce umožňuje připojení odsávacího zařízení.<br /><br /><strong>Díky výkonnému motoru tloušťkovací frézy JET je možný úběr materiálu až 2,5 mm při jednom protažení.</strong><br /><br /><em>• Typ: JWP-12<br />• Doporučené použití: Řemeselník<br />• Příkon (230V): 1,8 kW<br />• Otáčky: 9000 o', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_01_web.jpg', 0, '8476.19', '8900.00', '121-JWP-12M', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-JWP-12M/121-JWP-12M_04_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8343, 991, 'JET OES-80CS Oscilační hranová bruska', 'JET OES-80CS Oscilační hranová bruska', '<p><strong>• Broušení v horizontální nebo vertikální poloze a libovolném úhlu.<br />• Oscilace 50 kmitů/min zabezpečuje perfektní povrch.<br />• Robustní litinový stůl s jednoduchým přestavením.<br />• Pogumovaný povrch hnacího válce.<br />• Výškově nastavitelný stůl.<br />• Podstavec s úložným prostorem.<br />• Páka pro rychlé napnutí pásu.<br />• Malé úhlové pravítko v základní výbavě.<br />• Vodící T-drážka.<br />• Podkladová grafitová deska.<br />• Stůl pro broušení tvarových dílců v základní výbavě.</strong><br /><br />Hranová oscilační bruska slouží k broušení hran a rádiusů. Bruska umožňuje plynulé naklápění brusného pásu, broušení v horizontální nebo vertikální poloze. Brusný pás osciluje 50 kmitů / min bez škrábanců na povrchu materiálu. Masivní litinový stůl může být snadno přesouván nahoru nebo dolů, takže lze využít celou plochu brusného pásu. Poháněný válec je pogumovaný, což zajišťuje maximální přenos síly na brusný pás. Napínání a oscilaci lze jednoduše seřídit. Základ s', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_01_web.jpg', 0, '26950.48', '28298.00', '121-OES-80CST', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_01_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_02_web.jpg', 'https://www..cz/pictureprovider.aspx?path=c:/abra/web/userdata/images/storecards/121-OES-80CST/121-OES-80CS_04a_web.jpg', 21, 1, 1, 1, '', 0, '1-0-0-0', NULL, '2021-01-10 15:44:07'),
(8344, 1030, 'Spirálová hrubovací fréza V čelo (D=16; I=55; S=16; Z=3) RH, DIA potahovaná', 'Spirálová hrubovací fréza V čelo (D=16; I=55; S=16; Z=3) RH, DIA potahovaná', '<div style=\\\"caret-color: #000000; color: #000000; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; margin: 0px; font-stretch: normal; font-size: 11px; line-height: normal; font-family: \\\'Lucida Sans\\\';\\\">\\n<div><span style=\\\"font-size: 16px;\\\"><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/nadia.jpg\\\" alt=\\\"\\\" width=\\\"303\\\" height=\\\"92\\\" /></span></div>\\n<div><span style=\\\"font-size: 16px;\\\">DIA Spirálové frézy:</span></div>\\n<div><span style=\\\"font-size: 16px;\\\">Diamantový povlak (DLC) je výsledkem procesu PECVD, který je jednou z nejnovějších technologií povlakování. Celková tloušťka povlaku 1 mikron dosahuje velmi odolného povrchu a nekorozní prostředí. Z provedených testů vyplývají velmi dobré výsledky, které potvrzují zvý', '_vyr_1030celo.jpg', 0, '6493.65', '7215.00', '195.163.11XTR', '_vyrn_1030celo.jpg', '', '', '', 21, 1, 1, 1, '', 0, '2-1-11-313|2-0-0-0|2-1-0-0|2-1-11-0|2-7-0-0|2-7-45-0|2-7-45-597', NULL, '2021-01-10 15:44:07'),
(8345, 1035, 'Freud LU3D Pilový kotouč na lamino a DTD - D300x3,2 d30 Z96 HM', 'Freud LU3D Pilový kotouč na lamino a DTD - D300x3,2 d30 Z96 HM', '<p>Pilový kotouč Freud s chromovaným povrchem, který redukuje ulpívání zbytků lepidla a pryskyřice na těle kotouče. Má ideální tlumící drážky vyplněné červeným polyuretanem pro snížení vibrací a hlučnosti. Trapézové zuby z extra tvrdého tvrdokovu pro řezání lamina, dřevotřískových desek a MDF. Vysoká životnost. Pro pily s předřezem.</p>\\n<p> </p>', '_vyr_1035FLU3D.jpg', 0, '1720.00', '2150.00', 'FLU3D0600', '_vyrn_1035FLU3D.jpg', '_vyrp11_1035FLU3D-1.jpg', '_vyrp12_1035FLU3D-2.jpg', '_vyrp13_1035FLU3D-4.jpg', 21, 1, 5, 1, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|7-0-0-0|7-419-0-0', NULL, '2021-01-10 15:44:07'),
(8346, 1036, 'Freud LI16 Předřezový Pilový kotouč dvoudílný - D120x2,8-3,6 d20 Z12+12 HM', 'Freud LI16 Předřezový Pilový kotouč dvoudílný - D120x2,8-3,6 d20 Z12+12 HM', '<p>Předřezový pilový kotouč pro řezání oboustranně laminovaných desek (LTD). Používá se spolu s pilovým kotoučem LU3D.</p>\\n<p>Předřezávací pilový kotouč - dvoudílný - pro docílení vyšší kvality řezu na spodní ploše oboustranně povrchově upravovaných materiálů. (Laminované dřevotřískové desky apod.) Pro formátovací pily bez možnosti výškového nastavení předřezového zařízení. Maximální hloubka řezu 2 mm. Prořez předřezového kotouče se nastavuje pomocí distančních kroužků. Doporučené nastavení prořezu je o cca 0,3 mm větší než prořez formátovacího kotouče.<br /><br />Šířka zubu: 2,8 - 3,6 mm.<br />Zuby: Úhel čela 11°.</p>', '_vyr_1036FLI16.jpg', 0, '1376.00', '1720.00', 'FLI16MAA3', '_vyrn_1036FLI16.jpg', '101456_1036__vyrp11_537C28970020H-1.jpeg', '', '', 21, 1, 1, 1, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-2-21-0|2-2-21-357|7-0-0-0|7-419-0-0', NULL, '2021-01-10 15:44:07'),
