(8376, 1067, 'FREUD LU1C Pilový kotouč pro podélné řezání masivního dřeva - 300x3,2x30 Z26 WZ', 'FREUD LU1C Pilový kotouč pro podélné řezání masivního dřeva - 300x3,2x30 Z26 WZ', '<p><strong>LU1C - Pilový kotouč pro podélné řezání masivního dřeva.</strong></p>\\n<p>Použití:<br />Kotouč určený pro řezání podél vláken.</p>\\n<p>Obráběcí stroje:<br />Stolní kotoučové pily, formátovací pily, přenosné pily.</p>\\n<p>Tvar zubu:<br />GS Zub je střídavě šikmý s 10° nakloněn s kladným úhlem čela a omezovacím zubem.</p>\\n<p>Materiál:<br />Masivní dřevo: tvrdé, měkké a exotické, svalovité.</p>\\n<p> </p>', '_vyr_1067LU1C.jpg', 1, '1403.00', '1559.00', 'FLU1C0400', '_vyrn_1067LU1C.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-19-0|2-2-19-352', NULL, '2021-01-10 15:44:07'),
