(8378, 1071, 'Virutex Olepovačka hran 1500W', 'Virutex Olepovačka hran 1500W, rám max. 40,5mm, min. 4,5mm', '<p><span style=\\\"font-family: verdana, geneva;\\\"><strong>Olepovačka hran</strong></span></p>\\n<p><span style=\\\"padding: 0px; margin: auto; border: 0px; outline: 0px; font-weight: normal; font-style: normal; font-size: 14px; font-family: verdana, geneva; vertical-align: baseline; caret-color: #000000; color: #000000; font-variant-caps: normal; letter-spacing: normal; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none;\\\">Olepovačka je určena pro lamino hranu s naneseným lepidlem. Umožňuje olepování rovných i tvarových dílců a navíc i vystouplých falců. Čas nahřátí je menší než 1 minuta. Má integrované nůžky na odstřihnutí pásky, stavitelné kleštiny na různé tloušťky desek. Protože konstrukce tohoto strojku je velmi lehká a ergonomická, pracuje se s ním snadno i po delší dobu. Má speciální režimy pro olepení rámu dveří a olepení horního povrchu se čtyřmi možnostmi o', '_vyr_1071AG98E_AG98E.jpg', 0, '7187.00', '7986.00', 'AG98E', '_vyrn_1071AG98E_AG98E.jpg', '_vyrp11_1071AG98E_ag98ed1.jpg', '_vyrp12_1071AG98E_ag98ed2.jpg', '_vyrp13_1071ag98fil1-1.jpg', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:08'),
(8379, 1072, 'Kleštinový upínač CNC HSK 63F - HYDRO D20 RH/LH', 'Kleštinový upínač CNC HSK 63F - HYDRO D20 RH/LH', '<p>Upínač nástrojů s upínací klečtinou na CNC frézovacích strojích s automatickou výměnou nástrojů.</p>\\r\\n<ul>\\r\\n<li>upínací kužel podle DIN 69893-6 tvar F</li>\\r\\n<li>kalené a broušené provedení</li>\\r\\n<li>přesně vyvážené</li>\\r\\n<li>zabezpečení nástrojů proti pootočení pomocí šroubů nebo kolíků</li>\\r\\n<li>upínání pomocí HYDRO mechanizmu, úravé a levé použití</li>\\r\\n</ul>', '_vyr_1072AHYDRO12.jpg', 1, '7401.00', '7790.00', 'AHYDROD20', '_vyrn_1072AHYDRO12.jpg', '101456_1072__vyrp11_89HSK63F-1.jpg', '', '', 21, 1, 1, 1, '', 0, '2-8-0-0|2-8-306-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:08'),
