(8391, 1086, 'Virutex PC81U Multifunkční svěrka', 'Virutex PC81U Multifunkční svěrka', '<div>Multifunkční svěrku využijete na uchycení, přitlačení hrany na rovnou nebo zakřivenou desku. Můžete ji také použít jako úhlovou svěrku, anebo k přepravě. Silné hliníkové tělo svěrky je vybavené protiskluzovou rukojetí a pogumovanými přítlaky pro práci s jemnými povrchy.</div>\\n<div></div>\\n<div></div>\\n<div><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</span></div>\\n<ul>\\n<li>Šířka materiálu k uchycení: 0-46 mm</li>\\n<li>Hmotnost: 0,65 kg</li>\\n</ul>\\n<div>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno', '_vyr_10863479.jpg', 0, '1957.00', '2175.00', 'PC81U', '_vyrn_10863479.jpg', '', '', '', 21, 1, 1, 1, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:08'),
(8392, 1087, 'Virutex SVN450 vakuový upínací systém', 'Virutex SVN450 vakuový upínací systém', '<p><strong>SVN450 vakuový upínací systém</strong></p>\\n<p><span lang=\\\"cs\\\">Upínací vakuový systém s možností naklopení pevné části, sestávající ze základního modulu SVN250 namontovaného na nakloněné základně a distribučním bloku. Díky možnosti naklonění stroje je umožněno strojní zpracování roviny i hran bez opětovné instalace. Systém je vybaven distribučním blokem, který umožňuje připojení až čtyř dalších modulů SVN470 nebo SVN250, s uzavíracím ventilem a rychlospojkou pro připojení k externímu přívodu stlačeného vzduchu. <span>Standardní vybavení zahrnuje svorky ve tvaru písmene L pro montáž nástroje na pracovní plochu a sadu těsnicích prvků. Jako volitelné vybavení je možné zakoupit sadu 4 šroubů (0999102) pro připevnění k základně šikmého modulu.</span></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICKÉ SPECIFIKACE:</span></span></p>\\n<ul>\\n<li>Pracuje s kompresorem</li>\\n<li>Náklon stolu: 0 - 90 °</li>\\n</ul>\\n<p><span style=\\\"text-decoration: ', '_vyr_1087SVN450_SVN450.jpg', 0, '8465.00', '9406.00', 'SVN450', '_vyrn_1087SVN450_SVN450.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:08'),
(8393, 1088, 'Virutex AB111N - Lamelovací frézka 900W', 'Virutex AB111N - Lamelovací frézka 900W', '<p style=\\\"box-sizing: content-box; margin: 0px 0px 0.5em; padding: 0px; line-height: 1.5em; text-align: left; caret-color: #4e4e4e; color: #4e4e4e; font-family: Arial, serif; font-style: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; background-repeat: unset unset;\\\"><span style=\\\"font-family: verdana, geneva;\\\">Frézka AB111N je zvláště konstruovaná pro snadné a bezpečné drážkování desek. Může provádět jakýkoliv typ spojení rychle a přesně díky přední příložce, která může být nastavena ve výšce a úhlu bez použití nástrojů. AB111N přichází vybavena kanálem a výstupem odsávání. Její plně vybavený transportní kufřík ji předurčuje pro práci mimo dílnu.  </span></p>\\n<p style=\\\"box-sizing: content-box; margin: 0px 0px 0.5em; padding: 0px; line-height: 1.5em; text-a', '_vyr_1088AB111N.jpg', 0, '8165.00', '8595.00', 'AB111N', '_vyrn_1088AB111N.jpg', '_vyrp11_1088AB111N2.jpg', '_vyrp12_1088AB111N3.jpg', '_vyrp13_1088AB111N5.jpg', 21, 1, 1, 1, '', 0, '3-480-828-0|3-0-0-0|3-480-0-0', NULL, '2021-01-10 15:44:08'),
