(8402, 1104, 'Fréza DIA (D=16; I=25; S=16; Z=3+1) LH', 'Fréza DIA (D=16; I=25; S=16; Z=3+1) LH', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Tělo ze speciální tvrdé oceli </li>\\n<li>Dva celistvé PCD břity rozprostřené do tří spirál</li>\\n<li>Výška břitu PCD 4 mm</li>\\n<li>Možnost ostření 5-6 krát</li>\\n<li>Čelní PCD břit pro zavrtání</li>\\n</ul>\\n<p><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/dte.jpg\\\" alt=\\\"\\\" width=\\\"537\\\" height=\\\"126\\\" style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<div>Určeno pro všechny CNC stroje a ruční frézky pro spojování a frézování dřevotřískových desek, LTD, MDF a kompozitu na bázi dřeva, HPL, tvrdého dřeva, překližky.</div>\\n<div>\\n<h3>VÝHODY:</h3>\\n<p>Vynikající povrchová úprava obrobku, tichý provoz při vysokých dodávkách, větší vzdálenost mezi deskami pro snadnější odstranění třísek.</p>\\n</div>\\n<p></p>\\n<div><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/dte%20graf.jpg\\\" alt=\\\"\\\" width=\\\"508\\\" height=\\\"338\\\" style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" /></div>\\n<div><img', '_vyr_1104DTE.jpg', 0, '5268.48', '5854.00', 'DTE.16.025.16.0SL', '_vyrn_1104DTE.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-7-46-0|2-0-0-0|2-1-0-0|2-7-0-0|2-7-46-583|10-0-0-0|10-474-0-0|10-474-518-0|10-474-518-537', NULL, '2021-01-10 15:44:08'),
(8403, 1122, 'ADF diamantová fréza ', 'ADF diamantová fréza ', '<p>TECHNICKÉ ÚDAJE:<br />tělo z odolné oceli<br />Z2, Z2 + 2 nebo Z3<br />výška diamantové desky 4 mm<br />možnost ostření 5 - 6krát</p>\\n<p>POUŽITÍ:<br />Profily materiálů, jako jsou dřevotřískové desky, surové MDF nebo MDF<br />laminované, HDF, HPL, překližky.</p>\\n<p>VÝHODY VÝHODY ZVLÁŠTNÍ ZNAKY:<br />Velmi dobrá povrchová úprava obráběného povrchu.</p>\\n<p> </p>\\n<p>V případě, že není u produktu uvedená cena, můžete nás v souvislosti s ní <a href=\\\"https://www.stopkovefrezy.cz/Kontakty-a5_16.htm\\\">kontaktovat</a>.</p>', '_vyr_1122ADF.jpg', 0, '0.00', '0.00', 'FDF20017201SR', '_vyrn_1122ADF.jpg', '_vyrp11_1122ADF2.jpg', '_vyrp12_1122Ikona_10.jpg', '_vyrp13_1122Ikona_rh.jpg', 21, 1, 1, 0, '', 0, '2-7-46-0|2-7-46-587', NULL, '2021-01-10 15:44:08'),
(8404, 1125, 'FDG diamantová fréza zaoblovací', 'FDG diamantová fréza zaoblovací', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Tělo z vysoce odolné oceli</li>\\n<li>Výška DIA zubu 4 mm</li>\\n<li>závrtný DIA zub</li>\\n<li>Z2 nebo Z2+1</li>\\n<li>Ostřeno novou laserovou technologií</li>\\n<li>Možnost naostření max. 5-6 krát</li>\\n<li>Pro zaoblení nábytkových hran tzv. mýdlo</li>\\n</ul>\\n<p><img src=\\\"/fotky101456/fdg.jpg\\\" alt=\\\"\\\" width=\\\"344\\\" height=\\\"107\\\" /></p>\\n<h3>POUŽITÍ:</h3>\\n<p>Profily materiálů, jako jsou dřevotřískové desky, surové MDF nebo MDFlaminované, HDF, HPL, překližky.</p>\\n<h3>VÝHODY:</h3>\\n<p>Velmi dobrá povrchová úprava obráběného povrchu.</p>\\n<p><a href=\\\"https://www.stopkovefrezy.cz/fotky101456/fotos/_vyrp13_1677DT2--2.jpg\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\"><img src=\\\"https://www.stopkovefrezy.cz/fotky101456/DT2%20(2).jpg\\\" width=\\\"200\\\" height=\\\"232\\\" caption=\\\"false\\\" /></a></p>\\n<p>V případě, že není u produktu uvedená cena, můžete nás v souvislosti s ní <a href=\\\"https://www.stopkovefrezy.cz/Kontakty-a5_16.htm\\\">kontaktovat</a>.</p>', '_vyr_1125ADG.jpg', 0, '17810.69', '19789.65', 'FDG.100.018.25.1SR', '_vyrn_1125ADG.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-7-46-0|2-0-0-0|2-1-0-0|2-7-0-0|2-7-46-587|10-0-0-0|10-474-0-0|10-474-520-0|10-474-520-542', NULL, '2021-01-10 15:44:08'),
(8405, 1131, 'CAUL Falcovací fréza D180x30x50 Z4+4, extra velká ', 'CAUL Falcovací fréza D180x30x50 Z4+4, extra velká ', '<p><strong>Specifikace:</strong><br />Řezací hlava pro spojování a frézování. Hladká povrchová úprava a dlouhá životnost řezných vrstev nožů.</p>', '_vyr_1131caul.jpg', 0, '8182.00', '9625.00', 'TB151805030', '_vyrn_1131caul.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-3-0-0|2-3-29-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:08'),
(8406, 1132, 'CAUL falcovací žiletková fréza 125x30x30 Z4+4', 'CAUL falcovací žiletková fréza 125x30x30 Z4+4', '<p>Frézovací hlava pro spojování a drážkování.<br />Hladká povrchová úprava a dlouhá životnost díky HW žiletkám.</p>\\n<p>Frézovací hlava pro použití při drážkování a dalcování.<br />Konstrukce s výměnnými břity uloženými axiálně, předřezové nože.<br />Pevné, stabilní ocelové tělo zaručuje dlouhou životnost profesionálního nástroje.<br />Čistý řez.</p>', '_vyr_1132TB-01-1.png', 0, '3400.00', '4250.00', 'TB0101 ', '_vyrn_1132TB-01-1.png', '_vyrp11_1132TB-01-2.png', '_vyrp12_1132TB-01-3.png', '_vyrp13_1132TB-01-4.png', 21, 1, 1, 0, '', 0, '2-3-29-0|2-3-0-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:08'),
(8407, 1133, 'CAUL frézovací hlava, srovnávací a hoblovací 100x110x30 Z30', 'CAUL 100x110x30 Z30', '<p>Střídavé HW břity pro rychlé a velké odstranění materiálu s perfektní povrchovou úpravou.</p>\\n<p>Nože jsou speciálně uspořádání pro snadné nastavení a usazení v lůžku frézovací halyvy.</p>\\n<p>POUŽITÍ:<br />Hlava je vyrobená z masivního ocelového těla, je určena pro vákonnostní hoblování povrchu masivního dřeva. Uspořádání žiletek umožňuje úběr velkého množství materiálu. <br />Určeno pro strojní obrábění v profesionálních strojích.</p>\\n<p>Max otáčky 10 500 ot/min.</p>', '_vyr_1133TP10-1.png', 0, '12092.00', '15115.00', 'TP1001', '_vyrn_1133TP10-1.png', '_vyrp11_1133TP10-2.png', '_vyrp12_1133TP10-3.png', '_vyrp13_1133TP10-4.png', 21, 1, 1, 0, '', 0, '2-3-0-0|2-3-29-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:08'),
