(8491, 1221, 'C2S Úhlová fréza s ložiskem - 25° D26x21 S=8 HW', 'C2S Úhlová fréza s ložiskem - 25° D26x21 S=8 HW', '<p>• HW tvrdokovové zuby. <br />• Teflonový nepřilnavý povrch <br />• Kopírovací ložisko. <br /><br />Použití: Snadná výroba mnohoúhelníkových dílů. Frézují čisté a přesné úkosy pro výrobu dokonale vyrovnaných mnohostranných kontejnerů, krabic a dalších dekorativních předmětů. Mohou být použity s výbornými výsledky pro celou řadu prací, jako je výroba příček a sloupků. <br /><br /><strong>TIP:</strong> Je možno použít celou délku řezné hrany. Pravidelně nastavujte výšku frézy, aby byl maximálně využit celý HM tvrdokovový břit.</p>', '_vyr_57C2S-web.jpg', 0, '720.00', '900.00', 'GZ2487', '_vyrn_57C2S-web.jpg', '', '', '', 21, 1, 2, 0, '', 0, '2-1-0-0|2-1-13-0|2-1-13-321|7-0-0-0|7-422-0-0|14-0-0-0|14-612-0-0|14-612-631-0', NULL, '2021-01-10 15:44:08'),
