(8591, 1334, 'Univerzální frézovací hlava 120x52x30 2z 3560 OCEL/MAN', 'Univerzální frézovací hlava 120x52x30 2z 3560 OCEL/MAN', '<p>Tělo nástroje je vyrobeno z kvalitní oceli. Fréza je vybavena upínacím systémem pro profilové nože a omezovače, které umožňují bezpečný ruční posuv (MAN) materiálu do řezu. Euro upínací systém zajišťuje perfektní a přesné upnutí <a href=\\\"https://www.pilanamarket.cz/noze/profilove-noze/\\\">nožů 40 x 4mm a 50 x 4mm a omezovačů</a>.</p>\\n<p><strong>Parametry:</strong></p>\\n<ul>\\n<li>Otáčky 5100–7400 ot./min.,</li>\\n<li>ruční posuv materiálu MAN</li>\\n<li>pro 2 profilové nože a 2 omezovače</li>\\n<li>upínací průměr d=30mm.</li>\\n</ul>\\n<p><strong>Nože a omezovače nejsou součástí dodávky a objednávají se zvlášť!</strong></p>', '_vyr_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original.jpg', 0, '1338.00', '1410.00', '', '_vyrn_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original.jpg', '_vyrp11_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original.jpg', '_vyrp12_1336univerzalni-frezovaci-hlava-120x52x30-2z-3560-ocel-man-original--1.jpg', '', 21, 1, 1, 1, '', 0, '2-3-291-0|2-0-0-0|2-3-0-0|2-3-291-359|13-0-0-0|13-608-0-0', NULL, '2021-01-10 15:44:09'),
(8592, 1335, 'Univerzální frézovací hlava Vapos 100x40x30 4z OCEL/MAN', 'Univerzální frézovací hlava Vapos 100x40x30 4z OCEL/MAN', '<p>Tělo nástroje je vyrobeno z kvalitní oceli. Fréza je vybavena upínacím systémem pro profilové nože a omezovače, které umožňují bezpečný ruční posuv (MAN) materiálu do řezu. Euro upínací systém zajišťuje perfektní a přesné upnutí <a href=\\\"https://www.pilanamarket.cz/noze/profilove-noze/\\\">nožů 40 x 4mm a 50 x 4mm a omezovačů</a>.</p>\\n<p><strong>Parametry:</strong></p>\\n<ul>\\n<li>Otáčky 5100–7400 ot./min.,</li>\\n<li>ruční posuv materiálu MAN</li>\\n<li>pro 4 profilové nože a 4 omezovače</li>\\n<li>upínací průměr d=30mm.</li>\\n</ul>\\n<p><strong>Nože a omezovače nejsou součástí dodávky a objednávají se zvlášť!</strong></p>', '_vyr_1337bezpecnostni-frez-hlava.jpg', 0, '2199.00', '0.00', '', '_vyrn_1337bezpecnostni-frez-hlava.jpg', '_vyrp11_133727802-0-univerzalni-frezovaci-hlava-na-vymenne-noze.jpg', '_vyrp12_1337univerzalni-frezovaci-hlava-120x52x30-4z-3560-4-ocel-mec-original.jpg', '', 21, 1, 1, 1, '', 0, '2-3-291-0|2-0-0-0|2-3-0-0|2-3-291-359|13-0-0-0|13-608-0-0', NULL, '2021-01-10 15:44:09'),
(8593, 1336, 'Pokosová pila STACO 560mm', 'Pokosová pila STACO 560mm', '<pre id=\\\"tw-target-text\\\" class=\\\"tw-data-text tw-ta tw-text-small\\\" dir=\\\"ltr\\\" data-placeholder=\\\"Překlad\\\" data-fulltext=\\\"&quot;\\\"><span lang=\\\"cs\\\" style=\\\"font-family: arial, helvetica, sans-serif;\\\" tabindex=\\\"0\\\">Pokosová pila se stolem z odlitku a nastavitelnou pokosnicí.\\n\\nSe speciálně vytvrzenou vyměnitelnou čepelí s extra jemnými univerzálními zuby a šroubem <br />s rozpěrným čepem pro snadnou výměnu čepele a pro zajištění přesného řezu.\\n\\nRychlé upnutí materiálu pomocí rychloupínacího systému.\\n\\nNastavení úhlů pokosnice po 5° v úhlech 45, 55, 60, 70, 75, 90, -75, -70, -60, -55 a - 45 stupňů.<br /><br /></span></pre>', '_vyr_133871-zTMYcNgL-_SX450_.jpg', 0, '1125.00', '1250.00', '', '_vyrn_133871-zTMYcNgL-_SX450_.jpg', '', '', '', 21, 1, 1, 1, '', 0, '4-109-0-0|4-0-0-0', NULL, '2021-01-10 15:44:09'),
(8594, 1337, 'Bezdrátová nabíječka MINIBATT Fi80', 'Bezdrátová nabíječka MINIBATT Fi80', '<pre class=\\\"tw-data-text tw-ta tw-text-small\\\" dir=\\\"ltr\\\" data-placeholder=\\\"Překlad\\\" data-fulltext=\\\"\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\" tabindex=\\\"0\\\">MINIBATT Fi80 je první bezdrátová nabíječka baterií s technologií Medium Power, <br />díky tomu instalace může být viditelná nebo neviditelná, v jakémkoliv nábytku nebo pracovním stole, <br />pro nabíjení všech typů zařízení 5V a 9V. Snadná a rychlá instalace. <br />Balení neobsahuje napájecí adaptér, který je třeba objednat zvlášť. <br /><br />Technická specifikace<br /></span></pre>\\n<ul>\\n<li>Druh Cívky: Single Coil QI STANDARD: Version 1.2</li>\\n<li>Metoda nabíjení: One by One</li>\\n<li>Vstupní napětí: 5 V – 9 V</li>\\n<li>Vstupní proud: 1.6A max.</li>\\n<li>Bezdrátový výstup: 5W – 10W</li>\\n<li>Nabíjecí vzdálenost: 8-12 mm</li>\\n<li>Efektivnost nabíjení: 9 V-80% // 5 V-72%</li>\\n<li>Pracovní frekfence: 110-205KHz</li>\\n<li>Pracovní plocha: 324 mm</li>\\n<li>Rozměry: &#248; 80 x 16 mm</li>\\n<li></li>\\n</ul>', '_vyr_1339fi80-1.jpg', 0, '1266.00', '0.00', '', '_vyrn_1339fi80-1.jpg', '_vyrp11_1339fi80-1.jpg', '_vyrp12_1339fi80-3.jpg', '_vyrp13_1339fi80-3.jpg', 21, 1, 1, 1, '', 0, '9-0-0-0', NULL, '2021-01-10 15:44:09'),
(8595, 1338, 'Napájecí jednotka pro bezdrátové nabíječky MINIBATT', 'Napájecí jednotka pro bezdrátové nabíječky MINIBATT', '<p>Napájecí jednotka pro Fi80 bezdrátovou nabíjěčku.</p>', '_vyr_1340MB-ADP-1-USB_minibatt_quick_charge2-jgd5pfjs.jpg', 0, '594.00', '0.00', '', '_vyrn_1340MB-ADP-1-USB_minibatt_quick_charge2-jgd5pfjs.jpg', '_vyrp11_1340MB-ADP-1-USB_minibatt_quick_charge2-jgd5pfjs.jpg', '_vyrp12_1340MB-ADP-1-USB_minibattqc2-jgd5pfva.jpg', '', 21, 1, 1, 1, '', 0, '9-0-0-0', NULL, '2021-01-10 15:44:09'),
(8596, 1339, 'Bezdrátová nabíječka MINIBATT FS80 QI ', 'Bezdrátová nabíječka MINIBATT FS80 QI ', '<p>miniBatt Fs80 je stylová bezdrátová nabíječka, která je integrována do jakéhokoliv kusu nábytku s jednou indukční cívkou</p>\\n<p>a rychlým nabíjením s maximálním výstupem 10 W, kompatibilním se všemi bezdrátovými zařízeními Qi,</p>\\n<p>včetně zařízení iPhone 8 / 8plus, iPhone X nebo Samsun</p>\\n<pre id=\\\"tw-target-text\\\" class=\\\"tw-data-text tw-ta tw-text-small\\\" dir=\\\"ltr\\\" data-placeholder=\\\"Překlad\\\" data-fulltext=\\\"&quot;\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\" tabindex=\\\"0\\\">Video s instalací<br /> <br /><video width=\\\"657\\\" height=\\\"329\\\" controls=\\\"controls\\\">\\n<source src=\\\"http://minibatt.com/wp-content/uploads/downloads/Fs80%20tutorial.mp4\\\" type=\\\"video/mp4\\\" /></video><br /></span></pre>', '_vyr_1341fs80-B.jpg', 0, '1080.00', '0.00', '', '_vyrn_1341fs80-B.jpg', '_vyrp11_1341fs80-B.jpg', '_vyrp12_1341fs80-B2.jpg', '_vyrp13_1341MB-FS80_1.jpg', 21, 1, 1, 1, '', 0, '9-0-0-0', NULL, '2021-01-10 15:44:09'),
(8597, 1340, 'Falcovací fréza se šíkmými zuby Fink 5/4E 125x50x30 ALU', 'Falcovací fréza se šíkmými zuby Fink 5/4E 125x50x30 ALU', '<p> Frézy jsou osazeny 4 předřezy pro ostré rohy a 4 uběracími šikmými zuby. Upínací průměr d=30mm. Z Duralu</p>\\n<p> </p>\\n<p>Šikmé zuby 4, předřezy 4, otáčky 5600–8000 ot./min., ruční posuv materiálu MAN.</p>', '_vyr_13435-4.jpg', 0, '3825.00', '0.00', '', '_vyrn_13435-4.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-3-0-0|2-3-29-0|13-0-0-0|13-606-0-0', NULL, '2021-01-10 15:44:09'),
(8598, 1341, 'Výpňová fréza CAUL 210x12x30 Z2', 'Výpňová fréza CAUL 210x12x30 Z2', '<p>Pozor pouze ilustrační foto, má pouze 2 nože.</p>\\n<p>Profesionální výplňová fréza Caul se 2 noži. Pro výrobu výplní nábytku, skříňových a interiérových dveří z tvrdého a měkkého dřeva. </p>', '_vyr_1344TA_03-800x600.jpg', 0, '10207.00', '11340.00', '', '_vyrn_1344TA_03-800x600.jpg', '', '', '', 21, 1, 1, 0, '', 0, '2-0-0-0|2-3-0-0', NULL, '2021-01-10 15:44:09'),
(8599, 1342, 'Virutex Ruční hoblík 900W', 'Virutex Ruční hoblík - 900W 82 mm ', '<p><strong>GR120P Ruční hoblík</strong></p>\\n<p><span lang=\\\"cs\\\">Stroj určený pro zpracování dílů z masivního dřeva se specializací na zpracování koncových povrchů dveří a dalších dílů. Charakteristickým rysem tohoto modelu je možnost nejen prohloubení, ale také rozšíření falcu v jednom úběru. Je vybaven elektronickými systémy pro všestrannost a bezpečnost. Vzhledem k promyšlenému uspořádání ovládacích prvků a možnosti vývodu hoblin na obou stranách je stejně vhodný jak pro praváky, tak pro leváky.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span></p>\\n<p><span lang=\\\"cs\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li><span lang=\\\"cs\\\">Dvojitá izolace</span></li>\\n<li><span lang=\\\"cs\\\">Příkon: 900 W</span></li>\\n<li><span lang=\\\"cs\\\">Šířka hoblování: 82 mm</span></li>\\n<li><span lang=\\\"cs\\\">Hloubka úběru: 0-4 mm</span></li>\\n<li><span lang=\\\"cs\\\">Max. hloubka drážkování: 25 mm</span></li>\\n<li><span lang=\\\"cs\\\">Rychlost bez zatížení: 12500/min</span></li>\\n<li><span', '_vyr_1342gr120p.jpg', 0, '9023.00', '10025.00', 'GR120P', '_vyrn_1342gr120p.jpg', '_vyrp11_1342gr120p_1.jpg', '_vyrp12_1342gr120p_2.jpg', '_vyrp13_1342gr120p_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8600, 1343, 'Virutex Ruční hoblík 1200W 80 mm', 'Virutex Ruční hoblík 1200W 80 mm', '<p><strong>CE24E Ruční hoblík</strong></p>\\n<p>Tento hoblík je určen pro dlouhodobou práci a velké zatížení při nejvyšších nárocích na kvalitu povrchu. Celý kryt těla je vyroben z jednoho segmentu hliníkové slitiny. Plocha hoblíku je 455 mm dlouhá. Výkon 1 200 W zajišťuje perfektní a bezchybný chod v těch nejnáročnějších operacích při největším zatížení. Stroj je vybaven otočnými karbidovými noži a přípojkou k odsávání a je dodáván v praktickém transportním kufříku.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 1200 W</li>\\n<li>Šířka úběru: 80 mm</li>\\n<li>Úběr: 0-3 mm</li>\\n<li>Max. drážkovací hloubka: 22 mm</li>\\n<li>Otáčky: 13100 o/min</li>\\n<li>Váha: 6 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obr', '_vyr_1343ce24e.jpg', 0, '10305.00', '11450.00', 'CE24E', '_vyrn_1343ce24e.jpg', '_vyrp11_1343ce24e_1.jpg', '_vyrp12_1343ce24e_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8601, 1344, 'Virutex Ruční hoblík 750W 82mm', 'Virutex Ruční hoblík 750W 82mm', '<p><strong>CE120P Ruční hoblík</strong></p>\\n<p><span lang=\\\"cs\\\"><span>Hoblík je určen pro zpracování dílů z masivního dřeva, má výkonný motor a je vhodný pro práci v dílně i na montáži. </span></span>Hoblík je vybaven 316 mm dlouhou základnou a je perfektně vyvážen. Kromě obvyklých aplikací je speciálně konstruován na srovnávání dveří, nebo jiných masivních dílců. <span lang=\\\"cs\\\">Stejně jako GR120P je hoblík vybaven elektronickými systémy, jedinečným systémem prohlubování a rozšiřování falcu v jednom záběru, spínačem pro směr vyhazování hoblin a elektronicky řízeným výkonem při různých stupních zatížení. Na rozdíl od GR120P je hoblík připevněn na kratší základnu, což významně snížilo hmotnost nástroje. </span><span lang=\\\"cs\\\"><span>Při vývoji hoblíku byly obzvláště zohledněny ergonomické požadavky na profesionální použití. </span></span>Je designován pro praváky<br />i leváky a především pro pohodlnou dlouhodobou práci. <span lang=\\\"cs\\\">Hoblíky CE120P a GR120P mají jedinečnou sch', '_vyr_1344ce120p.jpg', 0, '6861.00', '7623.00', 'CE120P', '_vyrn_1344ce120p.jpg', '_vyrp11_1344ce120p_1.jpg', '_vyrp12_1344ce120p_2.jpg', '_vyrp13_1344ce120p_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8602, 1345, 'Virutex Ruční hoblík 700W', 'Virutex Ruční hoblík 700W', '<p><strong>CE35E Ruční hoblík</strong></p>\\n<p><span lang=\\\"cs\\\">Charakteristickým rysem tohoto modelu je jeho vysoký výkon (700 W) s nízkou hmotností, díky čemuž je tento model ideální pro práci v dílně i mimo ni. Vysoká rychlost otáčení nástroje v kombinaci se speciálním zpracováním podešve o délce 290 mm zajišťuje nejvyšší kvalitu hoblování. Rovina je výhodná při práci jednou rukou, má jednoduché a přesné nastavení. Hoblík je vybaven výměnnými oboustranými tvrdokovovými noži, které při výměně nepotřebují další seřízení. Stroj má vývod pro připojení externího vysavače, což udržuje pracovní plochu čistou a výrazně se tím prodlužuje životnost stroje. Hoblík je dodáván v přepravní krabici.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICKÉ PARAMETRY:</span></s', '_vyr_1345ce35e.jpg', 0, '5805.00', '6450.00', 'CE35E', '_vyrn_1345ce35e.jpg', '_vyrp11_1345ce35e_1.jpg', '_vyrp12_1345ce35e_2.jpg', '', 21, 1, 3, 1, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8603, 1346, 'Virutex Hoblík na srážení hran 700W', 'Virutex Hoblík na srážení hran 700W', '<p><strong>CE89E Hoblík na srážení hran</strong></p>\\n<p><span lang=\\\"cs\\\">Profesionální, lehký a výkonný hoblík speciálně navržený pro úpravu rohových zkosení. Díky speciální konstrukci podešve je hoblík spolehlivě založen na obrobku a má širokou škálu regulace hloubky úběru. Standardní dodací sada zahrnuje vyměnitelné oboustranné tvrdokovové nože, které při výměně nevyžadují další seřízení a výstup pro připojení externího vysavače. To vše je dodáváno v praktickém přepravním kufru.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICKÉ PARAMETRY:</span></span></p>\\n<ul>\\n<li><span lang=\\\"cs\\\">Dvojitá izolace</span></li>\\n<li><span lang=\\\"cs\\\">Příkon: 700 W</span></li>\\n<li><span lang=\\\"cs\\\">Šířka úběru (<span>90 °): 25 mm</span></span></li>\\n<li><span lang=\\\"cs\\\"><span>Hloubka úběru: 0-12,5 mm</span></span></li>\\n<li>Otáčky: 16500 o/min</li>\\n<li>Hmotnost: 3,3 kg</li>\\n</ul>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Přek', '_vyr_1346ce89e.jpg', 0, '8458.00', '9398.00', 'CE89E', '_vyrn_1346ce89e.jpg', '_vyrp11_1346ce89e_1.jpg', '_vyrp12_1346ce89e_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8604, 1347, 'Virutex Profilovací frézka 1300W ', 'Virutex Profilovací frézka 1300W ', '<p><strong>FR98H Profilovací frézka</strong></p>\\n<p></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Určeno pro profilování nosníků a krokví a také pro simulaci kazetových stropů. <br />Sériově je doplněna dvěma sadami fréz a odpovídajícími držáky nástrojů. <br />Použitím dalších fréz s různými profily získáte mnoho tvarových variant. Šířka <br />výsledného profilu je nastavitelná v rozsahu 0 - 40 mm. Vodící kolejnice, <br />na které spočívá obrobek, se může pohybovat vzhledem k fréze. Díky tomu <br />je v závislosti na části frézy, na které se provádí zpracování, možné získat <br />různé typy profilů. Zařízení je vybaveno dvěma madly namontovanými paralelně <br />a navzájem ve stejné úrovni, což vám umožňuje pohodlnou práci na dlouhých <br />nosnících a na svislých prvcích. Dále má horní držadlo pro práci na vodorovných površích. <br /></span><span lan', '_vyr_1347fr98h.jpg', 0, '16508.00', '18342.00', 'FR98H', '_vyrn_1347fr98h.jpg', '_vyrp11_1347fr98h_1.jpg', '_vyrp12_1347fr98h_2.jpg', '_vyrp13_1347fr98h_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8605, 1348, 'Virutex Hoblík na srovnávání nákližků 1300W ', 'Virutex Hoblík na srovnávání nákližků 1300W ', '<p><strong>CE53S Hoblík na srovnávání nákližků</strong></p>\\n<p>Speciální hoblík na srovnávání nákližků. Je vybaven velkou opěrnou plochou usnadňující držení roviny vůči srovnávané části. Obrábí velice přesně a je snadno nastavitelný na požadovaný úběr. Díky výkonu 1050 W nedochází k poklesu otáček ani při maximálním úběru a tím je zajištěna dokonalá kvalita povrchu. Plaz má velkou opěrnou plochu, která zajišťuje spolehlivé opření nástroje a usnadňuje práci. Stroj pracuje otočnými tvrdokovovými noži.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 1050 W</li>\\n<li>Šířka úběru: 55 mm</li>\\n<li>Otáčky: 11100 o/min</li>\\n<li>Váha 7,7 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virute', 'https://b2b-itatools.pl:443/Obrazki/CE53S_CE53S v. 2.jpg', 0, '10560.00', '11733.00', 'CE53S', 'https://b2b-itatools.pl:443/Obrazki/CE53S_CE53S v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/CE53S_CE53S v. 2.jpg', '', 'https://b2b-itatools.pl:443/Obrazki/CE53S_ce53.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8606, 1349, 'Rádiusový hoblík 700W Virutex', 'Rádiusový hoblík 700W Virutex', '<p><strong>CE96H Rádiusový hoblík</strong></p>\\n<p><span lang=\\\"cs\\\">Profesionální hoblík pro hoblování konvexních a konkávních povrchů. Charakteristickým rysem tohoto modelu je podešev vyrobená z pružinové oceli, která umožňuje měnit její geometrii v závislosti na poloměru zakřivení obrobku. Současně je možné použít hoblík na rovném povrchu. Ideální pro práci v truhlářské dílně, v loděnici nebo v továrně na sudy. Hoblík je lehký a snadno použitelný v dílně i mimo ni. Díky designovým prvkům podešve můžete při použití rustikálních nožů dosáhnout efektu rustikálně zpracované plochy. Tento typ zpracování je zvláště důležitý pro vytváření „starožitných“ interiérů a používá se ke zpracování sloupů, stropů a dalších prvků vnější výzdoby. Standardně je vybaven vyměnitelnými oboustrannými tvrdokovovými noži, které při výměně nevyžadují seřízení, a adaptérem pro připojení externiho vysavače prachu. Dodává se v přepravním kufříku.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\', '_vyr_1349ce96h.jpg', 0, '9089.00', '10099.00', 'CE96H', '_vyrn_1349ce96h.jpg', '_vyrp11_1349ce96h_1.jpg', '_vyrp12_1349ce96h_2.jpg', '_vyrp13_1349ce96h_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8607, 1350, 'Hoblík DUO 700W Virutex', 'Hoblík DUO 700W Virutex', '<p><strong>CE223X Hoblík DUO</strong></p>\\n<p>Revoluční DUO hoblík je zcela nový koncept vybavený výměnnými válečky. Model je lehký a jednoduchý s dvojím účelem, díky čemuž lze nástroj rychle převést na požadovaný typ stroje. Nahraďtě hoblovací váleček brusným - bude to trvat jen pár minut - a pokračujte v dokončovacích pracích. Hoblovací nástroj poskytuje vysoce kvalitní hoblování, zatímco s brusným válečkem můžete pracovat s masivním dřevem, umělým kamenem a syntetickými materiály. Hřebíky uvnitř dřeva již nejsou nepřekonatelnou bariérou, protože budou broušeny na stejnou úroveň jako zbytek povrchu. <span lang=\\\"cs\\\"><span>Použití brusného nástroje umožňuje využití hoblíku CE223X DUO během restaurátorských prací, například pro odstraňování starých nátěrů, broušení opravných vložek, zpracovatelských materiálů, které jsou heterogenní ve struktuře, spojů, kde jsou dřevěná vlákna vícesměrná, opravy surfovacích prken, zpracování palub, trupů lodí atd.</span></span></p>\\n<pre class=\\\"tw-da', '_vyr_1350ce223x.jpg', 0, '12041.00', '13379.00', 'CE223X', '_vyrn_1350ce223x.jpg', '_vyrp11_1350ce223x_1.jpg', '_vyrp12_1350ce223x_2.jpg', '_vyrp13_1350ce223x_3.jpg', 21, 1, 1, 0, '', 0, '3-480-483-0', NULL, '2021-01-10 15:44:09'),
(8608, 1351, 'Ruční válcová bruska 700W Virutex', 'Ruční válcová bruska 700W Virutex', '<p><strong>CE23N Ručná válcová bruska</strong></p>\\n<p><span>Tento nástroj je zvláště účinný pro odstraňování starých nátěrů na velkých plochách. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Díky speciální konstrukci může bruska zpracovávat tenké a křehké obrobky, jakož i zpracovávat obrobky kolmo k dřevěným vláknům bez rizika štěpení na výstupu. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Bruska se používá pro restaurátorské práce v truhlářství a je speciálně navržena pro broušení měkkého a tvrdého dřeva, překližky, <br />jakož i materiálů, jako jsou skleněné vlákno, uhlíkové vlákno, vinyl a polyester. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Může být použita pro broušení konců dřevotřísky před nanesením okrajového materiálu. Ideální pro loděnice, bednářství, tesařství a jakékoliv ostatní aplikace, vyžadující rovinné broušení. Je lehká, a proto užitečná pro práci v dílně i mimo ní. Je vybavena výměnnými brusnými válečky,', 'https://b2b-itatools.pl:443/Obrazki/CE23N_CE23N v. 2.jpg', 0, '9216.00', '10240.00', 'CE23N', 'https://b2b-itatools.pl:443/Obrazki/CE23N_CE23N v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/CE23N_CE23N v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/CE23N_ce23n_d7.jpg', '', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8609, 1352, 'Válcová bruska na obloukové dílce 700W Virutex', 'Válcová bruska na obloukové dílce 700W Virutex', '<p><strong>CE123N Válvová bruska na obloukové dílce</strong></p>\\n<p><span>Nástroj je určen k odstraňování epoxidových pryskyřic, ošetřování kombinovaných povrchů a materiálů, jako je Kevlar. Ideální pro loděnice, bednářství, tesařství a jakékoliv ostatní aplikace, vyžadující rovinné i obloukové broušení. Charakteristickým rysem tohoto modelu je podešev vyrobená z pružinové oceli, která umožňuje změnit její geometrii v závislosti na poloměru zakřivení obrobku. Je vybavena výměnnými brusnými válečky, které nevyžadují zvláštní nastavení. Stroj je také vybaven připojením na odsávání. Je lehká a proto užitečná pro práci v dílně i mimo ni. Bruska je dodávána v praktickém kufříku.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 700 W</li>\\n<li>Šířka základny: 81 mm</li>\\n<li>Otáčky:', 'https://b2b-itatools.pl:443/Obrazki/CE123N_CE123N v. 2.jpg', 0, '10007.00', '11119.00', 'CE123N', 'https://b2b-itatools.pl:443/Obrazki/CE123N_CE123N v. 2.jpg', '_vyrp11_1352ce123n_1.jpg', '_vyrp12_1352ce123n_2.jpg', '_vyrp13_1352ce123n_3.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8610, 1356, 'Virutex Brusný váleček Zrnitý 60 - oxid zirkoničitý', 'Virutex Brusný váleček Zrnitý 60 - oxid zirkoničitý', '<p>Náhradní brusný váleček se zrnitostí 60G. Vhodný do brusek CE23N, CE123N, CE223X od firmy Virutex.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl:443/Obrazki/2345514_2345514.jpg', 0, '0.00', '0.00', '2345514', 'https://b2b-itatools.pl:443/Obrazki/2345514_2345514.jpg', 'https://b2b-itatools.pl:443/Obrazki/2345514_2345514.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-504-0', NULL, '2021-01-10 15:44:09'),
(8611, 1357, 'Ruční pásová bruska s odsáváním Virutex ', 'Ruční pásová bruska s odsáváním 1200W Virutex 420 m/min', '<p><strong>LB31EA Ruční pásová bruska s odsáváním</strong></p>\\n<p>Vynikající, velkoplošná a opravdu výkonná pásová bruska s integrovaným systémem odsávání prachu. Stroj je určen k hrubému a střednímu broušení velkých ploch. Velká brusná plocha zvyšuje produktivitu a vytváří hladký povrch bez nežádoucích stop. Pohyb brusného pásu je rovnoběžný s vlákny, pročež se netvoří \\\"chloupky\\\", tudíž jsou dokončovací prace ještě jednodušší. <span lang=\\\"cs\\\">Bruska je opatřena zátkami z karbid wolframu, aby se zabránilo rychlému opotřebování a systémem pro nastavení polohy brusného pásu. Výměna brusného materiálu se provádí bez přídavného nástroje. Bruska je opatřena odsávacím vakem a možností připojení externího odsávání, které umožňuje pracovat obsluze pohodlně a včistém prostředí, čímž se prodlužuje životnost stroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=', '_vyr_1357lb31ea.jpg', 0, '9614.00', '10683.00', 'LB31EA', '_vyrn_1357lb31ea.jpg', '_vyrp11_1357lb31ea_1.jpg', '_vyrp12_1357lb31ea_2.jpg', '_vyrp13_1357lb31ea_3.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8612, 1358, 'Třífázová pásová bruska Virutex', 'Třífázová pásová bruska 900W Virutex', '<p><strong>AF11 Třífázová pásová bruska</strong></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Vysoce výkonná pásová bruska s třífázovým asynchronním motorem vám umožní provádět <br />tvrdou práci bez jakýchkoli problémů s údržbou. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Určeno pro hrubé a střední broušení velkých ploch <br />s velkým odstraněním materiálu. Při změně schématu zapojení lze stroj připojit k jednofázové síti.<br /></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Velká nosná plocha zajišťuje efektivní odstraňování materiálu a zabraňuje poškrábání. <br /></span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Stroj je vybaven systémem pro nastavení polohy brusného pásu a zarážky karbidu wolframu <br />brání poškození těla stroje při broušení brusného pásu před seřízením (po jeho výměně). <br /></span><span lang=\\\"', 'https://b2b-itatools.pl:443/Obrazki/AF11_AF11 v. 2.jpg', 0, '12495.00', '13883.00', 'AF11', 'https://b2b-itatools.pl:443/Obrazki/AF11_AF11 v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/AF11_AF11 v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/AF11_af11d1.jpg', 'https://b2b-itatools.pl:443/Obrazki/AF11_af11d2.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8613, 1359, 'Oscilační bruska Virutex', 'Oscilační bruska Virutex 370W', '<p><strong>LR46L Oscilační bruska</strong></p>\\n<p>Vibrační stroj s přímým pohonem je určen pro vysokou kvalitu leštění a dokončovacích prací. Vysoký výkon a dobré vyvážení zaručuje požadovanou úroveň kvality a vyhýbá se přebroušení. Zanechává hladký povrch bez nežádoucích důsledků broušení. Její ergonomická konstrukce s neklouzavým povrchem umožňuje práci bez únavy a je lehce ovladatelná. <span lang=\\\"cs\\\">Modely RTE46L, RTE146L, RT188N, LR46L a LRE46L jsou vybaveny novou účinnou ochranou ložisek proti mikročipům, která chrání mechanismus před poškozením. Speciální podešev zajišťuje odolnost proti opotřebení. Stroj má nový systém pro odstraňování prachu a sběrače prachu, což pomáhá zvyšovat životnost abrazivních materiálů a umístění sacích otvorů umožňuje používat většinu standardních brusiv. Stroj je vybaven přední rukojetí, která slouží k spolehlivějšímu a pohodlnějšímu ovládání nástroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\"', '_vyr_1359rl46l.jpg', 0, '5584.00', '6204.00', 'LR46L', '_vyrn_1359rl46l.jpg', '_vyrp11_1359rl46l_1.jpg', '_vyrp12_1359rl46l_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8614, 1360, 'Mini oscilační bruska s rotací Virutex ', 'Mini oscilační bruska s rotací Virutex 180W', '<p><strong>LRE84H Mini oscilační bruska s rotací</strong></p>\\n<p><span><span lang=\\\"cs\\\">Model patří do třídy lehkých brusek pro leštění a dokončovací práce. Díky nízké hmotnosti, ergonomickému designu a relativně vysokému výkonu je možné pracovat jednou rukou, což poskytuje pohodlí a snižuje únacu obsluhy. Zahrnuje extra základnu s delta tvarem pro brusné listy na suchý zip, takže lze stroj použít k ošetření těžko přístupných povrchů, jako jsou rámy, žaluzie, atd. Charakteristickým rysem modelu LRE84H je elektronický nastavovací systém, který umožňuje zvolit optimální režim zpracování pro různé typy materiálů, a brzdový systém, který zabraňuje zrychlení při volnoběhu. Pomocí volitelného disku lze převést na rotační oscilační brusku. Stroj je vybaven vestavěným systémem pro odtraňování prachu.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"> </span></pre>\\n<p><span></span></p>\\n<', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_LRE84H v. 2.jpg', 0, '3698.00', '4109.00', 'LRE84H', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_LRE84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_LRE84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_lr84a.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRE84H_lr84b.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8615, 1361, 'Víceúčelová bruska Virutex', 'Víceúčelová bruska Virutex 180W', '<p><strong>LRT84H Víceúčelová bruska</strong></p>\\n<p><span lang=\\\"cs\\\"><span>Víceúčelový stroj pro dokončování broušení zajišťuje vibrační a oscilační (excentrický) brusný pohyb. Tento model má k dispozici 3 základny. První základna (vibrační) má tzv. delta-tvar díky němuž lze velice snadno brousit i obtížně brousitelná místa jako jsou vnitřní rohy, lamely apod. Druhá základna je kruhová (rotačně-vibrační) vybavená Velcro systémem. Excentr kombinací dvou pohybů vytváří dokonale hladký povrch bez škrábanců. Třetí základna (vibrační) má klasický obdélníkový tvar a lze na něj osadit jak Velcro papíry tak klasický brusný papír. Díky své kompaktnosti a nízké hmotnosti lze stroj používat i ve svislých oblastech a při práci nad hlavou. Stroj je vybaven vestavěným systémem pro odstraňování prachu a sběračem prachu. Bruska je vybavena elektronickým seřizovacím systémem, který umožňuje zvolit optimální režim zpracování pro různé typy materiálů, a brzdovým systémem, který zabraňuje přetočení nez', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_LRT84H v. 2.jpg', 0, '3826.00', '4251.00', 'LRT84H', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_LRT84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_LRT84H v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_lrt84haa.jpg', 'https://b2b-itatools.pl:443/Obrazki/LRT84H_lrt84hab.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8616, 1363, 'Ruční excentrická bruska Virutex', 'Ruční excentrická bruska Virutex 350W ', '<p></p>\\n<p>Vysoký výkon a vyváženost této robustní brusky umožňuje uživateli dosáhnout perfektních výsledků při broušení a leštění především velkých lakovaných ploch. Vibračně-rotační systém zajišťuje povrch bez jakýchkoli nežádoucích stop po broušení. Ergonomický design s předním madlem a neklouzavý povrch umožňuje velice efektivní a pohodlnou práci. Stroj je vybaven nezbytnou elektronickou regulací otáček a brzdou proti přetočení stroje při nezatíženém běhu. Tento stroj je vybaven 4mm oscilací, která je určena především k jemnému a extra jemnému broušení povrchů určených k leštění. Brusná plocha je upínána Velcro systémem. Tyto brusky mají nový systém ochrany proti prachu a integrovaný sběr prachu, který umožňuje použití standardních brusiv a desek. Ergonomický design s protiskluzovými povrchy usnadňuje práci.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 350 W</li>\\n<li>Průměr kotouče: 150 mm</li>\\n<li>Otáčky: 4000 - 8000 ot/', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_RTE46L v. 2.jpg', 0, '9370.00', '10411.00', 'RTE46L', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_RTE46L v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_RTE46L v. 2.jpg', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_rte46ld1.jpg', 'https://b2b-itatools.pl:443/Obrazki/RTE46L_rte46ld5.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8617, 1364, 'Ruční excentrická bruska Virutex', 'Ruční excentrická bruska Virutex 350W', '<p><strong>RTE146L</strong></p>\\n<p>Vysoký výkon a vyváženost této robustní brusky umožňuje uživateli dosáhnout perfektních výsledků při broušení a leštění především velkých lakovaných ploch. Vibračně-rotační systém zajišťuje povrch bez jakýchkoli nežádoucích stop po broušení. Ergonomický design s předním madlem a neklouzavý povrch umožňuje velice efektivní a pohodlnou práci. Stroj je vybaven nezbytnou elektronickou regulací otáček a brzdou proti přetočení stroje při nezatíženém běhu. Tento stroj je vybaven 4mm oscilací, která je určena především k jemnému a extra jemnému broušení povrchů určených k leštění. Brusná plocha je upínána Velcro systémem a stroj je vybaven vestavěným odsáváním.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 350 W</li>\\n<li>Průměr kotouče: 150 mm</li>\\n<li>Otáčky: 4000 - 8000 ot/min</li>\\n<li>Průměr oscilace: 4 mm</li>\\n<li>Váha: 2,6 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\"', '_vyr_1364RTE146L_RTE146L-v--2.jpg', 0, '5318.00', '5909.00', 'RTE146L', '_vyrn_1364RTE146L_RTE146L-v--2.jpg', '_vyrp11_1364RTE146L_rte84hc.jpg', '_vyrp12_1364RTE146L_rte84hb.jpg', '_vyrp13_1364RTE146L_rte84ha.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:09'),
(8618, 1365, 'Ruční frézka 750W Virutex', 'Ruční frézka 750W Virutex', '<p><strong>FR192N Ruční frézka</strong></p>\\n<p>Lehká frézka na široké použití od ohraňovaní hran, přes drážkování a zahlubování až po frézování kruhových a rovných drážek za pomoci standardního příslušenství. Je vybavena elektrickým regulátorem otáček, speciálním systémem, který při různém zatížení udržuje stejné otáčky. Součástí produktu jsou dva typy nástroje, přípravek na frézování rovných a kruhových drážek, vodící ložisko a servisní klíč.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 750 W</li>\\n<li>Max. velikost nástroje: 25 mm</li>\\n<li>Upínací pouzdro: 6 mm</li>\\n<li>Otáčky: 14000 - 30000 ot/min</li>\\n<li>Váha: 1,8 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často o', '_vyr_1365fr192n.jpg', 0, '5264.00', '6183.00', 'FR192N', '_vyrn_1365fr192n.jpg', '_vyrp11_1365fr192n_1.jpg', '_vyrp12_1365fr192n_2.jpg', '_vyrp13_1365fr192n_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09');
