(8620, 1367, 'Ruční frézka na hrany 750W Virutex', 'Ruční frézka na hrany 750W Virutex', '<p><strong>FR156N Ruční frézka na hrany</strong></p>\\n<p>FR165N je rádiusová ohraňovací frézka s použitím na PVC a dýhy. Je vybavena frézou s poloměrem 3 mm a ložiskem (1140106). Nástroje s jinými poloměry jsou k dostání jako zvláštní příslušenství. Frézka má silný motor s elektronickou regulací otáček. Dále je vybavena systémem, který zajistí stejné otáčky při různém zatížení nástroje. Nástroj je také osazen přípojkou na odsávání zbytku materiálu a třemi různými opěrnými základnami (s otvorem o průměru 20, 30 a 36 mm) pro osazení různými nástroji. </p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Výkon: 750 W</li>\\n<li>Upínací pouzdro: 8 mm</li>\\n<li>Otáčky: 14000 - 30000 ot/min</li>\\n<li>Váha: 1,6 kgy<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (vě', '_vyr_1367fr156n.jpg', 0, '5915.00', '6573.00', 'FR156N', '_vyrn_1367fr156n.jpg', '_vyrp11_1367fr156n_1.jpg', '_vyrp12_1367fr156n_2.jpg', '', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8621, 1368, 'Frézka na hrany 750W Virutex', 'Frézka na hrany 750W Virutex', '<p><strong>FR256N Frézka na hrany</strong></p>\\n<p></p>\\n<p>Rádiusová ohraňovací frézka pro hrany z PVC a dýhy. Je vybavena frézou s poloměrem 2 mm a ložiskem (1140123). Nástroje s jinými poloměry jsou k dostání jako zvláštní příslušenství. Má silný motor a elektronickou regulaci otáček. Také je vybavena systémem, který zajistí stejné otáčky motoru při různém zatížení nástroje. Dále je osazena přípojkou na odsávání a třemi různými opěrnými základnami (s otvorem průměru 20, 36 a 30mm) pro osazení strojku různými nástroji. Součástí produktu je ořezávací hlava s větší plochou a madlem pro lepší stabilitu CA56G a přepravní kufřík.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span><br />Příkon: 750 W<br />Upínací pouzdro: 8 mm<br />Otáčky : 14 000 – 30 000 ot/min<br />Váha: 1,6 Kg</p>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl ', '_vyr_1368fr256n.jpg', 0, '8072.00', '8969.00', 'FR256N', '_vyrn_1368fr256n.jpg', '_vyrp11_1368fr256n_1.jpg', '_vyrp12_1368fr256n_2.jpg', '_vyrp13_1368fr256n_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8622, 1369, 'Horní frézka 1010W Virutex', 'Horní frézka 1010W Virutex', '<p><strong>FR277R Horní frézka</strong></p>\\n<p><strong></strong></p>\\n<p><span>„Mladší“ z hlediska výkonu a nejlehčí v řadě univerzálních frézek, určené ke zpracování masivního dřeva, dřevotřískových desek a plastů. Konstrukce frézy zajišťuje vysokou přesnost a stabilitu zpracování. Boční důraz a seřizovač hloubky frézování jsou vybaveny systémy jemného doladění. Vodicí tyče jsou uzavřeny speciální gumovou vrstvou, která zabraňuje jejich znečištění. Promyšlené uspořádání ovládacích prvků a ergonomický design držadel zaručují snadné používání a bezpečnost pracovníků. Pomocí 3 polohové věže se stává snadnější rychlá úprava frézování. Ideální stroj pro výspravu suků, práci se šablonou, řezání čepů pomocí nástroje PL 11, vytváření drážek, atd. Stroj má také vývod s přípojkou k externímu vysavači prachu, přivedený na horní část frézky pro lepší viditelnost při práci.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\', 'https://b2b-itatools.pl:443/Obrazki/FR277R_FR277R.jpg', 0, '7021.00', '7801.00', 'FR277R', 'https://b2b-itatools.pl:443/Obrazki/FR277R_FR277R.jpg', 'https://b2b-itatools.pl:443/Obrazki/FR277R_FR277R.jpg', 'https://b2b-itatools.pl:443/Obrazki/FR277R_fr277r_d1.jpg', 'https://b2b-itatools.pl:443/Obrazki/FR277R_fr277r_d3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8623, 1370, 'Ohraňovací rohová frézka 750W Virutex', 'Ohraňovací rohová frézka 750W Virutex', '<p><strong>FR217S Ohraňovací rohová frézka</strong></p>\\n<p>Frézka speciálně vytvořená k obrábění vnitřních rádiusů v místě styku boční plochy se dnem či půdou, a to u produktů z umělého kamene (Corian, Rausolid, atd.). Stroj je vybaven speciální oporou, která slouží k udržení konstantní vzdálenosti od boční plochy i k bezpečnému a snadnému použití frézky. Frézka je vybavena silným motorem o 750 W, elektronickou regulací rychlosti a systémem, který udržuje konstantní otáčky i při vyšším zatížení. Stroj má také vývod k připojení externího vysavače, který zajišťuje čistý pracovní prostor, čímž prodlužuje životnost stroje. Produkt se prodává s dvěma frézami R5 a R10. Upínacím pouzdrem (8 mm) a transportním kufrem.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span><br />Příkon: 750 W<br />Max. velikost nástroje: 20 mm<br />Upínací pouzdro: 8 mm<br />Otáčky : 14 000 – 30 000 ot/min<br />Váha: 1,6 Kg</p>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobe', '_vyr_1370fr217s.jpg', 0, '10117.00', '11241.00', 'FR217S', '_vyrn_1370fr217s.jpg', '_vyrp11_1370fr217s_1--1.jpg', '_vyrp12_1370fr217s_2.jpg', '_vyrp13_1370fr217s_3.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8624, 1373, 'Drážkovací frézka na okna Virutex', 'Drážkovací frézka na okna Virutex', '<p><strong>RA17VB Drážkovací frézka na okna</strong></p>\\n<p>Inovovaná ruční frézka určená pro drážkování, výborná pro drážkování nových i starších dřevěných oken a dveří pro instalaci silikonového těsnění. Vybaven 3mm nástrojem s dvojitou hlavou, dvěma vyměnitelnými vodítky, boční příložkou, přípojkou na odsávání a přepravním pouzdrem. Součástí balení je drážkovací frézka na okna, kombinovaný dvoustranný vrták 3 mm, příložka pro polodrážky 45°, příložka pro rovné drážky, výměnné vodítko, hloubkové měřidlo, servisní klíče, transportní kufřík, ve kterém je vše uloženo.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 630 W</li>\\n<li>Upínací kleštiny: 6 mm</li>\\n<li>Rychlost bez zatížení: 28000/min</li>\\n<li>Hmotnost: 1,95 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ', '_vyr_1373386_imatge_m.jpg', 0, '8791.00', '9767.00', 'RA17VB', '_vyrn_1373386_imatge_m.jpg', '_vyrp11_1373387_imatge_m.jpg', '_vyrp12_1373388_imatge_m.jpg', '_vyrp13_1373389_imatge_m.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8625, 1374, 'Zařízení pro řezání okenních rámů Virutex ', 'Zařízení pro řezání okenních rámů Virutex 1700W ', '<p><strong>RV7OU Zařízení pro řezání okenních rámů</strong></p>\\n<p><span>RV70U je navržen pro ořezání dřevěných okenních rámů a pro použití při obnově nebo výměně celých okenních bloků. Pro práci na oknech </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">je stroj vybaven speciálním pilovým listem 30 zubů z tvrdokovu a nastavitelným čelním vedením, které se používá jako nosná základna pro řezání.</span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"> Základní konstrukce umožňuje zpracování ve všech čtyřech rozích. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Nový RV70U usnadňuje výměnu oken, zachovává původní velikost nebo v je v případě nutnosti i zvětšuje. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Je také nezbytným nástrojem pro instalaci hliníkových nebo dřevěných oken. <span lang=\\\"cs\\\">V</span><span lang=\\\"cs\\\">e standardní výbavě je diamantový řezací kotouč určený pro řezání stavebníc materiálů D.180, čelní hran', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u_bod.jpg', 0, '20179.00', '22421.00', 'RV70U', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u_bod.jpg', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u_bod.jpg', 'https://b2b-itatools.pl:443/Obrazki/RV70U_maletin_rv70u.jpg', 'https://b2b-itatools.pl:443/Obrazki/RV70U_rv70u foto1.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8626, 1376, 'Rohová frézka 750W Virutex ', 'Rohová frézka 750W Virutex ', '<p><strong>FR817T Rohová frézka</strong></p>\\n<p>Frézka se používá k odfrézování rádiusů zůstávajících v rozích po přebroušení parketových podlah. K frézování v rozích už osazených desek slouží přídavné kopírovací zařízení, které je v čele stroje nad frézou a zabraňuje poškození desky. Frézka splňuje evropské standardy, má dvojitou izolaci, regulátor otáček, výstup třísek a hubici k odsávání třísek. Je dodávána v praktickém<br />přepravním kufříku.</p>\\n<p></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 550 W</li>\\n<li>Otáčky: 30000 ot/min</li>\\n<li>Váha: 1,9 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručn', '_vyr_1376333.jpg', 0, '9575.00', '10639.00', 'FR817T', '_vyrn_1376333.jpg', '_vyrp11_1376327.jpg', '_vyrp12_1376328.jpg', '_vyrp13_1376329.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:09'),
(8627, 1377, 'Kotoučová pila Virutex 1200W', 'Kotoučová pila Virutex 1200W', '<p><strong>SR74K Kotoučová pila</strong></p>\\n<p>Výkonný motor (1 200 W) umožňuje řezat do hloubky až 51 mm. Úhel nastavitelný do 45°. Hloubkové řezy a sklon lze nastavit pomocí mikrometrického měřítka. Stroj je vybaven štípacím nožem, paralelním vodítkem, ochranou pilového kotouče a bezpečností proti náhodnému spuštění. Dodáváno s přípojkou pro odsávání.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 1.200 W</li>\\n<li>Výkon: 1.200 W</li>\\n<li>Průměr kotouče: 153 mm</li>\\n<li>Hloubka řezu 90°: 51 mm</li>\\n<li>Hloubka řezu při 45°: 34 mm</li>\\n<li>Rychlost bez zatížení: 5.000/min</li>\\n<li>Hmotnost: 3,4 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně op', 'https://b2b-itatools.pl:443/Obrazki/SR74K_SR74K.jpg', 0, '2499.00', '2777.00', 'SR74K', 'https://b2b-itatools.pl:443/Obrazki/SR74K_SR74K.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR74K_SR74K.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR74K_sr74kd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR74K_sr74kd2.jpg', 21, 1, 1, 0, '', 0, '3-480-489-0', NULL, '2021-01-10 15:44:09'),
(8628, 1378, 'Kotoučová pila Virutex 1400W', 'Kotoučová pila Virutex 1400W', '<p><strong>SR90J Kotoučová pila</strong></p>\\n<p>Kotoučová pila SR90J nabízí profesionální výjimečné vlastnosti z hlediska výkonu, ovladatelnosti a bezpečnosti. Díky kompaktní struktuře a široké opěrné základně je pila snadno ovladatelná a vhodná pro dlouhodobý provoz. Můžete provádět řezy do hloubky až 70 mm, s možností regulace hloubky i úhlu. Pila je vybavena ochranným krytem pilového kotouče s automatickým vratným mechanismem a výstupem pro připojení externího vysavače. Tento pečlivý design má vysokou ergonomickou úroveň. Součástí dodávky je také velká pomocná rukojeť, která vám umožní pracovat v naprosto bezpečných podmínkách se stabilitou a komfortem, tvrdokovový kotouč a servisní klíč.</p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 1.400 W</li>\\n<li>', 'https://b2b-itatools.pl:443/Obrazki/SR90J_SR90J.jpg', 0, '6004.00', '6671.00', 'SR90J', 'https://b2b-itatools.pl:443/Obrazki/SR90J_SR90J.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR90J_SR90J.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR90J_sr90jd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/SR90J_sr90jd2.jpg', 21, 1, 1, 0, '', 0, '3-480-489-0', NULL, '2021-01-10 15:44:09'),
(8629, 1379, 'Sklopná pokosová laserová pila Virutex', 'Sklopná pokosová laserová pila 1500W Virutex', '<p><strong>TM33W Sklopná pokosová laserová pila</strong></p>\\n<p>Přenosná sklopná pokosová pila s vysokou přesností i velkou kapacitou řezu pro max. průřezy. Pila je vybavena horním stolem s plynulým nastavením pro pomocné práce, celkovým bezpečnostním systémem spouštění motoru, připojením pro vnější odsávání, blokovacím zařízením pro snadnou výměnu kotouče a hlavu je možné naklopit od 0° do 45°. Pila je odhlučněna s řemenovou transmisí se zajištěním napínání. Je vybavena kotoučem se 40-ti tvrdokovovými zuby, průměr 300 mm.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>příkon: 1.500 W</li>\\n<li>průměr pilového kotouče: 300 mm</li>\\n<li>rychlost bez zatížení: 3700 ot./min</li>\\n<li>hmotnost: 20 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) prod', 'https://b2b-itatools.pl:443/Obrazki/TM33W_TM33W.jpg', 0, '20406.00', '22673.00', 'TM33W', 'https://b2b-itatools.pl:443/Obrazki/TM33W_TM33W.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM33W_TM33W.jpg', '', 'https://b2b-itatools.pl:443/Obrazki/TM33W_portada foll tm33w_1_recortar mesa de madera.jpg', 21, 1, 1, 0, '', 0, '3-480-492-0', NULL, '2021-01-10 15:44:09'),
(8630, 1380, 'Sklopná pokosová pila Virutex', 'Sklopná pokosová pila1100W Virutex', '<p><strong>TM43L Sklopná pokosová pila</strong></p>\\n<p><span>Přenosná pokosová pila vyznačující se vysokou frekvencí otáčení disku, což zajišťuje vysoce kvalitní řez. Používá se ke zpracování profilů dřeva a MDF hlavně pro vysokou přesnost a jemné řezání. Hlava může být nakloněna pod úhlem od 0° do 45°. Pila je posazena na otočném stole s úhlem natočení od -45° do + 45° s fixací několika úhlů a možností nastavení nestandardních úhlů natočení stolu. Souprava obsahuje horní stůl s podélným vedením. <span lang=\\\"cs\\\">Zabezpečovací systém zahrnuje vestavěnou kotoučovou brzdu, ochranu proti náhodnému nastartování díky proudovému přerušovači napájení a pojistku, která chrání motor před přepětím, a také ochranu pilového kotouče, která zajišťuje bezpečnost pracovníků.</span></span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 1.100 W</li>\\n<li>Rychlost bez zatížení: 5 500 / min</li>\\n<li>Průměr pilové', 'https://b2b-itatools.pl:443/Obrazki/TM43L_TM43L.jpg', 0, '20290.00', '22544.00', 'TM43L', 'https://b2b-itatools.pl:443/Obrazki/TM43L_TM43L.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM43L_TM43L.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM43L_tm43ld1.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM43L_tm43ld2.jpg', 21, 1, 1, 1, '', 0, '3-480-492-0', NULL, '2021-01-10 15:44:09'),
(8631, 1381, 'Sklopná pokosová pila Virutex', 'Sklopná pokosová pila 1200W Virutex', '<p><strong>TM72C Sklopná pokosová pila</strong></p>\\n<p>Velice výkonná a přesná pokosová pila. Prořez až 150 mm. Hlava může být nakloněna od 0 ° do 45 °. Je vybavena nastavitelným horním stolkem včetně nastavitelného paralelního pravítka. Integrovaný bezpečnostní kryt spolu s elektro-brzdou zajišťuje bezpečnou práci. Konektor pro externí odsávání prachu. Tvrdokovový pilový list 48Z. Výkonná, přesná a bezpečná pila. Součástí standardní výbavy je imbus 8 mm, dřevěný doraz, posuvník, instruktážní manuál a bezpečnostní instrukce.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 1200 W</li>\\n<li>Průměr pilového kotouče: 300 mm</li>\\n<li>Otáčky: 3000/min</li>\\n<li>Váha: 30 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obro', 'https://b2b-itatools.pl:443/Obrazki/TM72C_TM72C.jpg', 0, '28958.00', '32176.00', 'TM72C', 'https://b2b-itatools.pl:443/Obrazki/TM72C_TM72C.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM72C_TM72C.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM72C_tm72cd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/TM72C_tm72cd2.jpg', 21, 1, 1, 1, '', 0, '3-480-492-0', NULL, '2021-01-10 15:44:09'),
(8632, 1382, 'Virutex Kapovací nůžky', 'Virutex Kapovací nůžky, max. tloušťka hrany 1,8mm', '<p><strong>Kapovací nůžky</strong></p>\\n<p>Kapovací nůžky se používají k lícovému stříhání přírodní dýhy. Stroj je určen pro stacionární použití na pracovním stole. Velká šířka řezu umožňuje zpracování obrobku až do šířky 145 mm a díky vodícímu pravítku je přesné řezání prováděno v úhlu 0 - 45°. </p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Šířka řezu (90°): 145 mm</li>\\n<li>Šířka řezu do 45°: 90 mm</li>\\n<li>Max. hloubka řezu: 1,8 mm</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručn', 'https://b2b-itatools.pl:443/Obrazki/U78_U78.jpg', 0, '9113.00', '10125.00', 'U78', 'https://b2b-itatools.pl:443/Obrazki/U78_U78.jpg', 'https://b2b-itatools.pl:443/Obrazki/U78_U78.jpg', 'https://b2b-itatools.pl:443/Obrazki/U78_u78d1.jpg', 'https://b2b-itatools.pl:443/Obrazki/U78_u78d2.jpg', 21, 1, 1, 0, '', 0, '3-480-490-0', NULL, '2021-01-10 15:44:09'),
(8633, 1383, 'Řezačka na lamino Virutex', 'Řezačka na lamino Virutex', '<p><strong>CO15L Řezačka na lamino</strong></p>\\n<p><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Řezačka je určena pro zpracování materiálu na pásy. Model se vyznačuje vysokou rychlostí a snadnou obsluhou.<br /> Díky použití tvrdokovových nožů je dosaženo čistého řezu bez třísek a odpadu. Stroj je možné použít na plast a přírodní dýhu. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">K nastavení šířky řezaného pásu se používá milimetrová stupnice a samotné seřízení se provádí ve dvou fázích: předběžné, díky odnímatelné matici ve vodicím pravítku, se pravítko rychle pohybuje a potřebná velikost se jemně vyladí pomocí  mikrometrického šroubu. </span><span lang=\\\"cs\\\"><span style=\\\"font-family: verdana, geneva;\\\">Při použití zařízení pro stacionární instalaci může být řezačka namontována na pracovní stůl nebo jinou pracovní plochu.</span><br /><span style=\\\"font-family: verdana, geneva;\\\"> V tomto provedení se nůž používá v případě, kdy je vhodnější pohybovat ', 'https://b2b-itatools.pl:443/Obrazki/CO15L_CO15L.jpg', 0, '2977.00', '3308.00', 'CO15L', 'https://b2b-itatools.pl:443/Obrazki/CO15L_CO15L.jpg', '_vyrp11_1383co15l-1.jpg', '_vyrp12_1383co15l-2.jpg', '_vyrp13_1383co15l-3.jpg', 21, 1, 1, 1, '', 0, '3-480-493-0', NULL, '2021-01-10 15:44:09'),
(8634, 1384, 'Zařezávací nůžky Virutex ', 'Zařezávací nůžky Virutex ', '<p><strong>MC3 Řezací nůžky</strong></p>\\n<p><span>Řezačka je určena pro řezání všech typů PVC profilů pro dekoraci interiéru, například po instalaci okenních bloků a rolet. Umožňuje oříznout profil podle délky, šířky nebo dokonce pokosové řezy v jakémkoli úhlu bez zbytečného úsilí. Řezačka nevyžaduje žádnou údržbu, má kompaktní rozměry a je pohodlná při přepravě, což ji předurčuje k použití nejen v dílně, ale i mimo ni.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Max. šířka řezu: 120 mm</li>\\n<li>Max. hloubka řezu: 4 mm</li>\\n<li>Hmotnost: 8,5 kg</li>\\n<li>Rozměry: 370 x 270 x 220 mm</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosér', 'https://b2b-itatools.pl:443/Obrazki/MC3_mc33.jpg', 0, '11176.00', '12418.00', 'MC3', 'https://b2b-itatools.pl:443/Obrazki/MC3_mc33.jpg', '_vyrp11_1384mc3-1.jpg', '_vyrp12_1384mc3-2.jpg', '', 21, 1, 1, 1, '', 0, '3-480-490-0', NULL, '2021-01-10 15:44:09'),
(8635, 1385, 'Virutex Mechanická nanášečka lepidla', 'Virutex Mechanická nanášečka lepidla, váleček 122mm', '<p><strong>Mechanická nanášečka lepidla</strong></p>\\n<p>Ruční nanášečka lepidla určená pro nanášení vinylového lepidla na velké plochy. Vybavená dorazovým zařízením pro zastavení výtoku lepidla při uvolnění válečku. <span>Rovněž výrobce přichází s podpěrou, na kterou je nanášečka odkládána, čímž udržuje pracovní plochu a stroj v čistotě.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Technické specifikace:</span></p>\\n<ul>\\n<li><span>Šířka spodního válce: </span><span>122 mm</span></li>\\n<li><span>Hmotnost: 1 kg</span></li>\\n</ul>', '_vyr_1385lepidlo1.jpg', 0, '2955.00', '3284.00', 'EM26D', '_vyrn_1385lepidlo1.jpg', 'https://b2b-itatools.pl:443/Obrazki/EM26D_EM26D.jpg', '', '', 21, 1, 1, 1, '', 0, '5-0-0-0|5-428-0-0', NULL, '2021-01-10 15:44:09'),
(8636, 1386, 'Virutex Mechanická nanášečka lepidla', 'Virutex Mechanická nanášečka lepidla, nanášecí válce o šířce 180mm/92mm', '<p><strong>EM125T Mechanická nanášečka lepidla</strong></p>\\n<p>Ruční nanášečka lepidla pro lepení velkých ploch pomocí<br />disperzního lepidla. Je vybavena spoušťovým uzavíracím<br />systémem pro zastavení toku lepidla. Navíc je vybavena<br />stojanem pro odkládání nanášečky a k zachování čistého<br />pracovního prostoru. Také je vybavena horním válcem<br />pro nanášení lepidla na menší dílce. Spodní válec má<br />šířku 180 mm.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">Technické parametry:</span></p>\\n<ul>\\n<li>šířka spodního válce: 180 mm</li>\\n<li>šířka horního válce: 92 mm</li>\\n<li>hmotnost: 1,4 kg</li>\\n</ul>', '_vyr_1386lepidlo2.jpg', 0, '4451.00', '4945.00', 'EM125T', '_vyrn_1386lepidlo2.jpg', 'https://b2b-itatools.pl:443/Obrazki/EM125T_EM125T.jpg', '', '', 21, 1, 1, 0, '', 0, '5-0-0-0|5-428-0-0', NULL, '2021-01-10 15:44:09'),
(8637, 1387, 'Virutex Mechanická nanášečka lepidla', 'Virutex Mechanická nanášečka lepidla 180mm, 2polyuretanové + pěnové válečky', '<p><strong>EM 126T Mechanická nanášečka lepidla</strong></p>\\n<p>Ruční nanášečka pro lepení velkých ploch pomocí vinylového lepidla.<br />Dolní šířka válce: 180 mm. Vybavena vypínacím zařízením pro zastavení<br />toku lepidla. Dodává se také s oporou, pro odložení stroje, čímž se udržuje pracovní<br />plocha a stroj čisté. Bez horního válce.</p>\\n<p>TECHNICKÉ PARAMETRY:</p>\\n<ul>\\n<li>Šířka spodního válce: 180 mm</li>\\n<li>Hmotnost: 1,4 kg</li>\\n</ul>\\n<p></p>', 'https://b2b-itatools.pl:443/Obrazki/EM126T_EM126T.jpg', 0, '4222.00', '4691.00', 'EM126T', 'https://b2b-itatools.pl:443/Obrazki/EM126T_EM126T.jpg', 'https://b2b-itatools.pl:443/Obrazki/EM126T_EM126T.jpg', '', '', 21, 1, 1, 1, '', 0, '5-0-0-0|5-428-0-0', NULL, '2021-01-10 15:44:09'),
(8638, 1388, 'Virutex Olepovačka hran', 'Virutex Olepovačka hran 1500W, rám max. 50mm', '<p><strong>Olepovačka hran</strong></p>\\n<p>Olepovačka je určena pro lamino hranu s již naneseným lepidlem. Umožňuje olepování rovných i tvarových dílců. Čas nahřátí je menší než 1 minuta. Má integrované kapovací nůžky, stavitelné kleštiny na různé tloušťky desek. Protože konstrukce tohoto strojku je velmi lehká a ergonomická, pracuje se s ním velmi snadno i delší dobu.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Výkon : 1500 W</li>\\n<li>Max. šířka olepení: 50mm</li>\\n<li>Dodávka vzduchu: 400 l/min</li>\\n<li>Váha: 2,7 kg</li>\\n<li>Teplota: I. 300 °C / II. 525 °C</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Viru', 'https://b2b-itatools.pl:443/Obrazki/AG98F_AG98F.jpg', 0, '6690.00', '7433.00', 'AG98F', 'https://b2b-itatools.pl:443/Obrazki/AG98F_AG98F.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG98F_AG98F.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG98F_ag98fd1.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG98F_ag98fd2.jpg', 21, 1, 1, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8639, 1389, 'Virutex Olepovačka hran', 'Virutex Olepovačka hran 1500W na 1-3mm tlusté dýhy', '<p><strong>Olepovačka hran</strong></p>\\n<p>Olepovačka hran AG98R je určena k olepování hran pomocí hran s již naneseným lepidlem. Ja uzpůsobena k práci s hranou z PVC, polyesteru, melaminu, nebo dřevěných dýh tloušťky do 1 mm, případně předem nastřihané pásky do 3 mm. <span lang=\\\"cs\\\">Může být použita pro zpracování zakřivených dílů. </span>Má stavitelné kleštiny na různé tloušťky desek, což zajišťuje spolehlivé obrábění. Dvojitý systém podavače hrany dává možnost si vybrat nepřerušenou hranu šířky 1 - 50 mm, nebo použít vodítko pro předřezané hrany do šířky 25 mm. Protože konstrukce tohoto strojku je velmi lehká a ergonomická, pracuje se s ním velmi snadno i delší dobu. <span lang=\\\"cs\\\">Jako další zařízení se pro zvýšení životnosti a zlepšení kvality prováděné práce je vhodné použít uvolňovací aerosol, který zabraňuje přilepení lepidla k pracovním částem nástroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" d', 'https://b2b-itatools.pl:443/Obrazki/AG98R_AG98R.jpg', 0, '8293.00', '9214.00', 'AG98R', 'https://b2b-itatools.pl:443/Obrazki/AG98R_AG98R.jpg', '', 'https://b2b-itatools.pl:443/Obrazki/AG98R_ag98r_aplacando_cam.jpg', '_vyrp13_1389ag98r-1.jpg', 21, 1, 1, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8640, 1390, 'Virutex Olepovačka hran+sada (AG98F, AU93, RC21E)', 'Virutex Olepovačka hran+sada (AG98F, AU93, RC21E)', '<p><strong>AG52F Olepovačka hran+sada (AG98F, AU93, RC21E)</strong></p>\\n<p><span>Sada pro olepování hran i s kompletním začištěním. Součástí balení je olepovačka, která je určena pro lamino hranu s již naneseným lepidlem. Umožňuje olepování rovných i tvarových dílců. Čas nahřátí je méně než 1 minuta. Má integrované kapovací nůžky na odstřihnutí hrany, stavitelné kleštiny na různé tloušťky desek. Dále jsou v sadě obsaženy ruční ořezávačka a kapovačka.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Příkon: 1500W - 220W</li>\\n<li>Maximální šířka hrany (tloušťka 1 mm): 50mm</li>\\n<li>Maximální šířka hrany (tloušťka 3 mm): 25mm</li>\\n<li>Teplota l:300°C II:525°C</li>\\n<li>Hmotnost: 2,8 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovs', 'https://b2b-itatools.pl:443/Obrazki/AG52F_AG52F.jpg', 0, '7463.00', '8293.00', 'AG52F', 'https://b2b-itatools.pl:443/Obrazki/AG52F_AG52F.jpg', 'https://b2b-itatools.pl:443/Obrazki/AG52F_AG52F.jpg', '', '', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8641, 1391, 'Virutex Manuální olepovačka', 'Virutex Manuální olepovačka', '<p><strong>PEB200 Manuální olepovačka</strong></p>\\n<p>Přenosná manuální olepovačka hran. <span lang=\\\"cs\\\">Stroj je určen pro lepení hran z PVC, ABS, melamin, lemovací plast a přírodní dýha, předem nařezané na požadovanou délku. Umožňuje zpracovat zakřivené (konkávní i konvexní), kulaté a rovné díly s výškou 10 až 62 mm a tloušťkou hranového materiálu od 0,4 do 3 mm. <span>Jednoduché a rychlé přizpůsobení tloušťce panelu a hraně, jakož i automatické podávání hrany pomocí vodicího systému pro polohování hranového materiálu na lisovacím válci a motorickém přítlačném válci, zajišťuje rychlé a kvalitní lepení hranového materiálu. Nastavovací mechanismus umožňuje změnit tloušťku nanesené lepicí vrstvy. Je to velmi praktické v dílně (protože má schopnost pracovat se zavěšením) a na místě, díky velkokapacitní nádobě na lepidlo s teflonovým povlakem (Teflon®). Model PEB200 nemá elektronickou regulaci teploty a posuvu. Stroj je zasílán v přepravní tašce.</span></span></p>\\n<pre class=\\\"tw-data', 'https://b2b-itatools.pl:443/Obrazki/PEB200_PEB200.jpg', 0, '38423.00', '42692.00', 'PEB200', 'https://b2b-itatools.pl:443/Obrazki/PEB200_PEB200.jpg', 'https://b2b-itatools.pl:443/Obrazki/PEB200_PEB200.jpg', '_vyrp12_1391peb250-1.jpg', '_vyrp13_1391peb250-4.jpg', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8642, 1392, 'Virutex Manuální olepovačka', 'Virutex Manuální olepovačka', '<p><strong>PEB250 Manuální olepovačka</strong></p>\\n<p><span lang=\\\"cs\\\">Olepovačka nové generace s nádobou na lepidlo. Stroj je určen k lepení hran z PVC, ABS, melaminu, lamina a přírodní dýhy, předem nařezané na požadovanou délku. Umožňuje zpracovat zakřivené (konkávní i konvexní), kulaté a přímočaré díly s výškou 10 až 62 mm a tloušťkou hranovy od 0,4 do 3 mm. Stroj je velmi praktický v dílně k malosériové výrobě i díky tomu, že je schopen pracovat se zavěšením. Tomuto modelu olepovačky byl zvýšen obsah nádoby na lepidlo s teflonovým povlakem (Teflon®). Jednoduché a rychlé přizpůsobení tloušťce panelu i hraně, jakož i automatické podávání hranového materiálu pomocí vodicího systému pro polohování pásky na lisovacím válci a motorickém přítlačném válci, zajišťuje rychlé a kvalitní lepení hrany. Stroj je vybaven elektronickou regulací teploty a postupným nastavováním rychlosti lepení od 2 do 6 m/min, což vám umožní použít širší škálu lepidel a zlepšit kvalitu lepení. Nastavovací mechan', '_vyr_1392vir-peb250-1-540-1.jpg', 0, '48927.00', '54364.00', 'PEB250', '_vyrn_1392peb250.jpg', '_vyrp11_1392peb250-1.jpg', '_vyrp12_1392peb250-2.jpg', '_vyrp13_1392peb250-3.jpg', 21, 1, 1, 1, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:09'),
(8643, 1393, 'Virutex Stůl na manuální olepovačky', 'Virutex Stůl na manuální olepovačky', '<p><strong>MEB100 Stůl na manuální olepovačku</strong></p>\\n<p>Stůl na manuální olepovačky umožňuje <br />snadnější manipulaci s manuální olepovačkou.<br />Velký povrch stolu zvyšuje možnosti práce.<br /><br /></p>', 'https://b2b-itatools.pl:443/Obrazki/MEB100_154.jpg', 0, '6956.00', '7729.00', 'MEB100', 'https://b2b-itatools.pl:443/Obrazki/MEB100_154.jpg', 'https://b2b-itatools.pl:443/Obrazki/MEB100_154.jpg', 'https://b2b-itatools.pl:443/Obrazki/MEB100_506.jpg', 'https://b2b-itatools.pl:443/Obrazki/MEB100_507.jpg', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:09'),
(8644, 1394, 'Ruční ořezávačka hran Virutex', 'Ruční ořezávačka hran Virutex do 0,6mm', '<p><strong>AU93 Ruční ořezávačka hran</strong></p>\\n<p>Ruční ořezávačka hran je dvoubřitá a ořezává obě protilehlé hrany najednou a to do šíře 40mm a to bez nutnosti dalších dokončovacích operací. Na vetší šířku lze použít rozloženou ořezávačku na každou stranu hrany zvlášť. Má snadno vyměnitelné a velice odolné nože. Použití je primárně nn opracování melaminových hran. </p>\\n<p><span style=\\\"font-family: verdana, geneva;\\\"><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span><br /></span></p>\\n<ul>\\n<li><span face=\\\"verdana, geneva\\\" style=\\\"font-family: verdana, geneva;\\\">Max. šířka hrany: 40 mm</span></li>\\n<li><span face=\\\"verdana, geneva\\\" style=\\\"font-family: verdana, geneva;\\\">Max. tloušťka hrany: 0,6 mm</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují o', 'https://b2b-itatools.pl:443/Obrazki/AU93_AU93.jpg', 0, '309.00', '344.00', 'AU93', 'https://b2b-itatools.pl:443/Obrazki/AU93_AU93.jpg', '_vyrp11_1394au93-1.jpg', '', '', 21, 1, -2, 1, '', 0, '3-480-493-0', NULL, '2021-01-10 15:44:09'),
(8645, 1395, 'Cidlina-ořezávač hran do 1,5mm Virutex', 'Cidlina-ořezávač hran do 1,5mm Virutex', '<p style=\\\"font-size: 20px;\\\"><strong>RP28 Cidlina-ořezávač hran</strong></p>\\n<p>Pro dokončovací práce při olepování Váme zde nabízíme kombinovaný nástroj cidliny a ořezávače hrany. Poskytuje profesionální provedení, které odstraňuje zbytky lepidla, či nadbytečnou hranu. Hranu je možné ořezávat do přesahu 1,5 mm. Nástroj je vyroben z vysokopevnostní oceli, díky čemuž má dlouhou životnost. </p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', '_vyr_1395108_imatge_m.jpg', 0, '603.00', '670.00', 'RP28', '_vyrn_1395108_imatge_m.jpg', '_vyrp11_1395109_imatge_m.jpg', '_vyrp12_1395110_imatge_m.jpg', '', 21, 1, 0, 1, '', 0, '4-497-502-0', NULL, '2021-01-10 15:44:09'),
(8646, 1396, 'Kapovací nůž do 0,6mm Virutex', 'Kapovací nůž do 0,6mm Virutex', '<p><strong>RC21E Kapovací nůž</strong></p>\\n<p>Odstraňuje přesahy okrajových materiálů do tloušťky 0,6 mm a šířky 54 mm na koncích obrobku. Umožňuje perfektní, čisté a kvalitní zaříznutí hrany na obou koncích desky <span lang=\\\"cs\\\">bez poškození obrobku. Není tedy třeba dalších dokončovacích operací. Kapovačka je vybavena otočnými noži a může být použita pro zpracování hran z PVC, melaminu, přírodní dýha.</span></p>\\n<p><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span><br /><br /></span></p>\\n<ul>\\n<li><span face=\\\"verdana, geneva\\\" style=\\\"font-family: verdana, geneva;\\\">Max. šířka hrany: 54 mm</span></li>\\n<li><span face=\\\"verdana, geneva\\\" style=\\\"font-family: verdana, geneva;\\\">Max. tloušťka hrany: 0,6 mm</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od', '_vyr_1396rc21e.jpg', 0, '880.00', '977.00', 'RC21E', '_vyrn_1396rc21e.jpg', '_vyrp11_1396335.jpg', '', '', 21, 1, 1, 0, '', 0, '3-480-490-0', NULL, '2021-01-10 15:44:09'),
(8647, 1397, 'Kapovací kleště Virutex', 'Kapovací kleště do 2mm a max. šířky 45mm Virutex', '<p><strong>RC221R Kapovací kleště</strong></p>\\n<p>Umožňuje perfektní, čisté a kvalitní zaříznutí hrany na obou koncích desky. Není třeba žádných dalších dokončovacích operací. Kapovačka je vybavena otočnými noži. Používá se k zaříznutí hrany z PVC, melaminu, polyesteru, dýhy atd. maximální šířky 45mm a tloušťky 2mm. Možnost regulace polohy řezu.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Max. šíře pásky: 45 mm</li>\\n<li>Max. tloušťka pásky: 2 mm</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možn', '_vyr_1397rc221r.jpg', 0, '808.00', '898.00', 'RC221R', '_vyrn_1397rc221r.jpg', '_vyrp11_1397rc221r-1.jpg', '_vyrp12_1397rc221r-2.jpg', '_vyrp13_1397rc221r-3.jpg', 21, 1, 0, 1, '', 0, '3-480-494-0', NULL, '2021-01-10 15:44:09'),
(8648, 1398, 'Kapovací kleště Virutex', 'Kapovací kleště do 3mm a max. šířky 55mm', '<p><strong>RC321S Kapovací kleště</strong></p>\\n<p>Umožňuje perfektní, čisté a kvalitní zaříznutí hrany na obou koncích desky. Není třeba žádných dalších dokončovacích operací. Kapovačka je vybavena otočnými noži. Používá se k zaříznutí hrany z PVC, melaminu, polyesteru, dýhy atd. maximální šířky 45mm a tloušťky 3mm.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Max. tloušťka hrany při šíři 55 mm: 1 mm</li>\\n<li>Max. tloušťka hrany při šíři 45 mm: 2 mm</li>\\n<li>Max. tloušťka hrany při šíři 25 mm: 3 mm<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní', '_vyr_1398rc321s.jpg', 0, '2443.00', '2714.00', 'RC321S', '_vyrn_1398rc321s.jpg', '_vyrp11_1398rc321s_hoto1.jpg', '_vyrp12_1398rc321s_hoto2.jpg', '_vyrp13_1398rc321s_hoto3.jpg', 21, 1, 1, 1, '', 0, '3-480-494-0', NULL, '2021-01-10 15:44:09'),
