(8716, 1472, 'Předřezový kotouč dvoudílný - D125x2,8-3,6 d20 Z12+12 HW', 'Předřezový kotouč dvoudílný - D125x2,8-3,6 d20 Z12+12 HW', '<p>Pilový kotouč od značky Stehle vyniká německou kvalitou. Špičkový předřezový dvoudílný pilový kotouč pro pily s předřezovým agregátem. Je osazen HW zuby z extra tvrdého německého tvrdokovu pro řezání lamina, dřevotřískových desek, MDF a HPL nebo kompaktů. Vysoká životnost a výdrž.</p>', '101456_1472__vyr_68predrez-Stehle.jpg', 0, '1834.00', '2037.00', 'S58110206', '101456_1472__vyrn_68predrez-Stehle.jpg', '101456_1472_101456_68__vyrp11_33kotouc-hlavni-Stehle1.jpg', '', '', 21, 1, 1, 0, '', 0, '2-2-0-0|2-2-20-0|2-2-20-356|2-2-21-0|7-0-0-0|7-422-0-0', NULL, '2021-01-10 15:44:10'),
