(8890, 1674, 'Formátovací pila ABG Basic 220', 'Formátovací pila ABG Basic 220', '<h1 id=\\\"h1-fig\\\">ABG Basic 220</h1>\\n<p>Pevná a stabilní konstrukce rámu a <strong>2 samostatné motory</strong> pro pohon hlavního kotouče (5HP) a předřezu (0,75HP) jsou společně s pojezdovým stolem o délce 2200 mm základem formátovacích pil ABG Basic 220. Plně<strong> uspokojí požadavky každé truhlářské dílny</strong> zabývající se zakázkovou výrobou nábytku, která pro své potřeby hledá doplňkový stroj zejména<strong> na přípravu dílců do rozměru skříňových dveří a boků</strong>. Plně ji ocení i každý <strong>začínající truhlář</strong>.</p>\\n<p>Pojezdový stůl je uložen na<strong> kuličkové kleci</strong>, která se pohybuje ve čtveřici ocelových pásků. Na této pile<strong> lze řezat kotoučem s maximálním průměrem 355mm</strong>, předřez má průměr 120 mm. <strong>Hlavní pilový kotouč se otáčí rychlostí 4000 ot./min.</strong>, <strong>předřez 8000ot./min</strong>. Maximální prořez s kotoučem 305 mm je 90mm resp. 62mm při naklopení na 45<sup>o</sup>, <strong>naklápění a zdvih kotoučů je', '_vyr_1674basic-260-stin-maly.png', 0, '89900.00', '99900.00', 'ABGBA220', '_vyrn_1674basic-260-stin-maly.png', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-0-0-0|3-62-0-0', NULL, '2021-01-10 15:44:11'),
(8891, 1675, 'Formátovací pila ABG Basic 260', 'Formátovací pila ABG Basic 260', '<h1 id=\\\"h1-fig\\\">Formátovací pila ABG Basic 260</h1>\\n<p>Základním vybavením <strong>formátovacích pil ABG Basic 260</strong> jsou pevná a stabilní konstrukce rámu,<strong> 2 samostatné motory</strong>, které pohání hlavní kotouč (5 HP) a předřez (0,75 HP), a<strong> pojezdový stůl dlouhý 2600 mm</strong>. Přístroje se hodí do každé dílny zabývající se výrobou nábytku na zakázku. Jsou vhodné hlavně<strong> k přípravě dílců do rozměru skříňových dveří a boků</strong>. Pily také ocení začínající truhláři.<br />Ve čtveřici ocelových pásků se pohybuje<strong> kuličková klec</strong>, na které je uložen <strong>pojezdový stůl</strong>. Hlavní pilový kotouč se otáčí rychlostí 4000 ot./min., předřez 8000 ot./min. Můžete řezat <strong>kotoučem s maximálním průměrem 355 mm</strong>, <strong>předřez má průměr o velikosti 120 mm</strong>. Maximální prořez s kotoučem 305 mm je 90 mm (při naklonění na 45°).<strong> Naklápění a zdvih kotoučů funguje manuálně</strong>. Přesnost řezu zajišťuje pevné ', '_vyr_1675basic-260-stin-maly--1.png', 0, '99900.00', '109900.00', 'ABGBA260', '_vyrn_1675basic-260-stin-maly--1.png', '', '', '', 21, 1, 1, 4, '', 0, '3-62-399-0|3-0-0-0|3-62-0-0', NULL, '2021-01-10 15:44:11'),
(8892, 1682, 'Dlabačka Virutex FC116U', 'Dlabačka Virutex FC116U', '<p>Tato dlabačka byla speciálně navržena pro rychlé a precizní dlaby na dveřích a dalších produktech. Díky speciálnímu upevňovacímu systému je možné dlabání dveří, které už jsou zavěšeny, a to bez poškození okolního materiálu. Rychlé měření a úprava umožňují zhotovení několikanásobného dlabu v rekordním čase. Možnost vydlabat otvor pro zadlabací zámek je zajištěna změnou bitu. Výhodou je také velká dlabací hloubka až 125mm.</p>\\n<p></p>\\n<p>Technické informace:</p>\\n<p>Výkon:    1100W</p>\\n<p>Otáčky:        23.000 ot/m</p>\\n<p>Hloubka dlabu:  0-125mm</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % oprav', '_vyr_1682FC116U_fc116u_bd1.jpg', 0, '27477.00', '30530.00', 'FC116U', '', '_vyrp11_1682FC116U_fc116u_bd1.jpg', '_vyrp12_1682FC116U_fc116u_demo.jpg', '_vyrp13_1682FC116U_fc116u_pta_cerr.jpg', 21, 1, 1, 2, '', 0, '3-480-829-0|3-0-0-0|3-480-0-0', NULL, '2021-01-10 15:44:11'),
(8893, 1683, 'AKU šroubovák Virutex ATB40', '', '<h4><strong>Popis:</strong></h4>\\n<p>Kompaktní, praktický, multifunkční a lehký AKU šroubovák, který Vám usnadní práci mimo dílnu a na montážích. Výhodou tohoto šroubováku je rychloupínací sklíčidlo, které umožňuje výměnu nástroje bez jakékoli potřeby utahovacích klíčů.<br /><br />Šroubovák disponuje elektronicky nastavitelnou rychlostí s 2 různými režimy.</p>\\n<p>Šroubovák má zabudované LED světlo, které se nachází v přední části stroje a umožňuje optimální osvětlení pracovního prostoru. Díky tomu lze vrtat a šroubovat i v těžko osvětlených místech.</p>\\n<h4></h4>\\n<h4><img src=\\\"https://www.virutex.es/img/productes/158_equipo.jpg?1584435804\\\" alt=\\\" width=\\\" 250=\\\" height=\\\"200\\\" style=\\\"float: right;\\\" /></h4>\\n<h4><strong>Balení:</strong></h4>\\n<p>Součástí balení jsou 2 originální Li-Ion baterie a rychlonabíječka. Díky ní lze dobít akumulátor už <strong>pouze za 1 hodinu.</strong></p>\\n<p>Vše můžete pohodlně přepravit v přenosném kufříku.</p>', '_vyr_1683ATB40_ATB40_mag.jpg', 0, '2228.00', '2475.00', 'ATB40', '', '_vyrp11_1683ATB40_ATB40_mag.jpg', '_vyrp12_1683ATB40_ATB40-en-maletin_mag.jpg', '', 21, 1, 2, 1, '', 0, '3-480-484-0', NULL, '2021-01-10 15:44:11'),
(8894, 1686, 'Horkovzdušná pistole Virutex', 'Horkovzdušná pistole Virutex PD52X 1500W 300/525 °C', '<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: arial, helvetica, sans-serif;\\\"><span lang=\\\"cs\\\">Horkovzdušná pistole s elektronickou regulací teploty, <span>který vám umožňuje pracovat ve dvou teplotních <br />režimech a používat tento nástroj pro širokou škálu prací. Je to ideální nástroj pro odstraňování barev a laků. <br /></span></span><span lang=\\\"cs\\\">Je také vhodná pro tvarování a svařování plastů, odstraňování obtisků, smršťování vodičů, rozmrazování <br />vodovodních linek a mnoho dalších! Tento nástroj může pracovat s většinou příslušenství dostupných na trhu.<br /></span><br /><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></span></pre>\\n<ul>\\n<li class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: arial, helvetica, sans-serif;\\\">Příkon: 1500 W</span></li>\\n<li class=\\\"', '_vyr_1686PD52X_PD52X.jpg', 0, '2444.00', '2715.00', 'PD52X', '_vyrn_1686PD52X_PD52X.jpg', '_vyrp11_1686442.jpg', '', '', 21, 1, 2, 1, '', 0, '3-480-496-0', NULL, '2021-01-10 15:44:11'),
(8895, 1687, 'Přímočará pila Virutex ', 'Přímočará pila Virutex 650W', '<p>Výkonný a vysoce přesný profesionální nástroj. Pila je vybavena protiskluzovou rukojetí a mechanismem pro výměnu pilového listu. Stroj zanechává přesný řez bez třísek a to na dřevě, železných i neželzných kovech, plastech, aj. Stroj je vybaven mechanismem, který umožňuje nakloněnou základnu a to v rozsahu <span lang=\\\"cs\\\"><span>0 - 45°, jakož i elektronickou regulací rychlosti, která zajišťuje bezpečnost pracovníka, a výstupem pro připojení externího sběrače prachu. Je vhodná pro práci jednou rukou a pro zakřivené řezy.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"><span style=\\\"font-family: verdana, geneva;\\\"></span></span></pre>\\n<p><span></span><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>Příkon: 650 W</span></li>\\n<li><span>Max. hloubka řezu (dřevo): 100 mm</span></li>\\n<li><span>Rychlost bez zatížení: 500 - 3000/min</spa', '_vyr_1687SC324Y_sc324y.jpg', 0, '5658.00', '6287.00', 'SC324Y', '_vyrn_1687SC324Y_sc324y.jpg', '', '', '', 21, 1, 1, 2, '', 0, '3-480-488-0', NULL, '2021-01-10 15:44:11'),
(8896, 1688, 'Virutex SVN250 vakuový upínací systém', 'Virutex SVN250 vakuový upínací systém', '<p><strong>SVN250 vakuový upínací systém</strong></p>\\n<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Určeno pro upevnění obrobků s hladkými a neporézními povrchy pomocí vakua. <br />Obrobky zůstávají pevně připevněné, bez jakýchkoli známek po upnutí na jejich povrchu.  <br />Možnost opravy velkých i malých kusů v různých polohách.<br />Upevňovací síla umožňuje pohodlnou a snadnou práci.\\nPřívod vzduchu se provádí pomocí rychlospojky. Díky své kompaktní velikosti je velmi <br />univerzální a praktický pro práci v dílně i mimo ni. Je možné fixovat kusy ve svislé <br />nebo vodorovné poloze. Ideální pro několik operací, jako je ořez, lamelování... Sací desku\\nje možné rozdělit na menší sekce pomocí sady pryžových spojů dodávaných se zařízením,  <br /><span lang=\\\"cs\\\">což umožňuje upevnění malých kusů .</span>Pomocí několika SVN250 je možné opravit velké panely<br', '_vyr_1688SVN250_SVN250.jpg', 0, '2138.00', '2376.00', 'SVN250', '_vyrn_1688SVN250_SVN250.jpg', '_vyrp11_1688SVN250_svn250_f2.jpg', '_vyrp12_1688SVN250_SVN250_vertical.jpg', '', 21, 1, 0, 2, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:11'),
(8897, 1689, 'Vysavač Virutex 27L', 'Vysavač Virutex 27L', '<p>Profesionální vysavač na prach a kapaliny s nízkou hmotností, díky které je snadno přenosný. Ideální pro práci mimo dílnu nebo pro malé dílny. Speciálně určen pro připojení strojů a elektrického nářadí.  Díky své síle umožňuje práci v pohodlnějších a bezpečnějších podmínkách. Je vybaven zásuvkou pro připojení elektrického nářadí a má speciální zapínací systém, který aktivuje vysavač při zapnutí nástroje, který je zapojen, a zastaví jej o několik sekund později než nástroj. Vybaven dvojitým potrubním připojením umožňujícím připojení dvou strojů najednou.</p>\\n<p>TECHNICKÉ SPECIFIKACE:</p>\\n<ul>\\n<li>Příkon: 1.200 W</li>\\n<li>Objem nádoby: 27 l</li>\\n<li>Chlazení: obtok</li>\\n<li>Voda pl. Vac: 2,200 mm. H2O</li>\\n<li>Dodávka vzduchu: 170 m&#179; / h</li>\\n<li>Zásuvka pro připojení elektrického nářadí max .: 1 500 W</li>\\n<li>Délka kabelu: 8 m</li>\\n<li>Speciální filtr pro jemný prach</li>\\n<li>Polyesterový filtr</li>\\n</ul>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč', '_vyr_168975.jpg', 0, '8984.00', '9982.00', 'AS182K', '_vyrn_168975.jpg', '_vyrp11_168975.jpg', '_vyrp12_1689246.jpg', '_vyrp13_1689247.jpg', 21, 1, 1, 2, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8898, 1690, 'Vysavač Virutex 72L 2 motory', 'Vysavač Virutex 72L 2 motory', '<p>Profesionální vysavač na prach a kapaliny s nízkou hmotností, díky které je snadno přenosný. Ideální pro práci mimo dílnu nebo pro malé dílny. Speciálně určen pro připojení strojů a elektrického nářadí. Díky své síle umožňuje práci v pohodlnějších a bezpečnějších podmínkách. Je vybaven zásuvkou pro připojení elektrického nářadí a má speciální zapínací systém, který aktivuje vysavač při zapnutí nástroje, který je zapojen, a zastaví jej o několik sekund později než nástroj. Vybaven dvojitým potrubním připojením umožňujícím připojení dvou strojů najednou. Vybaven dvěma motory s vysokým sacím výkonem.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Příkon: 2.300 W</li>\\n<li>Objem nádoby: 72 l</li>\\n<li>Chlazení: obtok</li>\\n<li>Voda pl. Vac: 2,200 mm. H2O</li>\\n<li>Dodávka vzduchu: 340 m&#179; / h</li>\\n<li>Zásuvka pro připojení elektrického nářadí max .: 2 000 W</li>\\n<li>Délka kabelu: 8 m</li>\\n<li>Speciální filtr pro jemný prach</li>\\n', '_vyr_169076.jpg', 0, '0.00', '0.00', 'AS382L', '_vyrn_169076.jpg', '101456_1690__vyrp11_168975.jpg', '101456_1690__vyrp12_1689246.jpg', '101456_1690__vyrp13_1689247.jpg', 21, 1, 1, 1, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8899, 1692, 'Vysavač Virutex třída M', 'Vysavač Virutex třída M', '<p>Sběrač prachu na všechny druhy prachu, dřevěné štěpky nebo nebezpečné minerální materiály.  Filtr třídy „M“ pro minerální a dřevěný prach MAK&gt; 0,1 mg / m3. Vybaven automatickou třepačkou filtru. Díky vysokému sacímu výkonu umožňuje práci v pohodlnějších a bezpečnějších podmínkách. Vybaven zásuvkou pro připojení elektrického nářadí, má elektronický spínač na systému, který aktivuje vysavač při zapnutí nástroje, který je k němu připojen, a zastaví jej o několik sekund později než nástroj, a zastaví jej o několik sekund později než nástroj,aby umožnil vysavači vysát zbývající prach ve stroji.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Příkon: 1400 W</li>\\n<li>Zásuvka pro připojení elektrického nářadí max .: 2400 W</li>\\n<li>Objem nádoby: 21 l</li>\\n<li>Dodávka vzduchu: 215 m3 / h</li>\\n<li>Hmotnost: 12 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výr', '_vyr_1692143.jpg', 0, '12356.00', '13729.00', 'ASM582T', '_vyrn_1692143.jpg', '_vyrp11_1692143.jpg', '_vyrp12_1692456.jpg', '_vyrp13_1692457.jpg', 21, 1, 1, 2, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11');
