(8900, 1693, 'Virutex Podřezávací frézka na dveře ', 'Podřezávací frézka na dveře Virutex 1300W', '<p>Speciálně navržená pro řezání dveří, zárubní, základních desek a soklů, je ideální pro instalatéry parket nebo jiných podlahových krytin, jako jsou koberce, keramika atd. Je vybavena výkonným motorem, který umožňuje čistý a přesný řez snadno a rychle. Výška a hloubka řezu jsou nastavitelné po milimetrech. Hloubka řezu umožňuje řezání dveří najednou. Zahrnuje hubici pro sběr prachu a trubku pro připojení k vysavači.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 1.300 W</li>\\n<li>Hloubka řezu: 0-47 mm</li>\\n<li>Minimální výška řezu: 8 mm</li>\\n<li>Maximální výška řezu: 35 mm</li>\\n<li>Rychlost bez zatížení: 5 000/min</li>\\n<li>Hmotnost: 5,6 kg</li>\\n</ul>\\n<ul>\\n<li style=\\\"list-style-type: none;\\\"></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p><span>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světov', '_vyr_1693RZ270S_RZ270S.jpg', 0, '15740.00', '17488.00', 'RZ270S', '_vyrn_1693RZ270S_RZ270S.jpg', '_vyrp11_1693RZ270S_RZ270S.jpg', '_vyrp12_1693193.jpg', '_vyrp13_1693194.jpg', 21, 1, 2, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8901, 1694, 'Kombinovaná frézka Virutex', 'Kombinovaná frézka Virutex', '<p>Stroj o nízké hmotnosti navržený pro několik druhů úloh. Poskytuje vynikající povrchovou úpravu při ořezávání laminátu. Je velmi užitečná pro výrobu výlisků, práci s vysokou stabilitou a přesností. Ideální pro vytvoření vybrání pro umístění pantů pomocí speciálních šablon Virutex.</p>\\n<p>Jeho velká síla mu umožňuje vyrábět falc na dveřích nebo oknech se specifickým volitelným bitem. Možnost snadného a přesného provedení pravých nebo kruhových slotů s pouze příslušenstvím, které je součástí standardní výbavy. FR192N je vybaven výkonným motorem a elektronickou regulací otáček, pro nastavení konstanty rychlosti nezávisle na pracovním zatížení.<span></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malos', '_vyr_169433.jpg', 0, '6236.00', '6929.00', 'FR192VG', '', '_vyrp11_169433.jpg', '_vyrp12_169477.jpg', '_vyrp13_169478.jpg', 21, 1, 1, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8902, 1695, 'Ponorná pila Virutex', 'Ponorná pila Virutex', '<p><span>Sada je určena pro přesné řezání dřevotřísky. Design pily je silný a ergonomický, což dává spoustu možností využití stroje. Absence třísek během řezání je možné dosáhnout použitím pásky proti štěpení na vodicí kolejnici. Pila je namontována na vodicí lištu, po které klouže bez přídavného vybavení a excentricita v základně pily vám umožňuje zvolit mezeru při instalaci pily na lištu, což je nezbytné pro zajištění striktně rovného řezu. <span lang=\\\"cs\\\">Je třeba poznamenat, že vodicí pneumatika má kromě pásky proti štěpení dvě protiskluzové pásky a technologické drážky pro spojení dvou vodítek nebo připojení vodítka k dílci pomocí svorek ve tvaru písmene L nebo membránových přísavek. Výkonný motor umožňuje řezat různé typy materiálů obrobku. Pila je vybavena automatickým resetovacím ochranným systémem a systémem měkkého startu, rychlou brzdou pilového kotouče, dorazem vřetena, speciálním zařízením usnadňujícím výměnu pilového kotouče a nastavením hloubky řezu, adaptérem pro přip', '_vyr_169565.jpg', 0, '8779.00', '9755.00', 'SRI174T', '', '_vyrp11_1695208.jpg', '_vyrp12_1695209.jpg', '_vyrp13_1695210.jpg', 21, 1, 1, 4, '', 0, '3-480-495-0', NULL, '2021-01-10 15:44:11'),
(8903, 1696, 'Elektronická povrchová frézka Virutex', 'Elektronická povrchová frézka Virutex', '<p>Profesionální frézka na dřevo a plasty, vybavená elektronickým řízením rychlosti a elektronickým systémem, <br />který udržuje rychlost konstantní nezávisle na pracovní zátěži. Vysoká přesnost a stabilita při směrování. <br />Rychlé nastavení hloubky pomocí 6 přednastavených pozic. Motor o výkonu 1 800 W je vhodný pro těžké a nepřetržité <br />práce. Ideální pro ořezávání hran, kopírování rybinových sestav (s volitelným rybinovým nástavcem PL11), <br />vytváření zahloubení pro truhlářské kování atd. Vybaveno jemným nastavením hloubky frézování a bočního plotu <br />(dodává se jako standardní výbava). Blokovací systém hřídele motoru pro snadnou výměnu bitu. <br />Je vybavena vývodem odsávání prachu pro čistý a bezpečný pracovní prostor.</p>\\n<p><span style=\\\"text-decoration: underline;\\\"></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Výkon: 1800 W</li>\\n<li>Upínací kleština: 12 mm</li>\\n<li>Hloubka fr', '_vyr_169644.jpg', 0, '10814.00', '12015.00', 'FRE160P', '', '_vyrp11_1696120.jpg', '_vyrp12_1696121.jpg', '_vyrp13_1696122.jpg', 21, 1, 1, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8904, 1697, 'Elektronická frézka COMBI Virutex', 'Elektronická frézka COMBI Virutex', '<p>Elektronická frézka COMBI je multifunkční nástroj s vyměnitelnými frézovacími a brusnými hlavami. Vybaveno rychlým nastavením hloubky pomocí 6 přednastavených pozic. Dále je možnost jemného nastavení hloubky frézování a bočního plotu. Funkce COMBI umožňuje práci s odlišnými typy nejen frézovacích hlav, ale také s hlavami brusnými. Frézovací hlavy jsou opatřeny vývodem pro odsávání odebraného materiálu.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Příkon: 1000 W</li>\\n<li>Upínací kleština: 8 mm</li>\\n<li>Rychlost bez zatížení: 14000 - 27000/min</li>\\n<li>Hmotnost: 3,8 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériov', '_vyr_1697144.jpg', 0, '8879.00', '9865.00', 'FR356Z', '', '_vyrp11_1697144.jpg', '_vyrp12_1697458.jpg', '_vyrp13_1697459.jpg', 21, 1, 1, 4, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8905, 1699, 'Ostření břitu DIA nástroje 1mm', 'Ostření břitu diamantových nástrojů 1mm', '<h1 style=\\\"text-align: center;\\\"><strong>Ostření břitu DIA nástroje 1mm</strong></h1>\\n<p style=\\\"text-align: center;\\\">Laserová metoda funguje tak, že laser se zaměří na ostřené místo a odstraní materiál , který není v dopadu paprsku.<br />Množství odebraného materiálu závisí na intenzitě, pulsní a vlnové délce laseru, stejně jako na samotném<br />materiálu. Tato oblast absorbuje laser, který je v dosahu paprsku, čímž rozkládá chemické vazby v dané oblasti.<br />Laserové ostření je mnohem účinnější, spolehlivější a nákladově výhodnější metodou ostření DIA břitů.</p>\\n<p style=\\\"text-align: center;\\\"></p>\\n<p style=\\\"text-align: center;\\\">Ostření se účtuje po mm diamantového plátku. </p>\\n<p style=\\\"text-align: center;\\\">Objednávku upravíme podle ostřených mm na daném nástroji. </p>\\n<p style=\\\"text-align: center;\\\"></p>\\n<p style=\\\"text-align: center;\\\">Objednejte telefonicky na čísle<span> </span><strong><span style=\\\"font-size: 16px;\\\">548 226 252</span>,</strong> osobně v naší kan', '_vyr_1699Katalog-pro-Didika_Stranka_004_Obraz_0001.jpg', 0, '22.00', '25.00', 'DIA 1', '', '_vyrp11_1699Katalog-pro-Didika_Stranka_004_Obraz_0001.jpg', '_vyrp12_1699Katalog-pro-Didika_Stranka_004_Obraz_0002.jpg', '', 21, 1, 1000, 1, '', 0, '10-0-0-0|18-0-0-0', NULL, '2021-01-10 15:44:11'),
(8906, 1700, 'Virutex Frézka OVVO', 'Virutex Frézka OVVO 1000W', '<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span><br />Frézka OVVO je speciálně navržená pro vyříznutí slotů k umístění automatických konektorů OVVO®. <br /></span><span>Její snadné použití umožňuje rychlou a přesnou práci. Elektronické nastavení rychlosti umožňuje práci s různými materiály. <br />Stroj disponuje jednoduchým nastavením tloušťky i hloubky úběru, díky čemuž umožňuje nastavení <br />pro několik typů spojek bez nutné výměny nástrojů. Tento model byl patentován, pročež je jediný na trhu.</span><br /><br /><span style=\\\"text-decoration: underline;\\\">Technická specifikace</span>:</span></pre>\\n<ul>\\n<li><span>Výkonný 1000 W motor s elektronikou pro nastavení rychlosti a udržení konstantní rychlosti pod zatížením.</span></li>\\n<li><span>Manuální zasazení frézky pomocí zasouvacích zarážek. Není třeba žádné další manipualce.</span></li>\\n<li><span>Možnost ořezávání v někol', '_vyr_1700AB181VD_ab181vd-1.jpg', 0, '21899.00', '24332.00', 'AB181VD', '', '', '', '', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8907, 1701, 'Virutex Průmyslový vysavač 1200 W 72l', 'Virutex Průmyslový vysavač 1200 W 72l', '<p></p>\\n<p>Profesionální vysavač na prach a kapaliny s nízkou hmotností, díky které je snadno přenosný. Ideální pro práci mimo dílnu nebo pro malé dílny. Speciálně určen pro připojení strojů a elektrického nářadí. Díky své síle umožňuje práci v pohodlnějších a bezpečnějších podmínkách. Je vybaven zásuvkou pro připojení elektrického nářadí a má speciální zapínací systém, který aktivuje vysavač při zapnutí nástroje, který je zapojen, a zastaví jej o několik sekund později než nástroj. Vybaven dvojitým potrubním připojením umožňujícím připojení dvou strojů najednou.</p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Příkon: <span>1.200 W</span></li>\\n<li><span>Objem nádoby: 72 l</span></li>\\n<li><span>Chlazení: obtok</span></li>\\n<li><span>Voda pl. Vac: 2,200 mm. H2O</span></li>\\n<li><span>Dodávka vzduchu: 340 m&#179; / h</span></li>\\n<li><span>Zásuvka pro připojení elektrického nářadí max .: 2 000 W</span></li>\\n<li><span>Délka kabelu: 8 m</', '_vyr_1701AS282K_AS282K-1.jpg', 0, '12715.00', '14128.00', 'AS282K', '', '', '_vyrp12_1701AS282K_AS282K_demo_Y-1.jpg', '', 21, 1, 1, 1, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8908, 1702, 'Virutex Frézka 1100W', 'Virutex Frézka 1100W', '<h2><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Virutex Frézka</span></h2>\\n<p><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Stroj speciálně navržený pro těžké práce při frézování falců. Je možné jej také použít k obrábění laminátu. Při použití směrovací hlavy CA66F je stroj přetransformován na povrchovou frézku. Při síle motoru o 1100 W je tak využití frézky rozšířeno k frézování rybinových spojů podle šablony PL11 či k dalším podobným pracem</span></p>\\n<div class=\\\"text_producte\\\">\\n<p><span style=\\\"text-decoration: underline;\\\">Technické specifikace:</span></p>\\n<ul>\\n<li class=\\\"subtitol_producte\\\">dvojitá izolace</li>\\n<li class=\\\"subtitol_producte\\\">příkon: 1100 W</li>\\n<li class=\\\"subtitol_producte\\\">upínací kleština: 6 mm</li>\\n<li class=\\\"subtitol_producte\\\">rychlost bez zatížení: <span>23 000 / min</span></li>\\n<li class=\\\"subtitol_producte\\\"><span>hmotnost: 3,7 kg</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výr', '_vyr_1702AS93_AS93-1.jpg', 0, '6480.00', '7200.00', 'AS93', '', '_vyrp11_1702AS93_as93d4-1.jpg', '_vyrp12_1702AS93_as93d2-1.jpg', '_vyrp13_1702AS93_as93d1-1.jpg', 21, 1, 1, 0, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8909, 1703, 'Virutex Průmyslový vysavač 1200W suché/mokré vysávání', 'Virutex Průmyslový vysavač 1200W suché/mokré vysávání', '<p><strong>Virutex Průmyslový vysavač</strong></p>\\n<p><span lang=\\\"cs\\\">Odolný a kompaktní profesionální vysavač na prach a kapaliny. Díky vysokému sacímu výkonu umožňuje práci v pohodlnějších a bezpečnějších podmínkách. Je vybaven zásuvkou pro připojení elektrického nářadí. Je vybaven elektronickým spínačem, který aktivuje vysavač, při zapnutí nástroje, a zastaví se několik sekund po připojeném stroji, aby vysavač mohl vysát zbývající prach ve stroji. Elektronické seřízení speciálně určené pro rotační oscilační brusky, aby se zabránilo přilepování stroje k obrobku během broušení v důsledku sacího výkonu.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\"><span lang=\\\"cs\\\">TECHNICKÉ SPECIFIKACE:</span></span></p>\\n<ul>\\n<li>váha: 13 kg</li>\\n<li>výkon: 1200 W</li>\\n<li>kapacita: 25 l</li>\\n<li>pro suché a mokré vysávání</li>\\n<li>není zabudován automatický čistič filtru</li>\\n<li>balení zahrnuje: papírový filtr a šáček do vysavače </li>\\n<li>elektrická síť: 210 - 240 V / 50 - ', '_vyr_1703ASC682_asc682-1.jpg', 0, '10781.00', '11979.00', 'ASC682', '', '', '', '', 21, 1, 1, 1, '', 0, '3-480-485-0', NULL, '2021-01-10 15:44:11'),
(8910, 1704, 'Virutex Automatická řezačka laminátu 180W', 'Virutex Automatická řezačka laminátu 180W', '<p><strong>Automatická řezačka laminátu Virutex </strong></p>\\n<p><span>Umožňuje řezat proužky z laminátu, plastu, dýhy a jiných lehkých nekovových materiálů.<span> </span>Podávací systém pomocí pohyblivých pryžových válečků a exkluzivní systém řezání pomocí lopatek kol umožňuje čisté řezy bez odpadu.<span> </span>Je možné pracovat s laminátovými deskami všech rozměrů díky dobře dimenzovanému stolu, který poskytuje dobrou stabilitu pro dokonalé řezy.<span> </span>Není nutná žádná další manipulace. </span><span>Řezačka je vybavena rozpěrkami kol, speciálními pro lamináty.<span> </span>Je také vybavena pohyblivým řezacím vodítkem a stupnicí pro snadné nastavení šíře řezání.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>příkon: 0,18 kW</li>\\n<li>rychlost podávání materiálu: 13,6 m/min</li>\\n<li>max. tloušťka řezu: 1.6 mm</li>\\n<li>min. délka řezu: 185 mm</li>\\n<li>nastavitelná šířka řezu: 16 - 635 mm</li>\\n<li>hmotnost: 44 kg</li>\\', '_vyr_1704CO49K_co49k_2012-1.jpg', 0, '52991.00', '58878.00', 'CO49K', '', '_vyrp11_1704CO49K_co49kd1-1.jpg', '_vyrp12_1704CO49K_co49kd2-1.jpg', '_vyrp13_1704CO49K_co49kdef1-1.jpg', 21, 1, 1, 0, '', 0, '3-480-493-0', NULL, '2021-01-10 15:44:11'),
(8911, 1705, 'Virutex Automatická olepovačka hran', 'Virutex Automatická olepovačka hran', '<p><strong>Virutex Automatická olepovačka hran</strong></p>\\n<p><span style=\\\"font-family: verdana, geneva;\\\"><span>Automatická olepovačka je určena pro použití hrany z PVC, dýhy, melaninu, ABS pásky (součástí 3D a skleněného efektu). Jednofázovou 220-240V olepovačku lze nastavit a uvést do provozu velice rychle. Samotné zahřívání zabere pouze 5 minut. Nastavení teploty lepidla je řízeno mikroprocesorem, který zabraňuje kolísání teploty. Olepovačka disponuje motorizovaným válečkem pro tlakové lepení, ten zajistí dokonalé olepování hran od začátku panelu, dále je vybavena lepicím válcem s polymerizačním zpracováním, který pomáhá snižovat spotřebu lepidla <span lang=\\\"cs\\\">a umožňuje nanášení tavného lepidla na hrany s 3D a Glass efekty bez rizika poškození základní vrstvy. Je třeba si uvědomit, že pro práci shranovými materiály s 3D a Glass efekty se používají speciální nízkoteplotní lepidla</span>.. Lepicí nádoba je potažená Teflonem® pro snadné čištění a údržbu. Pomocí této olepovačky', '_vyr_1705EB135_eb135-1.jpg', 0, '256578.00', '285086.00', 'EB135', '_vyrn_1705eb135.jpg', '_vyrp11_1705eb135_photo_3.jpg', '_vyrp12_1705eb135_photo_4.jpg', '_vyrp13_1705eb135_photo_5.jpg', 21, 1, 1, 1, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8912, 1706, 'Virutex Frézka pro montáž pantů', 'Virutex Frézka pro montáž pantů', '<p><strong>Virutex Frézka pro montáž pantů</strong></p>\\n<p>Speciální frézka pro instalaci všech druhů závěsů na rámy a křídla dveří. Snadná montáž 3 nebo 4 pantů na dveře (vpravo nebo vlevo směr otevření), bez měření a značení. Dvojitá hloubka zátky umožňuje vyvrtat obě hloubky pantů zároveň bez nutnosti měnit nástavec. Frézka je také připravena pro montáž jakéhokoli tradičního závěsu.</p>\\n<p>Nový a snadno nastavitelný upínací systém udržuje frézku dokonale na dveřích a rámu, aniž by došlo k poškození jeho povrchu. Montáž nástavce je velmi rychlá, je pevná a připravená k použití stisknutím do vnitřku držáku. Frézka je vybavena silným motorem o výkonu 1 000 W, elektronickou regulací rychlosti a elektronickým systémem pro udržení konstantní rychlosti při zatížení.</p>\\n<p>Montáž skrytých závěsu delších než 160 mm pouze ve 2 krocích. Montáž úderových plechů nad 152 mm. Distanční sloupky pro drážky vyšší než 13 mm.</p>\\n<p>Kufřík v ceně.</p>\\n<p><span style=\\\"text-decoration: underline;\\', '_vyr_1706FR129VB_FR129VB-20v--202-1.jpg', 0, '17470.00', '19411.00', 'FR129VB', '', '_vyrp11_1706163.jpg', '_vyrp12_1706165.jpg', '_vyrp13_1706166.jpg', 21, 1, 1, 1, '', 0, '3-480-829-0|3-0-0-0|3-480-0-0', NULL, '2021-01-10 15:44:11'),
(8913, 1707, 'Virutex Povrchová frézka 1300W', 'Virutex Povrchová frézka 1300W', '<p><span style=\\\"font-size: 14px;\\\"><strong>Virutex Povrchová frézka</strong></span></p>\\n<p><span style=\\\"font-size: 14px;\\\"><strong></strong></span></p>\\n<p>Médium v řadě frézek, pokud jde o výkon a prakticky nejlehčí v řadě. Je vybavena elektrickým seřizovacím systémem, který umožňuje zvolit optimální rychlost pro jakýkoli druh zpracovávaného materiálu a je určena ke zpracování masivního dřeva, dřevotřískových desek a plastů. Konstrukce frézy zajišťuje vysokou přesnost a stabilitu zpracování. Boční důraz a seřizovač hloubky frézování jsou vybaveny systémem jemného doladění. Vodící tyče jsou uzavřeny speciální gumovou vrstvou, která<span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"> zabraňuje jejich znečištění. Promyšlené uspořádání ovládacích prvků a ergonomický design držadel zaručují snadné používání a bezpečnost pracovníků. Pomocí 3polohové věže se stává snadnější rychlá úprava hloubky frézování. </span><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Ideální nást', '_vyr_1707fr278r.jpg', 0, '8143.00', '9048.00', 'FR278R', '_vyrn_1707fr278r.jpg', '_vyrp11_1707fr278r_1.jpg', '_vyrp12_1707fr278r_2.jpg', '_vyrp13_1707fr278r_3.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8914, 1708, 'Virutex Sklopná směrovací frézka 2100W', 'Virutex Sklopná směrovací frézka 2100W', '<div><span style=\\\"font-size: 14px;\\\"></span></div>\\n<div></div>\\n<div><span style=\\\"font-family: verdana, geneva; font-size: 14px;\\\"></span></div>\\n<div><span style=\\\"font-family: verdana, geneva; font-size: 14px;\\\">Profesionální frézka FR317VD je vylepšený model se silnějším motorem, vycházející z původní frézky FR317S. Frézka je určena pro práci s <span>materiálem Corian<sup>® </sup>a s podobnými materiály. Je možno ji s výhodou použít jak pro výrobu nových výrobků, tak pro opravy poškozených nebo opotřebovaných materíálů u zákazníka. Pro frézku je možno dokoupit různé profesionální přípravky a doplňky, např. přísavky, vodící pravítka a pod. Stroj je vybaven zarážkou při vertikálním pohybu, pro frézování spojů na pracovních deskách Corian®. Frézka disponuje velkou opěrnou plochou pro ořez hran. Hloubka řezu je možné nastavit s mikroskopickou přesností. FR317VD je jediná frézka, která je vybavena hydraulickým tlumičem ve vertikálním pohybu a otočnou hlavici se svislým pohybem. Součás', '_vyr_1708FRE317VD_125-1.jpg', 0, '25304.00', '28116.00', 'FRE317VD', '', '_vyrp11_1708FRE317VD_126-1.jpg', '_vyrp12_1708FRE317VD_127-1.jpg', '_vyrp13_1708FRE317VD_45-1.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8915, 1709, 'Ruční pásová bruska Virutex', 'Ruční pásová bruska 1200W Virutex 420 m/min', '<p><strong>Ruční pásová bruska Virutex</strong></p>\\n<p><span>Špičková pásová bruska určená pro vyhlazení a hrubé či střední zbroušení velkých ploch.<span> </span></span><span>Její velká brusná plocha zvyšuje produktivitu a vytváří hladký povrch bez poškrábání.<span> Pohyb brusných částic je rovnoběžný s vlákny, pročež se netvoří \\\"chloupky\\\" a dokončovací operace jsou tudíž jednodušší. Bruska je</span></span><span> opatřena zátkami z karbid wolframu, aby se zabránilo rychlému opotřebování a systémem pro nastavení polohy brusného pásu. Výměna brusného materiálu se provádí bez přídavného nástroje. <span>Bruska je opatřena</span></span><span> přípojkou k vysavači, která umožňuje obsluze pracovat pohodlně a v čistém prostředí, čímž se prodlužuje životnost stroje.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"></span><span lang=\\\"cs\\\"></span></pre>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIF', '_vyr_1709LB31E_LB31E-20v--202-1.jpg', 0, '8774.00', '9748.00', 'LB31E', '', '_vyrp11_1709LB31E_lb31ed1-1.jpg', '_vyrp12_1709LB31E_lb31ed2-1.jpg', '_vyrp13_1709LB31E_lb31ed3-1.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8916, 1710, 'Ruční sádrokartonová bruska na nástavci Virutex', 'Sádrokartonová bruska na nástavci Virutex 550W d=225 mm', '<p><span>Ideální bruska pro malíře umožňující broušení stěn a stropů.<span> </span></span><span>Umožňuje snadnější, rychlejší a méně únavné dokončovací práce.<span> Díky své nízké hmotnosti a e</span></span><span>rgonomickému designu je práce s touto bruskou o mnoho snazší</span><span>.<span> Relativně nízká hmotnost, promyšlené </span></span><span>vyvážení hmotnosti a velká brusná plocha, poskytuje snazší broušení s vysokým výkonem v několika různých úhlech. Umístění motoru v blízkosti brusného kotouče zajišťuje plnou kontrolu nad strojem, díky čemuž jdou pohodlně brousit stěny či stropy s plnou kontrolou nad manipulací.</span><span><span> Stroj disponuje v</span></span><span>elkou brusnou kapacitou a<span> e</span></span><span>lektronickou regulací rychlosti pro výběr nejvhodnější rychlosti pro broušený povrch a brusný papír a ochranou spínače proti prachu. Dále je součástí produktu<span> t</span></span><span>ryska pro sběr prachu s bajonetovým konektorem,<span> trubka na sběr prachu', '_vyr_1710LPC97S_lpc97s_bodegon2-1.jpg', 0, '17260.00', '19178.00', 'LPC97S', '', '_vyrp11_1710LPC97S_lpc97s_estucado-1.jpg', '_vyrp12_1710LPC97S_lpc97s_fig2-1.jpg', '_vyrp13_1710LPC97S_lpc97s_fig8-1.jpg', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8917, 1711, 'Ruční sádrokartonová bruska Virutex', 'Ruční sádrokartonová bruska Virutex 1200W d=225mm ', '<p><strong>Ruční sádrokartonová bruska Virutex</strong></p>\\n<p><span>Stroj je zkrácenou verzí LPC97S, což je výhodné při detailním broušení lehko přístupných míst. Ideální pro malíře a dekoratéry pro broušení stěn a stropů.<span> I při velké brusné kapacitě je bruska zkonstruována tak, aby u</span></span><span>možňovaka snadnější, rychlejší a méně únavnou práci.<span> Je vybavena e</span></span><span>lektronickou regulací rychlosti, což nám dává možnost zvolit optimální rychlost v závislosti na typu ošetřovaného povrchu i použitém abrazivním materiálu. Standardní výbava obsahuje trysku pro připojení hadice k odsavači prachu s b</span><span>ajonetovým konektorem a brusný kotouč gr. 80. Stroj je dodáván v praktickém přepravím kufříku.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>příkon: 1200 W</li>\\n<li>rychlost bez zatížení: 650-1300 ot./min</li>\\n<li>průměr kotouče: 225 mm</li>\\n<li>hmotnost: 3,1 kg</li>\\n</ul>\\n<p><span style', '_vyr_1711LPM97S_lpm97s_bodegon-1.jpg', 0, '9813.00', '10904.00', 'LPM97S', '', '_vyrp11_1711LPM97S_lpm97s_caja-20elec2-1.jpg', '_vyrp12_1711LPM97S_lpm97s_maletin-1.jpg', '', 21, 1, 1, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8918, 1713, 'Elektronická oscilační bruska Virutex', 'Elektronická oscilační bruska Virutex 370W 4 000-9 800/min', '<h1 style=\\\"text-align: center;\\\"><strong>Elektronická oscilační bruska Virutex</strong></h1>\\n<p style=\\\"text-align: center;\\\">Vysoce výkonná oscilační bruska pro leštění a povrchovou úpravu. Výkonná a vyvážená bruska umožňuje uživateli provádět vysoce kvalitní práci bez nutnosti jakéhokoli manuálního zásahu. PUR deska, která je standardně dodávaná, je téměř nerozbitná. Mobilní základna je vybavena pro použití se suchým zipem. Tento stroj má nový systém ochrany proti prachu a integrovaný sběr prachu, díky kterému brusiva déle vydrží. Díky ergonomickému designu s protiskluzovými povrchy a přední rukojetí, je stroj pohodlný a práce s ním efektivní. Lze použít standardní brusiva. Zahrnuje elektronické ovládání rychlosti.</p>\\n<table style=\\\"border-color: #000000; margin-left: auto; margin-right: auto;\\\" border=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td>\\n<h3>Proč výrobek od světové jedničky VIRUTEX:</h3>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kt', '_vyr_1713LRE46L_LRE46L-20v--202-1.jpg', 0, '5987.00', '6652.00', 'LRE46L', '', '_vyrp11_1713LRE46L_lr46ld1-1.jpg', '_vyrp12_1713LRE46L_lre46ld2-1.jpg', '', 21, 1, 4, 0, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8919, 1714, 'Kotoučová bruska Virutex', 'Kotoučová bruska Virutex 700W d=173 mm', '<h1><strong>Kotoučová bruska Virutex</strong></h1>\\n<p><span>Tento nástroj je speciálně navržen pro leštění plechů a mramoru.<span> </span></span><span>Jeho 700W motor poskytuje dostatečný výkon pro náročnou práci.<span> </span></span><span>Standardní výbava zahrnuje gumový disk a brusný kotouč.</span></p>\\n<p>Náhradní brusný kotouč si můžete prohlédnout <strong><a href=\\\"https://www.stopkovefrezy.cz/Brusny-kotouc-zrnitost-120-bez-otvoru-4591020-d1825.htm\\\">zde</a></strong>.</p>\\n<table style=\\\"border-color: #000000;\\\" border=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td>\\n<h3>Proč výrobek od světové jedničky VIRUTEX:</h3>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problé', '_vyr_1714PDE446L_PDE446L-20v--202-1.jpg', 0, '7552.00', '8391.00', 'PDE446L', '', '_vyrp11_1714PDE446L_pde446ld1-1.jpg', '_vyrp12_1714PDE446L_pde446ld2-1.jpg', '', 21, 1, 3, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8920, 1715, 'Olepovačka hran Virutex', 'Olepovačka hran Virutex 830W 120/200 °C', '<p><strong>Olepovačka hran Virutex</strong></p>\\n<div><span style=\\\"font-size: 14px;\\\">Olepovačka se stacionárním stolem. Pro PVC, ABS, melaminové, laminátové nebo dýhové hrany. Je možné olepit rovné, kulaté nebo tvarované panely. Velmi praktické pro malé výrobní série, zejména na rovných panelech. Snadné ovládání a rychlé nastavení. </span><span style=\\\"font-size: 14px;\\\">Stůl s prodlouženým čelním vedením. Snadné nastavení tloušťky hrany a panelu. </span><span style=\\\"font-size: 14px;\\\">Elektronická regulace rychlosti a teploty. </span><span style=\\\"font-size: 14px;\\\">Motorická ořezávací jednotka pomocí kruhových nožů. </span><span style=\\\"font-size: 14px;\\\">Nádrž na lepidlo a posuvná základna pro pásky je pokryta Teflonem® pro snadné čištění a údržbu. </span><span style=\\\"font-size: 14px;\\\">Vybaven držákem válečku a automatickým řezáním koncové pásky.</span></div>\\n<div><span style=\\\"font-size: 14px;\\\">Olepovačka také disponuje horním přítlačným lisem. Součástí balení je cidlina.</s', '_vyr_1715PEB250TRM_peb250trm-1.jpg', 0, '110514.00', '122794.00', 'PEB250TRM', '_vyrn_1715peb250trm.jpg', '_vyrp11_1715peb250trm-1.jpg', '_vyrp12_1715peb250trm-2.jpg', '', 21, 1, 1, 1, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8921, 1716, 'Drážkovací frézka Virutex', 'Drážkovací fréza Virutex 1000W', '<p><strong>Drážkovací frézka Virutex</strong></p>\\n<p><span>Silnější sestra drážkovací frézky RA17VB. </span>Inovovaná ruční frézka určená pro drážkování, výborná pro drážkování nových i starších dřevěných oken a dveří pro instalaci silikonového těsnění. Vybaven 3mm nástrojem s dvojitou hlavou, dvěma vyměnitelnými vodítky, boční příložkou, přípojkou na odsávání a přepravním pouzdrem. Součástí balení je drážkovací frézka na okna, kombinovaný dvoustranný vrták 3 mm, příložka pro polodrážky 45°, příložka pro rovné drážky, výměnné vodítko, hloubkové měřidlo, servisní klíče, transportní kufřík, ve kterém je vše uloženo.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ PARAMETRY:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 1000 W</li>\\n<li>Upínací kleštiny: 6 mm</li>\\n<li>Rychlost bez zatížení: 14000 - 30000/min</li>\\n<li>Hmotnost: 1,95 kg<br /><br /></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span>', '_vyr_1716RA17VG_RA17VB-20v--202-1.jpg', 0, '8791.00', '9767.00', 'RA17VG', '_vyrn_1716386_imatge_m.jpg', '_vyrp11_1716387_imatge_m.jpg', '_vyrp12_1716388_imatge_m.jpg', '_vyrp13_1716390_imatge_m.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8922, 1717, 'Řezačka zárubní Virutex', 'Řezačka zárubní Virutex 1700W 6500/min', '<p><strong>Řezačka zárubní Virutex</strong></p>\\n<p><span>Řezačka zárubní a okenních rámů RMV70S se používá k oříznutí rámů dveří a oken do tloušťky 68 mm, což umožňuje zachovat jejich původní velikost.<span> </span></span><span>Má pilový list z tvrdého kovu, který velmi rychle řeže, zatímco se pohybuje po odnímatelném vodítku, což zaručuje řízený a stabilní řez.<span> </span></span><span>Stroj je standardně dodáván s vodítkem pro oříznutí dveřních rámů a s příslušenstvím potřebným pro oříznutí okenních rámů, což je proces, který nevyžaduje vedení, protože RMV70S má nastavitelnou přední hranu, která účinně vede stroj při ořezávání rámu.<span> </span></span><span>RMV70S přichází s účinným externím systémem sběru prachu, pro který je standardně dodávána sběračka prachu kompatibilní s celou řadou sběračů prachu Virutex. Ve standardní výbavě je řezačka zárubní Virutex, návod a příslušenství pro ořezávání zárubní, přední hrana pro ořezávání oken, 30z MD čepel pro ořezávání dřeva. Trubice pr', '_vyr_1717rmv70u.jpg', 0, '50813.00', '56458.00', 'RMV70U', '_vyrn_1717rmv70u.jpg', '_vyrp11_1717rmv70u_1.jpg', '_vyrp12_1717rmv70u_2.jpg', '_vyrp13_1717rmv70u_3.jpg', 21, 1, 1, 1, '', 0, '3-480-481-0', NULL, '2021-01-10 15:44:11'),
(8923, 1718, 'Vertikální bruska Virutex (níže vyberte varianty)', 'Vertikální bruska Virutex 1000W', '<p><strong>Vertikální bruska Virutex</strong></p>\\n<p><span>Vertikální bruska Virutex, opatřená upínací kleštinou 6 mm je vhodná pro kovové a hrubé povrchy.<span> Stroj je standardně používán pro odizolování lemovacích a vstřikovacích kanálů. </span></span><span>Může být použita s většinou standardních brusných doplňků na trhu.<span> Bruska disponuje </span></span><span>elektronickou regulací rychlosti. Standardně není vybavena čisticím nástrojem. K dispozici s upínací kleštinou &#216; 8 mm (obj. Č. 5600401)</span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Dvojitá izolace</li>\\n<li>Příkon: 1000 W</li>\\n<li>Rychlost bez zatížení: 14 000-30 000 ot./min</li>\\n<li>Upínací kleština: 6 mm</li>\\n<li>Hmotnost: 1,3 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří ', '_vyr_1718RO156N_RO156N-20v--202-1.jpg', 0, '6192.00', '0.00', 'RO156N', '', '_vyrp11_1718RO156N_ro156n_d1-1.jpg', '', '', 21, 1, 1, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8924, 1719, 'Excentrická (rotační) bruska Virutex', 'Excentrická (rotační) bruska Virutex 900W (d = 7 mm)', '<p><strong>Rotační bruska Virutex</strong></p>\\n<p><span>Bruska je ideální pro broušení nebo leštění dřevěných nebo kovových povrchů. Je vybavena výkonným motorem o výkonu 800 W s elektronickým nastavením rychlosti.<span> </span></span><span>Je to nejvýkonnější rotační oscilační bruska na trhu.<span> </span></span><span>Její velká síla a dobře vyvážená konstrukce umožňuje perfektní brousící výsledky s nízkou úrovní vibrací. Oscilace poskytuje vysoce kvalitní broušení a v kombinaci s rotačním oscilačním pohybem zanechává povrchy hladké a bez nerovnosti připravené pro lakování či malování.<span> </span></span><span>Elektronické nastavení rychlosti umožňuje přizpůsobit rychlost broušení vzhledem k broušenému materiálu k dosažení těch nejlepších podmínek k broušení. RT188N je profesionální stroj vybavený hliníkovým pouzdrem převodovky a zakrytý plastovým krytem s protiskluznou vrstvou.<span> </span></span><span>Je také vybaven boční rukojetí, kterou lze namontovat na obě strany a</span><sp', '_vyr_1719RT188N_RT188N-20v--202-1.jpg', 0, '7851.00', '8723.00', 'RT188N', '', '_vyrp11_1719RT188N_RT188N_d1-1.jpg', '', '', 21, 1, 1, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8925, 1720, 'Kotoučová pila Virutex 1200W', 'Kotoučová pila Virutex 1200W  5000/min', '<p><strong>Kotoučová pila Virutex </strong></p>\\n<p><span>Kotoučová pila s motorem o výkonu 1 200 W umožňuje řezat až do 55 mm </span><span>hloubky, s úhlem řezu nastavitelným do 45°.<span> </span></span><span>Hloubkové řezání a sklon jsou nastavitelné pomocí mikrometrické stupnice.<span> </span></span><span>Pila je vybavena také štípacím nožem, paralelním vedením směru, ochranou pilového kotouče a bezpečnostní pojistkou proti náhodnému spuštění.<span> Pila je dodávána s přípojkou na sběr prachu</span></span><span>.</span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>dvojitá izolace</span></li>\\n<li><span>příkon: 1200 W</span></li>\\n<li><span>průměr kotouče: 165 mm</span></li>\\n<li><span>hloubka řezu při 90°: 55 mm</span></li>\\n<li><span>hloubka řezu při 45°: 38 mm</span></li>\\n<li><span>rychlost bez zatížení: 4700 ot./min</span></li>\\n<li><span>hmotnost: 4,2 kg</span></li>\\n</ul>\\n<p><span style=\\\"text-dec', '_vyr_1720SR165_SR165-1.jpg', 0, '4455.00', '4950.00', 'SR165', '', '_vyrp11_1720SR165_SR165_a-1.jpg', '_vyrp12_1720SR165_SR165_b-1.jpg', '', 21, 1, 1, 0, '', 0, '3-480-489-0', NULL, '2021-01-10 15:44:11'),
(8926, 1725, 'Kartáčová bruska Virutex', 'Kartáčová bruska 1400W ', '<h1 style=\\\"text-align: center;\\\"><strong>Kartáčová bruska</strong></h1>\\n<p style=\\\"text-align: center;\\\">Ruční kartáčovačka ST62 pro úpravu povrchů dřeva, kovu a kamene. V rámci produktu je dodáván nylonový válec, který je určený k opracování dřeva, leštění kovu a mramoru. V případě potřeby vyrábí firma Virutex serii válců, které jsou kompatibilní s tímto strojem, čímž jej uzpůsobují také k začišťování a uhlazování kovových povrchů (kovový váleček), k seškrabávání starých nátěrů (vrstvený váleček) či k leštění nerezové oceli.</p>\\n<p style=\\\"text-align: center;\\\">Silný motor je před prachem chráněn dvojitým pláštěm. Stroj dále obsahuje vývod odebraného materiálu do externího vysavače, což zachová Vaše pracoviště v čistotě a výrazně tím prodloužíte životnost stroje. Tomu také napomáhá uzavřený kryt kartáče, který zvyšuje účinnost odsávání prachu. Díky 2 rychlostním programům můžete upravovat téměř jakýkoliv povrch. Výhodou tohoto stroje je také rychlá a snadná výměna válečku. Součástí', '_vyr_1725_vyr_1508ST62_Satinadora-ST62_mag.jpg', 0, '9467.00', '10519.00', 'ST62', '', '_vyrp11_1725ST62_ST62-1-1.jpg', '', '', 21, 1, 4, 1, '', 0, '3-480-482-0', NULL, '2021-01-10 15:44:11'),
(8927, 1726, 'Rohové dláto Virutex', 'Rohové dláto Virutex', '<p style=\\\"font-size: 20px;\\\"><strong>Rohové dláto</strong></p>\\n<p><span>Rohové dláto RC29M umožňuje řezat hrotem v rohových částech, které jste vybrali pro umístění pantů, což dává přesný pravý úhel 90°. Lze řezat poloměry až 20 mm s hloubkou řezu 6 mm.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', '_vyr_1726RC29M_RC29M-1.jpg', 0, '2648.00', '2942.00', 'RC29M', '', '', '', '', 21, 1, 0, 0, '', 0, '4-497-500-0', NULL, '2021-01-10 15:44:11'),
(8928, 1727, 'Kapovací kleště Virutex', 'Kapovací kleště Virutex', '<p><span style=\\\"font-size: 14px;\\\">Poskytuje čistý a přesný řez bez poškození panelu. Díky dvěma upevňovacím knoflíkům zkracuje přebytek hrany</span> na obou koncích panelu.</p>\\n<p><span style=\\\"font-size: 14px;\\\">Kromě řezu v pravých úhlech umožňuje také čistý řez na otevřených úhlech do 120 ° a uzavřené úhly do 45 °.</span><br /><span style=\\\"font-size: 14px;\\\">Pro řezání přebytku PVC, ABS, melaminu, dýhy atp. </span></p>\\n<p><span style=\\\"font-size: 14px;\\\">Produkt je vybaven čepelemi profesionální kvality, které lze ostřit.</span></p>', '_vyr_1727RC421_155-1.jpg', 0, '5729.00', '6366.00', 'RC421', '', '', '', '', 21, 1, 1, 1, '', 0, '4-109-0-0', NULL, '2021-01-10 15:44:11'),
(8929, 1746, 'Olepovačka hran Virutex', 'Olepovačka hran Virutex', '<p><strong>Olepovačka hran Virutex</strong></p>\\n<p><span><span lang=\\\"cs\\\">Stolní olepovačka hran pro obkládání dílců předlepenou hranou do tloušťky 1 mm (PVC, melamin, přírodní dýha). Snadná obsluha a snadná údržba. Velmi rychlá příprava na práci - méně než 2 minuty. Doba zahřívání je 30 sekund. Elektronická regulace teploty s integrovaným monitorovacím teploměrem.  Automatické ořezávání hrany. Není nutný stlačený vzduch, ani sběrač prachu. Je vybaven motorizovaným blokem pro odstraňování podélných přesahů hrany, určeným pro zpracování rovných obdélníkových dílců. Demontujete-li jednotku pro odstranění podélných přesahů, otevře se vám možnost lepení hrany na zakřivené dílce, ale bez odstranění přesahů podél čela. Jako další zařízení ke zvýšení životnosti a zlepšení kvality prováděné práce se doporučuje použít antiadhezivní aerosol, který zabraňuje přilepení lepidla k pracovním částem stroje.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10c%20retoque%20color.jpg', 0, '94869.00', '105410.00', 'EB10C', '', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10c%20retoque%20color.jpg', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10cd1.jpg', 'https://b2b-itatools.pl/Obrazki/EB10C_eb10cd2.jpg', 21, 1, 1, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:11'),
(8930, 1747, 'Automatická olepovačka hran Virutex EB140', '', '<h3><strong>Podrobnosti:</strong></h3>\\n<p>Olepovačka má k dispozici automatický podavač pásek s pneumatickým řezacím systémem, který je vybaven čtyřmi gumovými válečky na pracovní desce, které zajišťují dostatečný přítlak na lepící válce. Lepící válce jsou samohybné a jejich nespornou výhodou je dokonalé lepení již od začátku olepované desky. <em><strong>(Pro zajímavost: Tato technologie nyní čeká na vyřízení patentu, takže používáte unikátní systém)</strong></em><em><strong></strong></em></p>\\n<h4><strong>Olepování:</strong></h4>\\n<p>Olepovací stroj je určen pro hrany ve velikosti 3 m, lze ho dle potřeby nastavit na požadovaný provoz. Díky vysoce kvalitní povrchové úpravě zamezíte nežádoucímu opotřebovaní olepovaného materiálu. V rámci ovládání je možné přímé nastavení ořezávacích bitů a vodícího zařízení pomocí digitálních měřičů. <span>Současně se dá nastavit stroj pro určitou tloušťku hrany, vodítka a lepicí válce jediným digitálním měřičem. Stroj umí automaticky regulovat teplotu', 'https://b2b-itatools.pl/Obrazki/EB140_EB140PLC%20delantera%20abierta.jpg', 0, '334474.00', '371638.00', 'EB140', '_vyrn_1747eb140.jpg', 'https://b2b-itatools.pl/Obrazki/EB140_EB140PLC%20delantera%20abierta.jpg', 'https://b2b-itatools.pl/Obrazki/EB140_EB140PLC%20display%20tactil.jpg', '_vyrp13_1747eb140-2.jpg', 21, 1, 2, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8931, 1748, 'Automatická olepovačka hran Virutex', 'Automatická olepovačka hran Virutex', '<h3><b>Automatická olepovačka hran</b></h3>\\n<p><span>Olepovačka hran disponuje technologií ZeroLine® (olepuje pomocí horkého vzduchu), díky které je hrana na panel nanesena prakticky dokonale a spoje jsou naprosto hladké.<span> </span>Výsledkem tohoto postupu je vysoce kvalitní olepení hran. Výhodou tohoto stroje je také jeho rychlé nastavení a uvedení do provozu, které netrvá déle než <strong>2 minuty</strong>.</span></p>\\n<p><span>Olepovací stroj pracuje s PVC a ABS hranami s extrudovanou nebo dodatečně zpracovanou aktivní vrstvou a je možné olepovat akrylátové a lakované desky. Lze použít hrany do tloušťky 2 mm.</span></p>\\n<p><span>Olepovačka je vybavena automatickým podavačem, o</span><span>řezávací jednotkou s digitálním nastavením a<span> m</span>ožností řezání s různým poloměrem nebo 10° zkosením.<span> </span>Vynikající povrchové úpravy bez zbytků lepidla dosáhne olepovačka díky dvojité ploché škrabce.</span><span><span> Disponuje a</span>utomatickým řezáním vpředu a vzadu.</', 'https://b2b-itatools.pl/Obrazki/EB150_153.jpg', 0, '429398.00', '477108.00', 'EB150', '', '_vyrp11_1748EB150-W-3-426x426.jpg', '_vyrp12_1748EB150-W-2-426x426.jpg', '', 21, 1, 4, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8932, 1749, 'Olepovačka Virutex', 'Olepovačka Virutex', '<p><strong>Olepovačka EB25</strong></p>\\n<p><span>Stolní olepovačka pro olepení <span lang=\\\"cs\\\">pravoúhlých obdélníkových panelů s lemovacími materiály do tloušťky 1 mm (PVC, melamin, přírodní dýha) s předem naneseným tavným lepidlem. Olepovačka disponuje automatickým podávacím systémem a dokáže ořezávat na obou stranách pomocí motorizované horní a spodní řezací jednotky. Také lze přeně oříznout přední a zadní přesah okrajového materiálu. Olepovačka má snadnou obsluhu i údržbu, díky elektronické regulaci teploty a krátké době zahžívání - 30 sekund. Není třeba žádného stlačeného vzduchu ani sběrače prachu. Stůl s velkým nosným povrchem a speciálními vodítky pro zlepšení posuvu obrobku a zabránění jeho poškození. Jako další zařízení ke zvýšení životnosti a zlepšení kvality prováděné práce se doporučuje použít antiadhezivní aerosol, který zabraňuje přilepení lepidla k pracovním částem stroje.</span></span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Př', 'https://b2b-itatools.pl/Obrazki/EB25_EB25.jpg', 0, '169006.00', '187785.00', 'EB25', '', 'https://b2b-itatools.pl/Obrazki/EB25_EB25.jpg', 'https://b2b-itatools.pl/Obrazki/EB25_eb25d1.jpg', 'https://b2b-itatools.pl/Obrazki/EB25_eb25d2.jpg', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8933, 1750, 'Olepovačka Virutex', 'Olepovačka Virutex', '<p><strong>Olepovačka Virutex EB35</strong></p>\\n<p><span lang=\\\"cs\\\">Charakteristickým rysem tohoto stroje je možnost lepení hranových materiálů do tloušťky 3 mm, následovaným frézováním přesahů hranového materiálu a seškrábáním. Systém automatického podávání obrobeného panelu je synchronizován se systémem podávání hrany. Stroj je vybaven frézovací jednotkou, sestávající ze dvou nezávislých frézovacích modulů, pro odstraňování podélných přesahů (ze spodní a horní strany panelu současně). Přesné oříznutí předního a zadního přesahu pro lemovací materiál do tloušťky 2 mm (při použití hrany o tloušťce 3 mm je přední konec obroben s přídavkem). Stroj je určen k obkladu přímých obdélníkových panelů s lemovacími materiály (PVC, melamin, přírodní dýha). Rychlá příprava na práci (2 minuty). Stroj se zahřívá 30 sekund. Dále má elektronickou regulaci teploty. Snadno se obsluhuje i udržuje. Stůl má velký nosný povrch a speciální vodítka pro zlepšení posuvu obrobku a zabránění jeho poškození. Pro ', 'https://b2b-itatools.pl/Obrazki/EB35_eb35-2013.jpg', 0, '231091.00', '256768.00', 'EB35', '', 'https://b2b-itatools.pl/Obrazki/EB35_eb35-2013.jpg', 'https://b2b-itatools.pl/Obrazki/EB35_EB35-052005_demo1b.jpg', 'https://b2b-itatools.pl/Obrazki/EB35_eb35d1.jpg', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8934, 1751, 'Olepovačka hran Virutex', 'Olepovačka hran Virutex', '<p><strong>Olepovačka PEB200TRC</strong></p>\\n<p><span><span lang=\\\"cs\\\">Přenosná olepovačka fungující na bázi zahřátí lepidla. navržen pro olepení rovných i zakřivených částí hranou z PVC, ABS, melaminu a dýhy. Tento model je velmi vhodný pro zpracování malých rovných dílců v dílně. Model je vybaven vysokokapacitní nádobou na lepidlo s teflonovým povlakem. Olepovačka nepoužívá elektronické nastavování teploty. Umožňuje zpracovat dílce o tloušťce 10 až 62 mm. Může být použita pro zpracování velkých dílů. Jednoduché a rychlé nastavení podle typu a šířky hrany a tloušťky panelu. Má nainstalované automatické podávání pásky s vodicím systémem pro umístění okrajového materiálu na lisovacím válci s ručním ovládáním délky šlehacího a motorizovaného přítlačného válce pro přesné a rychlé lepení. Stejně jako ostatní olepovačky ze stejné řady, nepostrádá ani tento stroj schopnost upravit tloušťku vrstvy lepidla. Praktické je, že pracovní deska má výsuvnou čelní část pro vyšší stabilitu lepené des', 'https://b2b-itatools.pl/Obrazki/PEB200TRC_PEB200TRC.jpg', 0, '58934.00', '65482.00', 'PEB200TRC', '_vyrn_1751peb200trc.jpg', '_vyrp11_1751peb250-4.jpg', '_vyrp12_1751peb250trc-1.jpg', '', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8935, 1752, 'Olepovačka hran Virutex', 'Olepovačka hran Virutex', '<p><strong>Olepovačka hran</strong></p>\\n<p><span>Přenosná olepovačka fungující na bázi zahřátí lepidla. Vhodná pro PVC, ABS, melaminové, laminátové nebo dýhové hrany, které jsou předem nařezané na požadovanou délku pro rovné, kulaté nebo tvarované panely. Olepovačka je velmi praktická pro malosériové výroby pro rovné panely. Její výhodou je snadné ovládání a rychlé nastavení. Pracovní deska má výsuvnou čelní část pro vyšší stabilitu lepené desky. </span><span>U olepovačky lze velmi jednoduše a intuitivně nastavit výška pásky a tloušťka panelu. Stroj je vybaven přesnou kontrolou dávkování lepidla a asistovaným podáváním pásky s elektronicky řízenou rychlosti podávání. </span><span>Lepicí válec je polymerovou vrstvou a umožňuje lepit pásky s 3D a skleněným efektem. Stroj je vybaven přesnou regulací pro dávkování lepidla a elektronickou regulací teploty. </span><span>Nádoba na lepidlo a posuvná základna je potažená Teflonem® pro snadné čištění a údržbu. Olepovačka je vybavena držákem vál', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_2014.jpg', 0, '66176.00', '73529.00', 'PEB250TRC', '', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_2014.jpg', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_d1.jpg', 'https://b2b-itatools.pl/Obrazki/PEB250TRC_peb250trc_d5.jpg', 21, 1, 1, 0, '', 0, '3-480-487-0', NULL, '2021-01-10 15:44:11'),
(8936, 1753, 'Manuální nanášečka lepidla na hrany Virutex', 'Manuální nanášečka lepidla na hrany Virutex', '<h2><span></span></h2>\\n<p><strong>Manuální nanášečka lepidla na hrany</strong></p>\\n<div class=\\\"text_producte\\\">\\n<p style=\\\"text-align: left;\\\"><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Stroj pro lepení hran pro pozdější použití použití se stroji pro předem nanesené hrany.</span></p>\\n<p style=\\\"text-align: left;\\\"><span style=\\\"font-size: 14px; font-family: verdana, geneva;\\\">Stroj je nízkoúdržbová nanášečka na nanášení hran lepidlem. Jedná se o nanášení plastových či laminátových hran, vrstvených hran o velikostech 0,4 až 2 mm pro PVC desky, ABS, polyester, melamin nebo dřevěné dýhy. Stroj lepí pásky pro pozdější použití se stroji pro předem lepené hrany, které jsou vyráběny společností Virutex, nebo s jakýmikoli jinými horkovzdušnými olepovacími stroji. Stroj disponuje termoelektrickým řízením teploty, automatickým zapínáním a vypínáním čerpadla pro přívod lepidla, v závislosti na teplotě lepidla a přesném dávkovacím mechanismu, který dávkuje přesné množství ', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P.jpg', 0, '72197.00', '80218.00', 'PR25P', '', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P_d1g.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P_PR25P_d2e.jpg', 21, 1, 1, 0, '', 0, '3-480-491-0', NULL, '2021-01-10 15:44:11');
