(8937, 1754, 'Automatická nanášečka lepidla na hrany Virutex', 'Automatická nanášečka lepidla na hrany Virutex', '<h3><strong>Automatická nanášečka lepidla na hrany</strong></h3>\\n<p><span>Automatické nanášečka s automatickou údržbou, pro lepení hran z materiálů jako jsou: plasty nebo laminát či vrstvené pásy. Stroj je vhodný k použití hran 0,4 až 3 mm (PVC, ABS, polyester, melamin nebo dýha).<span> </span>Tento stroj automaticky nanáší lepidlo na hrany pro pozdější použití se stroji pro předem nalepené pásky, které jsou vyráběny společností Virutex, či je možné nanesené hrany využít s jakýmikoli jinými horkovzdušnými stroji.<span> Polepovačka m</span>á termoelektrickou regulaci teploty, disponuje automatickým zapnutím a vypnutím čerpadla lepidla v závislosti na teplotě lepidla a přesném dávkovacím mechanismu, který dávkuje takové přesné množství lepidla, aby se získala požadovaná hustota na zadní straně hrany.<span> Stroj m</span>á vestavěný automatický naviják, který se snadno odvíjí a navíjí a díky zabudované sušící jednotce nehrozí riziko náhodného lepení. </span></p>\\n<p>Provoz stroje zvládne', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25P-DV.jpg', 0, '93222.00', '103580.00', 'PR25P-DV', '', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25P-DV.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25PDV_d10b.jpg', 'https://b2b-itatools.pl/Obrazki/PR25P-DV_PR25PDV_d11c.jpg', 21, 1, 2, 1, '', 0, '3-480-491-0', NULL, '2021-01-10 15:44:11'),
(8938, 1756, 'Upínací zařízení ASU317S Virutex', 'Upínací zařízení ASU317S', '<p><span>Nabízíme Vám upínací rovinný podtlakový přípravek, který <span lang=\\\"cs\\\" id=\\\"result_box\\\">Umožňuje pevné a stabilní upevnění při lepení dvou panelů ve vodorovné poloze. <span lang=\\\"cs\\\">Upínací podtlakové přísavky pracují jen na rovné a hladké neporézní ploše.</span></span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/1745927_corian%201.jpg', 0, '10952.00', '12169.00', 'ASU317S', '', '', '', '', 21, 1, 1, 1, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:11'),
(8939, 1757, 'Elastické upínací zařízení ATU317S Virutex', 'Elastické upínací zařízení ATU317S', '<p><span>Nabízíme Vám upínací podtlakový přípravek, který u<span lang=\\\"cs\\\" id=\\\"result_box\\\">možňuje pevné a stabilní upevnění při lepení dvou panelů pod úhlem. <span lang=\\\"cs\\\">Upínací podtlakové přísavky pracují jen na rovné a hladké neporézní ploše.</span></span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/1745928_corian%202.jpg', 0, '9015.00', '10016.00', 'ATU317S', '', '', '', '', 21, 1, 1, 1, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:11'),
(8940, 1758, 'Standardní sací přípojka 5m Virutex', 'Standardní sací přípojka 5m', '<p>Vlastníte-li nějaký z našich vysavačů od firmy Virutex, možná se Vám bude hodit delší sací hubice. Tu Vám zde nabízíme v délce 5 m. Pokud vlastníte vysavač od jiné značky, nevěšte hlavu, přípojka je kompatibilní i se stroji od mnoha jiných firem.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>\\n<p> </p>', 'https://b2b-itatools.pl/Obrazki/1746245_6446073.jpg', 0, '1228.00', '1364.00', '1746245', '', '', '', '', 21, 1, 1, 1, '', 0, '4-497-499-0', NULL, '2021-01-10 15:44:11'),
(8941, 1759, 'Váleček pro umisťování těsnění Virutex', 'Váleček pro umisťování těsnění', '<p><span>Ruční nástroj Virutex, který Vám umožňuje tvořit žlábky (N9P, N9P/B, N9GT, N10GT, PL10P, N10P a PP) pro umisťování těsnění (FP,FP/B a FGT).</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', 'https://b2b-itatools.pl/Obrazki/1850036_1746158.jpg', 0, '265.00', '295.00', '1850036', '', '', '', '', 21, 1, 1, 1, '', 0, '4-497-500-0', NULL, '2021-01-10 15:44:11'),
