(8951, 1770, 'Sada vrtáků (vrtáky 18, 21, 23, 25, 30 mm) Virutex', 'Sada vrtáků (vrtáky 18, 21, 23, 25, 30 mm) Virutex', '<p>Sada vrtáků kompatibilních s dlabací frézkou Virutex FC116U, ale i se stroji jiných značek. Pomocí těchto vrtáků vydlabete dlaby o průměru 18, 21, 23, 25, 30 mm. </p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>\\n<h1></h1>', 'https://b2b-itatools.pl/Obrazki/1640138_set_widia_boren_voor_fc116u_1__2.jpg', 0, '3317.00', '3686.00', '1640138', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-499-0', NULL, '2021-01-10 15:44:11'),
(8952, 1771, 'Karbidový vrták Virutex', 'Karbidový vrták Virutex', '<p>Máte - li zájem rozšířit využití své frézky, máme přímo řešení pro Vás. Nabízíme Vám karbidový vrták 2c o průměru 24 mm od značky Virutex. Tento vrták je primárně kompatibilní s frézkou FC116U, ale je možné jej použít o do frézek od jiné firmy stejného typu.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', '_vyr_1771drill.jpg', 0, '896.00', '995.00', '1640140', '_vyrn_1771drill.jpg', '', '', '', 21, 1, 1, 0, '', 0, '4-497-499-0', NULL, '2021-01-10 15:44:11'),
