(9143, 1978, 'Frézovací kotouč na zásmolky AB111N Virutex', 'Frézovací kotouč na zásmolky AB111N Virutex', '<p>Pro odstranění vad dřeva, jako jsou zásmolky, suky, atd. Vám nabízíme frézovací kotouč pro frézku AB111N od firmy virutex. Kotouč má průměr 100 mm a je opatřen 4 tvrdokovovými zuby. Tento nástroj je ideální při použití v kombinaci s frézovacím stolkem <span>CA64B.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', 'https://b2b-itatools.pl/Obrazki/6440376_6440376.jpg', 0, '3649.00', '4054.00', '6440376', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-509-0', NULL, '2021-01-10 15:44:12'),
