(9147, 1982, 'Dřevěná lamela 47x15x4mm hloubka 8mm Virutex', 'Dřevěná lamela 47x15x4mm hloubka 8mm Virutex (balení 1000ks; velikost 0)', '<p><span style=\\\"font-weight: 400;\\\">Firma Virutex Vám nabízí také spojovací lamely kompatibilní s lamelovací frézkou Virutex AB111N, ale i s lamelovacími frézkami od jiných výrobců. <span>Spojovací lamely slouží pro vytvoření pevného a rychlého spoje při výrobě nábytku a některých stavebně truhlářských výrobků. Jsou určeny na spojování dílců z aglomerovaných materiálů (DTD, DVD) ale i z masivního dřeva. Lamelky jsou komprimované z masivního bukového dřeva, které když přijde do styku s vlhkostí obsaženou v lepidle beze zbytku vyplní drážku.</span></span></p>\\n<p style=\\\"font-weight: 400;\\\"></p>\\n<p style=\\\"font-weight: 400;\\\"><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li style=\\\"font-weight: 400;\\\">Rozměry: 47x15x4 mm</li>\\n<li style=\\\"font-weight: 400;\\\">Požadovaná hloubka drážky: 8 mm</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky ', 'https://b2b-itatools.pl/Obrazki/1405001_lamelki.jpg', 0, '718.00', '798.00', '1405001', '', 'https://b2b-itatools.pl/Obrazki/1405001_caja%20pastillas%20no.20.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-499-0', NULL, '2021-01-10 15:44:12'),
