(9163, 2001, 'Řezací sada k olepovačce AU93 Virutex', 'Řezací sada k olepovačce AU93 Virutex', '<p>Sada obsahuje dva produkty v hodné k dokončovacím pracem při olepování. Prvním produktem je ruční ořezávačka hran, která je dvoubřitá, tedy ořezává obě protilehlé hrany najednou. Maximální šíře ořezu je 40 mm. Je-li nutné ořezávačku použít na větší rozměr, je možné použít rozloženou ořezávačku na každou stranu hrany zvlášť. Ořezává všechny typy hran, ABS do tloušťky 0,5 mm. Nože jsou kvalitní a snadno vyměnitelné. Druhým produktem je kapovačka, kterou jsou prováděny čísté a kvalitní řezy na obou koncích desky. Po použití tohoto nástroje již není třeba dalších dokončovacích prací. Nože jsou otočné s možností regulace polohy řezu. Používá se na hrany z PVC, melaminu, polyesteru, dýhy a dalších. Maximální šířka hrany je 45 mm a tloušťka 2 mm.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<p>Ruční ořezávačka hran</p>\\n<ul>\\n<li>2 břity</li>\\n<li>Max. šíře ořezu 40 mm</li>\\n<li>Všechny typy hran</li>\\n<li>ABS max. 0,5 mm</li>\\n<li>Vyměnit', 'https://b2b-itatools.pl/Obrazki/2800086_2800036.jpg', 0, '989.00', '1098.00', '2800086', '', '', '', '', 21, 1, 0, 0, '', 0, '3-480-486-0', NULL, '2021-01-10 15:44:13'),
(9164, 2002, 'Pneumatické upínací zařízení Virutex', 'Pneumatické upínací zařízení FRE317VD Virutex', '<p><span>Nabízíme Vám upínací rovinný podtlakový přípravek, který u<span lang=\\\"cs\\\" id=\\\"result_box\\\">možňuje pevné a stabilní upevnění při lepení dvou panelů ve vodorovné poloze. <span lang=\\\"cs\\\">Upínací podtlakové přísavky pracují jen na rovné a hladké neporézní ploše.</span></span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/ASUN317_fre317vd_2017_acc_unio.jpg', 0, '9983.00', '11093.00', 'ASUN317', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
