(9166, 2004, 'Frézovací stolek FR156N Virutex', 'Frézovací stolek FR156N Virutex', '<p><span style=\\\"font-size: 16px;\\\">Pro zjednodušení práce s Vaší frézkou FR156N od firmy Virutex Vám nabízíme frézovací stolek pro snadné kopírování hrany. S přípravkem je velmi snadná manipulace díky velké rovné ploše a knoflíku, s kterým lze udržet rovinu téměř za jakýchkoliv podmínek. Stolek dále obsahuje vývod k externímu odsavači prachu, který udrží Váš pracovní prostor čistý, tudíž i prodlužuje životnost stroje.</span></p>\\n<p><span style=\\\"text-decoration: underline;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', 'https://b2b-itatools.pl/Obrazki/CA56U_CA56U.jpg', 0, '2176.00', '2418.00', 'CA56U', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-509-0', NULL, '2021-01-10 15:44:13'),
(9167, 2005, 'Frézovací stolek na zásmolky Virutex ', 'Frézovací stolek na zásmolky Virutex ', '<p>Pokud jste narazili na nějakou vadu ve dřevě, může Vám pomoci Vaše lamelovací frézka AB111N. Nabízíme Vám frézovací stolek, se kterým je možné odfrézovat vady dřeva jako např. zásmolky, suky, apod. Do vyfrézovabého materiálu poté vlepíte tzv. lodičky a máte hotovo. Velkou výhodou je snadná manipulace s přípravkem a navíc je ve stolku průzor, díky kterému vidíte na práci, takže nehrozí žádné nepřesnosti při frézování.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', 'https://b2b-itatools.pl/Obrazki/CA64B_CA64B.jpg', 0, '1347.00', '1496.00', 'CA64B', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-509-0', NULL, '2021-01-10 15:44:13'),
(9168, 2006, 'Boční vodítko Virutex pro lamelovací frézku AB111N', 'Boční vodítko Virutex pro lamelovací frézku AB111N', '<p><span>Pořídili jste si lamelovací frézku AB111N Virutex a potřebovali byste rozšířit jejý využití? Máme tu něco přímo pro Vás! Nabízíme Vám boční vodítko pro lamelovací frézku Virutex. Nasazení na frézku je rychlé a snadné, takže je téměř okamžitě možné začít Vaší lamelovací frézkou frézovat i tenké drážky do lamina.</span></p>\\n<p></p>\\n<ul></ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/CB64B_CB64B.jpg', 0, '2266.00', '2518.00', 'CB64B', '', '', '', '', 21, 1, 3, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9169, 2007, 'Zvedák na dveře max. 200kg Virutex', 'Zvedák na dveře max. 200kg Virutex', '<p><span>Dveřní zvedák EP70P je ideální pro snadné zvednutí těžkých dveří. </span><span>Umožňuje zvedat těžké dveře, jako jsou obrněné či protipožární dveře.<span> </span>Konstrukce zvedáku umožňuje otočit nástroj na jakoukoli stranu, což usnadňuje zvedání i vyjímání dveří.<span> Pro usnadnění práce s dveřmi je u zvedáku jeho čelní část nastavitelná a pokryta materiálem proti poškrábání.</span><span> Se zvedákem je snadná manipulace díky jeho nízké hmotnosti (1kg).</span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opr', 'https://b2b-itatools.pl/Obrazki/EP70P_ep70.jpg', 0, '1344.00', '1415.00', 'EP70P', '', 'https://b2b-itatools.pl/Obrazki/EP70P_ep02.jpg', 'https://b2b-itatools.pl/Obrazki/EP70P_ep701.jpg', '', 21, 1, 0, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9170, 2008, 'Přítlačné válce Virutex', 'Přítlačné válce Virutex', '<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Zařízení pro lisování lepených povrchů.\\nVálec zajišťuje rovnoměrné rozdělení tlaku na adhezivní vrstvu, aby se <br />odstranily vzduchové bubliny během lepení. Délka je 100 mm.<br /><br /></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><', 'https://b2b-itatools.pl/Obrazki/L100_rolk.jpg', 0, '2013.00', '2237.00', 'L100', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9171, 2010, 'Univezální truhlářská svěrka Virutex', 'Univezální truhlářská svěrka Virutex', '<p>Univerzální svěrka. Je ideální pro truhlářské práce mimo dílnu. <span>Lze ji snadno umístit na téměř jakýkoliv stůl a přichytit jakoukoliv desku. </span><span>Velké čelisti drží materiál bezpečně, spolehlivě a nezanechávají na něm žádné stopy.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/MR81B_Mr81b.jpg', 0, '1785.00', '1983.00', 'MR81B', '', 'https://b2b-itatools.pl/Obrazki/MR81B_mr81bd2.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9172, 2011, 'Přenosný pracovní stůl Virutex', 'Přenosný pracovní stůl Virutex', '<p>Výškově nastavitelný, přepravitelný a skládací pracovní stůl od firmy Virutex. Poskytuje pevný pracovní povrch, na kterém je možné stroj upevnit. Stůl se strojem, který je na něm připevněn, lze přesouvat a skládat, aniž by se stroj neustále fixoval a vyjímal. Je použitelný například pro pilu<span> </span>TM72C, <a href=\\\"http://www.stolarske-potreby.cz/pily/tm72c-sklopna-pokosova-prerezavaci-pila-virutex/skupina=200/karta/produkt=599\\\"></a>nebo pro pilu<span> </span>TM33L.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravi', 'https://b2b-itatools.pl/Obrazki/MT58K_MT58K.jpg', 0, '10091.00', '11212.00', 'MT58K', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-501-0', NULL, '2021-01-10 15:44:13'),
(9173, 2012, 'Netspray objem 400ml Virutex', 'Netspray objem 400ml Virutex', '<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Při práci s ruční olepovačkou se občas stane, že Vám na něčem ulpí lepidlo. Pro tyto případy zde máme univerzální odmašťovací čistič Netspray VIRUTEX. <br />Univerzální čistič je velmi účinný při odstraňování stop lepidla.<br /><br /></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\', 'https://ita.tools/Miniaturki/E5/E50646D05F2B2A28D2A7A695B041B0C6.jpg', 0, '464.00', '516.00', 'Netspray', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-508-0', NULL, '2021-01-10 15:44:13'),
(9174, 2013, 'Konstrukce pro upevnění rámů dveří Virutex', 'Konstrukce pro upevnění rámů dveří Virutex', '<p><span>Šablona je navržena tak, aby usnadňovala rychlé a dokonalé umístění rámů dveří a pomohla při zajištění rámů pomocí polyuretanové pěny.<span> </span></span><span>Šablona může být umístěna do nových nebo starých dveřních rámů.<span> </span></span><span>Použití polyuretanové pěny zaručuje celkovou odolnost, díky čemuž dveře pevně drží.<span> </span></span><span>Nasatvení je rychlé (do 10 minut), což umožňuje rychlou práci a optimální využití dostupného času.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </', 'https://b2b-itatools.pl/Obrazki/PB83E_pb83e.jpg', 0, '18337.00', '20374.00', 'PB83E', '', 'https://b2b-itatools.pl/Obrazki/PB83E_PB83ED1.jpg', 'https://b2b-itatools.pl/Obrazki/PB83E_pb83ed2.jpg', 'https://b2b-itatools.pl/Obrazki/PB83E_pb83ed3.jpg', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9175, 2015, 'Šablona k připojení frézy pro frézování elips a kruhů Virutex', 'Šablona k připojení frézy pro frézování elips a kruhů Virutex', '<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"><span style=\\\"font-family: verdana, geneva;\\\">Nástroj <span>pro frézování kruhů a elips s nastavitelným poloměrem. Ideální nástroj pro vkládání <br />zrcadel, oken, dveří nebo jakéhokoli jiného výrobku, kde je nutné frézování kruhů a elips. <br />Frézování elipsy je prováděno z jedné základny díky dvěma mobilním podložkám, jež jsou <br />součástí standardmího balení. Kruh je frézován pomocí jediné podložky. PE60 je také vybaven <br />dvěma vakuovými přísavkami pro připevnění základny k obrobku bez předchozího vyvrtání <br />středu kruhu. V případě, že není možné použít vakuové přísavky, je šablona upevněna šrouby.<br /></span><span>Pro montáž frézek Virutex jsou standardně dodávány dvě montážní tyče &#216;8 mm.</span><br /></span><br /></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výro', 'https://b2b-itatools.pl/Obrazki/PE60_pe60_d1.jpg', 0, '24495.00', '27217.00', 'PE60', '', 'https://b2b-itatools.pl/Obrazki/PE60_pe60_d2.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9176, 2016, 'Kolejnicová šablona pro frézování 120x320 mm Virutex', 'Kolejnicová šablona pro frézování 120x320 mm Virutex', '<p><span>Frézovací šablona PF400 Vám umožňuje složité ořezy pomocí směrovací frézy. S šablonou můžete vytvořit drážky, vyfrézovat hrany, rámy, oblouky či kruhy. Maximální plocha opracování je 120x320 mm.</span></p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\"> </span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span lang=\\', 'https://b2b-itatools.pl/Obrazki/PF400_pf400_pf700.jpg', 0, '5380.00', '5978.00', 'PF400', '', 'https://b2b-itatools.pl/Obrazki/PF400_pf700_d1.jpg', 'https://b2b-itatools.pl/Obrazki/PF400_pf400_d2.jpg', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9177, 2017, 'Kolejnicová šablona pro frézování 320x620 mm Virutex', 'Kolejnicová šablona pro frézování 320x620 mm Virutex', '<p><span>Frézovací šablona PF700 Vám umožňuje složité ořezy pomocí směrovací frézy. S šablonou můžete vytvořit drážky, vyfrézovat hrany, rámy, oblouky či kruhy. Maximální plocha opracování je 320x650 mm.</span></p>\\n<p><span></span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', 'https://b2b-itatools.pl/Obrazki/PF700_pf400_pf700.jpg', 0, '7231.00', '8035.00', 'PF700', '', 'https://b2b-itatools.pl/Obrazki/PF700_pf700_d1.jpg', 'https://b2b-itatools.pl/Obrazki/PF700_pf400_d2.jpg', '', 21, 1, 0, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9178, 2018, 'Šablona pro frézování desek a následnou montáž Virutex', 'Šablona pro frézování desek a následnou montáž Virutex', '<p>Přesná a pevná šablona vyrobená z fenolického materiálu o tloušťce 12 mm. Šablona je speciálně navržena pro ořezávání a montáž pracovních desek o šířce 420 mm až 650 mm. Úhel montáže může být 45° nebo 90°. Je ideální pro použití se směrovacími frézami modelu FR160P. Lze ji velmi snadně ukotvit dle značek na šabloně. Zkracuje dobu frézování pouze na 15 minut v rámci frézování obou stran desky a výrazně snižuje pravděpodobnost chyb při práci.</p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>\\n<pre class=\\\"t', 'https://b2b-itatools.pl/Obrazki/PFE60_pfe60%20grande.jpg', 0, '4352.00', '4836.00', 'PFE60', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9179, 2019, 'Kolejnicová šablona - schody Virutex', 'Kolejnicová šablona - schody Virutex', '<p><span>Šablona pro tvorbu konstrukce schodišť. V porovnání se staršími šablonami, zavádí tento model několik praktických opatření pro jednodušší a plynulejší práci. Jednou z novinek je p<span lang=\\\"cs\\\">řítomnost dorazů a fixace pomocí svorek ve tvaru písmene L ve spojení s robustním hliníkovým rámem, jež poskytuje stabilní přesnost s absolutní jednoduchostí designu. Další nespornou výhodou je možnost získání pravého úhlu ve viditelných oblastech spojení běhounu a stoupačky, čehož je dosaženo zvláštním důrazem. Chcete-li frézovat profil na opačném stojanu, stačí otočit šablonu. Nový je také jednoduchý a rychlý přenos rozměrů a frézování celého profilu bez nutnosti použít úplné označení - stačí označit pouze první dva kroky. </span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) prod', 'https://b2b-itatools.pl/Obrazki/PFP_pfp.jpg', 0, '16484.00', '18315.00', 'PFP', '', 'https://b2b-itatools.pl/Obrazki/PFP_pfp_demo_foll.jpg', 'https://b2b-itatools.pl/Obrazki/PFP_pfp_demo5_cmyk.jpg', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9180, 2020, 'Rybinový nástavec Virutex', 'Rybinový nástavec Virutex', '<p><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Přesný nástroj pro vytváření rybinového spoje. Standardně se dodává se šablonou se sklonem 26 mm, kterou lze nahradit <br />další šablonou s jiným sklonem. Stroj je vybaven zarážkami pro frézované díly, které poskytují vysoce kvalitní napojení spoje.<br />Polotovary jsou umístěny ve dvojicích v horizontální a vertikální rovině s přesahem odpovídajícím stoupání. Může být použit s <br /></span><span lang=\\\"cs\\\">frézkami FR66P, FR160P, FRE160P, FR277R, FR278R nebo AS93. Podešev frézy je zcela položena na ploše, čímž je udržena <br />stabilita. Poškzení spoje je tedy nepravděpodobné.<br /><br /></span></span></p>\\n<p style=\\\"font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</p>\\n<ul>\\n<li><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Pracovní šířka: 360 mm</span></span></li>\\n<li><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\"><span lang=\\\"cs\\\">Rozestupy šablony: 26 mm</span></spa', 'https://b2b-itatools.pl/Obrazki/PL11_PL11.jpg', 0, '9043.00', '10047.00', 'PL11', '', '_vyrp11_2020pl11_1.jpg', '_vyrp12_2020pl11_2.jpg', '_vyrp13_2020pl11_3.jpg', 21, 1, 1, 0, '', 0, '4-497-502-0', NULL, '2021-01-10 15:44:13'),
(9181, 2021, 'Šablona pro vrtání děr pro spojovací kolíky (d=8mm) pro desky (16 a 19mm) Virutex', 'Šablona pro vrtání děr pro spojovací kolíky (d=8mm) pro desky (16 a 19mm) Virutex', '<p>Šablona je používána pro přesné vrtání otvorů pro spojovací prostředky. <span>Určeno pro vrtání otvorů, slepých nebo průchozích, pro spojovací prvky pro spojování panelů o tloušťce 16 a 19 mm pomocí kruhového kolíku (&#216; 8 mm) nebo nábytkových šroubů (confermat). Vzhledem k vysoké přesnosti tohoto produktu není nutná žádná další konfigurace. Můžete tedy vytvořit spojení jakéhokoli typu podél okraje nebo konce a dokonce uprostřed dílce. <span lang=\\\"cs\\\">Nepostradatelný nástroj pro provádění malých objednávek, oprav, úprav atd. Standardní výbava zahrnuje rozpěrky pro panely 16 mm, pouzdro adaptéru &#216; 8/5 mm a zastavení vrtání. Při použití šablony je nutné dodržovat zásadu jednoty bází, tzn. pokud při zpracování bočních stěn zakládáte šablonu na přední straně, pak při zpracování protilehlé části by měla být šablona založena na přední straně. Celková délka 600mm.</span></span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek', 'https://b2b-itatools.pl/Obrazki/PM11D_PM11D.jpg', 0, '1426.00', '1585.00', 'PM11D', '', 'https://b2b-itatools.pl/Obrazki/PM11D_pm11dd1.jpg', 'https://b2b-itatools.pl/Obrazki/PM11D_pm11dd2.jpg', '', 21, 1, 2, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9182, 2024, 'Transportní sada 2ks Virutex', 'Transportní sada 2ks Virutex (přidržování,přenášení a zvedání)', '<p>Praktický a ergonomický design umožňuje snadné přenášení panelů ze dřeva, kovu, PVC, atd. až do tloušťky 46 mm. Skládá se z pevného hliníkového těla, dvou protiskluzových koncovek a rukojeti. PT81U je výkonné příslušenství, které umožňuje zvednout materiál až do 70 kg.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li>Šířka materiálu: 0 - 46 mm</li>\\n<li>Max. zatížení: 70 kg</li>\\n<li>Hmotnost: 0,5 kg</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit', '_vyr_20247BCFD4180BD0FE50E3BBD95E61C64AED.jpg', 0, '2585.00', '2722.00', 'PT81U', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13');
