(9183, 2025, 'Sada pro ruční lepení Virutex', 'Sada pro ruční lepení Virutex', '<p><span>Sada pro ruční nanášení lepidla. Díky množství nástavců je možné ji použít pro šitoké spektrum truhlářských operací.</span></p>\\n<p><span style=\\\"font-size: 20px;\\\"><b>Obsah balení:</b></span></p>\\n<ul>\\n<li><span>250 ml plastová láhev</span></li>\\n<li><span>Nástavec pro ploché nanášení (lamely)</span></li>\\n<li>Nástavec pro kulaté nanášení </li>\\n<li>Hubička pro přímé vstřikování</li>\\n<li>Pevný uzávěr</li>\\n<li>Kryty na všechny nástavce</li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>', 'https://b2b-itatools.pl/Obrazki/SEM1_Zestaw%20do%20klejenia%20r%c4%99cznego%20SEM1.jpg', 0, '483.00', '537.00', 'SEM1', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-503-0', NULL, '2021-01-10 15:44:13'),
(9184, 2026, 'Podpěra pro držení panelu či jiné desky (nosnost 3kg) Virutex', 'Podpěra pro držení panelu či jiné desky (nosnost 3kg) Virutex', '<p><span>Praktická podpěra umožňující pevně držet jakýkoli kus (panely, dveře ...).<span> </span></span><span>Disponuje vysokou stabilitou.<span> </span></span><span>Je možné držet panely nebo dveře o tloušťce 6 až 80 mm.<span> </span></span><span>Může pojmout kusy do hmotnosti 80 kg.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/SP270R_SP270R_2011.jpg', 0, '4120.00', '4578.00', 'SP270R', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9185, 2027, 'Pojízdná upínací podpěra na desky a dveře (8kg) Virutex', 'Pojízdná upínací podpěra (8kg) na dvou kolech pro dveře,panely a jiné materiály do max. 200 kg Virut', '<p><span class=\\\"hps\\\">Praktická</span><span> </span><span class=\\\"hps\\\">podpěra</span><span> </span><span class=\\\"hps\\\">s</span><span> </span><span class=\\\"hps\\\">koly</span><span> </span><span class=\\\"hps\\\">umožňuje</span><span> aby </span><span class=\\\"hps\\\">jeden člověk</span><span> </span><span class=\\\"hps\\\">držel</span><span> </span><span class=\\\"hps\\\">a nosil</span><span> </span><span class=\\\"hps\\\">všechny druhy</span><span> </span><span class=\\\"hps\\\">panelů</span><span>, těžké</span><span> </span><span class=\\\"hps\\\">dveře,</span><span> </span><span class=\\\"hps\\\">truhlářské</span><span> </span><span class=\\\"hps\\\">díly</span><span> </span><span class=\\\"hps\\\">ze dřeva</span><span>, hliníku</span><span>, PVC,</span><span> </span><span class=\\\"hps\\\">apod.<span> </span></span><span class=\\\"hps\\\">Svěrka se dá</span><span> </span><span class=\\\"hps\\\">otevřít na</span><span> </span><span class=\\\"hps\\\">6-110mm</span><span>,</span><span> </span><span class=\\\"hps\\\">obě čelisti jsou</span><sp', 'https://b2b-itatools.pl/Obrazki/SPR770T_spr770t_grande_2012.jpg', 0, '6608.00', '7342.00', 'SPR770T', '', 'https://b2b-itatools.pl/Obrazki/SPR770T_spr770t_d2.jpg', 'https://b2b-itatools.pl/Obrazki/SPR770T_spr770t_d3.jpg', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9186, 2028, 'Elektrický vakuový upínací systém Virutex', 'Elektrický vakuový upínací systém Virutex', '<p><span>Vakuový upínací systém ovládaný výkonnou, nehlučnou elektrickou vakuovou pumpou, který je vybaven sacími deskami na obou stranách (horní a spodní) umožňující vodorovné nebo svislé upnutí kusů různých materiálů.<span> U upínacích desek je možné upravit velikost upínací plochy</span> pro upínání menších kusů. Součástí standardní dodávky je transportní kufřík.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>Příkon: 120 W</span></li>\\n<li><span>Generované vakuum: 750mbar</span></li>\\n<li><span>Upínací síla na obou stranách: 95 kg</span></li>\\n<li><span>Velikost upevňovací desky: 340x125mm</span></li>\\n<li><span>Celkové rozměry zařízení: 390x145x200 mm</span></li>\\n<li><span>Hmotnost: 14,7 kg</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jinýc', 'https://b2b-itatools.pl/Obrazki/SVE500_SVE500.jpg', 0, '18076.00', '20084.00', 'SVE500', '', 'https://b2b-itatools.pl/Obrazki/SVE500_sve500_d3.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9187, 2029, 'Naklápěcí / výkyvný elektrický vakuový upínací systém Virutex', 'Naklápěcí / výkyvný elektrický vakuový upínací systém Virutex', '<p><span>Upínací systém umožňuje pevné a okamžité upevnění kusů hladkého a neporézního povrchu vakuem.<span> </span>Rovněž umožňuje držet kusy vodorovně, svisle nebo v různých úhlech (v závislosti na modelu).<span> </span>Systém SVE je založen na autonomním a elektrickém vakuovém systému, který umožňuje vyhnout se externímu kompresoru.<span> </span>Usnadňuje fixaci kusů mimo dílnu. (není nutný těžký a objemný externí kompresor)<span> </span>K upnutí velkých kusů lze použít dvě nebo více jednotek.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">TECHNICKÉ SPECIFIKACE:</span></p>\\n<ul>\\n<li><span>Generované vakuum: 750 mbar</span></li>\\n<li><span>Příkon 95 W</span></li>\\n</ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které ', 'https://b2b-itatools.pl/Obrazki/SVE660_sve660.jpg', 0, '18679.00', '20754.00', 'SVE660', '', 'https://b2b-itatools.pl/Obrazki/SVE660_SVE---VER-2.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9188, 2032, 'Multifunkční upevňovací systém Virutex', 'Multifunkční upevňovací systém (náklápění, výkyv) Virutex', '<p><span>Systém vícenásobného upevnění SVN460 se skládá ze základního systému SVN250 namontovaného na výkyvné podpěře.<span> </span></span><span>Model SVN460 umožňuje obrábění hran a ploch bez nutnosti měnit pozici upevnění.<span> </span></span><span>Obsahuje vzduchový rozvaděč se čtyřmi volnými zásuvkami, který umožňuje připojení pomocných jednotek SVN250 nebo SVN470, vybavených ventilem a rychlospojkou sloužící k připojení k pneumatickému systému.<span> </span></span><span>Součástí vybavení je také G-svorka pro rychlé upnutí systému SVN460 k pracovní desce a sada tří gumových těsnění různých obvodů.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky V', 'https://b2b-itatools.pl/Obrazki/SVN460_SVN450.jpg', 0, '10555.00', '11728.00', 'SVN460', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9189, 2033, 'Sklopná upínací podpěra Virutex', 'Sklopná upínací podpěra Virutex', '<p><span>SVN470 je sklopná podpěra s napojením na SVN 450 nebo SVN 460. To umožňuje vypínat podtlak na obou plochách současně. </span><span>Umožňuje obrábění hran a povrchu beze změny podpěry.<span> </span>Součástí vybavení je také G-svorka pro rychlé upnutí systému SVN460 k pracovní desce a sada tří gumových těsnění různých obvodů.</span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/SVN470_SVN470.jpg', 0, '6322.00', '7025.00', 'SVN470', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9190, 2034, 'Vakuové upínací zařízení (340x125mm) Virutex', 'Vakuové upínací zařízení (340x125mm) Virutex', '<pre class=\\\"tw-data-text tw-text-large tw-ta\\\" data-placeholder=\\\"Translation\\\" dir=\\\"ltr\\\"><span lang=\\\"cs\\\" style=\\\"font-family: verdana, geneva;\\\">Vakuový upínací systém ovládaný stlačeným vzduchem.\\nSací desky na obou stranách (horní a spodní) umožňují vodorovné nebo svislé upnutí kusů. <br />Oddělitelné sací desky pro upínání malých kusů. Upínací síla na obou stranách až do 95 kg.<br /><br /></span><span lang=\\\"cs\\\"><span style=\\\"text-decoration: underline; font-size: 20px;\\\"><span style=\\\"font-family: verdana, geneva;\\\">TECHNICKÉ SPECIFIKACE:<br /></span></span><br /><span style=\\\"font-family: verdana, geneva;\\\">Pracovní tlak : 4-6 bar\\nPožadavek na vzduch (4 bar): 48l/min\\nVakuum: 700mbar\\nUpínací síla na obou stranách: 95 kg\\nRozměry sací desky: 340x125mm\\nRozměry jednotky: 390x145x200\\nHmotnost: 10,5 kg\\n</span><br /></span></pre>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyrá', 'https://b2b-itatools.pl/Obrazki/SVN500_SVN500.jpg', 0, '14387.00', '15985.00', 'SVN500', '', 'https://b2b-itatools.pl/Obrazki/SVN500_svn500_d3.jpg', '', '', 21, 1, 1, 0, '', 0, '4-497-505-0', NULL, '2021-01-10 15:44:13'),
(9191, 2035, 'Nástroj ke kopírování úhlů Virutex', 'Nástroj ke kopírování úhlů Virutex', '<p><span>Nástroj ke kopírování úhlu <span lang=\\\"cs\\\">umožňuje přenášet přesnou hodnotu úhlu na obrobek při výrobě. Tento nástroj vám umožňuje vyhnout se měření úhlů a ztrátě času při výpočtech, což z něj činí nepostradatelnou pomoc při výrobě úhlových spojů s jiným úhlem, než 90°. Nástroj je vybaven malým fixačním šroubkem pro zabránění změny velikosti úhlu při přenosu do stroje. Nastavte nástroj rovnoběžně s obrobkem a řezný nástroj rovnoběžně s indikátorem úhlu řezu a dostanete řez přesně v požadovaném úhlu. Potřeba měřit číselné hodnoty a vypočítat úhly je zcela vyloučena - vynikající výsledek snadno a rychle. Nástroj je kompatibilní se všemi pokosovými pilami na dřevo či kov na trhu.</span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů k', 'https://b2b-itatools.pl/Obrazki/TC133R_TC33.jpg', 0, '531.00', '590.00', 'TC133R', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9192, 2036, 'Šablona na dlabání a frézování zámků Virutex', 'Šablona na dlabání a frézování zámků Virutex', '<p><span>Šablona je konstruována pro provádění čelních a postranních otvorů ve dřevě pro jakýkoliv typ zámků na dveře a protiplechů na dveřních rámech. Šablona je zejména konstruována pro frézku Virutex FR66P, ale je kompatibilní i s dalšími typy frézek. S touto šablonou lze frézovat již zavěšené dveře bez poškození povrchu díky bezpečnému a spolehlivému sevření, tudíž je moužné šablonu použít nejen dílně, ale i přímo na montážích. Standardní výbava obsahuje vodící tyč, která drží šablonu vždy ve stejné výšce, dále několik prázdných plechových šablon, do kterých si můžete nechat vyfrézovat tvary pro frézování jakýchkoliv zámků nebo protiplechů.</span></p>\\n<p><span></span></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravi', 'https://b2b-itatools.pl/Obrazki/UC16K_UC16K.jpg', 0, '17642.00', '19602.00', 'UC16K', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-498-0', NULL, '2021-01-10 15:44:13'),
(9193, 2037, 'Šablona s přísavkami Virutex', 'Vodící lišta s přísavkami Virutex', '<p>Představujeme Vám šablonu pro frézování drážek do materiálu typu Corian. Na šabloně je možné nastavit délku drážky, hloubku i úhel. Nástroj je primárně určen pro frézky FRE317VD nebo FRE317S. Součástí standartního balení je jedna šablona a jedna přísavka. Vodící lišta UF317S, která je na úvodní fotografii, je taktéž k mání na našem e-shopu.</p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>\\n<pre class=\\\"tw-data-text tw-text-large XcVN5d tw-ta\\\" data-placeholder=\\\"Překlad\\\" id=\\\"tw-target-text\\\" dir=\\\"ltr\\\"><span la', 'https://b2b-itatools.pl/Obrazki/UC317S_corian%203.jpg', 0, '10369.00', '11521.00', 'UC317S', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9194, 2038, 'Vodící lišta s přísavkami Virutex', 'Vodící lišta s přísavkami Virutex', '<p><span>Potřebujete-li rozšířit Vaše vybavení o praktickou pomůcku v dílně, máme zde pro Vás snadnou pomoc. Jedním z příslušenství, které si můžete dokoupit je frézovací vodítko, které povede Vaše řezy s geometrickou přesností. Aby práce byla dokonalá, je vodítko vybaveno dvěma přísavkami na uchycení vodítka k obrobku bez zanechání jakýchkoli stop po upnutí. Nehrozí Vám tedy, že by se změnilo nastavení pravítka. Přizpůsobí se všem modelům kotoučových pil, přímočarých pil a směrovačů od firmy Virutex</span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let st', 'https://b2b-itatools.pl/Obrazki/UCP90_ucp90%20main.jpg', 0, '2893.00', '3214.00', 'UCP90', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9195, 2039, 'Řezací vodítko (pravítko) s přísavkami Virutex', 'Řezací vodítko (pravítko) s přísavkami Virutex', '<p><span>Potřebujete-li využít Vaši frézku FRE317VD a FRE317S ještě efektivněji než předtím, máme zde pro Vás snadnou pomoc. Jedním z příslušenství, které si můžete dokoupit je frézovací vodítko, které povede Vaše řezy s geometrickou přesností. Aby práce byla dokonalá, je pravítko vybaveno dvěma přísavkami na uchycení pravítka k materiálu bez zanechání jakýchkoli stop po upnutí. Nehrozí Vám tedy, že by se změnilo nastavení pravítka.</span></p>\\n<p></p>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit. </p>', 'https://b2b-itatools.pl/Obrazki/UF317S_fre317s_d3.jpg', 0, '7285.00', '8094.00', 'UF317S', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-506-0', NULL, '2021-01-10 15:44:13'),
(9196, 2040, 'Nástavec ZB93 pro Virutex FR192VG,FR192N', 'Příslušenství pro umisťování šroubů bez šablony s frézkami Virutex FR 192VG,FR192N', '<p><span>Máme zde pro Vás pomůcku při frézování k frézkám FR192N a FR192VB. Tento nástavec vám pomůže frézovat dlaby pro vkládání dveřních závěsů a to bez použití šablon. Možnost podélného a příčného pohybu vám umožní nainstalovat libovolné zapuštěné panty a vytvořit drážku pod přední lištou zámku.</span></p>\\n<p></p>\\n<ul></ul>\\n<p><span style=\\\"text-decoration: underline; font-size: 20px;\\\">Proč výrobek od světové jedničky VIRUTEX:</span></p>\\n<p>Výrobky Virutex jsou vyráběny v Barceloně ve Španělsku. Na rozdíl od jiných světových výrobců kteří (většinou v Asii) produkují obrovské série různých přístrojů které jsou často obtížně opravitelné, je u Virutexu výroba malosériová. Ručně montované výrobky Virutex jsou profesionálně přesné, 100 % kvalitní a také 100 % opravitelné. I výrobek 30 let starý je většinou možno bez problémů opravit.  </p>\\n<p><span></span></p>\\n<p></p>', '_vyr_204051PC6CvCjXL-_AC_.jpg', 0, '4596.00', '5107.00', 'ZB93', '', '', '', '', 21, 1, 1, 0, '', 0, '4-497-507-0', NULL, '2021-01-10 15:44:13'),
(9197, 2041, 'Fréza na 2D/3D vyřezávání (D=1,6; I=30; L=80; S=8) Z3', 'Fréza na 2D/3D vyřezávání (D=1,6; I=30; L=80; S=8; R=0,8) Z3', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Z3 tři pozitivní spirálové břity</li>\\n<li>Tělo ze speciálního tvrdého materiálu HM </li>\\n<li>Perfektní úprava na spodní povrch obrobku</li>\\n<li>Odvod třísky směrem nahoru</li>\\n</ul>\\n<p></p>\\n<h3>POUŽITÍ:</h3>\\n<p>Řezání a formátování plastových a hliníkových materiálů při vysokých rychlostech posuvu. Pro použití v CNC centrech, plotrech, numericky řízených a ručních frézkách.</p>\\n<h3>VÝHODY:</h3>\\n<p><span>Ideální kousek pro 3D řezbářství. </span><span>Přesné řezání 2D a 3D ve velkém měřítku. </span><span>Skvělé pro hluboké profilování. 2D a 3D tvarování, profilování, modelování a tvorba vzorů pro truhlářství, výrobu znamének, výrobu nábytku a výrobu šperků. </span></p>\\n<h3>VHODNÉ MATERIÁLY:</h3>\\n<table class=\\\"vypis_specifikaci\\\">\\n<tbody>\\n<tr>\\n<td>\\n<ul>\\n<li><span>Masiv</span></li>\\n</ul>\\n</td>\\n<td>\\n<ul>\\n<li><span>Bronz</span></li>\\n</ul>\\n</td>\\n<td>\\n<ul>\\n<li><span>Coroplast</span></li>\\n</ul>\\n</td>\\n<td>\\n<ul>\\n<li><span>La', '_vyr_2041152-080-163_474_1526_152_600x6003.jpg', 0, '1056.01', '1173.00', '152.080.163', '_vyrn_2041152-080-163_474_1526_152_600x6003.jpg', '', '', '', 21, 1, 2, 0, '', 0, '2-7-45-0|2-0-0-0|2-7-0-0|2-7-45-598|15-0-0-0|15-641-0-0|15-641-914-0', NULL, '2021-01-10 15:44:13'),
