(9199, 2053, 'Kotouč lamelovací pro lamelové spoje - D100x3,96 d22 Z8 HM střídavý zub', 'Kotouč lamelovací pro lamelové spoje - D100x3,96 d22 Z8 HM střídavý zub', '<p>Nový 100 mm CMT lamelovací kotouč s teflonovým oranžovým povrchem je vyroben z jakostní oceli. Tělo je osazeno tvrdokovovými zuby, které garantují dlouhou životnost. Určeno pro lamelovací frézky.</p>', '', 0, '741.00', '823.00', 'C24100804', '', '', '', '', 21, 1, 5, 1, '', 0, '2-2-286-0|2-2-287-0', NULL, '2021-01-10 15:44:13'),
