(9445, 8433, 'Výměnný nůž HW - 7,5x12,0x1,5 mm HC05', 'Výměnný nůž HW - 7,5x12,0x1,5 mm HC05', '<p>Nabízíme vám dvoustranné výměnné nože ze slinutého karbidu, který se převážně skládá z karbidu wolframu a pojiva, který se získává výhradně slinováním (spékáním).</p>\\n<p>Při této metodě se spéká wolfram v práškové podobě s pojivem za vysokého tlaku. Vlastnosti výměnného nože z velké míry závisí na zrnitosti prášku, ze kterého byl vyroben.</p>\\n<p>Čím nižší je obsah pojiva tím větší je tvrdost konečného produktu.</p>\\n<p></p>\\n<table width=\\\"820\\\" height=\\\"73\\\" border=\\\"5\\\" cellpadding=\\\"6\\\" cellspacing=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td><strong>Velikost zrna</strong></td>\\n<td><strong>Grafická prezentace</strong></td>\\n<td><b>Tvrdost</b></td>\\n</tr>\\n<tr>\\n<td>&lt; 0.2</td>\\n<td><img src=\\\"/fotky101456/0,2.png\\\" alt=\\\"\\\" width=\\\"162\\\" height=\\\"60\\\" /></td>\\n<td>UMG04</td>\\n</tr>\\n<tr>\\n<td>0.2 - 0.5</td>\\n<td><img src=\\\"/fotky101456/0,2-0,5.png\\\" alt=\\\"\\\" width=\\\"162\\\" height=\\\"59\\\" /></td>\\n<td>SMG02</td>\\n</tr>\\n<tr>\\n<td>0.5 - 0.7</td>\\n<td><img src=\\\"/fotky101456/0,5-0,7.png\\\" alt=\\\"\\\"', '_vyr_8433dvoustranna-ziletka.png', 0, '47.32', '53.00', '75122', '_vyrn_8433dvoustranna-ziletka.png', '_vyrp11_84330br1.png', '', '', 21, 1, 1, 0, '', 0, '22-0-0-0|22-689-0-0|22-689-737-0|22-689-737-830', NULL, '2021-01-10 15:44:16'),
