(9538, 8528, 'Matice s kinetickým odsáváním pro ER32', 'Matice s kinetickým odsáváním pro ER32 KINETIC', '<h3>TECHNICKÉ INFORMACE:</h3>\\n<ul>\\n<li>Pro kleštinové systémy <strong>ER32, ER40, EOC25</strong></li>\\n<li>Tělo z lehké slitiny se silným keramickým potahem</li>\\n<li>Maximální ochrana i minimalizace tření</li>\\n<li>Účinné při nízkých otáčkách, optimálně <strong>6000 - 20 000 ot./min</strong>.</li>\\n<li>Vhodné při práci s <strong>DTD, LTD, MDF, Corianem, sádrokartonem, OSB či HPL deskami</strong></li>\\n<li>Průměr <strong>100 mm</strong></li>\\n<li>Nahrazuje standartní matici</li>\\n<li>Prodlužuje životnost nástroje</li>\\n<li>Spoří čas udržením čistého pracovního prostoru</li>\\n<li>Snižuje prcento dřevního prachu ve vzduchu</li>\\n</ul>', '_vyr_8528992-101-EOC25_475_1412_dz_992_kde.jpg', 0, '7990.00', '8877.70', '992.101.ER32', '_vyrn_8528992-101-EOC25_475_1412_dz_992_kde.jpg', '_vyrp11_8528992-101-EOC25_474_1412_fz_992-kde.jpg', '', '', 21, 1, 10, 0, '', 0, '2-0-0-0|2-8-0-0|2-8-668-0', NULL, '2021-01-10 15:44:16'),
