(9590, 8597, 'Spirálová hrubovací fréza na zámky dveří (D=16; I=45; S=16; Z=3) RH, DIA povlak.', 'Spirálová hrubovací fréza na zámky dveří (D=16; I=45; S=16; Z=3) RH, DIA povlak.', '<div>DIA Spirálové<span> </span><span>frézy:</span></div>\\n<div><span>Diamantový </span>povlak (DLC) je výsledkem procesu PECVD, který je jednou z nejnovějších technologií povlakování. Celková tloušťka povlaku 1 mikron dosahuje velmi odolného povrchu a nekorozní prostředí. Z provedených testů vyplývají velmi dobré výsledky, které potvrzují zvýšení životnosti řezných nástrojů až o 300 %.</div>\\n<div> </div>\\n<div> </div>\\n<div>VÝHODY:</div>\\n<div><span>• několikrát </span>zvyšuje životnost nástrojů HM a HSS,</div>\\n<div>• snížení tření<span> </span><span>při frézování,</span></div>\\n<div><span>• snižuje </span>zahřívání,</div>\\n<div><span>• omezení </span>nalepování třísek,</div>\\n<div><span>• Zvýšená </span>životnost i po ostření.</div>\\n<div> </div>\\n<div>Materiál:</div>\\n<div><span>Měkké a tvrdé </span>masivní dřevo.</div>\\n<div></div>\\n<div>\\n<h3>KOMPLETNÍ SPECIFIKACE VŠECH VÝROBKŮ V TÉTO PRODUKTOVÉ ŘADĚ:</h3>\\n<table border=\\\"5\\\" cellpadding=\\\"6\\\" cellspacing=\\\"1\\\">\\n<tbody>\\n<tr>\\', '_vyr_8597_vyr_8341Na-zamky-dveri.jpg', 0, '28194.25', '31327.00', '195.162.11XTR', '_vyrn_8597_vyr_8341Na-zamky-dveri.jpg', '', '', '', 21, 1, 0, 0, '', 0, '2-0-0-0|2-1-0-0|2-1-11-0|2-1-11-313|2-7-0-0|2-7-45-0|2-7-45-597', NULL, '2021-01-10 15:44:17'),
