(9648, 8656, 'Pilový kotouč na lamino a dřevotřísku (D=350mm / Z=108 / F=30mm)', 'Pilový kotouč na lamino a dřevotřísku (D=350mm / Z=108 / F=30mm)', '<p><strong>Použití:</strong></p>\\n<p>Tento pilový kotouč je velmi vhodný pro formátovací řezy materiálu, jako je lamino či dřevotříska. Dokáže vytvořit perfektní finální řez díky jeho tvarovaným zubům.</p>\\n<p><strong>Stroje:</strong></p>\\n<p>Pilový kotouč je vhodný zejména pro stolní pily, horizontální a vertikální formátovací stroje.</p>\\n<p><strong>Materiál:</strong></p>\\n<p>Kotouč můžete použít ideálně pro práci s jednostranně či oboustranně laminovanými deskami, DTD, HPL.</p>\\n<h3><span><strong>P</strong></span><strong>ODROBNÁ SPECIFIKACE VŠECH PŘEDŘEZOVÝCH KOTOUČŮ:</strong></h3>\\n<table border=\\\"3\\\" cellpadding=\\\"1\\\">\\n<tbody>\\n<tr>\\n<td><span style=\\\"font-family: arial, helvetica, sans-serif;\\\"><strong>Průměr řezného nástroje</strong></span></td>\\n<td>\\n<pre><span style=\\\"font-family: arial, helvetica, sans-serif;\\\"><strong>Upínací otvor</strong></span></pre>\\n</td>\\n<td rowspan=\\\"2\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\"><strong>PH</strong></span></td>\\n<td', '_vyr_8656P15-250030080-00W_P15-ITA.jpg', 0, '2202.19', '2447.00', 'P15.350030108.01W', '_vyrn_8656P15-250030080-00W_P15-ITA.jpg', '', '', '', 21, 1, 10, 0, '', 0, '2-0-0-0|2-2-0-0|2-2-20-0|2-2-20-356|2-2-842-0|2-2-842-856', NULL, '2021-01-10 15:44:17'),
(9649, 8657, 'Výměnný nůž do hoblíku HW 82,0x5,1x1,2 mm HC305', 'Výměnný nůž do hoblíku HW 82,0x5,1x1,2 mm HC305', '<p>Nabízíme Vám výměnné nože do hoblíků ze slinutého karbidu, který se převážně skládá z karbidu wolframu a pojiva, který se získává výhradně slinováním (spékáním).</p>\\n<p>Při této metodě se spéká wolfram v práškové podobě s pojivem za vysokého tlaku. Vlastnosti výměnného nože z velké míry závisí na zrnitosti prášku, ze kterého byl vyroben.</p>\\n<p>Čím nižší je obsah pojiva tím větší je tvrdost konečného produktu.</p>\\n<p></p>\\n<p style=\\\"text-align: center;\\\"><strong>Značení</strong></p>\\n<p><strong><img src=\\\"/fotky101456/obr.png\\\" alt=\\\"\\\" width=\\\"469\\\" height=\\\"202\\\" style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" /></strong></p>\\n<p>L - šířka čepele                                                      R - poloměr                          ? – úhel sklonu nože</p>\\n<p>H - výška nože                                                       F - průměr otvoru</p>\\n<p>K - tloušťka nože                                                    ? – úhel čela</p>\\n<p>LA - vzdálenos', '_vyr_8657hobl-nuz.png', 0, '124.67', '139.00', '820558', '_vyrn_8657hobl-nuz.png', '_vyrp11_8657hob-nuz.png', '', '', 21, 1, 1, 0, '', 0, '22-0-0-0|22-768-0-0|22-768-891-0', NULL, '2021-01-10 15:44:17'),
